$cc52012d1a8e92a6$exports = JSON.parse('{"title":"Abi-Dalzim\'s Horrid Wilting","source":"Xanathar\'s Guide to Everything","levelAndSchool":"8th-level necromancy","level":8,"castingTime":"1 action","range":"150 feet","components":"V, S, M (a bit of sponge)","duration":"Instantaneous","description":["You draw the moisture from every creature in a 30-foot cube centered on a point you choose within range. Each creature in that area must make a Constitution saving throw. Constructs and undead aren\u2019t affected, and plants and water elementals make this saving throw with disadvantage. A creature takes 10d8 necrotic damage on a failed save, or half as much damage on a successful one."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $06123b92f8875e5a$exports = {};
$06123b92f8875e5a$exports = JSON.parse('{"title":"Absorb Elements","source":"Xanathar\'s Guide to Everything","levelAndSchool":"1st-level abjuration","level":1,"castingTime":"1 reaction, which you take when you take acid, cold, fire, lightning, or thunder damage","range":"Self","components":"S","duration":"1 round","description":["The spell captures some of the incoming energy, lessening its effect on you and storing it for your next melee attack. You have resistance to the triggering damage type until the start of your next turn. Also, the first time you hit with a melee attack on your next turn, the target takes an extra 1d6 damage of the triggering type, and the spell ends.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the extra damage increases by 1d6 for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $c1df249169360baa$exports = {};
$c1df249169360baa$exports = JSON.parse('{"title":"Acid Splash","source":"Player\'s Handbook","levelAndSchool":"Conjuration cantrip","level":0,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Instantaneous","description":["You hurl a bubble of acid. Choose one creature you can see within range, or choose two creatures you can see within range that are within 5 feet of each other. A target must succeed on a Dexterity saving throw or take 1d6 acid damage.","At Higher Levels. This spell\u2019s damage increases by 1d6 when you reach 5th level (2d6), 11th level (3d6), and 17th level (4d6)."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $59457fbac3cf2290$exports = {};
$59457fbac3cf2290$exports = JSON.parse('{"title":"Acid Stream (UA)","source":"Unearthed Arcana 70 - Spells and Magic Tattoos","levelAndSchool":"1st-level evocation","level":1,"castingTime":"1 action","range":"Self (30-foot line)","components":"V, S, M (a bit of rotten food)","duration":"Concentration, up to 1 minute","description":["A stream of acid emanates from you in a line 30 feet long and 5 feet wide in a direction you choose. Each creature in the line must succeed on a Dexterity saving throw or be covered in acid for the spell\u2019s duration or until a creature uses its action to scrape or wash the acid off itself or another creature. A creature covered in the acid takes 3d4 acid damage at the start of each of its turns.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the damage increases by 1d4 for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $b796fab93419bd23$exports = {};
$b796fab93419bd23$exports = JSON.parse('{"title":"Aganazzar\'s Scorcher","source":"Xanathar\'s Guide to Everything","levelAndSchool":"2nd-level evocation","level":2,"castingTime":"1 action","range":"30 feet","components":"V, S, M (a red dragon\u2019s scale)","duration":"Instantaneous","description":["A line of roaring flame 30 feet long and 5 feet wide emanates from you in a direction you choose. Each creature in the line must make a Dexterity saving throw. A creature takes 3d8 fire damage on a failed save, or half as much damage on a successful one.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, the damage increases by 1d8 for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $93f7e9f5770822d1$exports = {};
$93f7e9f5770822d1$exports = JSON.parse('{"title":"Aid","source":"Player\'s Handbook","levelAndSchool":"2nd-level abjuration","level":2,"castingTime":"1 action","range":"30 feet","components":"V, S, M (a tiny strip of white cloth)","duration":"8 hours","description":["Your spell bolsters your allies with toughness and resolve. Choose up to three creatures within range. Each target\u2019s hit point maximum and current hit points increase by 5 for the duration.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, a target\u2019s hit points increase by an additional 5 for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:paladin","/spells:ranger"]}');


var $44e8f8745a1ae39e$exports = {};
$44e8f8745a1ae39e$exports = JSON.parse('{"title":"Air Bubble","source":"Spelljammer: Adventures in Space - Astral Adventurer\'s Guide","levelAndSchool":"2nd-Level Conjuration","level":2,"castingTime":"1 action","range":"60 feet","components":"S","duration":"24 hours","description":["You create a spectral globe around the head of a willing creature you can see within range. The globe is filled with fresh air that lasts until the spell ends. If the creature has more than one head, the globe of air appears around only one of its heads (which is all the creature needs to avoid suffocation, assuming that all its heads share the same respiratory system).","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, you can create two additional globes of fresh air for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $05c065e759b93d81$exports = {};
$05c065e759b93d81$exports = JSON.parse('{"title":"Alarm","source":"Player\'s Handbook","levelAndSchool":"1st-level abjuration (ritual)","level":1,"castingTime":"1 minute","range":"30 feet","components":"V, S, M (a tiny bell and a piece of fine silver wire)","duration":"8 hours","description":["You set an alarm against unwanted intrusion. Choose a door, a window, or an area within range that is no larger than a 20-foot cube. Until the spell ends, an alarm alerts you whenever a tiny or larger creature touches or enters the warded area. When you cast the spell, you can designate creatures that won\u2019t set off the alarm. You also choose whether the alarm is mental or audible.","A mental alarm alerts you with a ping in your mind if you are within 1 mile of the warded area. This ping awakens you if you are sleeping. An audible alarm produces the sound of a hand bell for 10 seconds within 60 feet."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:ranger","http://dnd5e.wikidot.com/spells:wizard"]}');


var $c6d4a8338151eaef$exports = {};
$c6d4a8338151eaef$exports = JSON.parse('{"title":"Alter Self","source":"Player\'s Handbook","levelAndSchool":"2nd-level transmutation","level":2,"castingTime":"1 action","range":"Self","components":"V, S","duration":"Concentration, up to 1 hour","description":["You assume a different form. When you cast the spell, choose one of the following options, the effects of which last for the duration of the spell. While the spell lasts, you can end one option as an action to gain the benefits of a different one.","Aquatic Adaptation. You adapt your body to an aquatic environment, sprouting gills, and growing webbing between your fingers. You can breathe underwater and gain a swimming speed equal to your walking speed.","Change Appearance. You transform your appearance. You decide what you look like, including your height, weight, facial features, sound of your voice, hair length, coloration, and distinguishing characteristics, if any. You can make yourself appear as a member of another race, though none of your statistics change. You also don\u2019t appear as a creature of a different size than you, and your basic shape stays the same; if you\'re bipedal, you can\u2019t use this spell to become quadrupedal, for instance. At any time for the duration of the spell, you can use your action to change your appearance in this way again.","Natural Weapons. You grow claws, fangs, spines, horns, or a different natural weapon of your choice. Your unarmed strikes deal 1d6 bludgeoning, piercing, or slashing damage, as appropriate to the natural weapon you chose, and you are proficient with your unarmed strikes. Finally, the natural weapon is magic and you have a +1 bonus to the attack and damage rolls you make using it."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $f0cbd931ccc4c82e$exports = {};
$f0cbd931ccc4c82e$exports = JSON.parse('{"title":"Animal Friendship","source":"Player\'s Handbook","levelAndSchool":"1st-level enchantment","level":1,"castingTime":"1 action","range":"30 feet","components":"V, S, M (a morsel of food)","duration":"24 hours","description":["This spell lets you convince a beast that you mean it no harm. Choose a beast that you can see within range. It must see and hear you. If the beast\u2019s Intelligence is 4 or higher, the spell fails. Otherwise, the beast must succeed on a Wisdom saving throw or be charmed by you for the spell\u2019s duration. If you or one of your companions harms the target, the spell ends.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, you can affect one additional beast for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger"]}');


var $d0bf18549c1ea164$exports = {};
$d0bf18549c1ea164$exports = JSON.parse('{"title":"Animal Messenger","source":"Player\'s Handbook","levelAndSchool":"2nd-level enchantment (ritual)","level":2,"castingTime":"1 action","range":"30 feet","components":"V, S, M (a morsel of food)","duration":"24 hours","description":["By means of this spell, you use an animal to deliver a message. Choose a Tiny beast you can see within range, such as a squirrel, a blue jay, or a bat. You specify a location, which you must have visited, and a recipient who matches a general description, such as \u201Ca man or woman dressed in the uniform of the town guard\u201D or \u201Ca red-haired dwarf wearing a pointed hat.\u201D You also speak a message of up to twenty-five words. The target beast travels for the duration of the spell toward the specified location, covering about 50 miles per 24 hours for a flying messenger, or 25 miles for other animals.","When the messenger arrives, it delivers your message to the creature that you described, replicating the sound of your voice. The messenger speaks only to a creature matching the description you gave. If the messenger doesn\u2019t reach its destination before the spell ends, the message is lost, and the beast makes its way back to where you cast this spell.","At Higher Levels. If you cast this spell using a spell slot of 3rd level or higher, the duration of the spell increases by 48 hours for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger"]}');


var $dc7bd5707de0af67$exports = {};
$dc7bd5707de0af67$exports = JSON.parse('{"title":"Animal Shapes","source":"Player\'s Handbook","levelAndSchool":"8th-level transmutation","level":8,"castingTime":"1 action","range":"30 feet","components":"V, S","duration":"Concentration, up to 24 hours","description":["Your magic turns others into beasts. Choose any number of willing creatures that you can see within range. You transform each target into the form of a large or smaller beast with a challenge rating of 4 or lower. On subsequent turns, you can use your actions to transform affected creatures into new forms.","The transformation lasts for the duration for each target, or until the target drops to 0 hit points or dies. You can choose a different form for each target. A target\u2019s game statistics are replaced by the statistics of the chosen beast, though the target retains its alignment and Intelligence, Wisdom, and Charisma scores. The target assumes the hit points of its new form, and when it reverts to its normal form, it returns to the number of hit point it had before it transformed. If it reverts as a result of dropping to 0 hit points, any excess damage carries over to its normal form. As long as the excess damage doesn\u2019t reduce the creature\u2019s normal form to 0 hit points, it isn\u2019t knocked unconcious. The creature is limited in the actions it can perform by the nature of its new form, and it can\u2019t speak or cast spells.","The target\u2019s gear melds into the new form. The target can\u2019t activate, wield, or otherwise benefit from any of its equipment."],"spellLists":["http://dnd5e.wikidot.com/spells:druid"]}');


var $f238974a81dc5ce4$exports = {};
$f238974a81dc5ce4$exports = JSON.parse('{"title":"Animate Dead","source":"Player\'s Handbook","levelAndSchool":"3rd-level necromancy","level":3,"castingTime":"1 minute","range":"10 feet","components":"V, S, M (a drop of blood, a piece of flesh, and a pinch of bone dust)","duration":"Instantaneous","description":["This spell creates an undead servant. Choose a pile of bones or a corpse of a Medium or Small humanoid within range. Your spell imbues the target with a foul mimicry of life, raising it as an undead creature. The target becomes a skeleton if you chose bones or a zombie if you chose a corpse (the DM has the creature\u2019s game statistics).","On each of your turns, you can use a bonus action to mentally command any creature you made with this spell if the creature is within 60 feet of you (if you control multiple creatures, you can command any or all of them at the same time, issuing the same command to each one). You decide what action the creature will take and where it will move during its next turn, or you can issue a general command, such as to guard a particular chamber or corridor. If you issue no commands, the creature only defends itself against hostile creatures. Once given an order, the creature continues to follow it until its task is complete.","The creature is under your control for 24 hours, after which it stops obeying any command you\u2019ve given it. To maintain the control of the creature for another 24 hours, you must cast this spell on the creature again before the current 24-hour period ends. This use of the spell reasserts your control over up to four creatures you have animated with this spell, rather than animating a new one.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, you animate or reassert control over two additional undead creatures for each slot level above 3rd. Each of the creatures must come from a different corpse or pile of bones."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:wizard"]}');


var $8fd364e40198ab6d$exports = {};
$8fd364e40198ab6d$exports = JSON.parse('{"title":"Animate Objects","source":"Player\'s Handbook","levelAndSchool":"5th-level transmutation","level":5,"castingTime":"1 action","range":"120 feet","components":"V, S","duration":"Concentration, up to 1 minute","description":["Objects come to life at your command. Choose up to ten nonmagical objects within range that are not being worn or carried. Medium targets count as two objects, Large targets count as four objects, Huge targets count as eight objects. You can\u2019t animate any object larger than Huge. Each target animates and becomes a creature under your control until the spell ends or until reduced to 0 hit points.","As a bonus action, you can mentally command any creature you made with this spell if the creature is within 500 feet of you (if you control multiple creatures, you can command any or all of them at the same time, issuing the same command to each one). You decide what action the creature will take and where it will move during its next turn, or you can issue a general command, such as to guard a particular chamber or corridor. If you issue no commands, the creature only defends itself against hostile creatures. Once given an order, the creature continues to follow it until its task is complete.","Animated Object Statistics","Size","HP","AC","Attack","Ability Scores","Tiny","20","18","+8 to hit, 1d4 + 4 damage","Str: 4, Dex: 18","Small","25","16","+6 to hit, 1d8 + 2 damage","Str: 6, Dex: 14","Medium","40","13","+5 to hit, 2d6 + 1 damage","Str: 10, Dex: 12","Large","50","10","+6 to hit, 2d10 + 2 damage","Str: 14, Dex: 10","Huge","80","10","+8 to hit, 2d12 + 4 damage","Str: 18, Dex: 6","An animated object is a construct with AC, hit points, attacks, Strength, and Dexterity determine by its size. Its Constitution is 10 and its Intelligence and Wisdom are 3, and its Charisma is 1. Its speed is 30 feet; if the objects lack legs or other appendages it can use for locomotion, it instead has a flying speed of 30 feet and can hover. If the object is securely attached to a surface or larger object, such as a chain bolted to a wall, its speed is 0. It has blindsight with a radius of 30 feet and is blind beyond that distance. When the animated object drops to 0 hit points, it reverts to its original object form, and any remaining damage carries over to its original object form.","If you command an object to attack, it can make a single melee attack against a creature within 5 feet of it. It makes a slam attack with an attack bonus and bludgeoning damage determine by its size. The DM might rule that a specific object inflicts slashing or piercing damage based on its form.","At Higher Levels. If you cast this spell using a spell slot of 6th level or higher, you can animate two additional objects for each slot level above 5th."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $40439d1830d09d59$exports = {};
$40439d1830d09d59$exports = JSON.parse('{"title":"Antagonize (UA)","source":"Unearthed Arcana 85 - Wonders of the Multiverse","levelAndSchool":"3rd-level enchantment","level":3,"castingTime":"1 action","range":"30 feet","components":"V, S, M (a playing card depicting a rogue)","duration":"Instantaneous","description":["You whisper magical words that antagonize one creature of your choice within range. The target must make a Wisdom saving throw. On a failed save, it takes 4d4 psychic damage and must immediately use its reaction, if available, to make a melee attack against another creature of your choice that you can see. If no other creature is within range, the target has disadvantage on the next attack roll it makes before the start of your next turn.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, the damage increases by 1d4 for each slot level above 3rd."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $87ccd06a94bd931c$exports = {};
$87ccd06a94bd931c$exports = JSON.parse('{"title":"Antagonize","source":"The Book of Many Things","levelAndSchool":"3rd-Level Enchantment","level":3,"castingTime":"1 action","range":"30 feet","components":"V, S, M (a playing card depicting a rogue)","duration":"Instantaneous","description":["You whisper magical words that antagonize one creature of your choice within range. The target must make a Wisdom saving throw. On a failed save, the target takes 4d4 psychic damage and must immediately use its reaction to make a melee attack against another creature of your choice that you can see. If the target can\u2019t make this attack (for example, because there is no one within its reach or because its reaction is unavailable), the target instead has disadvantage on the next attack roll it makes before the start of your next turn. On a successful save, the target takes half as much damage only.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, the damage increases by 1d4 for each slot level above 3rd."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $4dea85ea1f8cca41$exports = {};
$4dea85ea1f8cca41$exports = JSON.parse('{"title":"Antilife Shell","source":"Player\'s Handbook","levelAndSchool":"5th-level abjuration","level":5,"castingTime":"1 action","range":"Self (10-foot radius)","components":"V, S","duration":"Concentration, up to 1 hour","description":["A shimmering barrier extends out from you in a 10-foot radius and moves with you, remaining centered on you and hedging out creatures other than undead and constructs.","The barrier lasts for the duration. The barrier prevents an affected creature from passing or reaching through. An affected creature can cast spells or make attacks with ranged or reach weapons through the barrier.","If you move so that an affected creature is forced to pass through the barrier, the spell ends."],"spellLists":["http://dnd5e.wikidot.com/spells:druid"]}');


var $2a7ee24e634e67e2$exports = {};
$2a7ee24e634e67e2$exports = JSON.parse('{"title":"Antimagic Field","source":"Player\'s Handbook","levelAndSchool":"8th-level abjuration","level":8,"castingTime":"1 action","range":"Self (10-foot-radius sphere)","components":"V, S, M (a pinch of powdered iron or iron filings)","duration":"Concentration, up to 1 hour","description":["A 10-foot-radius invisible sphere of antimagic surrounds you. This area is divorced from the magical energy that suffuses the multiverse. Within the sphere, spells can\'t be cast, summoned creatures disappear, and even magic items become mundane. Until the spell ends, the sphere moves with you, centered on you.","Spells and other magical effects, except those created by an artifact or a deity, are suppressed in the sphere and can\'t protrude into it. A slot expended to cast a suppressed spell is consumed. While an effect is suppressed, it doesn\'t function, but the time it spends suppressed counts against its duration.","Targeted Effects. Spells and other magical effects, such as magic missile and charm person, that target a creature or an object in the sphere have no effect on that target.","Areas of Magic. The area of another spell or magical effect, such as fireball, can\'t extend into the sphere. If the sphere overlaps an area of magic, the part of the area that is covered by the sphere is suppressed. For example, the flames created by a wall of fire are suppressed within the sphere, creating a gap in the wall if the overlap is large enough.","Spells. Any active spell or other magical effect on a creature or an object in the sphere is suppressed while the creature or object is in it.","Magic Items. The properties and powers of magic items are suppressed in the sphere. For example, a +1 longsword in the sphere functions as a nonmagical longsword. A magic weapon\'s properties and powers are suppressed if it is used against a target in the sphere or wielded by an attacker in the sphere. If a magic weapon or piece of magic ammunition fully leaves the sphere (for example, if you fire a magic arrow or throw a magic spear at a target outside the sphere) the magic of the item ceases to be suppressed as soon as it exits.","Magical Travel. Teleportation and planar travel fail to work in the sphere, whether the sphere is the destination or the departure point for such magical travel. A portal to another location, world, or plane of existence, as well as an opening to an extradimensional space such as that created by the rope trick spells, temporarily closes while in the sphere.","Creatures and Objects. A creature or object summoned or created by magic temporarily winks out of existence in the sphere. Such a creature instantly reappears once the space the creature occupied is no longer within the sphere.","Dispel Magic. Spells and magical effects such as dispel magic have no effect on the sphere. Likewise, the spheres created by different antimagic field spells don\'t nullify each other."],"spellLists":["/spell:magic-missile","/spell:charm-person","/spell:fireball","/spell:wall-of-fire","/spell:dispel-magic","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:wizard"]}');


var $9634136fd366aad9$exports = {};
$9634136fd366aad9$exports = JSON.parse('{"title":"Antipathy/Sympathy","source":"Player\'s Handbook","levelAndSchool":"8th-level enchantment","level":8,"castingTime":"1 hour","range":"60 feet","components":"V, S, M (either a lump of alum soaked in vinegar for the antipathy effect or a drop of honey for the sympathy effect)","duration":"10 days","description":["This spell attracts or repels creatures of your choice. You target something within range, either a Huge or smaller object or creature or an area that is no larger than a 200-foot cube. Then specify a kind of intelligent creature, such as red dragons, goblins, or vampires. You invest the target with an aura that either attracts or repels the specified creatures for the duration. Choose antipathy or sympathy as the aura\u2019s effect.","Antipathy. The enchantment causes creatures of the kind you designated to feel an intense urge to leave the area and avoid the target. When such a creature can see the target or comes within 60 feet of it, the creature must succeed on a Wisdom saving throw or become frightened. The creature remains frightened while it can see the target or is within 60 feet of it. While frightened by the target, the creature must use its movement to move to the nearest safe spot from which it can\u2019t see the target. If the creature moves more than 60 feet from the target and can\u2019t see it, the creature is no longer frightened, but the creature becomes frightened again if it regains sight of the target or moves within 60 feet of it.","Sympathy. The enchantment causes the specified creatures to feel an intense urge to approach the target while within 60 feet of it or able to see it. When such a creature can see the target or comes within 60 feet of it, the creature must succeed on a Wisdom saving throw or use its movement on each of its turns to enter the area or move within reach of the target. When the creature has done so, it can\u2019t willingly move away from the target. If the target damages or otherwise harms an affected creature, the affected creature can make a Wisdom saving throw to end the effect, as described below.","Ending the Effect. If an affected creature ends its turn while not within 60 feet of the target or able to see it, the creature makes a Wisdom saving throw. On a successful save, the creature is no longer affected by the target and recognizes the feeling of repugnance or attraction as magical. In addition, a creature affected by the spell is allowed another Wisdom saving throw every 24 hours while the spell persists. A creature that successfully saves against this effect is immune to it for 1 minute, after which time it can be affected again."],"spellLists":["/spells:bard","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:wizard"]}');


var $cc08d5e86253b28e$exports = {};
$cc08d5e86253b28e$exports = JSON.parse('{"title":"Arcane Eye","source":"Player\'s Handbook","levelAndSchool":"4th-level divination","level":4,"castingTime":"1 action","range":"30 feet","components":"V, S, M (a bit of bat fur)","duration":"Concentration, up to 1 hour","description":["You create an invisible, magical eye within range that hovers in the air for the duration. You mentally receive visual information from the eye, which has normal vision and darkvision out to 30 feet. The eye can look in every direction.","As an action, you can move the eye up to 30 feet in any direction. There is no limit to how far away from you the eye can move, but it can\u2019t enter another plane of existence. A solid barrier blocks the eye\u2019s movement, but the eye can pass through an opening as small as 1 inch in diameter."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $68c1a92718260de0$exports = {};
$68c1a92718260de0$exports = JSON.parse('{"title":"Arcane Gate","source":"Player\'s Handbook","levelAndSchool":"6th-level conjuration","level":6,"castingTime":"1 action","range":"500 feet","components":"V, S","duration":"Concentration, up to 10 minutes","description":["You create linked teleportation portals that remain open for the duration. Choose two points on the ground that you can see, one point within 10 feet of you and one point within 500 feet of you. A circular portal, 10 feet in diameter, opens over each point. If the portal would open in the space occupied by a creature, the spell fails, and the casting is lost.","The portals are two-dimensional glowing rings filled with mist, hovering inches from the ground and perpendicular to it at the points you choose. A ring is visible only from one side (your choice), which is the side that functions as a portal.","Any creature or object entering the portal exits from the other portal as if the two were adjacent to each other; passing through a portal from the nonportal side has no effect. The mist that fills each portal is opaque and blocks vision through it. On your turn, you can rotate the rings as a bonus action so that the active side faces in a different direction."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $f6bfca1928562961$exports = {};
$f6bfca1928562961$exports = JSON.parse('{"title":"Arcane Hacking (UA)","source":"Unearthed Arcana 7 - Modern Magic","levelAndSchool":"2nd-level transmutation (technomagic)","level":2,"castingTime":"1 action","range":"Self","components":"V, S, M (hacking tools)","duration":"Concentration, up to 1 hour","description":["You gain advantage on all Intelligence checks using hacking tools to break software encryption or online security when using a foreign system.","This spell also allows you to break 2nd level and lower protective spells such as Arcane Lock or Glyph of Warding by making an Intelligence check using hacking tools against the spell save DC of the spell\u2019s caster.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, you can attempt to counteract a spell set to secure the foreign system if the spell\u2019s level is equal to or less than the level of the spell slot you used."],"spellLists":["http://http://dnd5e.wikidot.com/spell:arcane-lock","http://http://dnd5e.wikidot.com/spell:glyph-of-warding","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $834b1f84db0d74d1$exports = {};
$834b1f84db0d74d1$exports = JSON.parse('{"title":"Arcane Lock","source":"Player\'s Handbook","levelAndSchool":"2nd-level abjuration","level":2,"castingTime":"1 action","range":"Touch","components":"V, S, M (gold dust worth at least 25 gp, which the spell consumes)","duration":"Until dispelled","description":["You touch a closed door, window, gate, chest, or other entryway, and it becomes locked for the duration.","You and the creatures you designate when you cast this spell can open the object normally. You can also set a password that, when spoken within 5 feet of the object, suppresses this spell for 1 minute. Otherwise, it is impassable until it is broken or the spell is dispelled or suppressed. Casting Knock on the object suppresses Arcane Lock for 10 minutes.","While affected by this spell, the object is more difficult to break or force open; the DC to break it or pick any locks on it increases by 10."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $c801bca39e79f1b0$exports = {};
$c801bca39e79f1b0$exports = JSON.parse('{"title":"Arcane Weapon (UA)","source":"Unearthed Arcana 60 - The Artificer Returns","levelAndSchool":"1st-level transmutation","level":1,"castingTime":"1 bonus action","range":"Self","components":"V, S","duration":"Concentration, up to 1 hour","description":["You channel arcane energy into one simple or martial weapon you\u2019re holding, and choose one damage type: acid, cold, fire, lightning, poison, or thunder. Until the spell ends, you deal an extra 1d6 damage of the chosen type to any target you hit with the weapon. If the weapon isn\u2019t magical, it becomes a magic weapon for the spell\u2019s duration.","As a bonus action, you can change the damage type, choosing from the options above.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, you can maintain your concentration on the spell for up to 8 hours."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer"]}');


var $debb480ad6635aad$exports = {};
$debb480ad6635aad$exports = JSON.parse('{"title":"Armor of Agathys","source":"Player\'s Handbook","levelAndSchool":"1st-level abjuration","level":1,"castingTime":"1 action","range":"Self","components":"V, S, M (a cup of water)","duration":"1 hour","description":["A protective magical force surrounds you, manifesting as a spectral frost that covers you and your gear. You gain 5 temporary hit points for the duration. If a creature hits you with a melee attack while you have these hit points, the creature takes 5 cold damage.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, both the temporary hit points and the cold damage increase by 5 for each slot."],"spellLists":["http://dnd5e.wikidot.com/spells:warlock"]}');


var $f4b52d8b64734d6b$exports = {};
$f4b52d8b64734d6b$exports = JSON.parse('{"title":"Arms of Hadar","source":"Player\'s Handbook","levelAndSchool":"1st-level conjuration","level":1,"castingTime":"1 action","range":"Self (10-foot radius)","components":"V, S","duration":"Instantaneous","description":["You invoke the power of Hadar, the Dark Hunger. Tendrils of dark energy erupt from you and batter all creatures within 10 feet of you. Each creature in that area must make a Strength saving throw. On a failed save, a target takes 2d6 necrotic damage and can\u2019t take reactions until its next turn. On a successful save, the creature takes half damage, but suffers no other effect.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the damage increases by 1d6 for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:warlock"]}');


var $e486db5e46272a17$exports = {};
$e486db5e46272a17$exports = JSON.parse('{"title":"Ashardalon\'s Stride","source":"Fizban\'s Treasury of Dragons","levelAndSchool":"3rd-level Transmutation","level":3,"castingTime":"1 bonus action","range":"Self","components":"V,S","duration":"Concentration, up to 1 minute","description":["The billowing flames of a dragon blast from your feet, granting you explosive speed. For the duration, your speed increases by 20 feet and moving doesn\u2019t provoke opportunity attacks.","When you move within 5 feet of a creature or an object that isn\u2019t being worn or carried, it takes 1d6 fire damage from your trail of heat. A creature or object can take this damage only once during a turn.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, increase your speed by 5 feet for each spell slot level above 3rd. The spell deals an additional 1d6 fire damage for each slot level above 3rd."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:ranger","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $3dd9709ad6f5f4bf$exports = {};
$3dd9709ad6f5f4bf$exports = JSON.parse('{"title":"Astral Projection","source":"Player\'s Handbook","levelAndSchool":"9th-level necromancy","level":9,"castingTime":"1 hour","range":"10 feet","components":"V, S, M (for each creature you affect with this spell, you must provide one jacinth worth at least 1,000 gp and one ornately carved bar of silver worth at least 100 gp, all of which the spell consumes)","duration":"Special","description":["You and up to eight willing creatures within range project your astral bodies into the Astral Plane (the spell fails and the casting is wasted if you are already on that plane). The material body you leave behind is unconscious and in a state of suspended animation; it doesn\u2019t need food or air and doesn\u2019t age.","Your astral body resembles your mortal form in almost every way, replicating your game statistics and possessions. The principal difference is the addition of a silvery cord that extends from between your shoulder blades and trails behind you, fading to invisibility after 1 foot. This cord is your tether to your material body. As long as the tether remains intact, you can find your way home. If the cord is cut\u2014something that can happen only when an effect specifically states that it does\u2014your soul and body are separated, killing you instantly.","Your astral form can freely travel through the Astral Plane and can pass through portals there leading to any other plane. If you enter a new plane or return to the plane you were on when casting this spell, your body and possessions are transported along the silver cord, allowing you to re-enter your body as you enter the new plane. Your astral form is a separate incarnation. Any damage or other effects that apply to it have no effect on your physical body, nor do they persist when you return to it. The spell ends for you and your companions when you use your action to dismiss it. When the spell ends, the affected creature returns to its physical body, and it awakens.","The spell might also end early for you or one of your companions. A successful dispel magic spell used against an astral or physical body ends the spell for that creature. If a creature\u2019s original body or its astral form drops to 0 hit points, the spell ends for that creature. If the spell ends and the silver cord is intact, the cord pulls the creature\u2019s astral form back to its body, ending its state of suspended animation. If you are returned to your body prematurely, your companions remain in their astral forms and must find their own way back to their bodies, usually by dropping to 0 hit points."],"spellLists":["/spell:dispel-magic","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $48968c0429e9c6bf$exports = {};
$48968c0429e9c6bf$exports = JSON.parse('{"title":"Augury","source":"Player\'s Handbook","levelAndSchool":"2nd-level divination (ritual)","level":2,"castingTime":"1 minute","range":"Self","components":"V, S, M (specially marked sticks, bones, or similar tokens worth at least 25 gp)","duration":"Instantaneous","description":["By casting gem-inlaid sticks, rolling dragon bones, laying out ornate cards, or employing some other divining tool, you receive an omen from an otherworldly entity about the results of a specific course of action that you plan to take within the next 30 minutes. The DM chooses from the following possible omens:","Weal, for good results","Woe, for bad results","Weal and woe, for both good and bad results","Nothing, for results that aren\u2019t especially good or bad","The spell doesn\u2019t take into account any possible circumstances that might change the outcome, such as the casting of additional spells or the loss or gain of a companion. If you cast the spell two or more times before completing your next long rest, there is a cumulative 25 percent chance for each casting after the first that you get a random reading. The DM makes this roll in secret."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","/spells:druid","/spells:wizard"]}');


var $db1b8d5bfc251c6c$exports = {};
$db1b8d5bfc251c6c$exports = JSON.parse('{"title":"Aura of Life","source":"Player\'s Handbook","levelAndSchool":"4th-level abjuration","level":4,"castingTime":"1 action","range":"Self (30-foot radius)","components":"V","duration":"Concentration, up to 10 minutes","description":["Life-preserving energy radiates from you in an aura with a 30-foot radius. Until the spell ends, the aura moves with you, centered on you. Each non-hostile creature in the aura (including you) has resistance to necrotic damage, and its hit point maximum can\u2019t be reduced. In addition, a non-hostile, living creature regains 1 hit point when it starts its turn in the aura with 0 hit points."],"spellLists":["/spells:cleric","http://dnd5e.wikidot.com/spells:paladin"]}');


var $3dfff7ec73348d70$exports = {};
$3dfff7ec73348d70$exports = JSON.parse('{"title":"Aura of Purity","source":"Player\'s Handbook","levelAndSchool":"4th-level abjuration","level":4,"castingTime":"1 action","range":"Self (30-foot radius)","components":"V","duration":"Concentration, up to 10 minutes","description":["Purifying energy radiates from you in an aura with a 30-foot radius. Until the spell ends, the aura moves with you, centered on you. Each non-hostile creature in the aura (including you) can\u2019t become diseased, has resistance to poison damage, and has advantage on saving throws against effects that cause any of the following conditions: blinded, charmed, deafened, frightened, paralyzed, poisoned, and stunned."],"spellLists":["/spells:cleric","http://dnd5e.wikidot.com/spells:paladin"]}');


var $7ae1c19aa2f42b16$exports = {};
$7ae1c19aa2f42b16$exports = JSON.parse('{"title":"Aura of Vitality","source":"Player\'s Handbook","levelAndSchool":"3rd-level evocation","level":3,"castingTime":"1 action","range":"Self (30-foot radius)","components":"V","duration":"Concentration, up to 1 minute","description":["Healing energy radiates from you in an aura with a 30-foot radius. Until the spell ends, the aura moves with you, centered on you. You can use a bonus action to cause one creature in the aura (including you) to regain 2d6 hit points."],"spellLists":["/spells:cleric","/spells:druid","http://dnd5e.wikidot.com/spells:paladin"]}');


var $767b8d4c462e42f3$exports = {};
$767b8d4c462e42f3$exports = JSON.parse('{"title":"Awaken","source":"Player\'s Handbook","levelAndSchool":"5th-level transmutation","level":5,"castingTime":"8 hours","range":"Touch","components":"V, S, M (an agate worth at least 1,000 gp, which the spell consumes)","duration":"Instantaneous","description":["After spending the casting time tracing magical pathways within a precious gemstone, you touch a huge or smaller beast or plant. The target must have either no Intelligence score or an Intelligence of 3 or less.","The target gains an Intelligence of 10. The target also gains the ability to speak one language you know. If the target is a plant, it gains the ability to move its limbs, roots, vines, creepers, and so forth, and it gains senses similar to a human\u2019s. Your DM chooses statistics appropriate for the awakened plant, such as the statistics for the awakened shrub or the awakened tree.","The awakened beast or plant is charmed by you for 30 days or until you and your companions do anything harmful to it. When the charmed condition ends, the awakened creature chooses whether to remain friendly to you, based on how you treated it while it was charmed."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:druid"]}');


var $432b36cc5e3d2d6d$exports = {};
$432b36cc5e3d2d6d$exports = JSON.parse('{"title":"Bane","source":"Player\'s Handbook","levelAndSchool":"1st-level enchantment","level":1,"castingTime":"1 action","range":"30 feet","components":"V, S, M (a drop of blood)","duration":"Concentration, up to 1 minute","description":["Up to three creatures of your choice that you can see within range must make Charisma saving throws. Whenever a target that fails this saving throw makes an attack roll or a saving throw before the spell ends, the target must roll a d4 and subtract the number rolled from the attack roll or saving throw.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, you can target one additional creature for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric"]}');


var $ddbb63c02e8757f4$exports = {};
$ddbb63c02e8757f4$exports = JSON.parse('{"title":"Banishing Smite","source":"Player\'s Handbook","levelAndSchool":"5th-level abjuration","level":5,"castingTime":"1 bonus action","range":"Self","components":"V","duration":"Concentration, up to 1 minute","description":["The next time you hit a creature with a weapon attack before this spell ends, your weapon crackles with force, and the attack deals an extra 5d10 force damage to the target. Additionally, if this attack reduces the target to 50 hit points of fewer, you banish it. If the target is native to a different plane of existence than the on you\u2019re on, the target disappears, returning to its home plane. If the target is native to the plane you\u2019re on, the creature vanishes into a harmless demiplane. While there, the target is incapacitated. It remains there until the spell ends, at which point the target reappears in the space it left or in the nearest unoccupied space if that space is occupied."],"spellLists":["http://dnd5e.wikidot.com/spells:paladin"]}');


var $a8534143624fe4b4$exports = {};
$a8534143624fe4b4$exports = JSON.parse('{"title":"Banishment","source":"Player\'s Handbook","levelAndSchool":"4th-level abjuration","level":4,"castingTime":"1 action","range":"60 feet","components":"V, S, M (an item distasteful to the target)","duration":"Concentration, up to 1 minute","description":["You attempt to send one creature that you can see within range to another place of existence. The target must succeed on a Charisma saving throw or be banished.","If the target is native to the plane of existence you\u2019re on, you banish the target to a harmless demiplane. While there, the target is incapacitated. The target remains there until the spell ends, at which point the target reappears in the space it left or in the nearest unoccupied space if that space is occupied.","If the target is native to a different plane of existence that the one you\u2019re on, the target is banished with a faint popping noise, returning to its home plane. If the spell ends before 1 minute has passed, the target reappears in the space it left or in the nearest unoccupied space if that space is occupied. Otherwise, the target doesn\u2019t return.","At Higher Levels. When you cast this spell using a spell slot of 5th level or higher, you can target one additional creature for each slot level above 4th."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:paladin","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $d1513471b87142f1$exports = {};
$d1513471b87142f1$exports = JSON.parse('{"title":"Barkskin","source":"Player\'s Handbook","levelAndSchool":"2nd-level transmutation","level":2,"castingTime":"1 action","range":"Touch","components":"V, S, M (a handful of oak bark)","duration":"Concentration, up to 1 hour","description":["You touch a willing creature. Until the spell ends, the target\u2019s skin has a rough, bark-like appearance, and the target\u2019s AC can\u2019t be less than 16, regardless of what kind of armor it is wearing."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger"]}');


var $08541b83163a072a$exports = {};
$08541b83163a072a$exports = JSON.parse('{"title":"Beacon of Hope","source":"Player\'s Handbook","levelAndSchool":"3rd-level abjuration","level":3,"castingTime":"1 action","range":"30 feet","components":"V, S","duration":"Concentration, up to 1 minute","description":["This spell bestows hope and vitality. Choose any number of creatures within range. For the duration, each target has advantage on Wisdom saving throws and death saving throws, and regains the maximum number of hit points possible from any healing."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric"]}');


var $554df4c1371a2ca9$exports = {};
$554df4c1371a2ca9$exports = JSON.parse('{"title":"Beast Bond","source":"Xanathar\'s Guide to Everything","levelAndSchool":"1st-level divination","level":1,"castingTime":"1 action","range":"Touch","components":"V, S, M (a bit of fur wrapped in cloth)","duration":"Concentration, up to 10 minutes","description":["You establish a telepathic link with one beast you touch that is friendly to you or charmed by you. The spell fails if the beast\u2019s Intelligence is 4 or higher. Until the spell ends, the link is active while you and the beast are within line of sight of each other. Through the link, the beast can understand your telepathic messages to it, and it can telepathically communicate simple emotions and concepts back to you. While the link is active, the beast gains advantage on attack rolls against any creature within 5 feet of you that you can see."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger"]}');


var $c936fa481f9c5036$exports = {};
$c936fa481f9c5036$exports = JSON.parse('{"title":"Beast Sense","source":"Player\'s Handbook","levelAndSchool":"2nd-level divination (ritual)","level":2,"castingTime":"1 action","range":"Touch","components":"S","duration":"Concentration, up to 1 hour","description":["You touch a willing beast. For the duration of the spell, you can use your action to see through the beast\u2019s eyes and hear what it hears, and continue to do so until you use your action to return to your normal senses."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger"]}');


var $39db0384576204e1$exports = {};
$39db0384576204e1$exports = JSON.parse('{"title":"Bestow Curse","source":"Player\'s Handbook","levelAndSchool":"3rd-level necromancy","level":3,"castingTime":"1 action","range":"Touch","components":"V, S","duration":"Concentration, up to 1 minute","description":["You touch a creature, and that creature must succeed on a Wisdom saving throw or become cursed for the duration of the spell. When you cast this spell, choose the nature of the curse from the following options:","Choose one ability score. While cursed, the target has disadvantage on ability checks and saving throws made with that ability score.","While cursed, the target has disadvantage on attack rolls against you.","While cursed, the target must make a Wisdom saving throw at the start of each of its turns. If it fails, it wastes its action that turn doing nothing.","While the target is cursed, your attacks and spells deal an extra 1d8 necrotic damage to the target.","A remove curse spell ends this effect. At the DM\'s option, you may choose an alternative curse effect, but it should be no more powerful than those described above. The DM has final say on such a curse\'s effect.","At Higher Levels. If you cast this spell using a spell slot of 4th level or higher, the duration is concentration, up to 10 minutes. If you use a spell slot of 5th level or higher, the duration is 8 hours. If you use a spell slot of 7th level or higher, the duration is 24 hours. If you use a 9th level spell slot, the spell lasts until it is dispelled. Using a spell slot of 5th level or higher grants a duration that doesn\'t require concentration."],"spellLists":["/spell:remove-curse","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:wizard"]}');


var $d7c690b6303cfedb$exports = {};
$d7c690b6303cfedb$exports = JSON.parse('{"title":"Bigby\'s Hand","source":"Player\'s Handbook","levelAndSchool":"5th-level evocation","level":5,"castingTime":"1 action","range":"120 feet","components":"V, S, M (an eggshell and a snakeskin glove)","duration":"Concentration, up to 1 minute","description":["You create a Large hand of shimmering, translucent force in an unoccupied space that you can see within range. The hand lasts for the spell\u2019s duration, and it moves at your command, mimicking the movements of your own hand.","The hand is an object that has AC 20 and hit points equal to your hit point maximum. If it drops to 0 hit points, the spell ends. It has a Strength of 26 (+8) and a Dexterity of 10 (+0). The hand doesn\u2019t fill its space.","When you cast the spell and as a bonus action on your subsequent turns, you can move the hand up to 60 feet and then cause one of the following effects with it.","Clenched Fist. The hand strikes one creature or object within 5 feet of it. Make a melee spell attack for the hand using your game statistics. On a hit, the target takes 4d8 force damage.","Forceful Hand. The hand attempts to push a creature within 5 feet of it in a direction you choose. Make a check with the hand\u2019s Strength contested by the Strength (Athletics) check of the target. If the target is Medium or smaller, you have advantage on the check. If you succeed, the hand pushes the target up to 5 feet plus a number of feet equal to five times your spellcasting ability modifier. The hand moves with the target to remain within 5 feet of it.","Grasping Hand. The hand attempts to grapple a Huge or smaller creature within 5 feet of it. You use the hand\u2019s Strength score to resolve the grapple. If the target is Medium or smaller, you have advantage on the check. While the hand is grappling the target, you can use a bonus action to have the hand crush it. When you do so, the target takes bludgeoning damage equal to 2d6 + your spellcasting ability modifier.","Interposing Hand. The hand interposes itself between you and a creature you choose until you give the hand a different command. The hand moves to stay between you and the target, providing you with half cover against the target. The target can\u2019t move through the hand\u2019s space if its Strength score is less than or equal to the hand\u2019s Strength score. If its Strength score is higher than the hand\u2019s Strength score, the target can move toward you through the hand\u2019s space, but that space is difficult terrain for the target.","At Higher Levels. When you cast this spell using a spell slot of 6th level or higher, the damage from the clenched fist option increases by 2d8 and the damage from the grasping hand increases by 2d6 for each slot level above 5th."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $6c1c39b4a9260b69$exports = {};
$6c1c39b4a9260b69$exports = JSON.parse('{"title":"Blade Barrier","source":"Player\'s Handbook","levelAndSchool":"6th-level evocation","level":6,"castingTime":"1 action","range":"90 feet","components":"V, S","duration":"Concentration, up to 10 minutes","description":["You create a vertical wall of whirling, razor-sharp blades made of magical energy. The wall appears within range and lasts for the duration. You can make a straight wall up to 100 feet long, 20 feet high, and 5 feet thick, or a ringed wall up to 60 feet in diameter, 20 feet high, and 5 feet thick. The wall provides three-quarters cover to creatures behind it, and its space is difficult terrain.","When a creature enters the wall\u2019s area for the first time on a turn or starts its turn there, the creature must make a Dexterity saving throw. On a failed save, the creature takes 6d10 slashing damage. On a successful save, the creature takes half as much damage."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric"]}');


var $d1631f2e94b04ff0$exports = {};
$d1631f2e94b04ff0$exports = JSON.parse('{"title":"Blade of Disaster","source":"Tasha\'s Cauldron of Everything","levelAndSchool":"9th-level conjuration","level":9,"castingTime":"1 bonus action","range":"60 feet","components":"V, S","duration":"Concentration, up to 1 minute","description":["You create a blade-shaped planar rift about 3 feet long in an unoccupied space you can see within range. The blade lasts for the duration. When you cast this spell, you can make up to two melee spell attacks with the blade, each one against a creature, loose object, or structure within 5 feet of the blade. On a hit, the target takes 4d12 force damage. This attack scores a critical hit if the number on the d20 is 18 or higher. On a critical hit, the blade deals an extra 8d12 force damage (for a total of 12d12 force damage).","As a bonus action on your turn, you can move the blade up to 30 feet to an unoccupied space you can see and then make up to two melee spell attacks with it again.","The blade can harmlessly pass through any barrier, including a Wall of Force."],"spellLists":["http://dnd5e.wikidot.com/spell:wall-of-force","/spells:sorcerer","/spells:warlock","/spells:wizard"]}');


var $e22b5c1fcfc67d1e$exports = {};
$e22b5c1fcfc67d1e$exports = JSON.parse('{"title":"Blade Ward","source":"Player\'s Handbook","levelAndSchool":"Abjuration cantrip","level":0,"castingTime":"1 action","range":"Self","components":"V, S","duration":"1 round","description":["You extend your hand and trace a sigil of warding in the air. Until the end of your next turn, you have resistance against bludgeoning, piercing, and slashing damage dealt by weapon attacks."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $37d8bd5adc50a4ac$exports = {};
$37d8bd5adc50a4ac$exports = JSON.parse('{"title":"Bless","source":"Player\'s Handbook","levelAndSchool":"1st-level enchantment","level":1,"castingTime":"1 action","range":"30 feet","components":"V, S, M (a sprinkling of holy water)","duration":"Concentration, up to 1 minute","description":["You bless up to three creatures of your choice within range. Whenever a target makes an attack roll or a saving throw before the spell ends, the target can roll a d4 and add the number rolled to the attack roll or saving throw.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, you can target one additional creature for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:paladin"]}');


var $79f6b9214f38fefd$exports = {};
$79f6b9214f38fefd$exports = JSON.parse('{"title":"Blight","source":"Player\'s Handbook","levelAndSchool":"4th-level necromancy","level":4,"castingTime":"1 action","range":"30 feet","components":"V, S","duration":"Instantaneous","description":["Necromantic energy washes over a creature of your choice that you can see within range, draining moisture and vitality from it. The target must make a Constitution saving throw. The target takes 8d8 necrotic damage on a failed save, or half as much damage on a successful one. This spell has no effect on undead or constructs.","If you target a plant creature or a magical plant, it makes the saving throw with disadvantage, and the spell deals maximum damage to it. If you target a nonmagical plant that isn\u2019t a creature, such as a tree or shrub, it doesn\u2019t make a saving throw; it simply withers and dies.","At Higher Levels. When you cast this spell using a spell slot of 5th level or higher, the damage increases by 1d8 for each slot level above 4th."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $cd7728332e31681b$exports = {};
$cd7728332e31681b$exports = JSON.parse('{"title":"Blinding Smite","source":"Player\'s Handbook","levelAndSchool":"3rd-level evocation","level":3,"castingTime":"1 bonus action","range":"Self","components":"V","duration":"Concentration, up to 1 minute","description":["The next time you hit a creature with a melee weapon attack during this spell\u2019s duration, you weapon flares with a bright light, and the attack deals an extra 3d8 radiant damage to the target. Additionally, the target must succeed on a Constitution saving throw or be blinded until the spell ends.","A creature blinded by this spell makes another Constitution saving throw at the end of each of its turns. On a successful save, it is no longer blinded."],"spellLists":["http://dnd5e.wikidot.com/spells:paladin"]}');


var $f69181a37cdc58fa$exports = {};
$f69181a37cdc58fa$exports = JSON.parse('{"title":"Blindness/Deafness","source":"Player\'s Handbook","levelAndSchool":"2nd-level necromancy","level":2,"castingTime":"1 action","range":"30 feet","components":"V","duration":"1 minute","description":["You can blind or deafen a foe. Choose one creature that you can see within range to make a Constitution saving throw. If it fails, the target is either blinded or deafened (your choice) for the duration. At the end of each of its turns, the target can make a Constitution saving throw. On a success, the spell ends.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, you can target one additional creature for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $92d16d3b055d096d$exports = {};
$92d16d3b055d096d$exports = JSON.parse('{"title":"Blink","source":"Player\'s Handbook","levelAndSchool":"3rd-level transmutation","level":3,"castingTime":"1 action","range":"Self","components":"V, S","duration":"1 minute","description":["Roll a d20 at the end of each of your turns for the duration of the spell. On a roll of 11 or higher, you vanish from your current plane of existence and appear in the Ethereal Plane (the spell fails and the casting is wasted if you were already on that plane).","At the start of you next turn, and when the spell ends if you are on the Ethereal Plane, you return to an unoccupied space of your choice that you can see within 10 feet of the space you vanished from. If no unoccupied space is available within that range, you appear in the nearest unoccupied space (chosen at random if more that one space is equally near). You can dismiss this spell as an action.","While on the Ethereal Plane, you can see and hear the plane you originated from, which is cast in shades of gray, and you can\u2019t see anything more than 60 feet away. You can only affect and be affected by other creatures on the Ethereal Plane. Creature that aren\u2019t there can\u2019t perceive you or interact with you, unless they have the ability to do so."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $7e5e062808f1c364$exports = {};
$7e5e062808f1c364$exports = JSON.parse('{"title":"Blur","source":"Player\'s Handbook","levelAndSchool":"2nd-level illusion","level":2,"castingTime":"1 action","range":"Self","components":"V","duration":"Concentration, up to 1 minute","description":["Your body becomes blurred, shifting and wavering to all who can see you. For the duration, any creature has disadvantage on attack rolls against you. An attacker is immune to this effect if it doesn\'t rely on sight, as with blindsight, or can see through illusions, as with truesight."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $6e289c79d2f95383$exports = {};
$6e289c79d2f95383$exports = JSON.parse('{"title":"Bones of the Earth","source":"Xanathar\'s Guide to Everything","levelAndSchool":"6th-level transmutation","level":6,"castingTime":"1 action","range":"120 feet","components":"V, S","duration":"Instantaneous","description":["You cause up to six pillars of stone to burst from places on the ground that you can see within range. Each pillar is a cylinder that has a diameter of 5 feet and a height of up to 30 feet. The ground where a pillar appears must be wide enough for its diameter, and you can target ground under a creature if that creature is Medium or smaller. Each pillar has AC 5 and 30 hit points. When reduced to 0 hit points, a pillar crumbles into rubble, which creates an area of difficult terrain with a 10-foot radius. The rubble lasts until cleared.","If a pillar is created under a creature, that creature must succeed on a Dexterity saving throw or be lifted by the pillar. A creature can choose to fail the save.","If a pillar is prevented from reaching its full height because of a ceiling or other obstacle, a creature on the pillar takes 6d6 bludgeoning damage and is restrained, pinched between the pillar and the obstacle. The restrained creature can use an action to make a Strength or Dexterity check (the creature\u2019s choice) against the spell\u2019s saving throw DC. On a success, the creature is no longer restrained and must either move off the pillar or fall off it.","At Higher Levels. When you cast this spell using a spell slot of 7th level or higher, you can create two additional pillars for each slot level above 6th."],"spellLists":["http://dnd5e.wikidot.com/spells:druid"]}');


var $55bbe0b2977021c1$exports = {};
$55bbe0b2977021c1$exports = JSON.parse('{"title":"Booming Blade","source":"Tasha\'s Cauldron of Everything","levelAndSchool":"Evocation cantrip","level":0,"castingTime":"1 action","range":"Self (5-foot radius)","components":"S, M (a melee weapon worth at least 1 sp)","duration":"1 round","description":["You brandish the weapon used in the spell\u2019s casting and make a melee attack with it against one creature within 5 feet of you. On a hit, the target suffers the weapon attack\u2019s normal effects and then becomes sheathed in booming energy until the start of your next turn. If the target willingly moves 5 feet or more before then, the target takes 1d8 thunder damage, and the spell ends.","At Higher Levels. At 5th level, the melee attack deals an extra 1d8 thunder damage to the target on a hit, and the damage the target takes for moving increases to 2d8. Both damage rolls increase by 1d8 at 11th level (2d8 and 3d8) and again at 17th level (3d8 and 4d8)."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","/spells:sorcerer","/spells:warlock","/spells:wizard"]}');


var $6ac2efb86cd69412$exports = {};
$6ac2efb86cd69412$exports = JSON.parse('{"title":"Borrowed Knowledge","source":"Strixhaven: A Curriculum of Chaos","levelAndSchool":"2nd-level Divination","level":2,"castingTime":"1 action","range":"Self","components":"V, S, M (a book worth at least 25 gp)","duration":"1 hour","description":["You draw on knowledge from spirits of the past. Choose one skill in which you lack proficiency. For the spell\'s duration, you have proficiency in the chosen skill. The spell ends early if you cast it again."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $753c15ac306e1066$exports = {};
$753c15ac306e1066$exports = JSON.parse('{"title":"Branding Smite","source":"Player\'s Handbook","levelAndSchool":"2nd-level evocation","level":2,"castingTime":"1 bonus action","range":"Self","components":"V","duration":"Concentration, up to 1 minute","description":["The next time you hit a creature with a weapon attack before this spell ends, the weapon gleams with astral radiance as you strike. The attack deals an extra 2d6 radiant damage to the target, which becomes visible if it is invisible, and the target sheds dim light in a 5-foot radius and can\u2019t become invisible until the spell ends.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, the extra damage increases by 1d6 for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:paladin"]}');


var $1568f4a7405d3aeb$exports = {};
$1568f4a7405d3aeb$exports = JSON.parse('{"title":"Burning Hands","source":"Player\'s Handbook","levelAndSchool":"1st-level evocation","level":1,"castingTime":"1 action","range":"Self (15-foot cone)","components":"V, S","duration":"Instantaneous","description":["As you hold your hands with thumbs touching and fingers spread, a thin sheet of flames shoots forth from your outstretched fingertips. Each creature in a 15-foot cone must make a Dexterity saving throw. A creature takes 3d6 fire damage on a failed save, or half as much damage on a successful one.","The fire ignites any flammable objects in the area that aren\u2019t being worn or carried.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the damage increases by 1d6 for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $61df0b36c18b13ef$exports = {};
$61df0b36c18b13ef$exports = JSON.parse('{"title":"Call Lightning","source":"Player\'s Handbook","levelAndSchool":"3rd-level conjuration","level":3,"castingTime":"1 action","range":"120 feet","components":"V, S","duration":"Concentration, up to 10 minutes","description":["A storm cloud appears in the shape of a cylinder that is 10 feet tall with a 60-foot radius, centered on a point you can see within range directly above you. The spell fails if you can\u2019t see a point in the air where the storm cloud could appear (for example, if you are in a room that can\u2019t accommodate the cloud).","When you cast the spell, choose a point you can see under the cloud. A bolt of lightning flashes down from the cloud to that point. Each creature within 5 feet of that point must make a Dexterity saving throw. A creature takes 3d10 lightning damage on a failed save, or half as much damage on a successful one. On each of your turns until the spell ends, you can use your action to call down lightning in this way again, targeting the same point or a different one.","If you are outdoors in stormy conditions when you cast this spell, the spell gives you control over the existing storm instead of creating a new one. Under such conditions, the spell\u2019s damage increases by 1d10.","At Higher Levels. When you cast this spell using a spell slot of 4th or higher level, the damage increases by 1d10 for each slot level above 3rd."],"spellLists":["http://dnd5e.wikidot.com/spells:druid"]}');


var $16f0c4440503b731$exports = {};
$16f0c4440503b731$exports = JSON.parse('{"title":"Calm Emotions","source":"Player\'s Handbook","levelAndSchool":"2nd-level enchantment","level":2,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Concentration, up to 1 minute","description":["You attempt to suppress strong emotions in a group of people. Each humanoid in a 20-foot-radius sphere centered on a point you choose within range must make a Charisma saving throw; a creature can choose to fail this saving throw if it wishes. If a creature fails its saving throw, choose one of the following two effects. You can suppress any effect causing a target to be charmed or frightened. When this spell ends, any suppressed effect resumes, provided that its duration has not expired in the meantime.","Alternatively, you can make a target indifferent about creatures of your choice that it is hostile toward. This indifference ends if the target is attacked or harmed by a spell or if it witnesses any of its friends being harmed. When the spell ends, the creature becomes hostile again, unless the DM rules otherwise."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric"]}');


var $a463452a18a6ead6$exports = {};
$a463452a18a6ead6$exports = JSON.parse('{"title":"Catapult","source":"Xanathar\'s Guide to Everything","levelAndSchool":"1st-level transmutation","level":1,"castingTime":"1 action","range":"60 feet","components":"S","duration":"Instantaneous","description":["Choose one object weighing 1 to 5 pounds within range that isn\u2019t being worn or carried. The object flies in a straight line up to 90 feet in a direction you choose before falling to the ground, stopping early if it impacts against a solid surface. If the object would strike a creature, that creature must make a Dexterity saving throw. On a failed save, the object strikes the target and stops moving. When the object strikes something, the object and what it strikes each take 3d8 bludgeoning damage.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the maximum weight of objects that you can target with this spell increases by 5 pounds, and the damage increases by 1d8, for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard","http://dnd5e.wikidot.com/spells:artificer"]}');


var $40c6217bede60c9f$exports = {};
$40c6217bede60c9f$exports = JSON.parse('{"title":"Catnap","source":"Xanathar\'s Guide to Everything","levelAndSchool":"3rd-level Enchantment","level":3,"castingTime":"1 action","range":"30 feet","components":"S, M (a pinch of sand)","duration":"10 minutes","description":["You make a calming gesture, and up to three willing creatures of your choice that you can see within range fall unconscious for the spell\u2019s duration. The spell ends on a target early if it takes damage or someone uses an action to shake or slap it awake. If a target remains unconscious for the full duration, that target gains the benefit of a short rest, and it can\u2019t be affected by this spell again until it finishes a long rest."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $f4a05d75f759351d$exports = {};
$f4a05d75f759351d$exports = JSON.parse('{"title":"Cause Fear","source":"Xanathar\'s Guide to Everything","levelAndSchool":"1st-level necromancy","level":1,"castingTime":"1 action","range":"60 feet","components":"V","duration":"Concentration, up to 1 minute","description":["You awaken the sense of mortality in one creature you can see within range. A construct or an undead is immune to this effect. The target must succeed on a Wisdom saving throw or become frightened of you until the spell ends. The frightened target can repeat the saving throw at the end of each of its turns, ending the effect on itself on a success.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, you can target one additional creature for each slot level above 1st. The creatures must be within 30 feet of each other when you target them."],"spellLists":["http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $5164e365211ca023$exports = {};
$5164e365211ca023$exports = JSON.parse('{"title":"Ceremony","source":"Xanathar\'s Guide to Everything","levelAndSchool":"1st-level evocation (ritual)","level":1,"castingTime":"1 hour","range":"Touch","components":"V, S, M (25 gp worth of powdered silver, which the spell consumes)","duration":"Instantaneous (see below)","description":["You perform one of several religious ceremonies. When you cast the spell, choose one of the following ceremonies, the target of which must be within 10 feet of you throughout the casting.","Atonement. You touch one willing creature whose alignment has changed, and you make a DC 20 Wisdom (Insight) check. On a successful check, you restore the target to its original alignment.","Bless Water. You touch one vial of water and cause it to become holy water.","Coming of Age. You touch one humanoid who is a young adult. For the next 24 hours, whenever the target makes an ability check, it can roll a d4 and add the number rolled to the ability check. A creature can benefit from this rite only once.","Dedication. You touch one humanoid who wishes to be dedicated to your god\u2019s service. For the next 24 hours, whenever the target makes a saving throw, it can roll a d4 and add the number rolled to the save. A creature can benefit from this rite only once.","Funeral Rite. You touch one corpse, and for the next 7 days, the target can\u2019t become undead by any means short of a Wish spell.","Investiture (UA). You touch one willing humanoid. Choose one 1st-level spell you have prepared and expend a spell slot and any material components as if you were casting that spell. The spell has no effect. Instead, the target can cast this spell once without having to expend a spell slot or use material components. If the target doesn\u2019t cast the spell within 1 hour, the invested spell is lost.","Wedding. You touch adult humanoids willing to be bonded together in marriage. For the next 7 days, each target gains a +2 bonus to AC while they are within 30 feet of each other. A creature can benefit from this rite again only if widowed."],"spellLists":["http://dnd5e.wikidot.com/spell:wish","http://dnd5e.wikidot.com/spells","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:paladin"]}');


var $7c17336637fb9b5e$exports = {};
$7c17336637fb9b5e$exports = JSON.parse('{"title":"Chain Lightning","source":"Player\'s Handbook","levelAndSchool":"6th-level evocation","level":6,"castingTime":"1 action","range":"150 feet","components":"V, S, M (a bit of fur; a piece of amber, glass, or a crystal rod; and three silver pins)","duration":"Instantaneous","description":["You create a bolt of lightning that arcs toward a target of your choice that you can see within range. Three bolts then leap from that target to as many as three other targets, each of which must be within 30 feet of the first target. A target can be a creature or an object and can be targeted by only one of the bolts.","A target must make a Dexterity saving throw. The target takes 10d8 lightning damage on a failed save, or half as much on a successful one.","At Higher Levels. When you cast this spell using a spell slot of 7th level or higher, one additional bolt leaps from the first target to another target for each slot level above 6th."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $d7e3e219d2b01344$exports = {};
$d7e3e219d2b01344$exports = JSON.parse('{"title":"Chaos Bolt","source":"Xanathar\'s Guide to Everything","levelAndSchool":"1st-level evocation","level":1,"castingTime":"1 action","range":"120 feet","components":"V, S","duration":"Instantaneous","description":["You hurl an undulating, warbling mass of chaotic energy at one creature in range. Make a ranged spell attack against the target. On a hit, the target takes 2d8 + 1d6 damage. Choose one of the d8s. The number rolled on that die determines the attack\'s damage type, as shown below.","d8","Damage Type","1","Acid","2","Cold","3","Fire","4","Force","5","Lightning","6","Poison","7","Psychic","8","Thunder","If you roll the same number on both d8s, the chaotic energy leaps from the target to a different creature of your choice within 30 feet of it. Make a new attack roll against the new target, and make a new damage roll, which could cause the chaotic energy to leap again.","A creature can be targeted only once by each casting of this spell.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, each target takes 1d6 extra damage of the type rolled for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer"]}');


var $d053bcf2af1668cd$exports = {};
$d053bcf2af1668cd$exports = JSON.parse('{"title":"Charm Monster","source":"Xanathar\'s Guide to Everything","levelAndSchool":"4th-level enchantment","level":4,"castingTime":"1 action","range":"30 feet","components":"V, S","duration":"1 hour","description":["You attempt to charm a creature you can see within range. It must make a Wisdom saving throw, and it does so with advantage if you or your companions are fighting it. If it fails the saving throw, it is charmed by you until the spell ends or until you or your companions do anything harmful to it. The charmed creature is friendly to you. When the spell ends, the creature knows it was charmed by you.","At Higher Levels. When you cast this spell using a spell slot of 5th level or higher, you can target one additional creature for each slot level above 4th. The creatures must be within 30 feet of each other when you target them."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:druid,","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $5db593dac3a386eb$exports = {};
$5db593dac3a386eb$exports = JSON.parse('{"title":"Charm Person","source":"Player\'s Handbook","levelAndSchool":"1st-level enchantment","level":1,"castingTime":"1 action","range":"30 feet","components":"V, S","duration":"1 hour","description":["You attempt to charm a humanoid you can see within range. It must make a Wisdom saving throw, and does so with advantage if you or your companions are fighting it. If it fails the saving throw, it is charmed by you until the spell ends or until you or your companions do anything harmful to it. The charmed creature regards you as a friendly acquaintance. When the spell ends, the creature knows it was charmed by you.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, you can target one additional creature for each slot level above 1st. The creatures must be within 30 feet of each other when you target them."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $3152770c3086868e$exports = {};
$3152770c3086868e$exports = JSON.parse('{"title":"Chill Touch","source":"Player\'s Handbook","levelAndSchool":"Necromancy cantrip","level":0,"castingTime":"1 action","range":"120 feet","components":"V, S","duration":"1 round","description":["You create a ghostly, skeletal hand in the space of a creature within range. Make a ranged spell attack against the creature to assail it with the chill of the grave. On a hit, the target takes 1d8 necrotic damage, and it can\u2019t regain hit points until the start of your next turn. Until then, the hand clings to the target. If you hit an undead target, it also has disadvantage on attack rolls against you until the end of your next turn.","At Higher Levels. This spell\u2019s damage increases by 1d8 when you reach 5th level (2d8), 11th level (3d8), and 17th level (4d8)."],"spellLists":["/sorcerer","/warlock","/wizard"]}');


var $eeafd196f9dc28f3$exports = {};
$eeafd196f9dc28f3$exports = JSON.parse('{"title":"Chromatic Orb","source":"Player\'s Handbook","levelAndSchool":"1st-level evocation","level":1,"castingTime":"1 action","range":"90 feet","components":"V, S, M (a diamond worth at least 50 gp)","duration":"Instantaneous","description":["You hurl a 4-inch-diameter sphere of energy at a creature that you can see within range. You choose acid, cold, fire, lightning, poison, or thunder for the type of orb you create, and then make a ranged spell attack against the target. If the attack hits, the creature takes 3d8 damage of the type you chose.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the damage increases by 1d8 for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $0ea23f5e10780e72$exports = {};
$0ea23f5e10780e72$exports = JSON.parse('{"title":"Circle of Death","source":"Player\'s Handbook","levelAndSchool":"6th-level necromancy","level":6,"castingTime":"1 action","range":"150 feet","components":"V, S, M (the powder of a crushed black pearl worth at least 500 gp)","duration":"Instantaneous","description":["A sphere of negative energy ripples out in a 60-foot-radius sphere from a point within range. Each creature in that area must make a Constitution saving throw. A target takes 8d6 necrotic damage on a failed save, or half as much damage on a successful one.","At Higher Levels. When you cast this spell using a spell slot of 7th level or higher, the damage increases by 2d6 for each slot level above 6th."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $ad05093aedb71e5c$exports = {};
$ad05093aedb71e5c$exports = JSON.parse('{"title":"Circle of Power","source":"Player\'s Handbook","levelAndSchool":"5th-level abjuration","level":5,"castingTime":"1 action","range":"Self (30-foot radius)","components":"V","duration":"Concentration, up to 10 minutes","description":["Divine energy radiates from you, distorting and diffusing magical energy within 30 feet of you. Until the spell ends, the sphere moves with you, centered on you. For the duration, each friendly creature in the area (including you) has advantage on saving throws against spells and other magical effects.","Additionally, when an affected creature succeeds on a saving throw made against a spell or magical effect that allows it to make a saving throw to take only half damage, it instead takes no damage if it succeeds on the saving throws."],"spellLists":["http://dnd5e.wikidot.com/spells:paladin"]}');


var $acc2e5e01aae08e7$exports = {};
$acc2e5e01aae08e7$exports = JSON.parse('{"title":"Clairvoyance","source":"Player\'s Handbook","levelAndSchool":"3rd-level divination","level":3,"castingTime":"10 minutes","range":"1 mile","components":"V, S, M (a focus worth at least 100 gp, either a jeweled horn for hearing or a glass eye for seeing)","duration":"Concentration, up to 10 minutes","description":["You create an invisible sensor within range in a location familiar to you (a place you have visited or seen before) or in an obvious location that is unfamiliar to you (such as behind a door, around a corner, or in a grove of trees). The sensor remains in place for the duration, and it can\u2019t be attacked or otherwise interacted with.","When you cast the spell, you choose seeing or hearing. You can use the chosen sense through the sensor as if you were in its space. As your action, you can switch between seeing and hearing. A creature that can see the sensor (such as a creature benefitting from see invisibility or truesight) sees a luminous, intangible orb about the size of your fist."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $8afe99791fe42522$exports = {};
$8afe99791fe42522$exports = JSON.parse('{"title":"Clone","source":"Player\'s Handbook","levelAndSchool":"8th-level necromancy","level":8,"castingTime":"1 hour","range":"Touch","components":"V, S, M (a diamond worth at least 1000 gp and at least 1 cubic inch of flesh of the creature that is to be cloned, which the spell consumes. A vessel worth at least 2000 gp that has a sealable lid and is large enough to hold the creature being cloned, such as a huge urn, coffin, mud-filled cyst in the ground, or crystal container filled with salt water)","duration":"Instantaneous","description":["This spell grows an inert duplicate of a living creature as a safeguard against death. This clone forms inside the vessel used in the spell\'s casting and grows to full size and maturity after 120 days; you can also choose to have the clone be a younger version of the same creature. It remains inert and endures indefinitely, as long as its vessel remains undisturbed.","At any time after the clone matures, if the original creature dies, its soul transfers to the clone, provided that the soul is free and willing to return. The clone is physically identical to the original and has the same personality, memories, and abilities, but none of the original\u2019s equipment. The original creature\u2019s physical remains, if they still exist, become inert and can\u2019t thereafter be restored to life, since the creature\u2019s soul is elsewhere."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $90d5cc4ab4cfd53b$exports = {};
$90d5cc4ab4cfd53b$exports = JSON.parse('{"title":"Cloud of Daggers","source":"Player\'s Handbook","levelAndSchool":"2nd-level conjuration","level":2,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a sliver of glass)","duration":"Concentration, up to 1 minute","description":["You fill the air with spinning daggers in a cube 5 feet on each side, centered on a point you choose within range. A creature takes 4d4 slashing damage when it enters the spell\u2019s area for the first time on a turn or starts its turn there.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, the damage increases by 2d4 for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $6f663ecc0b5106d4$exports = {};
$6f663ecc0b5106d4$exports = JSON.parse('{"title":"Cloudkill","source":"Player\'s Handbook","levelAndSchool":"5th-level conjuration","level":5,"castingTime":"1 action","range":"120 feet","components":"V, S","duration":"Concentration, up to 10 minutes","description":["You create a 20-foot-radius sphere of poisonous, yellow-green fog centered on a point you choose within range. The fog spreads around corners. It lasts for the duration or until strong wind disperses the fog, ending the spell. Its area is heavily obscured.","When a creature enters the spell\u2019s area for the first time on a turn or starts its turn there, that creature must make a Constitution saving throw. The creature takes 5d8 poison damage on a failed save, or half as much damage on a successful one. Creatures are affected even if they hold their breath or don\u2019t need to breathe.","The fog moves 10 feet away from you at the start of each of your turns, rolling along the surface of the ground. The vapors, being heavier than air, sink to the lowest level of the land, even pouring down openings.","At Higher Levels. When you cast this spell using a spell slot of 6th level or higher, the damage increases by 1d8 for each slot level above 5th."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $b9a88bccdb05c14d$exports = {};
$b9a88bccdb05c14d$exports = JSON.parse('{"title":"Color Spray","source":"Player\'s Handbook","levelAndSchool":"1st-level illusion","level":1,"castingTime":"1 action","range":"Self (15-foot cone)","components":"V, S, M (a pinch of powder or sand that is colored red, yellow, and blue)","duration":"1 round","description":["A dazzling array of flashing, colored light springs from your hand. Roll 6d10, the total is how many hit points of creatures this spell can effect. Creatures in a 15-foot cone originating from you are affected in ascending order of their current hit points (ignoring unconscious creatures and creatures that can\u2019t see).","Starting with the creature that has the lowest current hit points, each creature affected by this spell is blinded until the end of your next turn. Subtract each creature\u2019s hit points from the total before moving on to the creature with the next lowest hit points. A creature\u2019s hit points must be equal to or less than the remaining total for the creature to be affected.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, roll an additional 2d10 for each slot level above 1st."],"spellLists":["/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $420567ccfad48a20$exports = {};
$420567ccfad48a20$exports = JSON.parse('{"title":"Command","source":"Player\'s Handbook","levelAndSchool":"1st-level enchantment","level":1,"castingTime":"1 action","range":"60 feet","components":"V","duration":"1 round","description":["You speak a one-word command to a creature you can see within range. The target must succeed on a Wisdom saving throw or follow the command on its next turn. The spell has no effect if the target is undead, if it doesn\u2019t understand your language, or if your command is directly harmful to it. Some typical commands and their effects follow. You might issue a command other than one described here. If you do so, the DM determines how the target behaves. If the target can\u2019t follow your command, the spell ends.","Approach. The target moves toward you by the shortest and most direct route, ending its turn if it moves within 5 feet of you.","Drop. The target drops whatever it is holding and then ends its turn.","Flee. The target spends its turn moving away from you by the fastest available means.","Grovel. The target falls prone and then ends its turn.","Halt. The target doesn\u2019t move and takes no actions. A flying creature stays aloft, provided that it is able to do so. If it must move to stay aloft, it flies the minimum distance needed to remain in the air.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, you can affect one additional creature for each slot level above 1st. The creatures must be within 30 feet of each other when you target them."],"spellLists":["/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:paladin"]}');


var $f48d81a8e036dfa8$exports = {};
$f48d81a8e036dfa8$exports = JSON.parse('{"title":"Commune with City (UA)","source":"Unearthed Arcana 7 - Modern Magic","levelAndSchool":"5th-level divination (ritual) (technomagic)","level":5,"castingTime":"1 minute","range":"Self","components":"V, S","duration":"Instantaneous","description":["You briefly become one with the city and gain knowledge of the surrounding area. Aboveground, this spell gives you knowledge of the area within 1 mile of you. In sewers and other underground settings, you gain knowledge of the area within 600 feet of you.","You instantly gain knowledge of up to three facts of your choice about any of the following subjects as they relate to the area:","Terrain and bodies of water","Prevalent buildings, plants, animals, or intelligent creatures","Powerful (CR 1 or higher) celestials, fey, fiends, elementals, or undead","Influences from other planes of existence","Electrical currents, wireless signals, and active transit lines and tracks","For example, you could determine the location of powerful undead in the area, the location of major sources of electrical power or interference, and the location of any nearby parks."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $fd7f3efc319d6bbf$exports = {};
$fd7f3efc319d6bbf$exports = JSON.parse('{"title":"Commune with Nature","source":"Player\'s Handbook","levelAndSchool":"5th-level divination (ritual)","level":5,"castingTime":"1 minute","range":"Self","components":"V, S","duration":"Instantaneous","description":["You briefly become one with nature and gain knowledge of the surrounding territory. In the outdoors, the spell gives you knowledge of the land within 3 miles of you. In caves and other natural underground settings, the radius is limited to 300 feet. The spell doesn\u2019t function where nature has been replaced by construction, such as in dungeons and towns.","You instantly gain knowledge of up to three facts of your choice about any of the following subjects as they relate to the area:","terrain and bodies of water","prevalent plants, minerals, animals, or peoples","powerful celestials, fey, fiends, elementals, or undead","influence from other planes of existence","buildings","For example, you could determine the location of powerful undead in the area, the location of major sources of safe drinking water, and the location of any nearby towns."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger"]}');


var $5f6ddbcde89a6ddd$exports = {};
$5f6ddbcde89a6ddd$exports = JSON.parse('{"title":"Commune","source":"Player\'s Handbook","levelAndSchool":"5th-level divination (ritual)","level":5,"castingTime":"1 minute","range":"Self","components":"V, S, M (incense and a vial of holy or unholy water)","duration":"1 minute","description":["You contact your deity or a divine proxy and ask up to three questions that can be answered with a yes or no. You must ask your questions before the spell ends. You receive a correct answer for each question.","Divine beings aren\u2019t necessarily omniscient, so you might receive \u201Cunclear\u201D as an answer if a question pertains to information that lies beyond the deity\u2019s knowledge. In a case where a one-word answer could be misleading or contrary to the deity\u2019s interests, the DM might offer a short phrase as an answer instead.","If you cast the spell two or more times before finishing your next long rest, there is a cumulative 25 percent chance for each casting after the first that you get no answer. The DM makes this roll in secret."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric"]}');


var $025a93e974a5dd3c$exports = {};
$025a93e974a5dd3c$exports = JSON.parse('{"title":"Compelled Duel","source":"Player\'s Handbook","levelAndSchool":"1st-level enchantment","level":1,"castingTime":"1 bonus action","range":"30 feet","components":"V","duration":"Concentration, up to 1 minute","description":["You attempt to compel a creature into a duel. One creature that you can see within range must make a Wisdom saving throw. On a failed save, the creature is drawn to you, compelled by your divine demand. For the duration, it has disadvantage on attack rolls against creatures other than you, and must make a Wisdom saving throw each time it attempts to move to a space that is more than 30 feet away from you; if it succeeds on this saving throw, this spell doesn\u2019t restrict the target\u2019s movement for that turn.","The spell ends if you attack any other creature, if you cast a spell that targets a hostile creature other than the target, if a creature friendly to you damages the target or casts a harmful spell on it, or if you end your turn more than 30 feet away from the target."],"spellLists":["http://dnd5e.wikidot.com/spells:paladin"]}');


var $6d21a725df14e83d$exports = {};
$6d21a725df14e83d$exports = JSON.parse('{"title":"Comprehend Languages","source":"Player\'s Handbook","levelAndSchool":"1st-level divination (ritual)","level":1,"castingTime":"1 action","range":"Self","components":"V, S, M (a pinch of soot and salt)","duration":"1 hour","description":["For the duration, you understand the literal meaning of any spoken language that you hear. You also understand any written language that you see, but you must be touching the surface on which the words are written. It takes about 1 minute to read one page of text.","This spell doesn\u2019t decode secret messages in a text or glyph, such as an arcane sigil, that isn\u2019t part of a written language."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $2bbc07c6ed054481$exports = {};
$2bbc07c6ed054481$exports = JSON.parse('{"title":"Compulsion","source":"Player\'s Handbook","levelAndSchool":"4th-level enchantment","level":4,"castingTime":"1 action","range":"30 feet","components":"V, S","duration":"Concentration, up to 1 minute","description":["Creatures of your choice that you can see within range and that can hear you must make a Wisdom saving throw. A target automatically succeeds on this saving throw if it can\u2019t be charmed. On a failed save, a target is affected by this spell. Until the spell ends, you can use a bonus action on each of your turns to designate a direction that is horizontal to you. Each affected target must use as much of its movement as possible to move in that direction on its next turn. It can take its action before it moves. After moving in this way, it can make another Wisdom saving throw to try to end the effect.","A target isn\u2019t compelled to move into an obviously deadly hazard, such as a fire pit, but it will provoke opportunity attacks to move in the designated direction."],"spellLists":["http://dnd5e.wikidot.com/spells:bard"]}');


var $5504697d025f0b05$exports = {};
$5504697d025f0b05$exports = JSON.parse('{"title":"Cone of Cold","source":"Player\'s Handbook","levelAndSchool":"5th-level evocation","level":5,"castingTime":"1 action","range":"Self (60-foot cone)","components":"V, S, M (a small crystal or glass cone)","duration":"Instantaneous","description":["A blast of cold air erupts from your hands. Each creature in a 60-foot cone must make a Constitution saving throw. A creature takes 8d8 cold damage on a failed save, or half as much damage on a successful one. A creature killed by this spell becomes a frozen statue until it thaws.","At Higher Levels. When you cast this spell using a spell slot of 6th level or higher, the damage increases by 1d8 for each slot level above 5th."],"spellLists":["/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $7399c170edbc48f7$exports = {};
$7399c170edbc48f7$exports = JSON.parse('{"title":"Confusion","source":"Player\'s Handbook","levelAndSchool":"4th-level enchantment","level":4,"castingTime":"1 action","range":"90 feet","components":"V, S, M (three nut shells)","duration":"Concentration, up to 1 minute","description":["This spell assaults and twists creatures\u2019 minds, spawning delusions and provoking uncontrolled actions. Each creature in a 10-foot-radius sphere centered on a point you choose within range must succeed on a Wisdom saving throw when you cast this spell or be affected by it.","An affected target can\u2019t take reactions and must roll a d10 at the start of each of its turns to determine its behavior for that turn.","d10","Behavior","1","The creature uses all its movement to move in a random direction. To determine the direction, roll a d8 and assign a direction to each die face. The creature doesn\u2019t take an action this turn.","2-6","The creature doesn\u2019t move or take actions this turn.","7-8","The creature uses its action to make a melee attack against a randomly determined creature within its reach. If there is no creature within its reach, the creature does nothing this turn.","9-10","The creature can act and move normally.","At the end of its turns, an affected target can make a Wisdom saving throw. If it succeeds, this effect ends for that target.","At Higher Levels. When you cast this spell using a spell slot of 5th level or higher, the radius of the sphere increases by 5 feet for each slot level above 4th."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $8ecada3ef9d16d19$exports = {};
$8ecada3ef9d16d19$exports = JSON.parse('{"title":"Conjure Animals","source":"Player\'s Handbook","levelAndSchool":"3rd-level conjuration","level":3,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Concentration, up to 1 hour","description":["You summon fey spirits that take the form of beasts and appear in unoccupied spaces that you can see within range.","Choose one of the following options for what appears:","One beast of challenge rating 2 or lower","Two beasts of challenge rating 1 or lower","Four beasts of challenge rating 1/2 or lower","Eight beasts of challenge rating 1/4 or lower","Each beast is also considered fey, and it disappears when it drops to 0 hit points or when the spell ends.","The summoned creatures are friendly to you and your companions. Roll initiative for the summoned creatures as a group, which has its own turns. They obey any verbal commands that you issue to them (no action required by you). If you don\u2019t issue any commands to them, they defend themselves from hostile creatures, but otherwise take no actions. The DM has the creatures\u2019 statistics.","At Higher Levels. When you cast this spell using certain higher-level spell slots, you choose one of the summoning options above, and more creatures appear: twice as many with a 5th-level slot, three times as many with a 7th-level slot, and four times as many with a 9th-level slot."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger"]}');


var $2e4ddb82dc1edc9d$exports = {};
$2e4ddb82dc1edc9d$exports = JSON.parse('{"title":"Conjure Barlgura (UA)","source":"Unearthed Arcana 11 - That Old Black Magic","levelAndSchool":"4th-level conjuration","level":4,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Up to 10 minutes","description":["You summon a barlgura that appears in an unoccupied space you can see within range. The barlgura disappears when it drops to 0 hit points or when the spell ends.","The barlgura is hostile to all non-demons. Roll initiative for the barlgura, which has its own turns. At the start of its turn, it moves toward and attacks the nearest non-demon it can perceive. If two or more creatures are equally near, it picks one at random. If it cannot see any potential enemies, the barlgura moves in a random direction in search of foes.","As part of casting the spell, you can scribe a circle on the ground using the blood of an intelligent humanoid slain within the past 24 hours. The circle is large enough to encompass your space. The summoned barlgura cannot cross the circle or target anyone in it while the spell lasts."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $322d15549c65c158$exports = {};
$322d15549c65c158$exports = JSON.parse('{"title":"Conjure Barrage","source":"Player\'s Handbook","levelAndSchool":"3rd-level conjuration","level":3,"castingTime":"1 action","range":"Self (60-foot cone)","components":"V, S, M (one piece of ammunition or a thrown weapon)","duration":"Instantaneous","description":["You throw a nonmagical weapon or fire a piece of nonmagical ammunition into the air to create a cone of identical weapons that shoot forward and then disappear. Each creature in a 60-foot cone must succeed on a Dexterity saving throw. A creature takes 3d8 damage on a failed save, or half as much damage on a successful one. The damage type is the same as that of the weapon or ammunition used as a component."],"spellLists":["http://dnd5e.wikidot.com/spells:ranger"]}');


var $6133fbbc7d0cb31b$exports = {};
$6133fbbc7d0cb31b$exports = JSON.parse('{"title":"Conjure Celestial","source":"Player\'s Handbook","levelAndSchool":"7th-level conjuration","level":7,"castingTime":"1 minute","range":"90 feet","components":"V, S","duration":"Concentration, up to 1 hour","description":["You summon a celestial of challenge rating 4 or lower, which appears in an unoccupied space that you can see within range. The celestial disappears when it drops to 0 hit points or when the spell ends.","The celestial is friendly to you and your companions for the duration. Roll initiative for the celestial, which has its own turns. It obeys any verbal commands that you issue to it (no action required by you), as long as they don\u2019t violate its alignment. If you don\u2019t issue any commands to the celestial, it defends itself from hostile creatures but otherwise takes no actions. The DM has the celestial\u2019s statistics.","At Higher Levels. When you cast this spell using a 9th-level spell slot, you summon a celestial of challenge rating 5 or lower."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric"]}');


var $59b35835e818db32$exports = {};
$59b35835e818db32$exports = JSON.parse('{"title":"Conjure Elemental","source":"Player\'s Handbook","levelAndSchool":"5th-level conjuration","level":5,"castingTime":"1 minute","range":"90 feet","components":"V, S, M (burning incense for air, soft clay for earth, sulfur and phosphorus for fire, or water and sand for water)","duration":"Concentration, up to 1 hour","description":["You call forth an elemental servant. Choose an area of air, earth, fire, or water that fills a 10-foot cube within range. An elemental of challenge rating 5 or lower appropriate to the area you chose appears in an unoccupied space within 10 feet of it. For example, a fire elemental emerges from a bonfire, and an earth elemental rises up from the ground. The elemental disappears when it drops to 0 hit points or when the spell ends.","The elemental is friendly to you and your companions for the duration. Roll initiative for the elemental, which has its own turns. It obeys any verbal commands that you issue to it (no action required by you). If you don\u2019t issue any commands to the elemental, it defends itself from hostile creatures but otherwise takes no actions.","If your concentration is broken, the elemental doesn\u2019t disappear. Instead, you lose control of the elemental, it becomes hostile toward you and your companions, and it might attack. An uncontrolled elemental can\u2019t be dismissed by you, and it disappears 1 hour after you summoned it. The DM has the elemental\u2019s statistics.","At Higher Levels. When you cast this spell using a spell slot of 6th level or higher, the challenge rating increases by 1 for each slot level above 5th."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:wizard"]}');


var $cef696a0cd61a22b$exports = {};
$cef696a0cd61a22b$exports = JSON.parse('{"title":"Conjure Fey","source":"Player\'s Handbook","levelAndSchool":"6th-level conjuration","level":6,"castingTime":"1 action","range":"90 feet","components":"V, S","duration":"Concentration, up to 1 hour","description":["You summon a fey creature of challenge rating 6 or lower, or a fey spirit that takes the form of a beast of challenge rating 6 or lower. It appears in an unoccupied space that you can see within range. The fey creature disappears when it drops to 0 hit points or when the spell ends.","The fey creature is friendly to you and your companions for the duration. Roll initiative for the creature, which has its own turns. It obeys any verbal commands that you issue to it (no action required by you), as long as they don\u2019t violate its alignment. If you don\u2019t issue any commands to the fey creature, it defends itself from hostile creatures but otherwise takes no actions.","If your concentration is broken, the fey creature doesn\u2019t disappear. Instead, you lose control of the fey creature, it becomes hostile toward you and your companions, and it might attack. An uncontrolled fey creature can\u2019t be dismissed by you, and it disappears 1 hour after you summoned it. The DM has the fey creature\u2019s statistics.","At Higher Levels. When you cast this spell using a spell slot of 7th level or higher, the challenge rating increases by 1 for each slot level above 6th."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:warlock"]}');


var $4e8fc4af7ca13d51$exports = {};
$4e8fc4af7ca13d51$exports = JSON.parse('{"title":"Conjure Hezrou (UA)","source":"Unearthed Arcana 11 - That Old Black Magic","levelAndSchool":"7th-level conjuration","level":7,"castingTime":"1 action","range":"60 feet","components":"V, S, M (food worth at least 100 gp, which the spell consumes)","duration":"Concentration, up to 1 hour","description":["You summon a hezrou that appears in an unoccupied space you can see within range. The hezrou disappears when it drops to 0 hit points or when the spell ends.","The hezrou\u2019s attitude depends on the value of the food used as a material component for this spell. Roll initiative for the hezrou, which has its own turns. At the start of the hezrou\u2019s turn, the DM makes a secret Charisma check on your behalf, with a bonus equal to the food\u2019s value divided by 20. The check DC starts at 10 and increases by 2 each round. You can issue orders to the hezrou and have it obey you as long as you succeed on the Charisma check.","If the check fails, the spell no longer requires concentration and the demon is no longer under your control. The hezrou then focuses on devouring any corpses it can see. If there are no such meals at hand, it attacks the nearest creatures and eats anything it kills. If its hit points are reduced to below half its hit point maximum, it returns to the Abyss.","As part of casting the spell, you can scribe a circle on the ground using the blood of an intelligent humanoid slain within the past 24 hours. The circle is large enough to encompass your space. The summoned hezrou cannot cross the circle or target anyone in it while the spell lasts."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $3e456c80466968ec$exports = {};
$3e456c80466968ec$exports = JSON.parse('{"title":"Conjure Knowbot (UA)","source":"Unearthed Arcana 7 - Modern Magic","levelAndSchool":"4th-level conjuration (technomagic)","level":4,"castingTime":"1 action","range":"Touch","components":"V, S","duration":"10 minutes","description":["You touch a single computerized device or computer system to conjure a knowbot\u2014a partially sentient piece of software imprinted with vestiges of your own skills and computer abilities. For the duration of the spell, you can use a bonus action to have the knowbot execute a computer related task that would normally require an action. The knowbot makes Intelligence ability checks using your ability score and proficiency bonuses including your proficiency with hacking tools, if applicable.","You have a limited telepathic bond with the knowbot, out to a range of 500 feet from the device or system where the knowbot was conjured. If you move beyond this range, the knowbot disappears in 2d4 rounds, as if the duration of the spell had expired. Moving within range again immediately reestablishes the bond.","The knowbot is bound to the system in which it was created, and it stays there until it is dismissed or the spell\u2019s duration expires.","At Higher Levels. When you cast this spell using a spell slot of 5th level or higher, the spell\u2019s duration increases to 1 hour. Additionally, your telepathic bond with the knowbot is effective out to a range of 1,000 feet, and if you leave the range of the bond, the knowbot continues performing its last directed task until the spell expires."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $dfc90a9283c71de1$exports = {};
$dfc90a9283c71de1$exports = JSON.parse('{"title":"Conjure Lesser Demon (UA)","source":"Unearthed Arcana 11 - That Old Black Magic","levelAndSchool":"3rd-level conjuration","level":3,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a vial of blood from an intelligent humanoid killed within the past 24 hours)","duration":"Concentration, up to 1 hour","description":["You summon up to a total of eight manes or dretches that appear in unoccupied spaces you can see within range. A manes or dretch disappears when it drops to 0 hit points or when the spell ends.","The demons are hostile to all creatures. Roll initiative for the summoned demons as a group, which has its own turns. The demons attack the nearest non-demons to the best of their ability.","As part of casting the spell, you can scribe a circle on the ground with the blood used as a material component. The circle is large enough to encompass your space. The summoned demons cannot cross the circle or target anyone in it while the spell lasts. Using the material component in this manner consumes it.","At Higher Levels. When you cast this spell using a spell slot of 6th or 7th level, you summon sixteen demons. If you cast it using a spell slot of 8th or 9th level, you summon thirty-two demons."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $72621ea2ad4dbf3c$exports = {};
$72621ea2ad4dbf3c$exports = JSON.parse('{"title":"Conjure Minor Elementals","source":"Player\'s Handbook","levelAndSchool":"4th-level conjuration","level":4,"castingTime":"1 minute","range":"90 feet","components":"V, S","duration":"Concentration, up to 1 hour","description":["You summon elementals that appear in unoccupied spaces that you can see within range. You choose one the following options for what appears:","One elemental of challenge rating 2 or lower","Two elementals of challenge rating 1 or lower","Four elementals of challenge rating 1/2 or lower","Eight elementals of challenge rating 1/4 or lower","An elemental summoned by this spell disappears when it drops to 0 hit points or when the spell ends.","The summoned creatures are friendly to you and your companions. Roll initiative for the summoned creatures as a group, which has its own turns. They obey any verbal commands that you issue to them (no action required by you). If you don\u2019t issue any commands to them, they defend themselves from hostile creatures, but otherwise take no actions. The DM has the creatures\u2019 statistics.","At Higher Levels. When you cast this spell using certain higher-level spell slots, you choose one of the summoning options above, and more creatures appear: twice as many with a 6th-level slot and three times as many with an 8th-level slot."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:wizard"]}');


var $91682c8aaa8849e9$exports = {};
$91682c8aaa8849e9$exports = JSON.parse('{"title":"Conjure Shadow Demon (UA)","source":"Unearthed Arcana 11 - That Old Black Magic","levelAndSchool":"4th-level conjuration","level":4,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a vial of blood from an intelligent humanoid killed within the past 24 hours)","duration":"Concentration, up to 1 hour","description":["You summon a shadow demon that appears in an unoccupied space you can see within range. The shadow demon disappears when it drops to 0 hit points or when the spell ends.","Roll initiative for the shadow demon, which has its own turns. You can issue orders to the shadow demon, and it obeys you as long as it can attack a creature on each of its turns and does not start its turn in an area of bright light. If either of these conditions is not met, the shadow demon immediately makes a Charisma check contested by your Charisma check. If you fail the check, the spell no longer requires concentration and the demon is no longer under your control. The demon automatically succeeds on the check if it is more than 100 feet away from you.","As part of casting the spell, you can scribe a circle on the ground using the blood of an intelligent humanoid slain within the past 24 hours. The circle is large enough to encompass your space. The summoned shadow demon cannot cross the circle or target anyone in it while the spell lasts."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $f0e42bc121d21acc$exports = {};
$f0e42bc121d21acc$exports = JSON.parse('{"title":"Conjure Volley","source":"Player\'s Handbook","levelAndSchool":"5th-level conjuration","level":5,"castingTime":"1 action","range":"150 feet","components":"V, S, M (one piece of ammunition or one thrown weapon)","duration":"Instantaneous","description":["You fire a piece of nonmagical ammunition from a ranged weapon or throw a nonmagical weapon into the air and choose a point within range. Hundreds of duplicates of the ammunition or weapon fall in a volley from above and then disappear. Each creature in a 40-foot-radius, 20-foot-high cylinder centered on that point must make a Dexterity saving throw. A creature takes 8d8 damage on a failed save, or half as much damage on a successful one. The damage type is the same as that of the ammunition or weapon."],"spellLists":["http://dnd5e.wikidot.com/spells:ranger"]}');


var $df7d38c6456ded40$exports = {};
$df7d38c6456ded40$exports = JSON.parse('{"title":"Conjure Vrock (UA)","source":"Unearthed Arcana 11 - That Old Black Magic","levelAndSchool":"5th-level conjuration","level":5,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a gem worth at least 100 gp, which the spell consumes)","duration":"Concentration, up to 1 hour","description":["You summon a vrock that appears in an unoccupied space you can see within range. The vrock disappears when it drops to 0 hit points or when the spell ends.","The vrock\u2019s attitude depends on the value of the gem used as a material component for this spell. Roll initiative for the vrock, which has its own turns. At the start of the vrock\u2019s turn, the DM makes a secret Charisma check on your behalf, with a bonus equal to the gem\u2019s value divided by 20. The check DC starts at 10 and increases by 2 each round. You can issue orders to the vrock and have it obey you as long as you succeed on the Charisma check.","If the check fails, the spell no longer requires concentration and the vrock is no longer under your control. The vrock takes no actions on its next turn and uses its telepathy to tell any creature it can see that it will fight in exchange for treasure. The creature that gives the vrock the most expensive gem can command it for the next 1d6 rounds. At the end of that time, it offers the bargain again. If no one offers the vrock treasure before its next turn begins, it attacks the nearest creatures for 1d6 rounds before returning to the Abyss.","As part of casting the spell, you can scribe a circle on the ground using the blood of an intelligent humanoid slain within the past 24 hours. The circle is large enough to encompass your space. The summoned vrock cannot cross the circle or target anyone in it while the spell lasts."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $6535a7502cc0e71b$exports = {};
$6535a7502cc0e71b$exports = JSON.parse('{"title":"Conjure Woodland Beings","source":"Player\'s Handbook","levelAndSchool":"4th-level conjuration","level":4,"castingTime":"1 action","range":"60 feet","components":"V, S, M (one holly berry per creature summoned)","duration":"Concentration, up to 1 hour","description":["You summon fey creatures that appear in unoccupied spaces that you can see within range. Choose one of the following options for what appears:","One fey creature of challenge rating 2 or lower","Two fey creatures of challenge rating 1 or lower","Four fey creatures of challenge rating 1/2 or lower","Eight fey creatures of challenge rating 1/4 or lower","A summoned creature disappears when it drops to 0 hit points or when the spell ends.","The summoned creatures are friendly to you and your companions. Roll initiative for the summoned creatures as a group, which have their own turns. They obey any verbal commands that you issue to them (no action required by you). If you don\u2019t issue any commands to them, they defend themselves from hostile creatures, but otherwise take no actions. The DM has the creatures\u2019 statistics.","At Higher Levels. When you cast this spell using certain higher-level spell slots, you choose one of the summoning options above, and more creatures appear: twice as many with a 6th-level slot, and three times as many with an 8th-level slot."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger"]}');


var $088ceb5203d1411f$exports = {};
$088ceb5203d1411f$exports = JSON.parse('{"title":"Contact Other Plane","source":"Player\'s Handbook","levelAndSchool":"5th-level divination (ritual)","level":5,"castingTime":"1 minute","range":"Self","components":"V","duration":"1 minute","description":["You mentally contact a demigod, the spirit of a long-dead sage, or some other mysterious entity from another plane. Contacting this extraplanar intelligence can strain or even break your mind. When you cast this spell, make a DC 15 Intelligence saving throw. On a failure, you take 6d6 psychic damage and are insane until you finish a long rest. While insane, you can\u2019t take actions, can\u2019t understand what other creatures say, can\u2019t read, and speak only in gibberish. A Greater Restoration spell cast on you ends this effect.","On a successful save, you can ask the entity up to five questions. You must ask your questions before the spell ends. The DM answers each question with one word, such as \\"yes,\\" \\"no,\\" \\"maybe,\\" \\"never,\\" \\"irrelevant,\\" or \\"unclear\\" (if the entity doesn\u2019t know the answer to the question). If a one-word answer would be misleading, the DM might instead offer a short phrase as an answer."],"spellLists":["http://dnd5e.wikidot.com/spell:greater-restoration","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $89e2421c45ccfa16$exports = {};
$89e2421c45ccfa16$exports = JSON.parse('{"title":"Contagion","source":"Player\'s Handbook","levelAndSchool":"5th-level necromancy","level":5,"castingTime":"1 action","range":"Touch","components":"V, S","duration":"7 days","description":["Your touch inflicts disease. Make a melee spell attack against a creature within your reach. On a hit, the target is poisoned.","At the end of each of the poisoned target\u2019s turns, the target must make a Constitution saving throw. If the target succeeds on three of these saves, it is no longer poisoned, and the spell ends. If the target fails three of these saves, the target is no longer poisoned, but choose one of the diseases below. The target is subjected to the chosen disease for the spell\u2019s duration.","Since this spell induces a natural disease in its target, any effect that removes a disease or otherwise ameliorates a disease\u2019s effects apply to it.","Blinding Sickness. Pain grips the creature\u2019s mind, and its eyes turn milky white. The creature has disadvantage on Wisdom checks and Wisdom saving throws and is blinded.","Filth Fever. A raging fever sweeps through the creature\u2019s body. The creature has disadvantage on Strength checks, Strength saving throws, and attack rolls that use Strength.","Flesh Rot. The creature\u2019s flesh decays. The creature has disadvantage on Charisma checks and vulnerability to all damage.","Mindfire. The creature\u2019s mind becomes feverish. The creature has disadvantage on Intelligence checks and Intelligence saving throws, and the creature behaves as if under the effects of the confusion spell during combat.","Seizure. The creature is overcome with shaking. The creature has disadvantage on Dexterity checks, Dexterity saving throws, and attack rolls that use Dexterity.","Slimy Doom. The creature begins to bleed uncontrollably. The creature has disadvantage on Constitution checks and Constitution saving throws. In addition, whenever the creature takes damage, it is stunned until the end of its next turn."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid"]}');


var $2f0e0dc7d1b371d7$exports = {};
$2f0e0dc7d1b371d7$exports = JSON.parse('{"title":"Contingency","source":"Player\'s Handbook","levelAndSchool":"6th-level evocation","level":6,"castingTime":"10 minutes","range":"Self","components":"V, S, M (a statuette of yourself carved from ivory and decorated with gems worth at least 1,500 gp)","duration":"10 days","description":["Choose a spell of 5th level or lower that you can cast, that has a casting time of 1 action, and that can target you. You cast that spell\u2014called the contingent spell\u2014as part of casting contingency, expending spell slots for both, but the contingent spell doesn\u2019t come into effect. Instead, it takes effect when a certain circumstance occurs. You describe that circumstance when you cast the two spells. For example, a contingency cast with water breathing might stipulate that water breathing comes into effect when you are engulfed in water or a similar liquid.","The contingent spell takes effect immediately after the circumstance is met for the first time, whether or not you want it to, and then contingency ends.","The contingent spell takes effect only on you, even if it can normally target others. You can use only one contingency spell at a time. If you cast this spell again, the effect of another contingency spell on you ends. Also, contingency ends on you if its material component is ever not on your person."],"spellLists":["/spell:water-breathing","http://dnd5e.wikidot.com/spells:wizard"]}');


var $7c66026d21049e82$exports = {};
$7c66026d21049e82$exports = JSON.parse('{"title":"Continual Flame","source":"Player\'s Handbook","levelAndSchool":"2nd-level evocation","level":2,"castingTime":"1 action","range":"Touch","components":"V, S, M (ruby dust worth 50 gp, which the spell consumes)","duration":"Until dispelled","description":["A flame, equivalent in brightness to a torch, springs forth from an object that you touch. The effect looks like a regular flame, but it creates no heat and doesn\u2019t use oxygen. A continual flame can be covered or hidden but not smothered or quenched."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:cleric","/spells:druid","http://dnd5e.wikidot.com/spells:wizard"]}');


var $b5308775ba4f7693$exports = {};
$b5308775ba4f7693$exports = JSON.parse('{"title":"Control Flames","source":"Xanathar\'s Guide to Everything","levelAndSchool":"Transmutation cantrip","level":0,"castingTime":"1 action","range":"60 feet","components":"S","duration":"Instantaneous or 1 hour","description":["You choose nonmagical flame that you can see within range and that fits within a 5-foot cube. You affect it in one of the following ways:","You instantaneously expand the flame 5 feet in one direction, provided that wood or other fuel is present in the new location.","You instantaneously extinguish the flames within the cube.","You double or halve the area of bright light and dim light cast by the flame, change its color, or both. The change lasts for 1 hour.","You cause simple shapes\u2014such as the vague form of a creature, an inanimate object, or a location\u2014to appear within the flames and animate as you like. The shapes last for 1 hour.","If you cast this spell multiple times, you can have up to three of its non-instantaneous effects active at a time, and you can dismiss such an effect as an action."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $d4de82517c814426$exports = {};
$d4de82517c814426$exports = JSON.parse('{"title":"Control Water","source":"Player\'s Handbook","levelAndSchool":"4th-level transmutation","level":4,"castingTime":"1 action","range":"300 feet","components":"V, S, M (a drop of water and a pinch of dust)","duration":"Concentration, up to 10 minutes","description":["Until the spell ends, you control any freestanding water inside an area you choose that is a cube up to 100 feet on a side. You can choose from any of the following effects when you cast this spell. As an action on your turn, you can repeat the same effect or choose a different one.","Flood. You cause the water level of all standing water in the area to rise by as much as 20 feet. If the area includes a shore, the flooding water spills over onto dry land. If you choose an area in a large body of water, you instead create a 20-foot tall wave that travels from one side of the area to the other and then crashes down. Any Huge or smaller vehicles in the wave\u2019s path are carried with it to the other side. Any Huge or smaller vehicles struck by the wave have a 25 percent chance of capsizing. The water level remains elevated until the spell ends or you choose a different effect. If this effect produced a wave, the wave repeats on the start of your next turn while the flood effect lasts.","Part Water. You cause water in the area to move apart and create a trench. The trench extends across the spell\u2019s area, and the separated water forms a wall to either side. The trench remains until the spell ends or you choose a different effect. The water then slowly fills in the trench over the course of the next round until the normal water level is restored.","Redirect Flow. You cause flowing water in the area to move in a direction you choose, even if the water has to flow over obstacles, up walls, or in other unlikely directions. The water in the area moves as you direct it, but once it moves beyond the spell\u2019s area, it resumes its flow based on the terrain conditions. The water continues to move in the direction you chose until the spell ends or you choose a different effect.","Whirlpool. This effect requires a body of water at least 50 feet square and 25 feet deep. You cause a whirlpool to form in the center of the area. The whirlpool forms a vortex that is 5 feet wide at the base, up to 50 feet wide at the top, and 25 feet tall. Any creature or object in the water and within 25 feet of the vortex is pulled 10 feet toward it. A creature can swim away from the vortex by making a Strength (Athletics) check against your spell save DC.","When a creature enters the vortex for the first time on a turn or starts its turn there, it must make a Strength saving throw. On a failed save, the creature takes 2d8 bludgeoning damage and is caught in the vortex until the spell ends. On a successful save, the creature takes half damage, and isn\u2019t caught in the vortex. A creature caught in the vortex can use its action to try to swim away from the vortex as described above, but has disadvantage on the Strength (Athletics) check to do so.","The first time each turn that an object enters the vortex, the object takes 2d8 bludgeoning damage, this damage occurs each round it remains in the vortex."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:wizard"]}');


var $124a6e685a4095f4$exports = {};
$124a6e685a4095f4$exports = JSON.parse('{"title":"Control Weather","source":"Player\'s Handbook","levelAndSchool":"8th-level transmutation","level":8,"castingTime":"10 minutes","range":"Self (5-mile radius)","components":"V, S, M (burning incense and bits of earth and wood mixed in water)","duration":"Concentration, Up to 8 hours","description":["You take control of the weather within 5 miles of you for the duration. You must be outdoors to cast this spell. Moving to a place where you don\u2019t have a clear path to the sky ends the spell early.","When you cast the spell, you change the current weather conditions, which are determined by the DM based on the climate and season. You can change precipitation, temperature, and wind. It takes 1d4 x 10 minutes for the new conditions to take effect. Once they do so, you can change the conditions again. When the spell ends, the weather gradually returns to normal.","When you change the weather conditions, find a current condition on the following tables and change its stage by one, up or down. When changing the wind, you can change its direction.","Precipitation","Stage 1","Clear","Stage 2","Light clouds","Stage 3","Overcast or ground fog","Stage 4","Rain, hail or snow","Stage 5","Torrential rain, driving hail or blizzard","Temperature","Stage 1","Unbearable heat","Stage 2","Hot","Stage 3","Warm","Stage 4","Cool","Stage 5","Cold","Stage 6","Arctic cold","Wind","Stage 1","Calm","Stage 2","Moderate wind","Stage 3","Strong wind","Stage 4","Gale","Stage 5","Storm"],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:wizard"]}');


var $0893f96541a0c330$exports = {};
$0893f96541a0c330$exports = JSON.parse('{"title":"Control Winds","source":"Xanathar\'s Guide to Everything","levelAndSchool":"5th-level transmutation","level":5,"castingTime":"1 action","range":"300 feet","components":"V, S","duration":"Concentration, up to 1 hour","description":["You take control of the air in a 100-foot cube that you can see within range. Choose one of the following effects when you cast the spell. The effect lasts for the spell\u2019s duration, unless you use your action on a later turn to switch to a different effect. You can also use your action to temporarily halt the effect or to restart one you\u2019ve halted.","Gusts. A wind picks up within the cube, continually blowing in a horizontal direction that you choose. You choose the intensity of the wind: calm, moderate, or strong. If the wind is moderate or strong, ranged weapon attacks that pass through it or that are made against targets within the cube have disadvantage on their attack rolls. If the wind is strong, any creature moving against the wind must spend 1 extra foot of movement for each foot moved.","Downdraft. You cause a sustained blast of strong wind to blow downward from the top of the cube. Ranged weapon attacks that pass through the cube or that are made against targets within it have disadvantage on their attack rolls. A creature must make a Strength saving throw if it flies into the cube for the first time on a turn or starts its turn there flying. On a failed save, the creature is knocked prone.","Updraft. You cause a sustained updraft within the cube, rising upward from the cube\u2019s bottom edge. Creatures that end a fall within the cube take only half damage from the fall. When a creature in the cube makes a vertical jump, the creature can jump up to 10 feet higher than normal."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $68e1c915df02d5c5$exports = {};
$68e1c915df02d5c5$exports = JSON.parse('{"title":"Cordon of Arrows","source":"Player\'s Handbook","levelAndSchool":"2nd-level transmutation","level":2,"castingTime":"1 action","range":"5 feet","components":"V, S, M (four or more arrows or bolts)","duration":"8 hours","description":["You plant four pieces of nonmagical ammunition \u2013 arrows or crossbow bolts \u2013 in the ground within range and lay magic upon them to protect an area. Until the spell ends, whenever a creature other than you comes within 30 feet of the ammunition for the first time on a turn or ends its turn there, one piece of ammunition flies up to strike it. The creature must succeed on a Dexterity saving throw or take 1d6 piercing damage. The piece of ammunition is then destroyed. The spell ends when no ammunition remains.","When you cast this spell, you can designate any creatures you choose, and the spell ignores them.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, the amount of ammunition that can be affected increases by two for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:ranger"]}');


var $b49481cd77ef3f75$exports = {};
$b49481cd77ef3f75$exports = JSON.parse('{"title":"Counterspell","source":"Player\'s Handbook","levelAndSchool":"3rd-level abjuration","level":3,"castingTime":"1 reaction, which you take when you see a creature within 60 feet of you casting a spell","range":"60 feet","components":"S","duration":"Instantaneous","description":["You attempt to interrupt a creature in the process of casting a spell. If the creature is casting a spell of 3rd level or lower, its spell fails and has no effect. If it is casting a spell of 4th level or higher, make an ability check using your spellcasting ability. The DC equals 10 + the spell\u2019s level. On a success, the creature\u2019s spell fails and has no effect.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, the interrupted spell has no effect if its level is less than or equal to the level of the spell slot you used."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $8ee6e71999b0cf75$exports = {};
$8ee6e71999b0cf75$exports = JSON.parse('{"title":"Create Bonfire","source":"Xanathar\'s Guide to Everything","levelAndSchool":"Conjuration cantrip","level":0,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Concentration, up to 1 minute","description":["You create a bonfire on ground that you can see within range. Until the spell ends, the bonfire fills a 5-foot cube. Any creature in the bonfire\u2019s space when you cast the spell must succeed on a Dexterity saving throw or take 1d8 fire damage. A creature must also make the saving throw when it enters the bonfire\u2019s space for the first time on a turn or ends its turn there.","At Higher Levels. The spell\u2019s damage increases by 1d8 when you reach 5th level (2d8), 11th level (3d8), and 17th level (4d8)."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $b45bbc0e983e7f47$exports = {};
$b45bbc0e983e7f47$exports = JSON.parse('{"title":"Create Food and Water","source":"Player\'s Handbook","levelAndSchool":"3rd-level conjuration","level":3,"castingTime":"1 action","range":"30 feet","components":"V, S","duration":"Instantaneous","description":["You create 45 pounds of food and 30 gallons of water on the ground or in containers within range, enough to sustain up to fifteen humanoids or five steeds for 24 hours. The food is bland but nourishing, and spoils if uneaten after 24 hours. The water is clean and doesn\u2019t go bad."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:paladin"]}');


var $1709e17c0c63861e$exports = {};
$1709e17c0c63861e$exports = JSON.parse('{"title":"Create Homunculus","source":"Xanathar\'s Guide to Everything","levelAndSchool":"6th-level transmutation","level":6,"castingTime":"1 hour","range":"Touch","components":"V, S, M (clay, ash, and mandrake root, all of which the spell consumes, and a jewel-encrusted dagger worth at least 1,000 gp)","duration":"Instantaneous","description":["While speaking an intricate incantation, you cut yourself with a jewel-encrusted dagger, taking 2d4 piercing damage that can\u2019t be reduced in any way. You then drip your blood on the spell\u2019s other components and touch them, transforming them into a special construct called a homunculus. The statistics of the homunculus are in the Monster Manual. It is your faithful companion, and it dies if you die. Whenever you finish a long rest, you can spend up to half your Hit Dice if the homunculus is on the same plane of existence as you. When you do so, roll each die and add your Constitution modifier to it. Your hit point maximum is reduced by the total, and the homunculus\u2019s hit point maximum and current hit points are both increased by it. This process can reduce you to no lower than 1 hit point. and the change to your and the homunculus\u2019s hit points ends when you finish your next long rest. The reduction to your hit point maximum can\u2019t be removed by any means before then, except by the homunculus\u2018s death. You can have only one homunculus at a time. If you cast this spell while your homunculus lives, the spell fails."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $3e48a194642a4d88$exports = {};
$3e48a194642a4d88$exports = JSON.parse('{"title":"Create Magen","source":"Icewind Dale - Rime of the Frostmaiden","levelAndSchool":"7th-level transmutation","level":7,"castingTime":"1 hour","range":"Touch","components":"V, S, M (a vial of quicksilver worth 500 gp and a life-sized human doll, both of which the spell consumes, and an intricate crystal rod worth at least 1,500 gp that is not consumed)","duration":"Instantaneous","description":["While casting the spell, you place a vial of quicksilver in the chest of a life-sized human doll stuffed with ash or dust. You then stitch up the doll and drip your blood on it. At the end of the casting, you tap the doll with a crystal rod, transforming it into a magen clothed in whatever the doll was wearing. The type of magen is chosen by you during the casting of the spell.","When the magen appears, your hit point maximum decreases by an amount equal to the magen\'s challenge rating (minimum reduction of 1). Only a Wish spell can undo this reduction to your hit point maximum.","Any magen you create with this spell obeys your commands without question."],"spellLists":["http://dnd5e.wikidot.com/spell:wish","http://dnd5e.wikidot.com/spells:wizard"]}');


var $4a4907f46925d226$exports = {};
$4a4907f46925d226$exports = JSON.parse('{"title":"Create or Destroy Water","source":"Player\'s Handbook","levelAndSchool":"1st-level transmutation","level":1,"castingTime":"1 action","range":"30 feet","components":"V, S, M (a drop of water if creating water or a few grains of sand if destroying it)","duration":"Instantaneous","description":["You either create or destroy water.","Create Water. You create up to 10 gallons of clean water within range in an open container. Alternatively, the water falls as rain in a 30-foot cube within range, extinguishing exposed flames in the area.","Destroy Water. You destroy up to 10 gallons of water in an open container within range. Alternatively, you destroy fog in a 30-foot cube within range.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, you create or destroy 10 additional gallons of water, or the size of the cube increases by 5 feet, for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid"]}');


var $dbad267a23551c2e$exports = {};
$dbad267a23551c2e$exports = JSON.parse('{"title":"Create Spelljamming Helm","source":"Spelljammer: Adventures in Space - Astral Adventurer\'s Guide","levelAndSchool":"5th-Level Transmutation","level":5,"castingTime":"1 action","range":"Touch","components":"V, S, M (a crystal rod worth at least 5000 gp, which the spell consumes)","duration":"Instantaneous","description":["Holding the rod used in the casting of the spell, you touch a Large or smaller chair that is unoccupied. The rod disappears, and the chair is transformed into a Spelljamming Helm."],"spellLists":["http://dnd5e.wikidot.com/wondrous-items:spelljamming-helm","http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $16c19b446b270ff8$exports = {};
$16c19b446b270ff8$exports = JSON.parse('{"title":"Create Undead","source":"Player\'s Handbook","levelAndSchool":"6th-level necromancy","level":6,"castingTime":"1 minute","range":"10 feet","components":"V, S, M (one clay pot filled with grave dirt, one clay pot filled with brackish water, and one 150 gp black onyx stone for each corpse)","duration":"Instantaneous","description":["You can cast this spell only at night. Choose up to three corpses of Medium or Small humanoids within range. Each corpse becomes a ghoul under your control. The DM has game statistics for these creatures.","As a bonus action on each of your turns, you can mentally command any creature you animated with this spell if the creature is within 120 feet of you (if you control multiple creatures, you can command any or all of them at the same time, issuing the same command to each one). You decide what action the creature will take and where it will move during its next turn, or you can issue a general command, such as to guard a particular chamber or corridor. If you issue no commands, the creature only defends itself against hostile creatures. Once given an order, the creature continues to follow it until its task is complete.","The creature is under your control for 24 hours, after which it stops obeying any command you have given it. To maintain control of the creature for another 24 hours, you must cast this spell on the creature before the current 24-hour period ends. This use of the spell reasserts your control over up to three creatures you have animated with this spell, rather than animating new ones.","At Higher Levels. When you cast this spell using a 7th-level spell slot, you can animate or reassert control over four ghouls. When you cast this spell using an 8th-level spell slot, you can animate or reassert control over five ghouls or two ghasts or wights. When you cast this spell using a 9th-level spell slot, you can animate or reassert control over six ghouls, three ghasts or wights, or two mummies."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $e9c941ee98729d67$exports = {};
$e9c941ee98729d67$exports = JSON.parse('{"title":"Creation","source":"Player\'s Handbook","levelAndSchool":"5th-level illusion","level":5,"castingTime":"1 minute","range":"30 feet","components":"V, S, M (a tiny piece of matter of the same type of the item you plan to create)","duration":"Special","description":["You pull wisps of shadow material from the Shadowfell to create a nonliving object of vegetable matter within range: soft goods, rope, wood, or something similar. You can also use this spell to create mineral objects such as stone, crystal, or metal. The object created must be no larger than a 5-foot cube, and the object must be of a form and material that you have seen before.","The duration depends on the object\u2019s material. If the object is composed of multiple materials, use the shortest duration.","Material","Duration","Vegetable matter","1 day","Stone, crystal","12 hours","Precious metals","1 hour","Gems","10 minutes","Adamantine, Mithral","1 minute","Using any material created by this spell as another spell\u2019s material component causes that spell to fail.","At Higher Levels. When you cast this spell using a spell slot of 6th level or higher, the cube increases by 5 feet for each slot level above 5th."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $87ae0e9c3b5a465f$exports = {};
$87ae0e9c3b5a465f$exports = JSON.parse('{"title":"Crown of Madness","source":"Player\'s Handbook","levelAndSchool":"2nd-level enchantment","level":2,"castingTime":"1 action","range":"120 feet","components":"V, S","duration":"Concentration, up to 1 minute","description":["One humanoid of your choice that you can see within range must succeed on a Wisdom saving throw or become charmed by you for the duration. While the target is charmed in this way, a twisted crown of jagged iron appears on its head, and a madness glows in its eyes.","The charmed target must use its action before moving on each of its turns to make a melee attack against a creature other than itself that you mentally choose. The target can act normally on its turn if you choose no creature or if none are within its reach.","On your subsequent turns, you must use your action to maintain control over the target, or the spell ends. Also, the target can make a Wisdom saving throw at the end of each of its turns. On a success, the spell ends."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $6dd337434ffa3c13$exports = {};
$6dd337434ffa3c13$exports = JSON.parse('{"title":"Crown of Stars","source":"Xanathar\'s Guide to Everything","levelAndSchool":"7th-level evocation","level":7,"castingTime":"1 action","range":"Self","components":"V, S","duration":"1 hour","description":["Seven star-like motes of light appear and orbit your head until the spell ends. You can use a bonus action to send one of the motes streaking toward one creature or object within 120 feet of you. When you do so, make a ranged spell attack. On a hit, the target takes 4d12 radiant damage. Whether you hit or miss, the mote is expended. The spell ends early if you expend the last mote. If you have four or more motes remaining, they shed bright light in a 30-foot radius and dim light for an additional 30 feet. If you have one to three motes remaining, they shed dim light in a 30-foot radius.","At Higher Levels. When you cast this spell using a spell slot of 8th level or higher, the number of motes created increases by two for each slot level above 7th."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $9f95f77317b8b035$exports = {};
$9f95f77317b8b035$exports = JSON.parse('{"title":"Crusader\'s Mantle","source":"Player\'s Handbook","levelAndSchool":"3rd-level evocation","level":3,"castingTime":"1 action","range":"Self","components":"V","duration":"Concentration, up to 1 minute","description":["Holy power radiates from you in an aura with a 30-foot radius, awakening boldness in friendly creatures. Until the spell ends, the aura moves with you, centered on you. While in the aura, each non-hostile creature in the aura (including you) deals an extra 1d4 radiant damage when it hits with a weapon attack."],"spellLists":["http://dnd5e.wikidot.com/spells:paladin"]}');


var $4fb4165c825dda06$exports = {};
$4fb4165c825dda06$exports = JSON.parse('{"title":"Cure Wounds","source":"Player\'s Handbook","levelAndSchool":"1st-level evocation","level":1,"castingTime":"1 action","range":"Touch","components":"V, S","duration":"Instantaneous","description":["A creature you touch regains a number of hit points equal to 1d8 + your spellcasting ability modifier. This spell has no effect on undead or constructs.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the healing increases by 1d8 for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:paladin","http://dnd5e.wikidot.com/spells:ranger"]}');


var $ea4103cafa4cffec$exports = {};
$ea4103cafa4cffec$exports = JSON.parse('{"title":"Dancing Lights","source":"Player\'s Handbook","levelAndSchool":"Evocation cantrip","level":0,"castingTime":"1 action","range":"120 feet","components":"V, S, M (a bit of phosphorus or wychwood, or a glowworm)","duration":"Concentration, up to 1 minute","description":["You create up to four torch-sized lights within range, making them appear as torches, lanterns, or glowing orbs that hover in the air for the duration. You can also combine the four lights into one glowing vaguely humanoid form of Medium size. Whichever form you choose, each light sheds dim light in a 10-foot radius.","As a bonus action on your turn, you can move the lights up to 60 feet to a new spot within range. A light must be within 20 feet of another light created by this spell, and a light winks out if it exceeds the spell\u2019s range."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $a99990ed3803fc58$exports = {};
$a99990ed3803fc58$exports = JSON.parse('{"title":"Danse Macabre","source":"Xanathar\'s Guide to Everything","levelAndSchool":"5th-level necromancy","level":5,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Concentration, up to 1 hour","description":["Threads of dark power leap from your fingers to pierce up to five Small or Medium corpses you can see within range. Each corpse immediately stands up and becomes undead. You decide whether it is a zombie or a skeleton (the statistics for zombies and skeletons are in the Monster Manual), and it gains a bonus to its attack and damage rolls equal to your spellcasting ability modifier. You can use a bonus action to mentally command the creatures you make with this spell, issuing the same command to all of them. To receive the command, a creature must be within 60 feet of you. You decide what action the creatures will take and where they will move during their next turn, or you can issue a general command, such as to guard a chamber or passageway against your foes. If you issue no commands, the creatures do nothing except defend themselves against hostile creatures. Once given an order, the creatures continue to follow it until their task is complete.","The creatures are under your control until the spell ends, after which they become inanimate once more.","At Higher Levels. When you cast this spell using a spell slot\u2018 of 6th level or higher, you animate up to two additional corpses for each slot level above 5th."],"spellLists":["http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $d808c3a08329f30d$exports = {};
$d808c3a08329f30d$exports = JSON.parse('{"title":"Dark Star","source":"Explorer\'s Guide to Wildemount","levelAndSchool":"8th-level evocation (dunamancy:graviturgy)","level":8,"castingTime":"1 action","range":"150 feet","components":"V, S, M (a shard of onyx and a drop of the caster\'s blood, both of which the spell consumes)","duration":"Concentration, up to 1 minute","description":["This spell creates a sphere centered on a point you choose within range. The sphere can have a radius of up to 40 feet. The area within this sphere is filled with magical darkness and crushing gravitational force.","For the duration, the spell\'s area is difficult terrain. A creature with darkvision can\'t see through the magical darkness, and nonmagical light can\'t illuminate it. No sound can be created within or pass through the area. Any creature or object entirely inside the sphere is immune to thunder damage, and creatures are deafened while entirely inside it. Casting a spell that includes a verbal component is impossible there.","Any creature that enters the spell\'s area for the first time on a turn or starts its turn there must make a Constitution saving throw. The creature takes 8d10 force damage on a failed save or half as much damage on a successful save. A creature reduced to 0 hit points by this damage is disintegrated. A disintegrated creature and everything it is wearing and carrying, except magic items, are reduced to a pile of fine gray dust."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $626410c8eae90deb$exports = {};
$626410c8eae90deb$exports = JSON.parse('{"title":"Darkness","source":"Player\'s Handbook","levelAndSchool":"2nd-level evocation","level":2,"castingTime":"1 action","range":"60 feet","components":"V, M (bat fur and a drop of pitch or piece of coal)","duration":"Concentration, up to 10 minutes","description":["Magical darkness spreads from a point you choose within range to fill a 15-foot radius sphere for the duration. The darkness spreads around corners. A creature with darkvision can\u2019t see through this darkness, and nonmagical light can\u2019t illuminate it.","If the point you choose is on an object you are holding or one that isn\u2019t being worn or carried, the darkness emanates from the object and moves with it. Completely covering the source of the darkness with an opaque object, such as a bowl or a helm, blocks the darkness.","If any of this spell\u2019s area overlaps with an area of light created by a spell of 2nd level or lower, the spell that created the light is dispelled."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $f9703f1c1397a424$exports = {};
$f9703f1c1397a424$exports = JSON.parse('{"title":"Darkvision","source":"Player\'s Handbook","levelAndSchool":"2nd-level transmutation","level":2,"castingTime":"1 action","range":"Touch","components":"V, S, M (either a pinch of dried carrot or an agate)","duration":"8 hours","description":["You touch a willing creature to grant it the ability to see in the dark. For the duration, that creature has darkvision out to a range of 60 feet."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $aa25c5728e9eb7b0$exports = {};
$aa25c5728e9eb7b0$exports = JSON.parse('{"title":"Dawn","source":"Xanathar\'s Guide to Everything","levelAndSchool":"5th-level evocation","level":5,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a sunburst pendant worth at least 100 gp)","duration":"Concentration, up to 1 minute","description":["The light of dawn shines down on a location you specify within range. Until the spell ends, a 30-foot-radius, 40-foot-high cylinder of bright light glimmers there. This light is sunlight. When the cylinder appears, each creature in it must make a Constitution saving throw, taking 4d10 radiant damage on a failed save, or half as much damage on a successful one. A creature must also make this saving throw whenever it ends its turn in the cylinder. If you\u2019re within 60 feet of the cylinder, you can move it up to 60 feet as a bonus action on your turn."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:wizard"]}');


var $57bf1991a6627d54$exports = {};
$57bf1991a6627d54$exports = JSON.parse('{"title":"Daylight","source":"Player\'s Handbook","levelAndSchool":"3rd-level evocation","level":3,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"1 hour","description":["A 60-foot-radius sphere of light spreads out from a point you choose within range. The sphere is bright light and sheds dim light for an additional 60 feet.","If you chose a point on an object you are holding or one that isn\u2019t being worn or carried, the light shines from the object with and moves with it. Completely covering the affected object with an opaque object, such as a bowl or a helm, blocks the light.","If any of this spell\u2019s area overlaps with an area of darkness created by a spell of 3rd level or lower, the spell that created the darkness is dispelled."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:paladin","http://dnd5e.wikidot.com/spells:ranger","http://dnd5e.wikidot.com/spells:sorcerer"]}');


var $73516bc5ce0da877$exports = {};
$73516bc5ce0da877$exports = JSON.parse('{"title":"Death Ward","source":"Player\'s Handbook","levelAndSchool":"4th-level abjuration","level":4,"castingTime":"1 action","range":"Touch","components":"V, S","duration":"8 hours","description":["You touch a creature and grant it a measure of protection from death. The first time the target would drop to 0 hit points as a result of taking damage, the target instead drops to 1 hit point, and the spell ends. If the spell is still in effect when the target is subjected to an effect that would kill it instantaneously without dealing damage, that effect is instead negated against the target, and the spells ends."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:paladin"]}');


var $9b375fd6307637fc$exports = {};
$9b375fd6307637fc$exports = JSON.parse('{"title":"Decompose (HB)","source":"Critical Role (Twitter)","levelAndSchool":"Necromancy cantrip","level":0,"castingTime":"1 action","range":"Touch","components":"V, S","duration":"1 minute","description":["You reach out and touch the corpse of a creature. Over the next minute, the corpse begins to rapidly decompose, sprouting fungus and moss as it begins to degrade into compost and mulch. An odd-colored flower or two may also spring from the corpse in this time. Applicable requirements for resurrection are unaffected by this decomposition."],"spellLists":["https://twitter.com/matthewmercer/status/1027797251484078080?lang=en","http://dnd5e.wikidot.com/spells:cleric"]}');


var $79d91bae936ddc9d$exports = {};
$79d91bae936ddc9d$exports = JSON.parse('{"title":"Delayed Blast Fireball","source":"Player\'s Handbook","levelAndSchool":"7th-level evocation","level":7,"castingTime":"1 action","range":"150 feet","components":"V, S, M (a tiny ball of bat guano and sulfur)","duration":"Concentration, up to 1 minute","description":["A beam of yellow light flashes from your pointing finger, then condenses to linger at a chosen point within range as a glowing bead for the duration. When the spell ends, either because your concentration is broken or because you decide to end it, the bead blossoms with a low roar into an explosion of flame that spreads around corners. Each creature in a 20-foot-radius sphere centered on that point must make a Dexterity saving throw. A creature takes fire damage equal to the total accumulated damage on a failed save, or half as much damage on a successful one.","The spell\u2019s base damage is 12d6. If at the end of your turn the bead has not yet detonated, the damage increases by 1d6.","If the glowing bead is touched before the interval has expired, the creature touching it must make a Dexterity saving throw. On a failed save, the spell ends immediately, causing the bead to erupt in flame. On a successful save, the creature can throw the bead up to 40 feet. When it strikes a creature or a solid object, the spell ends, and the bead explodes.","The fire damages objects in the area and ignites flammable objects that aren\u2019t being worn or carried.","At Higher Levels. When you cast this spell using a spell slot of 8th level or higher, the base damage increases by 1d6 for each slot level above 7th."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $7079830adb610308$exports = {};
$7079830adb610308$exports = JSON.parse('{"title":"Demiplane","source":"Player\'s Handbook","levelAndSchool":"8th-level conjuration","level":8,"castingTime":"1 action","range":"60 feet","components":"S","duration":"1 hour","description":["You create a shadowy door on a flat solid surface that you can see within range. The door is large enough to allow Medium creatures to pass through unhindered. When opened, the door leads to a demiplane that appears to be an empty room 30 feet in each dimension, made of wood or stone. When the spell ends, the door disappears, and any creatures or objects inside the demiplane remain trapped there, as the door also disappears from the other side.","Each time you cast this spell, you can create a new demiplane, or have the shadowy door connect to a demiplane you created with a previous casting of this spell. Additionally, if you know the nature and contents of a demiplane created by a casting of this spell by another creature, you can have the shadowy door connect to its demiplane instead."],"spellLists":["/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $c9378b12e2614aa9$exports = {};
$c9378b12e2614aa9$exports = JSON.parse('{"title":"Destructive Wave","source":"Player\'s Handbook","levelAndSchool":"5th-level evocation","level":5,"castingTime":"1 action","range":"Self (30-foot radius)","components":"V","duration":"Instantaneous","description":["You strike the ground, creating a burst of divine energy that ripples outward from you. Each creature you choose within 30 feet of you must succeed on a Constitution saving throw or take 5d6 thunder damage, as well as 5d6 radiant or necrotic damage (your choice), and be knocked prone. A creature that succeeds on its saving throw takes half as much damage and isn\u2019t knocked prone."],"spellLists":["http://dnd5e.wikidot.com/spells:paladin"]}');


var $9167f535c2a4470e$exports = {};
$9167f535c2a4470e$exports = JSON.parse('{"title":"Detect Evil and Good","source":"Player\'s Handbook","levelAndSchool":"1st-level divination","level":1,"castingTime":"1 action","range":"Self","components":"V, S","duration":"Concentration, up to 10 minutes","description":["For the duration, you know if there is an aberration, celestial, elemental, fey, fiend, or undead within 30 feet of you, as well as where the creature is located. Similarly, you know if there is a place or object within 30 feet of you that has been magically consecrated or desecrated.","The spell can penetrate most barriers, but it is blocked by 1 foot of stone, 1 inch of common metal, a thin sheet of lead, or 3 feet of wood or dirt."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:paladin"]}');


var $8c9c51b0be2bc14a$exports = {};
$8c9c51b0be2bc14a$exports = JSON.parse('{"title":"Detect Magic","source":"Player\'s Handbook","levelAndSchool":"1st-level divination (ritual)","level":1,"castingTime":"1 action","range":"Self","components":"V, S","duration":"Concentration, up to 10 minutes","description":["For the duration, you sense the presence of magic within 30 feet of you. If you sense magic in this way, you can use your action to see a faint aura around any visible creature or object in the area that bears magic, and you learn its school of magic, if any.","The spell can penetrate most barriers, but is blocked by 1 foot of stone, 1 inch of common metal, a thin sheet of lead, or 3 feet of wood or dirt."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:paladin","http://dnd5e.wikidot.com/spells:ranger","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $693160139b7d23a6$exports = {};
$693160139b7d23a6$exports = JSON.parse('{"title":"Detect Poison and Disease","source":"Player\'s Handbook","levelAndSchool":"1st-level divination (ritual)","level":1,"castingTime":"1 action","range":"Self","components":"V, S, M (a yew leaf)","duration":"Concentration, up to 10 minutes","description":["For the duration, you can sense the presence and location of poisons, poisonous creatures, and diseases within 30 feet of you. You also identify the kind of poison, poisonous creature, or disease in each case.","The spell can penetrate most barriers, but is blocked by 1 foot of stone, 1 inch of common metal, a thin sheet of lead, or 3 feet of wood or dirt."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:paladin","http://dnd5e.wikidot.com/spells:ranger"]}');


var $cb50c4c8027583e7$exports = {};
$cb50c4c8027583e7$exports = JSON.parse('{"title":"Detect Thoughts","source":"Player\'s Handbook","levelAndSchool":"2nd-level divination","level":2,"castingTime":"1 action","range":"Self","components":"V, S, M (a copper piece)","duration":"Concentration, up to 1 minute","description":["For the duration, you can read the thoughts of certain creatures. When you cast the spell and as your action on each turn until the spell ends, you can focus your mind on any one creature that you can see within 30 feet of you. If the creature you choose has an Intelligence of 3 or lower or doesn\u2019t speak any language, the creature is unaffected.","You initially learn the surface thoughts of the creature\u2014what is most on its mind in that moment. As an action, you can either shift your attention to another creature\u2019s thoughts or attempt to probe deeper into the same creature\u2019s mind. If you probe deeper, the target must make a Wisdom saving throw. If it fails, you gain insight into its reasoning (if any), its emotional state, and something that loom s large in its mind (such as something it worries over, loves, or hates). If it succeeds, the spell ends. Either way, the target knows that you are probing into its mind, and unless you shift your attention to another creature\u2019s thoughts, the creature can use its action on its turn to make an Intelligence check contested by your Intelligence check; if it succeeds, the spell ends.","Questions verbally directed at the target creature naturally shape the course of its thoughts, so this spell is particularly effective as part of an interrogation.","You can also use this spell to detect the presence of thinking creatures you can\u2019t see. When you cast the spell or as your action during the duration, you can search for thoughts within 30 feet of you. The spell can penetrate barriers, but 2 feet of rock, 2 inches of any metal other than lead, or a thin sheet of lead blocks you. You can\u2019t detect a creature with an Intelligence of 3 or lower or one that doesn\u2019t speak any language.","Once you detect the presence of a creature in this way, you can read its thoughts for the rest of the duration as described above, even if you can\u2019t see it, but it must still be within range."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $a92b8d3e8eb4df6d$exports = {};
$a92b8d3e8eb4df6d$exports = JSON.parse('{"title":"Digital Phantom (UA)","source":"Unearthed Arcana 7 - Modern Magic","levelAndSchool":"2nd-level abjuration (technomagic)","level":2,"castingTime":"1 action","range":"Self","components":"V, S, M (a small piece of copper wire)","duration":"Concentration, up to 1 hour","description":["This spell works to actively hide your presence within a computer system. For the spell\u2019s duration, you and any other users you choose on your local network gain a +10 bonus to Intelligence checks to avoid detection by administrators, knowbots, tracking software, and the like. Whenever you and your chosen users leave any computer system you are working in while this spell is in effect, all trace of your previous presence in that system is erased."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $7cefe00e892150f3$exports = {};
$7cefe00e892150f3$exports = JSON.parse('{"title":"Dimension Door","source":"Player\'s Handbook","levelAndSchool":"4th-level conjuration","level":4,"castingTime":"1 action","range":"500 feet","components":"V","duration":"Instantaneous","description":["You teleport yourself from your current location to any other spot within range. You arrive at exactly the spot desired. It can be a place you can see, one you can visualize, or one you can describe by stating distance and direction, such as \\"200 feet straight downward\\" or \\"upward to the northwest at a 45-degree angle, 300 feet\\".","You can bring along objects as long as their weight doesn\u2019t exceed what you can carry. You can also bring one willing creature of your size or smaller who is carrying gear up to its carrying capacity. The creature must be within 5 feet of you when you cast this spell.","If you would arrive in a place already occupied by an object or a creature, you and any creature traveling with you each take 4d6 force damage, and the spell fails to teleport you."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $1cf2823c977ad205$exports = {};
$1cf2823c977ad205$exports = JSON.parse('{"title":"Disguise Self","source":"Player\'s Handbook","levelAndSchool":"1st-level illusion","level":1,"castingTime":"1 action","range":"Self","components":"V, S","duration":"1 hour","description":["You make yourself \u2013 including your clothing, armor, weapons, and other belongings on your person \u2013 look different until the spell ends or until you use your action to dismiss it. You can seem 1 foot shorter or taller and can appear thin, fat, or in between. You can\u2019t change your body type, so you must adopt a form that has the same basic arrangement of limbs. Otherwise, the extent of the illusion is up to you.","The changes wrought by this spell fail to hold up to physical inspection. For example, if you use this spell to add a hat to your outfit, objects pass through the hat, and anyone who touches it would feel nothing or would feel your head and hair. If you use this spell to appear thinner than you are, the hand of someone who reaches out to touch you would bump into you while it was seemingly still in midair. To discern that you are disguised, a creature can use its action to inspect your appearance and must succeed on an Intelligence (Investigation) check against your spell save DC."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $0d9ce41791cf87a9$exports = {};
$0d9ce41791cf87a9$exports = JSON.parse('{"title":"Disintegrate","source":"Player\'s Handbook","levelAndSchool":"6th-level transmutation","level":6,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a lodestone and a pinch of dust)","duration":"Instantaneous","description":["A thin green ray springs from your pointing finger to a target that you can see within range. The target can be a creature, an object, or a creation of magical force, such as the wall created by wall of force.","A creature targeted by this spell must make a Dexterity saving throw. On a failed save, the target takes 10d6 + 40 force damage. The target is disintegrated if this damage leaves it with 0 hit points.","A disintegrated creature and everything it is wearing and carrying, except magic items, are reduced to a pile of fine gray dust. The creature can be restored to life only by means of a true resurrection or a wish spell.","This spell automatically disintegrates a Large or smaller nonmagical object or a creation of magical force. If the target is a Huge or larger object or creation of force, this spell disintegrates a 10-foot-cube portion of it. A magic item is unaffected by this spell.","At Higher Levels. When you cast this spell using a spell slot of 7th level or higher, the damage increases by 3d6 for each slot level above 6th."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $d794d72ab406abcb$exports = {};
$d794d72ab406abcb$exports = JSON.parse('{"title":"Dispel Evil and Good","source":"Player\'s Handbook","levelAndSchool":"5th-level abjuration","level":5,"castingTime":"1 action","range":"Self","components":"V, S, M (holy water or powdered silver and iron)","duration":"Concentration, up to 1 minute","description":["Shimmering energy surrounds and protects you from fey, undead, and creatures originating from beyond the Material Plane. For the duration, celestials, elementals, fey, fiends, and undead have disadvantage on attack rolls against you. You can end the spell early by using either of the following special functions.","Break Enchantment. As your action, you touch a creature you can reach that is charmed, frightened, or possessed by a celestial, an elemental, a fey, a fiend, or an undead. The creature you touch is no longer charmed, frightened, or possessed by such creatures.","Dismissal. As your action, make a melee spell attack against a celestial, an elemental, a fey, a fiend, or an undead you can reach. On a hit, you attempt to drive the creature back to its home plane. The creature must succeed on a Charisma saving throw or be sent back to its home plane (if it isn\u2019t there already). If they are already on their home plane, undead are sent to the Shadowfell, and fey are sent to the Feywild."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:paladin"]}');


var $a0d9bbcc6f96b45f$exports = {};
$a0d9bbcc6f96b45f$exports = JSON.parse('{"title":"Dispel Magic","source":"Player\'s Handbook","levelAndSchool":"3rd-level abjuration","level":3,"castingTime":"1 action","range":"120 feet","components":"V, S","duration":"Instantaneous","description":["Choose any creature, object, or magical effect within range. Any spell of 3rd level or lower on the target ends. For each spell of 4th level or higher on the target, make an ability check using your spellcasting ability. The DC equals 10 + the spell\'s level. On a successful check, the spell ends.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, you automatically end the effects of a spell on the target if the spell\'s level is equal to or less than the level of the spell slot you used."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:paladin","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $43b6e4a2cf84fafd$exports = {};
$43b6e4a2cf84fafd$exports = JSON.parse('{"title":"Dissonant Whispers","source":"Player\'s Handbook","levelAndSchool":"1st-level enchantment","level":1,"castingTime":"1 action","range":"60 feet","components":"V","duration":"Instantaneous","description":["You whisper a discordant melody that only one creature of your choice within range can hear, wracking it with terrible pain. The target must make a Wisdom saving throw. On a failed save, it takes 3d6 psychic damage and must immediately use its reaction, if available, to move as far as its speed allows away from you. The creature doesn\u2019t move into obviously dangerous ground, such as a fire or a pit. On a successful save, the target takes half as much damage and doesn\u2019t have to move away. A deafened creature automatically succeeds on the save.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the damage increases by 1d6 for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:bard"]}');


var $41cc0c375fed895d$exports = {};
$41cc0c375fed895d$exports = JSON.parse('{"title":"Distort Value","source":"Acquisitions Inc.","levelAndSchool":"1st-level Illusion","level":1,"castingTime":"1 minute","range":"Touch","components":"V","duration":"8 hours","description":["You cast this spell on an object no more than 1 foot on a side, doubling the object\'s perceived value by adding illusionary flourish or reducing its perceived value by half with the help of illusionary dents and scratches. Anyone examining the object must roll an Investigation check against your spell DC.","At Higher Levels. When you cast this spell using a higher spell slot, you increase the size of the object by 1 foot per spell slot over 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $98b6b383077ef44d$exports = {};
$98b6b383077ef44d$exports = JSON.parse('{"title":"Divination","source":"Player\'s Handbook","levelAndSchool":"4th-level divination (ritual)","level":4,"castingTime":"1 action","range":"Self","components":"V, S, M (incense and a sacrificial offering appropriate to your religion, together worth at least 25 gp, which the spell consumes)","duration":"Instantaneous","description":["Your magic and an offering put you in contact with a god or a god\u2019s servants. You ask a single question concerning a specific goal, event, or activity to occur within 7 days. The DM offers a truthful reply. The reply might be a short phrase, a cryptic rhyme, or an omen.","The spell doesn\u2019t take into account any possible circumstances that might change the outcome, such as the casting of additional spells or the loss or gain of a companion.","If you cast this spell two or more times before finishing your next long rest, there is a cumulative 25 percent chance for each casting after the first that you get a random reading. The DM makes this roll in secret."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","/spells:druid","/spells:wizard"]}');


var $49f80b3cf64b722e$exports = {};
$49f80b3cf64b722e$exports = JSON.parse('{"title":"Divine Favor","source":"Player\'s Handbook","levelAndSchool":"1st-level evocation","level":1,"castingTime":"1 bonus action","range":"Self","components":"V, S","duration":"Concentration, up to 1 minute","description":["Your prayer empowers you with divine radiance. Until the spell ends, your weapon attacks deal an extra 1d4 radiant damage on a hit."],"spellLists":["http://dnd5e.wikidot.com/spells:paladin"]}');


var $e2dae73423165c6f$exports = {};
$e2dae73423165c6f$exports = JSON.parse('{"title":"Divine Word","source":"Player\'s Handbook","levelAndSchool":"7th-level evocation","level":7,"castingTime":"1 bonus action","range":"30 feet","components":"V","duration":"Instantaneous","description":["You utter a divine word, imbued with the power that shaped the world at the dawn of creation. Choose any number of creatures you can see within range. Each creature that can hear you must make a Charisma saving throw. On a failed save, a creature suffers an effect based on its current hit points:","50 hit points or fewer: deafened for 1 minute","40 hit points or fewer: deafened and blinded for 10 minutes","30 hit points or fewer: blinded, deafened, and stunned for 1 hour","20 hit points or fewer: killed instantly","Regardless of its current hit points, a celestial, an elemental, a fey, or a fiend that fails its save is forced back to its plane of origin (if it isn\u2019t there already) and can\u2019t return to your current plane for 24 hours by any means short of a wish spell."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric"]}');


var $850690ee3d454ab1$exports = {};
$850690ee3d454ab1$exports = JSON.parse('{"title":"Dominate Beast","source":"Player\'s Handbook","levelAndSchool":"4th-level enchantment","level":4,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Concentration, up to 1 minute","description":["You attempt to beguile a beast that you can see within range. It must succeed on a Wisdom saving throw or be charmed by you for the duration. If you or creatures that are friendly to you are fighting it, it has advantage on the saving throw.","While the beast is charmed, you have a telepathic link with it as long as the two of you are on the same plane of existence. You can use this telepathic link to issue commands to the creature while you are conscious (no action required), which it does its best to obey. You can specify a simple and general course of action, such as \u201CAttack that creature,\u201D \u201CRun over there,\u201D or \u201CFetch that object.\u201D If the creature completes the order and doesn\u2019t receive further direction from you, it defends and preserves itself to the best of its ability.","You can use your action to take total and precise control of the target. Until the end of your next turn, the creature takes only the actions you choose, and doesn\u2019t do anything that you don\u2019t allow it to do. During this time, you can also cause the creature to use a reaction, but this requires you to use your own reaction as well.","Each time the target takes damage, it makes a new Wisdom saving throw against the spell. If the saving throw succeeds, the spell ends.","At Higher Levels. When you cast this spell with a 5th-level spell slot, the duration is concentration, up to 10 minutes. When you use a 6th-level spell slot, the duration is concentration, up to 1 hour. When you use a spell slot of 7th level or higher, the duration is concentration, up to 8 hours"],"spellLists":["http://dnd5e.wikidot.com/spells:druid","/spells:ranger","http://dnd5e.wikidot.com/spells:sorcerer"]}');


var $df56f18fb0137adf$exports = {};
$df56f18fb0137adf$exports = JSON.parse('{"title":"Dominate Monster","source":"Player\'s Handbook","levelAndSchool":"8th-level enchantment","level":8,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Concentration, up to 1 hour","description":["You attempt to beguile a creature that you can see within range. It must succeed on a Wisdom saving throw or be charmed by you for the duration. If you or creatures that are friendly to you are fighting it, it has advantage on the saving throw.","While the creature is charmed, you have a telepathic link with it as long as the two of you are on the same plane of existence. You can use this telepathic link to issue commands to the creature while you are conscious (no action required), which it does its best to obey. You can specify a simple and general course of action, such as \\"Attack that creature,\\" \\"Run over there,\\" or \\"Fetch that object.\\" If the creature completes the order and doesn\u2019t receive further direction from you, it defends and preserves itself to the best of its ability.","You can use your action to take total and precise control of the target. Until the end of your next turn, the creature takes only the actions you choose, and doesn\u2019t do anything that you don\u2019t allow it to do. During this time, you can also cause the creature to use a reaction, but this requires you to use your own reaction as well.","Each time the target takes damage, it makes a new Wisdom saving throw against the spell. If the saving throw succeeds, the spell ends.","At Higher Levels. When you cast this spell with a 9th-level spell slot, the duration is concentration, up to 8 hours."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $f0e70917828a4e44$exports = {};
$f0e70917828a4e44$exports = JSON.parse('{"title":"Dominate Person","source":"Player\'s Handbook","levelAndSchool":"5th-level enchantment","level":5,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Concentration, up to 1 minute","description":["You attempt to beguile a humanoid that you can see within range. It must succeed on a Wisdom saving throw or be charmed by you for the duration. If you or creatures that are friendly to you are fighting it, it has advantage on the saving throw.","While the target is charmed, you have a telepathic link with it as long as the two of you are on the same plane of existence. You can use this telepathic link to issue commands to the creature while you are conscious (no action required), which it does its best to obey. You can specify a simple and general course of action, such as \\"Attack that creature\\", \\"Run over there\\", or \\"Fetch that object\\". If the creature completes the order and doesn\u2019t receive further direction from you, it defends and preserves itself to the best of its ability.","You can use your action to take total and precise control of the target. Until the end of your next turn, the creature takes only the actions you choose, and doesn\u2019t do anything that you don\u2019t allow it to do. During this time you can also cause the creature to use a reaction, but this requires you to use your own reaction as well.","Each time the target takes damage, it makes a new Wisdom saving throw against the spell. If the saving throw succeeds, the spell ends.","At Higher Levels. When you cast this spell using a 6th-level spell slot, the duration is concentration, up to 10 minutes. When you use a 7th-level spell slot, the duration is concentration, up to 1 hour. When you use a spell slot of 8th level or higher, the duration is concentration, up to 8 hours."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $db33441873a2c1f7$exports = {};
$db33441873a2c1f7$exports = JSON.parse('{"title":"Draconic Transformation (UA)","source":"Unearthed Arcana 78 - Draconic Options","levelAndSchool":"7th-level transmutation","level":7,"castingTime":"1 bonus action","range":"Self","components":"V, S, M (a statuette of a dragon,","duration":"worth at least 500 gp)","description":["Duration: Concentration, up to 1 minute","With a roar, you draw on the magic of dragons to transform yourself, taking on various draconic features. You gain the following benefits until the spell ends:","You have blindsight with a range of 30 feet. Within that range, you can effectively see anything that isn\u2019t behind total cover, even if you\u2019re blinded or in darkness. Moreover, you can see an invisible creature, unless the creature successfully hides from you.","Incorporeal wings sprout from your back, giving you a flying speed of 40 feet.","When you cast this spell, and as a bonus action on subsequent turns for the duration, you can exhale a breath of shimmering energy in a 30-foot cone. Each creature in the area must make a Dexterity saving throw, taking 3d8 force damage on a failed save or half as much damage on a successful one."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $ea72624e47b0eed6$exports = {};
$ea72624e47b0eed6$exports = JSON.parse('{"title":"Draconic Transformation","source":"Fizban\'s Treasury of Dragons","levelAndSchool":"7th-level Transmutation","level":7,"castingTime":"1 Bonus Action","range":"Self","components":"V, S, M (a statuette of a dragon, worth at least 500 gp)","duration":"Concentration, up to 1 minute","description":["With a roar, you draw on the magic of dragons to transform yourself, taking on draconic features. You gain the following benefits until the spell ends:","Blindsight. You have blindsight with a range of 30 feet. Within that range, you can effectively see anything that isn\u2019t behind total cover, even if you\u2019re blinded or in darkness. Moreover, you can see an invisible creature, unless the creature successfully hides from you.","Breath Weapon. When you cast this spell, and as a bonus action on subsequent turns for the duration, you can exhale shimmering energy in a 60-foot cone. Each creature in that area must make a Dexterity saving throw, taking 6d8 force damage on a failed save, or half as much damage on a successful one.","Wings. Incorporeal wings sprout from your back, giving you a flying speed of 60 feet."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $1e6b29d405c3488c$exports = {};
$1e6b29d405c3488c$exports = JSON.parse('{"title":"Dragon\'s Breath","source":"Xanathar\'s Guide to Everything","levelAndSchool":"2nd-level transmutation","level":2,"castingTime":"1 bonus action","range":"Touch","components":"V, S, M (a hot pepper)","duration":"Concentration, up to 1 minute","description":["You touch one willing creature and imbue it with the power to spew magical energy from its mouth, provided it has one. Choose acid, cold, fire, lightning, or poison. Until the spell ends, the creature can use an action to exhale energy of the chosen type in a 15-foot cone. Each creature in that area must make a Dexterity saving throw, taking 3d6 damage of the chosen type on a failed save, or half as much damage on a successful one.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, the damage increases by 1d6 for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $7bc247415c72ca21$exports = {};
$7bc247415c72ca21$exports = JSON.parse('{"title":"Drawmij\'s Instant Summons","source":"Player\'s Handbook","levelAndSchool":"6th-level conjuration (ritual)","level":6,"castingTime":"1 minute","range":"Touch","components":"V, S, M (a sapphire worth 1,000 gp)","duration":"Until dispelled","description":["You touch an object weighing 10 pounds or less whose longest dimension is 6 feet or less. The spell leaves an invisible mark on its surface and invisibly inscribes the name of the item on the sapphire you use as the material component. Each time you cast this spell, you must use a different sapphire.","At any time thereafter, you can use your action to speak the item\u2019s name and crush the sapphire. The item instantly appears in your hand regardless of physical or planar distances, and the spell ends. If another creature is holding or carrying the item, crushing the sapphire doesn\u2019t transport the item to you, but instead you learn who the creature possessing the object is and roughly where that creature is located at that moment.","Dispel Magic or a similar effect successfully applied to the sapphire ends this spell\u2019s effect."],"spellLists":["http://dnd5e.wikidot.com/spell:dispel-magic","http://dnd5e.wikidot.com/spells:wizard"]}');


var $e67eadffffeb2c5c$exports = {};
$e67eadffffeb2c5c$exports = JSON.parse('{"title":"Dream of the Blue Veil","source":"Tasha\'s Cauldron of Everything","levelAndSchool":"7th-level conjuration","level":7,"castingTime":"10 minutes","range":"20 feet","components":"V, S, M (a magic item or a willing creature from the destination world)","duration":"6 hours","description":["You and up to eight willing creatures within range fall unconscious for the spells\u2019 duration and experience visions of another world on the Material Plane, such as Oerth, Toril, Krynn, or Eberron. If the spell reaches its full duration, the visions conclude with each of you encountering and pulling back a mysterious blue curtain. The spell then ends with you mentally and physically transported to the world that was in the visions.","To cast this spell, you must have a magic item that originated on the world you wish to reach, and you must be aware of the world\u2019s existence, even if you don\u2019t know the world\u2019s name. Your destination in the other world is a safe location within 1 mile of where the magic item was created. Alternatively, you can cast the spell if one of the affected creatures was born on the other world, which causes your destination to be a safe location within 1 mile of where that creature was born.","The spell ends early on a creature if that creature takes any damage, and the creature isn\u2019t transported. If you take any damage, the spell ends for you and all other creatures, with none of you being transported."],"spellLists":["/spells:bard","/spells:sorcerer","/spells:warlock","/spells:wizard"]}');


var $55f72f75ad266563$exports = {};
$55f72f75ad266563$exports = JSON.parse('{"title":"Dream","source":"Player\'s Handbook","levelAndSchool":"5th-level illusion","level":5,"castingTime":"1 minute","range":"Special","components":"V, S, M (a handful of sand, a dab of ink, and a writing quill plucked from a sleeping bird)","duration":"8 hours","description":["This spell shapes a creature\u2019s dreams. Choose a creature known to you as the target of this spell. The target must be on the same plane of existence as you. Creatures that don\u2019t sleep, such as elves, can\u2019t be contacted by this spell. You, or a willing creature you touch, enters a trance state, acting as a messenger. While in the trance, the messenger is aware of their surroundings, but can\u2019t take actions or move.","If the target is asleep, the messenger appears in the target\u2019s dreams and can converse with the target as long as it remains asleep, through the duration of the spell. The messenger can also shape the environment of the dream, creating landscapes, objects, and other images. The messenger can emerge from the trance at any time, ending the effect of the spell early. The target recalls the dream perfectly upon waking. If the target is awake when you cast the spell, the messenger knows it, and can either end the trance (and the spell) or wait for the target to fall asleep, at which point the messenger appears in the target\u2019s dreams.","You can make the messenger appear monstrous and terrifying to the target. If you do, the messenger can deliver a message of no more than ten words and then the target must make a Wisdom saving throw. On a failed save, echoes of the phantasmal monstrosity spawn a nightmare that lasts the duration of the target\u2019s sleep and prevents the target from gaining any benefit from that rest. In addition, when the target wakes up, it takes 3d6 psychic damage.","If you have a body part, lock of hair, clipping from a nail, or similar portion of the target\u2019s body, the target makes its saving throw with disadvantage."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $b93e15ebb4c47b9c$exports = {};
$b93e15ebb4c47b9c$exports = JSON.parse('{"title":"Druid Grove","source":"Xanathar\'s Guide to Everything","levelAndSchool":"6th-level abjuration","level":6,"castingTime":"10 minutes","range":"Touch","components":"V, S, M (mistletoe, which the spell consumes, that was harvested with a golden sickle under the light of a full moon)","duration":"24 hours","description":["You invoke the spirits of nature to protect an area outdoors or underground. The area can be as small as a 30-foot cube or as large as a 90-foot cube. Buildings and other structures are excluded from the affected area. If you cast this spell in the same area every day for a year, the spell lasts until dispelled. The spell creates the following effects within the area. When you cast this spell, you can specify creatures as friends who are immune to the effects. You can also specify a password that, when spoken aloud, makes the speaker immune to these effects. The entire warded area radiates magic. A dispel magic cast on the area, if successful, removes only one of the following effects, not the entire area. That spell\u2019s caster chooses which effect to end. Only when all its effects are gone is this spell dispelled.","Solid Fog. You can fill any number of 5-foot squares on the ground with thick fog, making them heavily obscured. The fog reaches 10 feet high. In addition, every foot of movement through the fog costs 2 extra feet. To a creature immune to this effect, the fog obscures nothing and looks like soft mist, with motes of green light floating in the air.","Grasping Undergrowth. You can fill any number of 5-foot squares on the ground that aren\u2019t filled with fog with grasping weeds and vines, as if they were affected by an entangle spell. To a creature immune to this effect, the weeds and vines feel soft and reshape themselves to serve as temporary seats or beds.","Grove Guardians. You can animate up to four trees in the area, causing them to uproot themselves from the ground. These trees have the same statistics as an awakened tree, which appears in the Monster Manual, except they can\u2019t speak, and their bark is covered with druidic symbols. If any creature not immune to this effect enters the warded area, the grove guardians fight until they have driven off or slain the intruders. The grove guardians also obey your spoken commands (no action required by you) that you issue while in the area. If you don\'t give them commands and no intruders are present, the grove guardians do nothing. The grove guardians can\u2018t leave the warded area. When the spell ends, the magic animating them disappears, and the trees take root again if possible.","Additional Spell Effect. You can place your choice of one of the following magical effects within the warded area:","A constant gust of wind in two locations of your choice","Spike growth in one location of your choice","Wind wall in two locations of your choice","To a creature immune to this effect, the winds are a fragrant, gentle breeze, and the area of spike growth is harmless."],"spellLists":["/spell:dispel-magic","/spell:entangle","/spell:gust-of-wind","/spell:spike-growth","/spell:wind-wall","http://dnd5e.wikidot.com/spells:druid"]}');


var $c9ef27e4ace1ecbe$exports = {};
$c9ef27e4ace1ecbe$exports = JSON.parse('{"title":"Druidcraft","source":"Player\'s Handbook","levelAndSchool":"Transmutation cantrip","level":0,"castingTime":"1 action","range":"30 feet","components":"V, S","duration":"Instantaneous","description":["Whispering to the spirits of nature, you create one of the following effects within range:","You create a tiny, harmless sensory effect that predicts what the weather will be at your location for the next 24 hours. The effect might manifest as a golden orb for clear skies, a cloud for rain, falling snowflakes for snow, and so on. This effect persists for 1 round.","You instantly make a flower blossom, a seed pod open, or a leaf bud bloom.","You create an instantaneous, harmless sensory effect, such as falling leaves, a puff of wind, the sound of a small animal, or the faint odor of skunk. The effect must fit in a 5-foot cube.","You instantly light or snuff out a candle, a torch, or a small campfire."],"spellLists":["http://dnd5e.wikidot.com/spells:druid"]}');


var $0dd1aac4ac24b28f$exports = {};
$0dd1aac4ac24b28f$exports = JSON.parse('{"title":"Dust Devil","source":"Xanathar\'s Guide to Everything","levelAndSchool":"2nd-level conjuration","level":2,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a pinch of dust)","duration":"Concentration, up to 1 minute","description":["Choose an unoccupied 5-foot cube of air that you can see within range. An elemental force that resembles a dust devil appears in the cube and lasts for the spell\u2019s duration.","Any creature that ends its turn within 5 feet of the dust devil must make a Strength saving throw. On a failed save, the creature takes 1d8 bludgeoning damage and is pushed 10 feet away. On a successful save, the creature takes half as much damage and isn\u2019t pushed.","As a bonus action, you can move the dust devil up to 30 feet in any direction. If the dust devil moves over sand, dust, loose dirt, or small gravel, it sucks up the material and forms a 10-foot-radius cloud of debris around itself that lasts until the start of your next turn. The cloud heavily obscures its area.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, the damage increases by 1d8 for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $ed01fc24b4a4f892$exports = {};
$ed01fc24b4a4f892$exports = JSON.parse('{"title":"Earth Tremor","source":"Xanathar\'s Guide to Everything/Elemental Evil Player\'s Companion","levelAndSchool":"1st-level evocation","level":1,"castingTime":"1 action","range":"Self (10-foot radius)","components":"V, S","duration":"Instantaneous","description":["You cause a tremor in the ground in a 10-foot radius. Each creature other than you in that area must make a Dexterity saving throw. On a failed save, a creature takes 1d6 bludgeoning damage and is knocked prone. If the ground in that area is loose earth or stone, it becomes difficult terrain until cleared.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the damage increases by 1d6 for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $a2476f0f49ce9760$exports = {};
$a2476f0f49ce9760$exports = JSON.parse('{"title":"Earthbind","source":"Xanathar\'s Guide to Everything","levelAndSchool":"2nd-level transmutation","level":2,"castingTime":"1 action","range":"300 feet","components":"V","duration":"Concentration, up to 1 minute","description":["Choose one creature you can see within range. Yellow strips of magical energy loop around the creature. The target must succeed on a Strength saving throw or its flying speed (if any) is reduced to 0 feet for the spell\u2019s duration. An airborne creature affected by this spell descends at 60 feet per round until it reaches the ground or the spell ends."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $5d3864fd331bf755$exports = {};
$5d3864fd331bf755$exports = JSON.parse('{"title":"Earthquake","source":"Player\'s Handbook","levelAndSchool":"8th-level evocation","level":8,"castingTime":"1 action","range":"500 feet","components":"V, S, M (a pinch of dirt, a piece of rock, and a lump of clay)","duration":"Concentration, up to 1 minute","description":["You create a seismic disturbance at a point on the ground that you can see within range. For the duration, an intense tremor rips through the ground in a 100-foot-radius circle centered on that point and shakes creatures and structures in contact with the ground in that area.","The ground in the area becomes difficult terrain. Each creature on the ground that is concentrating must make a Constitution saving throw. On a failed save, the creature\u2019s concentration is broken.","When you cast this spell and at the end of each turn you spend concentrating on it, each creature on the ground in the area must make a Dexterity saving throw. On a failed save, the creature is knocked prone.","This spell can have additional effects depending on the terrain in the area, as determined by the DM.","Fissures. Fissures open throughout the spell\u2019s area at the start of your next turn after you cast the spell. A total of 1d6 such fissures open in locations chosen by the DM. Each is 1d10 x 10 feet deep, 10 feet wide, and extends from one edge of the spell\u2019s area to the opposite side. A creature standing on a spot where a fissure opens must succeed on a Dexterity saving throw or fall in. A creature that successfully saves moves with the fissure\u2019s edge as it opens.","A fissure that opens beneath a structure causes it to automatically collapse (see below).","Structures. The tremor deals 50 bludgeoning damage to any structure in contact with the ground in the area when you cast the spell and at the start of each of your turns until the spell ends. If a structure drops to 0 hit points, it collapses and potentially damages nearby creatures. A creature within half the distance of a structure\u2019s height must make a Dexterity saving throw. On a failed save, the creature takes 5d6 bludgeoning damage, is knocked prone, and is buried in the rubble, requiring a DC 20 Strength (Athletics) check as an action to escape. The DM can adjust the DC higher or lower, depending on the nature of the rubble. On a successful save, the creature takes half as much damage and doesn\u2019t fall prone or become buried."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer"]}');


var $74f91fb1cf9d0cf9$exports = {};
$74f91fb1cf9d0cf9$exports = JSON.parse('{"title":"Ego Whip (UA)","source":"Unearthed Arcana 66 - Fighter, Rogue, and Wizard","levelAndSchool":"4th-level enchantment","level":4,"castingTime":"1 action","range":"30 feet","components":"V","duration":"Concentration, up to 1 minute","description":["You lash the mind of one creature you can see within range, filling it with despair. The target must succeed on an Intelligence saving throw or suffer disadvantage on attack rolls, ability checks, and saving throws, and it can\u2019t cast spells. At the end of each of its turns, the target can make another Intelligence saving throw. On a success, the spell ends on the target."],"spellLists":["/spells:bard","/spells:sorcerer","/spells:warlock","/spells:wizard"]}');


var $888d8303727801cd$exports = {};
$888d8303727801cd$exports = JSON.parse('{"title":"Eldritch Blast","source":"Player\'s Handbook","levelAndSchool":"Evocation cantrip","level":0,"castingTime":"1 action","range":"120 feet","components":"V, S","duration":"Instantaneous","description":["A beam of crackling energy streaks toward a creature within range. Make a ranged spell attack against the target. On a hit, the target takes 1d10 force damage.","At Higher Levels. The spell creates more than one beam when you reach higher levels: two beams at 5th level, three beams at 11th level, and four beams at 17th level. You can direct the beams at the same target or at different ones. Make a separate attack roll for each beam."],"spellLists":["http://dnd5e.wikidot.com/spells:warlock"]}');


var $61ed80e5757260f3$exports = {};
$61ed80e5757260f3$exports = JSON.parse('{"title":"Elemental Bane","source":"Xanathar\'s Guide to Everything","levelAndSchool":"4th-level transmutation","level":4,"castingTime":"1 action","range":"90 feet","components":"V, S","duration":"Concentration, up to 1 minute","description":["Choose one creature you can see within range, and choose one of the following damage types: acid, cold, fire, lightning, or thunder. The target must succeed on a Constitution saving throw or be affected by the spell for its duration. The first time each turn the affected target takes damage of the chosen type, the target takes an extra 2d6 damage of that type. Moreover, the target loses any resistance to that damage type until the spell ends.","At Higher Levels. When you cast this spell using a spell slot of 5th level or higher, you can target one additional creature for each slot level above 4th. The creatures must be within 30 feet of each other when you target them."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard","http://dnd5e.wikidot.com/spells:artificer"]}');


var $481cee2036b4878f$exports = {};
$481cee2036b4878f$exports = JSON.parse('{"title":"Elemental Weapon","source":"Player\'s Handbook","levelAndSchool":"3rd-level transmutation","level":3,"castingTime":"1 action","range":"Touch","components":"V, S","duration":"Concentration, up to 1 hour","description":["A nonmagical weapon you touch becomes a magic weapon. Choose one of the following damage types: acid, cold, fire, lightning, or thunder. For the duration, the weapon has a +1 bonus to attack rolls and deals an extra 1d4 damage of the chosen type when it hits.","At Higher Levels. When you cast this spell using a spell slot of 5th or 6th level, the bonus to attack rolls increases to +2 and the extra damage increases to 2d4. When you use a spell slot of 7th level or higher, the bonus increases to +3 and the extra damage increases to 3d4."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","/spells:druid","http://dnd5e.wikidot.com/spells:paladin","/spells:ranger"]}');


var $955fbc4075aae0ad$exports = {};
$955fbc4075aae0ad$exports = JSON.parse('{"title":"Encode Thoughts","source":"Guildmaster\'s Guide to Ravnica","levelAndSchool":"Enchantment cantrip","level":0,"castingTime":"1 action","range":"Self","components":"S","duration":"8 hours","description":["You pull a memory, an idea, or a message from your mind and transform it into a tangible string of glowing energy called a thought strand, which persists for the duration or until you cast this spell again. The thought strand appears in an unoccupied space within 5 feet of you as a Tiny, weightless, semisolid object that can be held and carried like a ribbon. It is otherwise stationary.","If you cast this spell while concentrating on a spell or an ability that allows you to read or manipulate the thoughts of others (such as detect thoughts or modify memory), you can transform the thoughts or memories you read, rather than your own, into a thought strand.","Casting this spell while holding a thought strand allows you to instantly receive whatever memory, idea, or message the thought strand contains. (Casting detect thoughts on the strand has the same effect.)"],"spellLists":["/spell:detect-thoughts","/spell:modify-memory","http://dnd5e.wikidot.com/spells:wizard"]}');


var $951f08d04bacd9bf$exports = {};
$951f08d04bacd9bf$exports = JSON.parse('{"title":"Enemies Abound","source":"Xanathar\'s Guide to Everything","levelAndSchool":"3rd-level enchantment","level":3,"castingTime":"1 action","range":"120 feet","components":"V, S","duration":"Concentration, up to 1 minute","description":["You reach into the mind of one creature you can see and force it to make an Intelligence saving throw. A creature automatically succeeds if it is immune to being frightened. On a failed save, the target loses the ability to distinguish friend from foe, regarding all creatures it can see as enemies until the spell ends. Each time the target takes damage, it can repeat the saving throw, ending the effect on itself on a success.","Whenever the affected creature chooses another creature as a target, it must choose the target at random from among the creatures it can see within range of the attack, spell, or other ability it\u2019s using. If an enemy provokes an opportunity attack from the affected creature, the creature must make that attack if it is able to."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $90ade27a9d723ea1$exports = {};
$90ade27a9d723ea1$exports = JSON.parse('{"title":"Enervation","source":"Xanathar\'s Guide to Everything","levelAndSchool":"5th-level necromancy","level":5,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Concentration, up to 1 minute","description":["A tendril of inky darkness reaches out from you, touching a creature you can see within range to drain life from it. The target must make a Dexterity saving throw. On a successful save, the target takes 2d8 necrotic damage, and the spell ends. On a failed save, the target takes 4d8 necrotic damage, and until the spell ends, you can use your action on each of your turns to automatically deal 4d8 necrotic damage to the target. The spell ends if you use your action to do anything else, if the target is ever outside the spell\u2019s range, or if the target has total cover from you. Whenever the spell deals damage to a target, you regain hit points equal to half the amount of necrotic damage the target takes.","At Higher Levels. When you cast this spell using a spell slot of 6th level or higher, the damage increases by 1d8 for each slot level above 5th."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $e236b51c43f515d3$exports = {};
$e236b51c43f515d3$exports = JSON.parse('{"title":"Enhance Ability","source":"Player\'s Handbook","levelAndSchool":"2nd-level transmutation","level":2,"castingTime":"1 action","range":"Touch","components":"V, S, M (fur or a feather from a beast)","duration":"Concentration, up to 1 hour","description":["You touch a creature and bestow upon it a magical enhancement. Choose one of the following effects; the target gains the effect until the spell ends.","Bear\u2019s Endurance. The target has advantage on Constitution checks. It also gains 2d6 temporary hit points, which are lost when the spell ends.","Bull\u2019s Strength. The target has advantage on Strength checks, and their carrying capacity doubles.","Cat\u2019s Grace. The target has advantage on Dexterity checks. It also doesn\u2019t take damage from falling 20 feet or less if it isn\u2019t incapacitated.","Eagle\u2019s Splendor. The target has advantage on Charisma checks.","Fox\u2019s Cunning. The target has advantage on Intelligence checks.","Owl\u2019s Wisdom. The target has advantage on Wisdom checks.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, you can target one additional creature for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","/spells:ranger","http://dnd5e.wikidot.com/spells:sorcerer","/spells:wizard"]}');


var $229672c7b89f4004$exports = {};
$229672c7b89f4004$exports = JSON.parse('{"title":"Enlarge/Reduce","source":"Player\'s Handbook","levelAndSchool":"2nd-level transmutation","level":2,"castingTime":"1 action","range":"30 feet","components":"V, S, M (a pinch of powdered iron)","duration":"Concentration, up to 1 minute","description":["You cause a creature or an object you can see within range to grow larger or smaller for the duration. Choose either a creature or an object that is neither worn nor carried. If the target is unwilling, it can make a Constitution saving throw. On a success, the spell has no effect.","If the target is a creature, everything it is wearing and carrying changes size with it. Any item dropped by an affected creature returns to normal size at once.","Enlarge. The target\u2019s size doubles in all dimensions, and its weight is multiplied by eight. This growth increases its size by one category \u2013 from Medium to Large, for example. If there isn\u2019t enough room for the target to double its size, the creature or object attains the maximum possible size in the space available. Until the spell ends, the target also has advantage on Strength checks and Strength saving throws. The target\u2019s weapons also grow to match its new size. While these weapons are enlarged, the target\u2019s attack with them deal 1d4 extra damage.","Reduce. The target\u2019s size is halved in all dimensions, and its weight is reduced to one-eighth of normal. This reduction decreases its size by one category \u2013 from Medium to Small, for example. Until the spell ends, the target also has disadvantage on Strength checks and Strength saving throws. The target\u2019s weapons also shrink to match its new size. While these weapons are reduced, the target\u2019s attacks with them deal 1d4 less damage (this can\u2019t reduce the damage below 1)."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","/spells:bard","/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $93ee46ecb41d419a$exports = {};
$93ee46ecb41d419a$exports = JSON.parse('{"title":"Ensnaring Strike","source":"Player\'s Handbook","levelAndSchool":"1st-level conjuration","level":1,"castingTime":"1 bonus action","range":"Self","components":"V","duration":"Concentration, up to 1 minute","description":["The next time you hit a creature with a weapon attack before this spell ends, a writhing mass of thorny vines appears at the point of impact, and the target must succeed on a Strength saving throw or be restrained by the magical vines until the spell ends. A Large or larger creature has advantage on this saving throw. If the target succeeds on the save, the vines shrivel away.","While restrained by this spell, the target takes 1d6 piercing damage at the start of each of its turns. A creature restrained by the vines or one that can touch the creature can use its action to make a Strength check against your spell save DC. On a success, the target is freed.","At Higher Levels. If you cast this spell using a spell slot of 2nd level or higher, the damage increases by 1d6 for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:ranger"]}');


var $c61c4db6deee36f8$exports = {};
$c61c4db6deee36f8$exports = JSON.parse('{"title":"Entangle","source":"Player\'s Handbook","levelAndSchool":"1st-level conjuration","level":1,"castingTime":"1 action","range":"90 feet","components":"V, S","duration":"Concentration, up to 1 minute","description":["Grasping weeds and vines sprout from the ground in a 20-foot square starting from a point within range. For the duration, these plants turn the ground in the area into difficult terrain.","A creature in the area when you cast the spell must succeed on a Strength saving throw or be restrained by the entangling plants until the spell ends. A creature restrained by the plants can use its action to make a Strength check against your spell save DC. On a success, it frees itself.","When the spell ends, the conjured plants wilt away."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","/spells:ranger"]}');


var $8b6d9195b56e740f$exports = {};
$8b6d9195b56e740f$exports = JSON.parse('{"title":"Enthrall","source":"Player\'s Handbook","levelAndSchool":"2nd-level enchantment","level":2,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"1 minute","description":["You weave a distracting string of words, causing creatures of your choice that you can see within range and that can hear you to make a Wisdom saving throw. Any creature that can\u2019t be charmed succeeds on this saving throw automatically, and if you or your companions are fighting a creature, it has advantage on the save. On a failed save, the target has disadvantage on Wisdom (Perception) checks made to perceive any creature other than you until the spell ends or until the target can no longer hear you. The spell ends if you are incapacitated or can no longer speak."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:warlock"]}');


var $123a98022495a009$exports = {};
$123a98022495a009$exports = JSON.parse('{"title":"Erupting Earth","source":"Xanathar\'s Guide to Everything/Elemental Evil Player\'s Companion","levelAndSchool":"3rd-level transmutation","level":3,"castingTime":"1 action","range":"120 feet","components":"V, S, M (a piece of obsidian)","duration":"Instantaneous","description":["Choose a point you can see on the ground within range. A fountain of churned earth and stone erupts in a 20-foot cube centered on that point. Each creature in that area must make a Dexterity saving throw. A creature takes 3d12 bludgeoning damage on a failed save, or half as much damage on a successful one. Additionally, the ground in that area becomes difficult terrain until cleared away. Each 5-foot-square portion of the area requires at least 1 minute to clear by hand.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, the damage increases by 1d12 for each slot level above 3rd."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $fd84e496a70d290c$exports = {};
$fd84e496a70d290c$exports = JSON.parse('{"title":"Etherealness","source":"Player\'s Handbook","levelAndSchool":"7th-level transmutation","level":7,"castingTime":"1 action","range":"Self","components":"V, S","duration":"Up to 8 hours","description":["You step into the border regions of the Ethereal Plane, in the area where it overlaps with your current plane. You remain in the Border Ethereal for the duration or until you use your action to dismiss the spell. During this time, you can move in any direction. If you move up or down, every foot of movement costs an extra foot. You can see and hear the plane you originated from, but everything there looks gray, and you can\u2019t see anything more than 60 feet away.","While on the Ethereal Plane, you can only affect and be affected by other creatures on that plane. Creatures that aren\u2019t on the Ethereal Plane can\u2019t perceive you and can\u2019t interact with you, unless a special ability or magic has given them the ability to do so.","You ignore all objects and effects that aren\u2019t on the Ethereal Plane, allowing you to move through objects you perceive on the plane you originated from. When the spell ends, you immediately return to the plane you originated from in the spot you currently occupy. If you occupy the same spot as a solid object or creature when this happens, you are immediately shunted to the nearest unoccupied space that you can occupy and take force damage equal to twice the number of feet you are moved.","This spell has no effect if you cast it while you are on the Ethereal Plane or a plane that doesn\u2019t border it, such as one of the Outer Planes.","At Higher Levels. When you cast this spell using a spell slot of 8th level or higher, you can target up to three willing creatures (including you) for each slot level above 7th. The creatures must be within 10 feet of you when you cast the spell."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $694051a05d2cff2f$exports = {};
$694051a05d2cff2f$exports = JSON.parse('{"title":"Evard\'s Black Tentacles","source":"Player\'s Handbook","levelAndSchool":"4th-level conjuration","level":4,"castingTime":"1 action","range":"90 feet","components":"V, S, M (a piece of tentacle from a giant octopus or a giant squid)","duration":"Concentration, up to 1 minute","description":["Squirming, ebony tentacles fill a 20-foot square on ground that you can see within range. For the duration, these tentacles turn the ground in the area into difficult terrain.","When a creature enters the affected area for the first time on a turn or starts its turn there, the creature must succeed on a Dexterity saving throw or take 3d6 bludgeoning damage and be restrained by the tentacles until the spell ends. A creature that starts its turn in the area and is already restrained by the tentacles takes 3d6 bludgeoning damage.","A creature restrained by the tentacles can use its action to make a Strength or Dexterity check (its choice) against your spell save DC. On a success, it frees itself."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $ef81d00593d6c850$exports = {};
$ef81d00593d6c850$exports = JSON.parse('{"title":"Expeditious Retreat","source":"Player\'s Handbook","levelAndSchool":"1st-level transmutation","level":1,"castingTime":"1 bonus action","range":"Self","components":"V, S","duration":"Concentration, up to 10 minutes","description":["This spell allows you to move at an incredible pace. When you cast this spell, and then as a bonus action on each of your turns until the spell ends, you can take the Dash action."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $a4729dceebb3367b$exports = {};
$a4729dceebb3367b$exports = JSON.parse('{"title":"Eyebite","source":"Player\'s Handbook","levelAndSchool":"6th-level necromancy","level":6,"castingTime":"1 action","range":"Self","components":"V, S","duration":"Concentration, up to 1 minute","description":["For the spell\u2019s duration, your eyes become an inky void imbued with dread power. One creature of your choice within 60 feet of you that you can see must succeed on a Wisdom saving throw or be affected by one of the following effects of your choice for the duration. On each of your turns until the spell ends, you can use your action to target another creature but can\u2019t target a creature again if it has succeeded on a saving throw against this casting of eyebite.","Asleep. The target falls unconscious. It wakes up if it takes any damage or if another creature uses its action to shake the sleeper awake.","Panicked. The target is frightened of you. On each of its turns, the frightened creature must take the Dash action and move away from you by the safest and shortest available route, unless there is nowhere to move. If the target moves to a place at least 60 feet away from you where it can no longer see you, this effect ends.","Sickened. The target has disadvantage on attack rolls and ability checks. At the end of each of its turns, it can make another Wisdom saving throw. If it succeeds, the effect ends."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $56835c37a93e641a$exports = {};
$56835c37a93e641a$exports = JSON.parse('{"title":"Fabricate","source":"Player\'s Handbook","levelAndSchool":"4th-level transmutation","level":4,"castingTime":"10 minutes","range":"120 feet","components":"V, S","duration":"Instantaneous","description":["You convert raw materials into products of the same material. For example, you can fabricate a wooden bridge from a clump of trees, a rope from a patch of hemp, and clothes from flax or wool.","Choose raw materials that you can see within range. You can fabricate a Large or smaller object (contained within a 10-foot cube, or eight connected 5-foot cubes), given a sufficient quantity of raw material. If you are working with metal, stone, or another mineral substance, however, the fabricated object can be no larger than Medium (contained within a single 5-foot cube). The quality of objects made by the spell is commensurate with the quality of the raw materials.","Creatures or magic items can\u2019t be created or transmuted by this spell. You also can\u2019t use it to create items that ordinarily require a high degree of craftsmanship, such as jewelry, weapons, glass, or armor, unless you have proficiency with the type of artisan\u2019s tools used to craft such objects."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $ac0a00de528f0fad$exports = {};
$ac0a00de528f0fad$exports = JSON.parse('{"title":"Faerie Fire","source":"Player\'s Handbook","levelAndSchool":"1st-level evocation","level":1,"castingTime":"1 action","range":"60 feet","components":"V","duration":"Concentration, up to 1 minute","description":["Each object in a 20-foot cube within range is outlined in blue, green, or violet light (your choice).","Any creature in the area when the spell is cast is also outlined in light if it fails a Dexterity saving throw. For the duration, objects and affected creatures shed dim light in a 10-foot radius.","Any attack roll against an affected creature or object has advantage if the attacker can see it, and the affected creature or object can\u2019t benefit from being invisible."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:druid"]}');


var $3405aa3354429e9f$exports = {};
$3405aa3354429e9f$exports = JSON.parse('{"title":"False Life","source":"Player\'s Handbook","levelAndSchool":"1st-level necromancy","level":1,"castingTime":"1 action","range":"Self","components":"V, S, M (a small amount of alcohol or distilled spirits)","duration":"1 hour","description":["Bolstering yourself with a necromantic facsimile of life, you gain 1d4 + 4 temporary hit points for the duration.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, you gain 5 additional temporary hit points for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $b41d5e9a0ccecbc5$exports = {};
$b41d5e9a0ccecbc5$exports = JSON.parse('{"title":"Far Step","source":"Xanathar\'s Guide to Everything","levelAndSchool":"5th-level conjuration","level":5,"castingTime":"1 bonus action","range":"Self","components":"V","duration":"Concentration, up to 1 minute","description":["You teleport up to 60 feet to an unoccupied space you can see. On each of your turns before the spell ends, you can use a bonus action to teleport in this way again."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $75ae85adb149ed66$exports = {};
$75ae85adb149ed66$exports = JSON.parse('{"title":"Fast Friends","source":"Acquisitions Inc.","levelAndSchool":"3rd-level enchantment","level":3,"castingTime":"1 action","range":"30 feet","components":"V","duration":"Concentration, up to 1 hour","description":["When you cast this spell, choose one humanoid within range that can see and hear you, and that can understand you. The creature must succeed on a Wisdom saving throw or become charmed by you for the duration. While the creature is charmed in this way, it undertakes to perform any services or activities you ask of it in a friendly manner, to the best of its ability.","You can set the creature new tasks when a previous task is completed, or if you decide to end its current task. If the service or activity might cause harm to the creature, or if it conflicts with the creature\'s normal activities and desires, the creature can make another Wisdom saving throw to try to end the effect. This save is made with advantage if you or your companions are fighting the creature. If the activity would result in certain death for the creature, the spell ends.","When the spell ends, the creature knows it was charmed by you.","At Higher Levels: When you cast this spell using a spell slot of 4th level or higher, you can target one additional creature for each slot level above 3rd.","Spell Lists: Bard, Cleric, Wizard"],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:wizard"]}');


var $156e9c3a323fa6c8$exports = {};
$156e9c3a323fa6c8$exports = JSON.parse('{"title":"Fear","source":"Player\'s Handbook","levelAndSchool":"3rd-level illusion","level":3,"castingTime":"1 action","range":"Self (30-foot cone)","components":"V, S, M (a white feather or the heart of a hen)","duration":"Concentration, up to 1 minute","description":["You project a phantasmal image of a creature\u2019s worst fears. Each creature in a 30-foot cone must succeed on a Wisdom saving throw or drop whatever it is holding and become frightened for the duration.","While frightened by this spell, a creature must take the Dash action and move away from you by the safest available route on each of its turns, unless there is nowhere to move. If the creature ends its turn in a location where it doesn\u2019t have line of sight to you, the creature can make a Wisdom saving throw. On a successful save, the spell ends for that creature."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $7b24a0a55b39b434$exports = {};
$7b24a0a55b39b434$exports = JSON.parse('{"title":"Feather Fall","source":"Player\'s Handbook","levelAndSchool":"1st-level transmutation","level":1,"castingTime":"1 reaction, which you take when you or a creature within 60 feet of you falls","range":"60 feet","components":"V, M (a small feather or piece of down)","duration":"1 minute","description":["Choose up to five falling creatures within range. A falling creature\u2019s rate of descent slows to 60 feet per round until the spell ends. If the creature lands before the spell ends, it takes no falling damage and can land on its feet, and the spell ends for that creature."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $fcfe6533ad2bfd90$exports = {};
$fcfe6533ad2bfd90$exports = JSON.parse('{"title":"Feeblemind","source":"Player\'s Handbook","levelAndSchool":"8th-level enchantment","level":8,"castingTime":"1 action","range":"150 feet","components":"V, S, M (a handful of clay, crystal, glass, or mineral spheres)","duration":"Instantaneous","description":["You blast the mind of a creature that you can see within range, attempting to shatter its intellect and personality. The target takes 4d6 psychic damage and must make an Intelligence saving throw.","On a failed save, the creature\u2019s Intelligence and Charisma scores become 1. The creature can\u2019t cast spells, activate magic items, understand language, or communicate in any intelligible way. The creature can, however, identify its friends, follow them, and even protect them.","At the end of every 30 days, the creature can repeat its saving throw against this spell. If it succeeds on its saving throw, the spell ends. The spell can also be ended by Greater Restoration, Heal, or Wish."],"spellLists":["http://dnd5e.wikidot.com/spell:greater-restoration","http://dnd5e.wikidot.com/spell:heal","http://dnd5e.wikidot.com/spell:wish","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $5f209fe0a1006337$exports = {};
$5f209fe0a1006337$exports = JSON.parse('{"title":"Feign Death","source":"Player\'s Handbook","levelAndSchool":"3rd-level necromancy (ritual)","level":3,"castingTime":"1 action","range":"Touch","components":"V, S, M (a pinch of graveyard dirt)","duration":"1 hour","description":["You touch a willing creature and put it into a cataleptic state that is indistinguishable from death.","For the spell\u2019s duration, or until you use an action to touch the target and dismiss the spell, the target appears dead to all outward inspection and to spells used to determine the target\u2019s status. The target is blinded and incapacitated, and its speed drops to 0. The target has resistance to all damage except psychic damage. If the target is diseased or poisoned when you cast the spell, or becomes diseased or poisoned while under the spell\u2019s effect, the disease and poison have no effect until the spell ends."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:wizard"]}');


var $eb42402b8ce1d894$exports = {};
$eb42402b8ce1d894$exports = JSON.parse('{"title":"Find Familiar","source":"Player\'s Handbook","levelAndSchool":"1st-level conjuration (ritual)","level":1,"castingTime":"1 hour","range":"10 feet","components":"V, S, M (10 gp worth of charcoal, incense, and herbs that must be consumed by fire in a brass brazier)","duration":"Instantaneous","description":["You gain the service of a familiar, a spirit that takes an animal form you choose: bat, cat, crab, frog (toad), hawk, lizard, octopus, owl, poisonous snake, fish (quipper), rat, raven, sea horse, spider, or weasel. Appearing in an unoccupied space within range, the familiar has the statistics of the chosen form, though it is a celestial, fey, or fiend (your choice) instead of a beast.","Your familiar acts independently of you, but it always obeys your commands. In combat, it rolls its own initiative and acts on its own turn. A familiar can\u2019t attack, but it can take other actions as normal.","When the familiar drops to 0 hit points, it disappears, leaving behind no physical form. It reappears after you cast this spell again. As an action, you can temporarily dismiss your familiar to a pocket dimension. Alternatively, you can dismiss it forever. As an action while it is temporarily dismissed, you can cause it to reappear in any unoccupied space within 30 feet of you. Whenever the familiar drops to 0 hit points or disappears into the pocket dimension, it leaves behind in its space anything it was wearing or carrying.","While your familiar is within 100 feet of you, you can communicate with it telepathically. Additionally, as an action, you can see through your familiar\u2019s eyes and hear what it hears until the start of your next turn, gaining the benefits of any special senses that the familiar has. During this time, you are deaf and blind with regard to your own senses.","You can\u2019t have more than one familiar at a time. If you cast this spell while you already have a familiar, you instead cause it to adopt a new form. Choose one of the forms from the above list. Your familiar transforms into the chosen creature.","Finally, when you cast a spell with a range of touch, your familiar can deliver the spell as if it had cast the spell. Your familiar must be within 100 feet of you, and it must use its reaction to deliver the spell when you cast it. If the spell requires an attack roll, you use your attack modifier for the roll."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $f64b016d7fdefdce$exports = {};
$f64b016d7fdefdce$exports = JSON.parse('{"title":"Find Greater Steed","source":"Xanathar\'s Guide to Everything","levelAndSchool":"4th-level conjuration","level":4,"castingTime":"10 minutes","range":"30 feet","components":"V, S","duration":"Instantaneous","description":["You summon a spirit that assumes the form of a loyal, majestic mount. Appearing in an unoccupied space within range, the spirit takes on a form you choose: a griffon, a pegasus, a peryton, a dire wolf, a rhinoceros, or a saber-toothed tiger. The creature has the statistics provided in the Monster Manual for the chosen form, though it is a celestial, a fey, or a fiend (your choice) instead of its normal creature type. Additionally, if it has an Intelligence score of 5 or lower, its Intelligence becomes 6, and it gains the ability to understand one language of your choice that you speak. You control the mount in combat. While the mount is within 1 mile of you, you can communicate with it telepathically. While mounted on it, you can make any spell you cast that targets only you also target the mount. The mount disappears temporarily when it drops to 0 hit points or when you dismiss it as an action. Casting this spell again re-summons the bonded mount, with all its hit points restored and any conditions removed. You can\u2019t have more than one mount bonded by this spell or find steed at the same time. As an action, you can release a mount from its bond, causing it to disappear permanently. Whenever the mount disappears, it leaves behind any objects it was wearing or carrying."],"spellLists":["http://dnd5e.wikidot.com/spells:paladin"]}');


var $920a3ce70ccbd682$exports = {};
$920a3ce70ccbd682$exports = JSON.parse('{"title":"Find Steed","source":"Player\'s Handbook","levelAndSchool":"2nd-level conjuration","level":2,"castingTime":"10 minutes","range":"30 feet","components":"V, S","duration":"Instantaneous","description":["You summon a spirit that assumes the form of an unusually intelligent, strong, and loyal steed, creating a long-lasting bond with it. Appearing in an unoccupied space within range, the steed takes on a form that you choose: a warhorse, a pony, a camel, an elk, or a mastiff. (Your DM might allow other animals to be summoned as steeds.) The steed has the statistics of the chosen form, though it is a celestial, fey, or fiend (your choice) instead of its normal type. Additionally, if your steed has an Intelligence of 5 or less, its Intelligence becomes 6, and it gains the ability to understand one language of your choice that you speak.","Your steed serves you as a mount, both in combat and out, and you have an instinctive bond with it that allows you to fight as a seamless unit. While mounted on your steed, you can make any spell you cast that targets only you also target your steed.","When the steed drops to 0 hit points, it disappears, leaving behind no physical form. You can also dismiss your steed at any time as an action, causing it to disappear. In either case, casting this spell again summons the same steed, restored to its hit point maximum.","While your steed is within 1 mile of you, you can communicate with each other telepathically. You can\u2019t have more than one steed bonded by this spell at a time. As an action, you can release the steed from its bond at any time, causing it to disappear."],"spellLists":["http://dnd5e.wikidot.com/spells:paladin"]}');


var $808a1e5f640f5aa0$exports = {};
$808a1e5f640f5aa0$exports = JSON.parse('{"title":"Find the Path","source":"Player\'s Handbook","levelAndSchool":"6th-level divination","level":6,"castingTime":"1 minute","range":"Self","components":"V, S, M (a set of divinatory tools \u2013 such as bones, ivory sticks, cards, teeth, or carved runes \u2013 worth 100 gp, and an object from the location you wish to find)","duration":"Concentration, up to 1 day","description":["This spell allows you to find the shortest, most direct physical route to a specific fixed location that you are familiar with on the same plane of existence. If you name a destination on another plan of existence, a destination that moves (such as a mobile fortress), or a destination that isn\u2019t specific (such as \\"a green dragon\u2019s lair\u201D), the spell fails.","For the duration, as long as you are on the same plane of existence as the destination, you know how far it is and in what direction it lies. While you are traveling there, whenever you are presented with a choice of paths along the way, you automatically determine which path is the shortest and most direct route (but not necessarily the safest route) to the destination."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid"]}');


var $e2efb8c9526f7d05$exports = {};
$e2efb8c9526f7d05$exports = JSON.parse('{"title":"Find Traps","source":"Player\'s Handbook","levelAndSchool":"2nd-level divination","level":2,"castingTime":"1 action","range":"120 feet","components":"V, S","duration":"Instantaneous","description":["You sense the presence of any trap within range that is within line of sight.","A trap, for the purpose of this spell, includes anything that would inflict a sudden or unexpected effect you consider harmful or undesirable, which was specifically intended as such by its creator. Thus, the spell would sense an area affected by the alarm spell, a glyph of warding, or a mechanical pit trap, but it would not reveal a natural weakness in the floor, an unstable ceiling, or a hidden sinkhole.","This spell merely reveals that a trap is present. You don\u2019t learn the location of each trap, but you do learn the general nature of the danger posed by a trap you sense."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger"]}');


var $7f080f0f570faf68$exports = {};
$7f080f0f570faf68$exports = JSON.parse('{"title":"Find Vehicle (UA)","source":"Unearthed Arcana 7 - Modern Magic","levelAndSchool":"2nd-level conjuration (technomagic)","level":2,"castingTime":"10 minutes","range":"30 feet","components":"V, S","duration":"8 hours","description":["You summon a spirit that assumes the form of a nonmilitary land vehicle of your choice, appearing in an unoccupied space within range. The vehicle has the statistics of a normal vehicle of its sort, though it is celestial, fey, or fiendish (your choice in origin). The physical characteristics of the vehicle reflect its origin to some degree. For example, a fiendish SUV might be jet black in color, with tinted windows and a sinister-looking front grille.","You have a supernatural bond with the conjured vehicle that allows you to drive beyond your normal ability. While driving the conjured vehicle, you are considered proficient with vehicles of its type, and you add double your proficiency bonus to ability checks related to driving the vehicle. While driving the vehicle, you can make any spell you cast that targets only you also target the vehicle.","If the vehicle drops to 0 hit points, it disappears, leaving behind no physical form. You can also dismiss the vehicle at any time as an action, causing it to disappear.","You can\'t have more than one vehicle bonded by this spell at a time. As an action, you can release the vehicle from its bond at any time, causing it to disappear.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, you can conjure a nonmilitary water vehicle large enough to carry six Medium creatures. When you cast this spell using a spell slot of 5th level or higher, you can conjure a nonmilitary air vehicle large enough to carry ten Medium creatures. When you cast this spell using a spell slot of 7th level or higher, you can conjure any type of vehicle, subject to the DM\'s approval."],"spellLists":["http://dnd5e.wikidot.com/spells:paladin","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $4bea4fdc633ef7e2$exports = {};
$4bea4fdc633ef7e2$exports = JSON.parse('{"title":"Finger of Death","source":"Player\'s Handbook","levelAndSchool":"7th-level necromancy","level":7,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Instantaneous","description":["You send negative energy coursing through a creature that you can see within range, causing it searing pain. The target must make a Constitution saving throw. It takes 7d8 + 30 necrotic damage on a failed save, or half as much damage on a successful one.","A humanoid killed by this spell rises at the start of your next turn as a zombie that is permanently under your command, following your verbal orders to the best of its ability."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $fbf01ef6263ef785$exports = {};
$fbf01ef6263ef785$exports = JSON.parse('{"title":"Fire Bolt","source":"Player\'s Handbook","levelAndSchool":"Evocation cantrip","level":0,"castingTime":"1 action","range":"120 feet","components":"V, S","duration":"Instantaneous","description":["You hurl a mote of fire at a creature or object within range. Make a ranged spell attack against the target. On a hit, the target takes 1d10 fire damage. A flammable object hit by this spell ignites if it isn\u2019t being worn or carried.","At Higher Levels. This spell\u2019s damage increases by 1d10 when you reach 5th level (2d10), 11th level (3d10), and 17th level (4d10)."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $193bbcbc88d5d219$exports = {};
$193bbcbc88d5d219$exports = JSON.parse('{"title":"Fire Shield","source":"Player\'s Handbook","levelAndSchool":"4th-level evocation","level":4,"castingTime":"1 action","range":"Self","components":"V, S, M (a bit of phosphorus or a firefly)","duration":"10 minutes","description":["Thin and wispy flames wreathe your body for the duration, shedding bright light in a 10-foot radius and dim light for an additional 10 feet. You can end the spell early by using an action to dismiss it.","The flames provide you with a warm shield or a chill shield, as you choose. The warm shield grants you resistance to cold damage, and the chill shield grants you resistance to fire damage.","In addition, whenever a creature within 5 feet of you hits you with a melee attack, the shield erupts with flame. The attacker takes 2d8 fire damage from a warm shield, or 2d8 cold damage from a cold shield."],"spellLists":["/spells:druid","/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $743f97fd61ee18af$exports = {};
$743f97fd61ee18af$exports = JSON.parse('{"title":"Fire Storm","source":"Player\'s Handbook","levelAndSchool":"7th-level evocation","level":7,"castingTime":"1 action","range":"150 feet","components":"V, S","duration":"Instantaneous","description":["A storm made up of sheets of roaring flame appears in a location you choose within range. The area of the storm consists of up to ten 10-foot cubes, which you can arrange as you wish. Each cube must have at least one face adjacent to the face of another cube. Each creature in the area must make Dexterity saving throw. It takes 7d10 fire damage on a failed save, or half as much damage on a successful one.","The fire damages objects in the area and ignites flammable objects that aren\u2019t being worn or carried. If you choose, plant life in the area is unaffected by this spell."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer"]}');


var $2fbeaaa8230f6cdb$exports = {};
$2fbeaaa8230f6cdb$exports = JSON.parse('{"title":"Fireball","source":"Player\'s Handbook","levelAndSchool":"3rd-level evocation","level":3,"castingTime":"1 action","range":"150 feet","components":"V, S, M (a tiny ball of bat guano and sulfur)","duration":"Instantaneous","description":["A bright streak flashes from your pointing finger to a point you choose within range then blossoms with a low roar into an explosion of flame. Each creature in a 20-foot radius must make a Dexterity saving throw. A target takes 8d6 fire damage on a failed save, or half as much damage on a successful one. The fire spreads around corners. It ignites flammable objects in the area that aren\u2019t being worn or carried.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, the damage increases by 1d6 for each slot level above 3rd."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $c1a30fca80fcb8d0$exports = {};
$c1a30fca80fcb8d0$exports = JSON.parse('{"title":"Fizban\'s Platinum Shield (UA)","source":"Unearthed Arcana 78 - Draconic Options","levelAndSchool":"6th-level abjuration","level":6,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a platinum-plated dragon scale, worth at least 500 gp)","duration":"Concentration, up to 1 minute","description":["You create a field of silvery light that surrounds a creature of your choice within range (you can choose yourself). The field sheds dim light out to 5 feet.","As a bonus action on subsequent turns, you can move the field to another creature within 60 feet of the field.","The creature protected by the field gains the following benefits:","The creature has half cover.","The creature has resistance to acid, cold, fire, lightning, and poison damage.","If the creature is subjected to an effect that allows it to make a Dexterity saving throw to take only half damage, the creature instead takes no damage if it succeeds on the saving throw, and only half damage if it fails."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $0ea5ccf6bc1e264d$exports = {};
$0ea5ccf6bc1e264d$exports = JSON.parse('{"title":"Fizban\'s Platinum Shield","source":"Fizban\'s Treasury of Dragons","levelAndSchool":"6th-level abjuration","level":6,"castingTime":"1 bonus action","range":"60 feet","components":"V, S, M (a platinum-plated dragon scale, worth at least 500 gp)","duration":"Concentration, up to 1 minute","description":["You create a field of silvery light that surrounds a creature of your choice within range (you can choose yourself). The field sheds dim light out to 5 feet. While surrounded by the field, a creature gains the following benefits:","Cover. The creature has half cover.","Damage Resistance. The creature has resistance to acid, cold, fire, lightning, and poison damage.","Evasion. If the creature is subjected to an effect that allows it to make a Dexterity saving throw to take only half damage, the creature instead takes no damage if it succeeds on the saving throw, and only half damage if it fails.","As a bonus action on subsequent turns, you can move the field to another creature within 60 feet of the field."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $a005b0692e0c7dd1$exports = {};
$a005b0692e0c7dd1$exports = JSON.parse('{"title":"Flame Arrows","source":"Xanathar\'s Guide to Everything","levelAndSchool":"3rd-level transmutation","level":3,"castingTime":"1 action","range":"Touch","components":"V, S","duration":"Concentration, up to 1 hour","description":["You touch a quiver containing arrows or bolts. When a target is hit by a ranged weapon attack using a piece of ammunition drawn from the quiver, the target takes an extra 1d6 fire damage. The spell\u2019s magic ends on the piece of ammunition when it hits or misses, and the spell ends when twelve pieces of ammunition have been drawn from the quiver.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, the number of pieces of ammunition you can affect with this spell increases by two for each slot level above 3rd."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard","http://dnd5e.wikidot.com/spells:artificer"]}');


var $61f383e4bfc7b514$exports = {};
$61f383e4bfc7b514$exports = JSON.parse('{"title":"Flame Blade","source":"Player\'s Handbook","levelAndSchool":"2nd-level evocation","level":2,"castingTime":"1 bonus action","range":"Self","components":"V, S, M (a leaf of sumac)","duration":"Concentration, up to 10 minutes","description":["You evoke a fiery blade in your free hand. The blade is similar in size and shape to a scimitar, and it lasts for the duration. If you let go of the blade, it disappears, but you can evoke the blade again as a bonus action.","You can use your action to make a melee spell attack with the fiery blade. On a hit, the target takes 3d6 fire damage. The flaming blade sheds bright light in a 10-foot radius and dim light for an additional 10 feet.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, the damage increases by 1d6 for every two slot levels above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","/spells:sorcerer"]}');


var $0fc203ec6c4287bc$exports = {};
$0fc203ec6c4287bc$exports = JSON.parse('{"title":"Flame Stride (UA)","source":"Unearthed Arcana 78 - Draconic Options","levelAndSchool":"3rd-level Transmutation","level":3,"castingTime":"1 bonus action","range":"Self","components":"V, S","duration":"Concentration, up to 1 minute","description":["The billowing flames of a dragon cover your feet, granting you explosive speed. For the duration, your speed increases by 20 feet and moving doesn\u2019t provoke opportunity attacks. When you move within 5 feet of a creature or object that isn\u2019t being worn or carried, it takes 1d6 fire damage from your trail of heat. A creature or object can take this damage only once during a turn.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, increase your speed by 5 feet for each spell slot level above 3rd. Additionally, the spell deals an additional 1d6 fire damage for each slot level above 3rd."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:ranger","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $f9f03638139c7174$exports = {};
$f9f03638139c7174$exports = JSON.parse('{"title":"Flame Strike","source":"Player\'s Handbook","levelAndSchool":"5th-level evocation","level":5,"castingTime":"1 action","range":"60 feet","components":"V, S, M (pinch of sulfur)","duration":"Instantaneous","description":["A vertical column of divine fire roars down from the heavens in a location you specify. Each creature in a 10-foot radius, 40-foot-high cylinder centered on a point within range must make a Dexterity saving throw. A creature takes 4d6 fire damage and 4d6 radiant damage on a failed save, or half as much damage on a successful one.","At Higher Levels. When you cast this spell using a spell slot of 6th level or higher, the fire damage or the radiant damage (your choice) increases by 1d6 for each slot level above 5th."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric"]}');


var $f76afee2403bb7cb$exports = {};
$f76afee2403bb7cb$exports = JSON.parse('{"title":"Flaming Sphere","source":"Player\'s Handbook","levelAndSchool":"2nd-level conjuration","level":2,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a bit of tallow, a pinch of brimstone, and a dusting of powdered iron)","duration":"Concentration, up to 1 minute","description":["A 5-foot-diameter sphere of fire appears in an unoccupied space of your choice within range and lasts for the duration. Any creature that ends its turn within 5 feet of the sphere must make a Dexterity saving throw. The creature takes 2d6 fire damage on a failed save, or half as much damage on a successful one.","As a bonus action, you can move the sphere up to 30 feet. If you ram the sphere into a creature, that creature must make the saving throw against the sphere\u2019s damage, and the sphere stops moving this turn.","When you move the sphere, you can direct it over barriers up to 5 feet tall and jump it across pits up to 10 feet wide. The sphere ignites flammable objects not being worn or carried, and it sheds bright light in a 20-foot radius and dim light for an additional 20 feet.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, the damage increases by 1d6 for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $d09d5c987688c1d1$exports = {};
$d09d5c987688c1d1$exports = JSON.parse('{"title":"Flesh to Stone","source":"Player\'s Handbook","levelAndSchool":"6th-level transmutation","level":6,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a pinch of lime, water, and earth)","duration":"Concentration, up to 1 minute","description":["You attempt to turn one creature that you can see within range into stone. If the target\'s body is made of flesh, the creature must make a Constitution saving throw. On a failed save, it is restrained as its flesh begins to harden. On a successful save, the creature isn\u2019t affected.","A creature restrained by this spell must make another Constitution saving throw at the end of each of its turns. If it successfully saves against this spell three times, the spell ends. If it fails saves three times, it is turned to stone and subjected to the petrified condition for the duration. The successes and failures don\u2019t need to be consecutive; keep track of both until the target collects three of a kind.","If the creature is physically broken while petrified, it suffers from similar deformities if it reverts to its original state. If you maintain your concentration on this spell for the entire possible duration, the creature is turned to stone until the effect is removed."],"spellLists":["/spells:druid","/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $67d39b30d69ed647$exports = {};
$67d39b30d69ed647$exports = JSON.parse('{"title":"Flock of Familiars","source":"Lost Laboratory of Kwalish","levelAndSchool":"2nd-level conjuration","level":2,"castingTime":"1 minute","range":"Touch","components":"V, S","duration":"Concentration, up to 1 hour","description":["You temporarily summon three familiars \u2013 spirits that take animal forms of your choice. Each familiar uses the same rules and options for a familiar conjured by the Find Familiar spell. All the familiars conjured by this spell must be the same type of creature (celestials, fey, or fiends; your choice). If you already have a familiar conjured by the Find Familiar spell or similar means, then one fewer familiars are conjured by this spell.","Familiars summoned by this spell can telepathically communicate with you and share their visual or auditory senses while they are within 1 mile of you.","When you cast a spell with a range of touch, one of the familiars conjured by this spell can deliver the spell, as normal. However, you can cast a touch spell through only one familiar per turn.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, you conjure an additional familiar for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spell:find-familiar","http://dnd5e.wikidot.com/spell:find-familiar","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $923fc143159abf7c$exports = {};
$923fc143159abf7c$exports = JSON.parse('{"title":"Fly","source":"Player\'s Handbook","levelAndSchool":"3rd-level transmutation","level":3,"castingTime":"1 action","range":"Touch","components":"V, S, M (a wing feather from any bird)","duration":"Concentration, up to 10 minutes","description":["You touch a willing creature. The target gains a flying speed of 60 feet for the duration. When the spell ends, the target falls if it is still aloft, unless it can stop the fall.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, you can target one additional creature for each slot level above 3rd."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $80c28040814fc3a3$exports = {};
$80c28040814fc3a3$exports = JSON.parse('{"title":"Fog Cloud","source":"Player\'s Handbook","levelAndSchool":"1st-level conjuration","level":1,"castingTime":"1 action","range":"120 feet","components":"V, S","duration":"Concentration, up to 1 hour","description":["You create a 20-foot-radius sphere of fog centered on a point within range. The sphere spreads around corners, and its area is heavily obscured. It lasts for the duration or until a wind of moderate or greater speed (at least 10 miles per hour) disperses it.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the radius of the fog increases by 20 feet for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $20189de0edf6c8ae$exports = {};
$20189de0edf6c8ae$exports = JSON.parse('{"title":"Forbiddance","source":"Player\'s Handbook","levelAndSchool":"6th-level abjuration (ritual)","level":6,"castingTime":"10 minutes","range":"Touch","components":"V, S, M (a sprinkling of holy water, rare incense, and powdered ruby worth at least 1,000 gp)","duration":"1 day","description":["You create a ward against magical travel that protects up to 40,000 square feet of floor space to a height of 30 feet above the floor. For the duration, creatures can\u2019t teleport into the area or use portals, such as those created by the gate spell, to enter the area. The spell proofs the area against planar travel, and therefore prevents creatures from accessing the area by way of the Astral Plane, Ethereal Plane, Feywild, Shadowfell, or the plane shift spell.","In addition, the spell damages types of creatures that you choose when you cast it. Choose one or more of the following: celestials, elementals, fey, fiends, and undead. When a chosen creature enters the spell\u2019s area for the first time on a turn or starts its turn there, the creature takes 5d10 radiant or necrotic damage (your choice when you cast this spell).","When you cast this spell, you can designate a password. A creature that speaks the password as it enters the area takes no damage from the spell.","This spell\u2019s area can\u2019t overlap with the area of another forbiddance spell. If you cast forbiddance every day for 30 days in the same location, the spell lasts until it is dispelled, and the material components are consumed on the last casting."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric"]}');


var $f42cb103b0997590$exports = {};
$f42cb103b0997590$exports = JSON.parse('{"title":"Forcecage","source":"Player\'s Handbook","levelAndSchool":"7th-level evocation","level":7,"castingTime":"1 action","range":"100 feet","components":"V, S, M (ruby dust worth 1,500 gp)","duration":"1 hour","description":["An immobile, invisible, cube-shaped prison composed of magical force springs into existence around an area you choose within range. The prison can be a cage or a solid box as you choose.","A prison in the shape of a cage can be up to 20 feet on a side and is made from 1/2-inch diameter bars spaced 1/2 inch apart.","A prison in the shape of a box can be up to 10 feet on a side, creating a solid barrier that prevents any matter from passing through it and blocking any spells cast into or out of the area.","When you cast the spell, any creature that is completely inside the cage\'s area is trapped. Creatures only partially within the area, or those too large to fit inside the area, are pushed away from the center of the area until they are completely outside the area.","A creature inside the cage can\'t leave it by nonmagical means. If the creature tries to use teleportation or interplanar travel to leave the cage, it must first make a Charisma saving throw. On a success, the creature can use that magic to exit the cage. On a failure, the creature can\'t exit the cage and wastes the use of the spell or effect. The cage also extends into the Ethereal Plane, blocking ethereal travel.","This spell can\'t be dispelled by dispel magic."],"spellLists":["/spell:dispel-magic","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $39674ad4fc30fc94$exports = {};
$39674ad4fc30fc94$exports = JSON.parse('{"title":"Foresight","source":"Player\'s Handbook","levelAndSchool":"9th-level divination","level":9,"castingTime":"1 minute","range":"Touch","components":"V, S, M (a hummingbird feather)","duration":"8 hours","description":["You touch a willing creature and bestow a limited ability to see into the immediate future. For the duration, the target can\u2019t be surprised and has advantage on attack rolls, ability checks, and saving throws. Additionally, other creatures have disadvantage on attack rolls against the target for the duration. This spell immediately ends if you cast it again before its duration ends."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $456f4bc581b9309b$exports = {};
$456f4bc581b9309b$exports = JSON.parse('{"title":"Fortune\'s Favor","source":"Explorer\'s Guide to Wildemount","levelAndSchool":"2nd-level divination (dunamancy)","level":2,"castingTime":"1 minute","range":"60 feet","components":"V, S, M (a white pearl worth at least 100 gp, which the spell consumes)","duration":"1 hour","description":["You impart latent luck to yourself or one willing creature you can see within range. When the chosen creature makes an attack roll, an ability check, or a saving throw before the spell ends, it can dismiss this spell on itself to roll an additional d20 and choose which of the d20s to use. Alternatively, when an attack roll is made against the chosen creature, it can dismiss this spell on itself to roll a d20 and choose which of the d20s to use, the one it rolled or the one the attacker rolled.","If the original d20 roll has advantage or disadvantage, the creature rolls the additional d20 after advantage or disadvantage has been applied to the original roll.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, you can target one additional creature for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $5f46e3fd49d06b10$exports = {};
$5f46e3fd49d06b10$exports = JSON.parse('{"title":"Freedom of Movement","source":"Player\'s Handbook","levelAndSchool":"4th-level abjuration","level":4,"castingTime":"1 action","range":"Touch","components":"V, S, M (a leather strap, bound around the arm or a similar appendage)","duration":"1 hour","description":["You touch a willing creature. For the duration, the target\u2019s movement is unaffected by difficult terrain, and spells and other magical effects can neither reduce the target\u2019s speed nor cause the target to be paralyzed or restrained.","The target can also spend 5 feet of movement to automatically escape from nonmagical restraints, such as manacles or a creature that has it grappled. Finally, being underwater imposes no penalties on the target\u2019s movement or attacks."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger"]}');


var $310e53fb8803f2fc$exports = {};
$310e53fb8803f2fc$exports = JSON.parse('{"title":"Freedom of the Waves (HB)","source":"Tal\'Dorei Campaign Setting Reborn","levelAndSchool":"3rd-level conjuration","level":3,"castingTime":"1 action","range":"120 feet","components":"V, S, M (a strand of wet hair)","duration":"Instantaneous","description":["You conjure a deluge of seawater in a 15-foot-radius, 10-foot-tall cylinder centered on a point within range. This water takes the form of a tidal wave, a whirlpool, a waterspout, or another form of your choice. Each creature in the area must succeed on a Strength saving throw against your spell save DC or take 2d8 bludgeoning damage and fall prone. You can choose a number of creatures equal to your spellcasting modifier (minimum of 1) to automatically succeed on this saving throw.","If you are within the spell\u2019s area, as part of the action you use to cast the spell, you can vanish into the deluge and teleport to an unoccupied space that you can see within the spell\u2019s area."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger","http://dnd5e.wikidot.com/spells:sorcerer"]}');


var $2a12ef95aecf08ca$exports = {};
$2a12ef95aecf08ca$exports = JSON.parse('{"title":"Freedom of the Winds (HB)","source":"Tal\'Dorei Campaign Setting Reborn","levelAndSchool":"5th-level abjuration","level":5,"castingTime":"1 action","range":"Self","components":"V, S, M (a scrap of sailcloth)","duration":"Concentration, up to 10 minutes","description":["Wind wraps around your body, tugging at your hair and clothing as your feet lift off the ground. You gain a flying speed of 60 feet. Additionally, you have advantage on ability checks to avoid being grappled, and on saving throws against being restrained or paralyzed.","When you are targeted by a spell or attack while this spell is in effect, you can use a reaction to teleport up to 60 feet to an unoccupied space you can see. If this movement takes you out of range of the triggering spell or attack, you are unaffected by it. This spell then ends when you reappear."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger","http://dnd5e.wikidot.com/spells:sorcerer"]}');


var $0f60a46c383fdef4$exports = {};
$0f60a46c383fdef4$exports = JSON.parse('{"title":"Friends","source":"Player\'s Handbook","levelAndSchool":"Enchantment cantrip","level":0,"castingTime":"1 action","range":"Self","components":"S, M (a small amount of makeup applied to the face as this spell is cast)","duration":"Concentration, up to 1 minute","description":["For the duration, you have advantage on all Charisma checks directed at one creature of your choice that isn\'t hostile toward you. When the spell ends, the creature realizes that you used magic to influence its mood and becomes hostile toward you. A creature prone to violence might attack you. Another creature might seek retribution in other ways (at the DM\'s discretion), depending on the nature of your interaction with it."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $40821f38a33a24ff$exports = {};
$40821f38a33a24ff$exports = JSON.parse('{"title":"Frost Fingers","source":"Icewind Dale - Rime of the Frostmaiden","levelAndSchool":"1st-level evocation","level":1,"castingTime":"1 action","range":"Self (15-foot cone)","components":"V, S","duration":"Instantaneous","description":["Freezing cold blasts from your fingertips in a 15-foot cone. Each creature in that area must make a Constitution saving throw, taking 2d8 cold damage on a failed save, or half as much damage on a successful one.","The cold freezes nonmagical liquids in the area that aren\'t being worn or carried.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the damage increases by 1d8 for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $42887060aa9c230f$exports = {};
$42887060aa9c230f$exports = JSON.parse('{"title":"Frostbite","source":"Xanathar\'s Guide to Everything","levelAndSchool":"Evocation cantrip","level":0,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Instantaneous","description":["You cause numbing frost to form on one creature that you can see within range. The target must make a Constitution saving throw. On a failed save, the target takes 1d6 cold damage, and it has disadvantage on the next weapon attack roll it makes before the end of its next turn.","At Higher Levels. The spell\u2019s damage increases by 1d6 when you reach 5th level (2d6), 11th level (3d6), and 17th level (4d6)."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard","http://dnd5e.wikidot.com/spells:artificer"]}');


var $c508dd0c60114275$exports = {};
$c508dd0c60114275$exports = JSON.parse('{"title":"Galder\'s Speedy Courier","source":"Lost Laboratory of Kwalish","levelAndSchool":"4th-level conjuration","level":4,"castingTime":"1 action","range":"10 feet","components":"V, S, M (25 gold pieces, or mineral goods of equivalent value, which the spell consumes)","duration":"10 minutes","description":["You summon a Small air elemental to a spot within range. The air elemental is formless, nearly transparent, immune to all damage, and cannot interact with other creatures or objects. It carries an open, empty chest whose interior dimensions are 3 feet on each side. While the spell lasts, you can deposit as many items inside the chest as will fit. You can then name a living creature you have met and seen at least once before, or any creature for which you possess a body part, lock of hair, clipping from a nail, or similar portion of the creature\u2019s body.","As soon as the lid of the chest is closed, the elemental and the chest disappear, then reappear adjacent to the target creature. If the target creature is on another plane, or if it is proofed against magical detection or location, the contents of the chest reappear on the ground at your feet.","The target creature is made aware of the chest\u2019s contents before it chooses whether or not to open it, and knows how much of the spell\u2019s duration remains in which it can retrieve them. No other creature can open the chest and retrieve its contents. When the spell expires or when all the contents of the chest have been removed, the elemental and the chest disappear. The elemental also disappears if the target creature orders it to return the items to you. When the elemental disappears, any items not taken from the chest reappear on the ground at your feet.","At Higher Levels. When you cast this spell using an 8th-level spell slot, you can send the chest to a creature on a different plane of existence from you."],"spellLists":["http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $11ed75263727dfc4$exports = {};
$11ed75263727dfc4$exports = JSON.parse('{"title":"Galder\'s Tower","source":"Lost Laboratory of Kwalish","levelAndSchool":"3rd-level conjuration","level":3,"castingTime":"10 minutes","range":"30 feet","components":"V, S, M (a fragment of stone, wood, or other building material)","duration":"24 hours","description":["You conjure a two-story tower made of stone, wood, or similar suitably sturdy materials. The tower can be round or square in shape. Each level of the tower is 10 feet tall and has an area of up to 100 square feet. Access between levels consists of a simple ladder and hatch. Each level takes one of the following forms, chosen by you when you cast the spell:","A bedroom with a bed, chairs, chest, and magical fireplace","A study with desks, books, bookshelves, parchments, ink, and ink pens","A dining space with a table, chairs, magical fireplace, containers, and cooking utensils","A lounge with couches, armchairs, side tables and footstools","A washroom with toilets, washtubs, a magical brazier, and sauna benches","An observatory with a telescope and maps of the night sky","An unfurnished, empty room","The interior of the tower is warm and dry, regardless of conditions outside. Any equipment or furnishings conjured with the tower dissipate into smoke if removed from it. At the end of the spell\u2019s duration, all creatures and objects within the tower that were not created by the spell appear safely outside on the ground, and all traces of the tower and its furnishings disappear.","You can cast this spell again while it is active to maintain the tower\u2019s existence for another 24 hours. You can create a permanent tower by casting this spell in the same location and with the same configuration every day for one year.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, the tower can have one additional story for each slot level beyond 3rd."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $f85725e91a39e529$exports = {};
$f85725e91a39e529$exports = JSON.parse('{"title":"Gaseous Form","source":"Player\'s Handbook","levelAndSchool":"3rd-level transmutation","level":3,"castingTime":"1 action","range":"Touch","components":"V, S, M (a bit of gauze and a wisp of smoke)","duration":"Concentration, up to 1 hour","description":["You transform a willing creature you touch, along with everything it\u2019s wearing and carrying, into a misty cloud for the duration. The spell ends if the creature drops to 0 hit points. An incorporeal creature isn\u2019t affected.","While in this form, the target\u2019s only method of movement is a flying speed of 10 feet. The target can enter and occupy the space of another creature. The target has resistance to nonmagical damage, and it has advantage on Strength, Dexterity, and Constitution saving throws. The target can pass through small holes, narrow openings, and even mere cracks, though it treats liquids as though they were solid surfaces. The target can\u2019t fall and remains hovering in the air even when stunned or otherwise incapacitated.","While in the form of a misty cloud, the target can\u2019t talk or manipulate objects, and any objects it was carrying or holding can\u2019t be dropped, used, or otherwise interacted with. The target can\u2019t attack or cast spells."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $8133dae7a46c31b8$exports = {};
$8133dae7a46c31b8$exports = JSON.parse('{"title":"Gate Seal","source":"Planescape - Adventures in the Multiverse","levelAndSchool":"4th-Level abjuration","level":4,"castingTime":"1 minute","range":"60 feet","components":"V, S, M (a broken portal key, which the spell consumes)","duration":"24 Hours","description":["You fortify the fabric of the planes within a 30-foot cube you can see within range. Within that area, portals close and can\'t be opened for the duration. Spells and other effects that allow planar travel or open portals such as gate or plane shift, fail if used to enter or leave the area. The cube is stationary.","At Higher Levels. When you cast this spell using a spell slot of 6th level or higher, the spell lasts until dispelled."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $0d32d26f75641257$exports = {};
$0d32d26f75641257$exports = JSON.parse('{"title":"Gate","source":"Player\'s Handbook","levelAndSchool":"9th-level conjuration","level":9,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a diamond worth at least 5,000 gp)","duration":"Concentration, up to 1 minute","description":["You conjure a portal linking an unoccupied space you can see within range to a precise location on a different plane of existence. The portal is a circular opening, which you can make 5 to 20 feet in diameter. You can orient the portal in any direction you choose. The portal lasts for the duration.","The portal has a front and a back on each plane where it appears. Travel through the portal is possible only by moving through its front. Anything that does so is instantly transported to the other plane, appearing in the unoccupied space nearest to the portal.","Deities and other planar rulers can prevent portals created by this spell from opening in their presence or anywhere within their domains.","When you cast this spell, you can speak the name of a specific creature (a pseudonym, title, or nickname doesn\u2019t work). If that creature is on a plane other than the one you are on, the portal opens in the named creature\u2019s immediate vicinity and draws the creature through it to the nearest unoccupied space on your side of the portal. You gain no special power over the creature, and it is free to act as the DM deems appropriate. It might leave, attack you, or help you."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:sorcerer","/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $1f1a90f72b30bd5d$exports = {};
$1f1a90f72b30bd5d$exports = JSON.parse('{"title":"Geas","source":"Player\'s Handbook","levelAndSchool":"5th-level enchantment","level":5,"castingTime":"1 minute","range":"60 feet","components":"V","duration":"30 days","description":["You place a magical command on a creature that you can see within range, forcing it to carry out some service or refrain from some action or course of activity as you decide.","If the creature can understand you, it must succeed on a Wisdom saving throw or become charmed by you for the duration. While the creature is charmed by you, it takes 5d10 psychic damage each time it acts in a manner directly counter to your instructions, but no more than once each day. A creature that can\u2019t understand you is unaffected by the spell.","You can issue any command you choose, short of an activity that would result in certain death. Should you issue a suicidal command, the spell ends. You can end the spell early by using an action to dismiss it. A Remove Curse, Greater Restoration, or Wish spell also ends it.","At Higher Levels. When you cast this spell using a spell slot of 7th or 8th level, the duration is 1 year. When you cast this spell using a spell slot of 9th level, the spell lasts until it is ended by one of the spells mentioned above."],"spellLists":["http://dnd5e.wikidot.com/spell:remove-curse","http://dnd5e.wikidot.com/spell:greater-restoration","http://dnd5e.wikidot.com/spell:wish","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:paladin","http://dnd5e.wikidot.com/spells:wizard"]}');


var $a7b5b7c9d6a516dd$exports = {};
$a7b5b7c9d6a516dd$exports = JSON.parse('{"title":"Gentle Repose","source":"Player\'s Handbook","levelAndSchool":"2nd-level necromancy (ritual)","level":2,"castingTime":"1 action","range":"Touch","components":"V, S, M (a pinch of salt and one copper piece placed on each of the corpse\u2019s eyes, which must remain there for the duration)","duration":"10 days","description":["You touch a corpse or other remains. For the duration, the target is protected from decay and can\u2019t become undead.","The spell also effectively extends the time limit on raising the target from the dead, since days spent under the influence of this spell don\u2019t count against the time limit of spells such as raise dead."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","/spells:paladin","http://dnd5e.wikidot.com/spells:wizard"]}');


var $09609eced49477c5$exports = {};
$09609eced49477c5$exports = JSON.parse('{"title":"Giant Insect","source":"Player\'s Handbook","levelAndSchool":"4th-level transmutation","level":4,"castingTime":"1 action","range":"30 feet","components":"V, S","duration":"Concentration, up to 10 minutes","description":["You transform up to ten centipedes, three spiders, five wasps, or one scorpion within range into giant versions of their natural forms for the duration. A centipede becomes a giant centipede, a spider becaomes a giant spider, a wasp becomes a giant wasp, and a scorpion becomes a giant scorpion.","Each creature obeys your verbal commands, and in combat, they act on your turn each round. The DM has the statistics for these creatures and resolves their actions and movement.","A creature remains in its giant size for the duration, until it drops to 0 hit points, or until you use an action to dismiss the effect on it.","The DM might allow you to choose different targets. For example, if you transform a bee, its giant version might have the same statistics as a giant wasp."],"spellLists":["http://dnd5e.wikidot.com/spells:druid"]}');


var $2619df6768f5b92b$exports = {};
$2619df6768f5b92b$exports = JSON.parse('{"title":"Gift of Alacrity","source":"Explorer\'s Guide to Wildemount","levelAndSchool":"1st-level divination (dunamancy:chronurgy)","level":1,"castingTime":"1 minute","range":"Touch","components":"V, S","duration":"8 hours","description":["You touch a willing creature. For the duration, the target can add 1d8 to its initiative rolls."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $6ffca343d30d088f$exports = {};
$6ffca343d30d088f$exports = JSON.parse('{"title":"Gift of Gab","source":"Acquisitions Inc.","levelAndSchool":"2nd-level enchantment","level":2,"castingTime":"1 reaction, which you take when you speak to another creature","range":"Self","components":"V, S, M (2 gold coins, which is consumed as tax for using the spell)","duration":"Instantaneous","description":["When you cast this spell, you skillfully reshape the memories of listeners in your immediate area, so that each creature of your choice within 5 feet of you forgets everything you said within the last 6 seconds. Those creatures then remember that you actually said the words you speak as the verbal component of the spell."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:wizard"]}');


var $1060a3a9950b293f$exports = {};
$1060a3a9950b293f$exports = JSON.parse('{"title":"Glibness","source":"Player\'s Handbook","levelAndSchool":"8th-level transmutation","level":8,"castingTime":"1 action","range":"Self","components":"V","duration":"1 hour","description":["Until the spell ends, when you make a Charisma check, you can replace the number you roll with a 15. Additionally, no matter what you say, magic that would determine if you are telling the truth indicates that you are being truthful."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:warlock"]}');


var $91cf9ced358f385d$exports = {};
$91cf9ced358f385d$exports = JSON.parse('{"title":"Globe of Invulnerability","source":"Player\'s Handbook","levelAndSchool":"6th-level abjuration","level":6,"castingTime":"1 action","range":"Self (10-foot radius)","components":"V, S, M (a glass or crystal bead that shatters when the spell ends)","duration":"Concentration, up to 1 minute","description":["An immobile, faintly shimmering barrier springs into existence in a 10-foot radius around you and remains for the duration.","Any spell of 5th level or lower cast from outside the barrier can\u2019t affect creatures or objects within it, even if the spell is cast using a higher level spell slot. Such a spell can target creatures and objects within the barrier, but the spell has no effect on them. Similarly, the area within the barrier is excluded from the areas affected by such spells.","At Higher Levels. When you cast this spell using a spell slot of 7th level or higher, the barrier blocks spells of one level higher for each slot level above 6th."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $041701fcd41677bc$exports = {};
$041701fcd41677bc$exports = JSON.parse('{"title":"Glyph of Warding","source":"Player\'s Handbook","levelAndSchool":"3rd-level abjuration","level":3,"castingTime":"1 hour","range":"Touch","components":"V, S, M (incense and powdered diamond worth at least 200 gp, which the spell consumes)","duration":"Until dispelled or triggered","description":["When you cast this spell, you inscribe a glyph that creates a magical effect triggered by other creatures, either upon a surface (such as a table or a section of floor or wall) or within an object that can be closed (such as a book, a scroll, or a treasure chest) to conceal the glyph. The glyph can cover an area no larger than 10 feet in diameter. If the surface or object is moved more than 10 feet from where you cast this spell, the glyph is broken, and the spell ends without being triggered.","The glyph is nearly invisible and requires a successful Intelligence (Investigation) check against your spell save DC to be found.","You decide what triggers the glyph when you cast the spell. For glyphs inscribed on a surface, the most typical triggers include touching or standing on the glyph, removing another object covering the glyph, approaching within a certain distance of the glyph, or manipulating the object on which the glyph is inscribed. For glyphs inscribed within an object, the most common triggers include opening that object, approaching within a certain distance of the object, or seeing or reading the glyph. Once a glyph is triggered, this spell ends.","You can further refine the trigger so the spell activates only under certain circumstances or according to physical characteristics (such as height or weight), creature kind (for example, the ward could be set to affect aberrations or drow), or alignment. You can also set conditions for creatures that don\u2019t trigger the glyph, such as those who say a certain password.","When you inscribe the glyph, choose explosive runes or a spell glyph.","Explosive Runes. When triggered, the glyph erupts with magical energy in a 20-foot-radius sphere centered on the glyph. The sphere spreads around corners. Each creature in the area must make a Dexterity saving throw. A creature takes 5d8 acid, cold, fire, lightning, or thunder damage on a failed saving throw (your choice when you create the glyph), or half as much damage on a successful one.","Spell Glyph. You can store a prepared spell of 3rd level or lower in the glyph by casting it as part of creating the glyph. The spell must target a single creature or an area. The spell being stored has no immediate effect when cast in this way. When the glyph is triggered, the stored spell is cast. If the spell has a target, it targets the creature that triggered the glyph. If the spell affects an area, the area is centered on that creature. If the spell summons hostile creatures or creates harmful objects or traps, they appear as close as possible to the intruder and attack it. If the spell requires concentration, it lasts until the end of its full duration.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, the damage of an explosive runes glyph increases by 1d8 for each slot level above 3rd. If you create a spell glyph, you can store any spell of up to the same level as the slot you use for the glyph of warding."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:wizard"]}');


var $17ea7474f2b9b725$exports = {};
$17ea7474f2b9b725$exports = JSON.parse('{"title":"Goodberry","source":"Player\'s Handbook","levelAndSchool":"1st-level transmutation","level":1,"castingTime":"1 action","range":"Touch","components":"V, S, M (a sprig of mistletoe)","duration":"Instantaneous","description":["Up to ten berries appear in your hand and are infused with magic for the duration. A creature can use its action to eat one berry. Eating a berry restores 1 hit point, and the berry provides enough nourishment to sustain a creature for one day.","The berries lose their potency if they have not been consumed within 24 hours of the casting of this spell."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger"]}');


var $ef487e1e86c494d4$exports = {};
$ef487e1e86c494d4$exports = JSON.parse('{"title":"Grasping Vine","source":"Player\'s Handbook","levelAndSchool":"4th-level conjuration","level":4,"castingTime":"1 bonus action","range":"30 feet","components":"V, S","duration":"Concentration, up to 1 minute","description":["You conjure a vine that sprouts from the ground in an unoccupied space of your choice that you can see within range. When you cast this spell, you can direct the vine to lash out at a creature within 30 feet of it that you can see. That creature must succeed on a Dexterity saving throw or be pulled 20 feet directly toward the vine.","Until the spell ends, you can direct the vine to lash out at the same creature or another one as a bonus action on each of your turns."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger"]}');


var $2876d436f32b3c72$exports = {};
$2876d436f32b3c72$exports = JSON.parse('{"title":"Gravity Fissure","source":"Explorer\'s Guide to Wildemount","levelAndSchool":"6th-level evocation (dunamancy:graviturgy)","level":6,"castingTime":"1 action","range":"Self (100-foot line)","components":"V, S, M (a fistful of iron filings)","duration":"Instantaneous","description":["You manifest a ravine of gravitational energy in a line originating from you that is 100 feet long and 5 feet wide. Each creature in that line must make a Constitution saving throw, taking 8d8 force damage on a failed save, or half as much damage on a successful one.","Each creature within 10 feet of the line but not in it must succeed on a Constitution saving throw or take 8d8 force damage and be pulled toward the line until the creature is in its area.","At Higher Levels. When you cast this spell using a spell slot of 7th level or higher, the damage increases by 1d8 for each slot level above 6th."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $b995fa2092280038$exports = {};
$b995fa2092280038$exports = JSON.parse('{"title":"Gravity Sinkhole","source":"Explorer\'s Guide to Wildemount","levelAndSchool":"4th-level evocation (dunamancy:graviturgy)","level":4,"castingTime":"1 action","range":"120 feet","components":"V, S, M (a black marble)","duration":"Instantaneous","description":["A 20-foot-radius sphere of crushing force forms at a point you can see within range and tugs at the creatures there. Each creature in the sphere must make a Constitution saving throw. On a failed save, the creature takes 5d10 force damage, and is pulled in a straight line toward the center of the sphere, ending in an unoccupied space as close to the center as possible (even if that space is in the air). On a successful save, the creature takes half as much damage and isn\'t pulled.","At Higher Levels. When you cast this spell using a spell slot of 5th level or higher, the damage increases by 1d10 for each slot level above 4th."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $0759a83d87e026e0$exports = {};
$0759a83d87e026e0$exports = JSON.parse('{"title":"Grease","source":"Player\'s Handbook","levelAndSchool":"1st-level conjuration","level":1,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a bit of pork rind or butter)","duration":"1 minute","description":["Slick grease covers the ground in a 10-foot square centered on a point within range and turns it into difficult terrain for the duration.","When the grease appears, each creature standing in its area must succeed on a Dexterity saving throw or fall prone. A creature that enters the area or ends its turn there must also succeed on a Dexterity saving throw or fall prone."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $e61d754e9d63e394$exports = {};
$e61d754e9d63e394$exports = JSON.parse('{"title":"Greater Invisibility","source":"Player\'s Handbook","levelAndSchool":"4th-level illusion","level":4,"castingTime":"1 action","range":"Touch","components":"V, S","duration":"Concentration, up to 1 minute","description":["You or a creature you touch becomes invisible until the spell ends. Anything the target is wearing or carrying is invisible as long as it is on the target\u2019s person."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $2d963694b384b901$exports = {};
$2d963694b384b901$exports = JSON.parse('{"title":"Greater Restoration","source":"Player\'s Handbook","levelAndSchool":"5th-level abjuration","level":5,"castingTime":"1 action","range":"Touch","components":"V, S, M (diamond dust worth at least 100 gp, which the spell consumes)","duration":"Instantaneous","description":["You imbue a creature you touch with positive energy to undo a debilitating effect. You can reduce the target\u2019s exhaustion level by one, or end one of the following effects on the target:","One effect that charmed or petrified the target","One curse, including the target\u2019s attunement to a cursed magic item","Any reduction to one of the target\u2019s ability scores","One effect reducing the target\u2019s hit point maximum"],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","/spells:ranger"]}');


var $5b63c44ecd5d2c59$exports = {};
$5b63c44ecd5d2c59$exports = JSON.parse('{"title":"Green-Flame Blade","source":"Tasha\'s Cauldron of Everything/Sword Coast Adventurer\'s Guide","levelAndSchool":"Evocation cantrip","level":0,"castingTime":"1 action","range":"Self (5-foot radius)","components":"S, M (a melee weapon worth at least 1 sp)","duration":"Instantaneous","description":["You brandish the weapon used in the spell\u2019s casting and make a melee attack with it against one creature within 5 feet of you. On a hit, the target suffers the weapon attack\u2019s normal effects, and you can cause green fire to leap from the target to a different creature of your choice that you can see within 5 feet of it. The second creature takes fire damage equal to your spellcasting ability modifier.","At Higher Levels. At 5th level, the melee attack deals an extra 1d8 fire damage to the target on a hit, and the fire damage to the second creature increases to 1d8 + your spellcasting ability modifier. Both damage rolls increase by 1d8 at 11th level (2d8 and 2d8) and 17th level (3d8 and 3d8)."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","/spells:sorcerer","/spells:warlock","/spells:wizard"]}');


var $34bf8e833dc43990$exports = {};
$34bf8e833dc43990$exports = JSON.parse('{"title":"Guardian of Faith","source":"Player\'s Handbook","levelAndSchool":"4th-level conjuration","level":4,"castingTime":"1 action","range":"30 feet","components":"V","duration":"8 hours","description":["A Large spectral guardian appears and hovers for the duration in an unoccupied space of your choice that you can see within range. The guardian occupies that space and is indistinct except for a gleaming sword and shield emblazoned with the symbol of your deity.","Any creature hostile to you that moves to a space within 10 feet of the guardian for the first time on a turn must succeed on a Dexterity saving throw. The creature takes 20 radiant damage on a failed save, or half as much damage on a successful one. The guardian vanishes when it has dealt a total of 60 damage."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric"]}');


var $0587d96155972c6a$exports = {};
$0587d96155972c6a$exports = JSON.parse('{"title":"Guardian of Nature","source":"Xanathar\'s Guide to Everything","levelAndSchool":"4th-level transmutation","level":4,"castingTime":"1 bonus action","range":"Self","components":"V","duration":"Concentration, up to 1 minute","description":["A nature spirit answers your call and transforms you into a powerful guardian. The transformation lasts until the spell ends. You choose one of the following forms to assume: Primal Beast or Great Tree.","Primal Beast. Bestial fur covers your body, your facial features become feral, and you gain the following benefits:","Your walking speed increases by 10 feet.","You gain darkvision with a range of 120 feet.","You make Strength-based attack rolls with advantage.","Your melee weapon attacks deal an extra 1d6 force damage on a hit.","Great Tree. Your skin appears barky, leaves sprout from your hair, and you gain the following benefits:","You gain 10 temporary hit points.","You make Constitution saving throws with advantage.","You make Dexterity and Wisdom-based attack rolls with advantage.","While you are on the ground, the ground within 15 feet of you is difficult terrain for your enemies."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger"]}');


var $1cfcd6986c029ac6$exports = {};
$1cfcd6986c029ac6$exports = JSON.parse('{"title":"Guards and Wards","source":"Player\'s Handbook","levelAndSchool":"6th-level abjuration","level":6,"castingTime":"10 minutes","range":"Touch","components":"V, S, M (burning incense, a small measure of brimstone and oil, a knotted string, a small amount of umber hulk blood, and a small silver rod worth at least 10 gp)","duration":"24 hours","description":["You create a ward that protects up to 2,500 square feet of floor space (an area 50 feet square, or one hundred 5-foot squares or twenty-five 10-foot squares). The warded area can be up to 20 feet tall, and shaped as you desire. You can ward several stories of a stronghold by dividing the area among them, as long as you can walk into each contiguous area while you are casting the spell.","When you cast this spell, you can specify individuals that are unaffected by any or all of the effects that you choose. You can also specify a password that, when spoken aloud, makes the speaker immune to these effects.","Guards and Wards creates the following effects within the warded area.","Corridors. Fog fills all the warded corridors, making them heavily obscured. In addition, at each intersection or branching passage offering a choice of direction, there is a 50 percent chance that a creature other than you will believe it is going in the opposite direction from the one it chooses.","Doors. All doors in the warded area are magically locked, as if sealed by an Arcane Lock spell. In addition, you can cover up to ten doors with an illusion (equivalent to the illusory object function of the Minor Illusion spell) to make them appear as plain sections of wall.","Stairs. Webs fill all stairs in the warded area from top to bottom, as the Web spell. These strands regrow in 10 minutes if they are burned or torn away while Guards and Wards lasts.","Other Spell Effect. You can place your choice of one of the following magical effects within the warded area of the stronghold.","Place Dancing Lights in four corridors. You can designate a simple program that the lights repeat as long as Guards and Wards lasts.","Place Magic Mouth in two locations.","Place Stinking Cloud in two locations. The vapors appear in the places you designate; they return within 10 minutes if dispersed by wind while Guards and Wards lasts.","Place a constant Gust of Wind in one corridor or room.","Place a Suggestion in one location. You select an area of up to 5 feet square, and any creature that enters or passes through the area receives the Suggestion mentally.","The whole warded area radiates magic. A Dispel Magic cast on a specific effect, if successful, removes only that effect. You can create a permanently Guarded and Warded structure by casting this spell there every day for one year."],"spellLists":["http://dnd5e.wikidot.com/spell:arcane-lock","http://dnd5e.wikidot.com/spell:minor-illusion","http://dnd5e.wikidot.com/spell:web","http://dnd5e.wikidot.com/spell:dancing-lights","http://dnd5e.wikidot.com/spell:magic-mouth","http://dnd5e.wikidot.com/spell:stinking-cloud","http://dnd5e.wikidot.com/spell:gust-of-wind","http://dnd5e.wikidot.com/spell:suggestion","http://dnd5e.wikidot.com/spell:dispel-magic","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:wizard"]}');


var $77037ae06b14cd76$exports = {};
$77037ae06b14cd76$exports = JSON.parse('{"title":"Guidance","source":"Player\'s Handbook","levelAndSchool":"Divination cantrip","level":0,"castingTime":"1 action","range":"Touch","components":"V, S","duration":"Concentration, up to 1 minute","description":["You touch one willing creature. Once before the spell ends, the target can roll a d4 and add the number rolled to one ability check of its choice. It can roll the die before or after making the ability check. The spell then ends."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid"]}');


var $ba0d5b5392e7f2a9$exports = {};
$ba0d5b5392e7f2a9$exports = JSON.parse('{"title":"Guiding Bolt","source":"Player\'s Handbook","levelAndSchool":"1st-level evocation","level":1,"castingTime":"1 action","range":"120 feet","components":"V, S","duration":"1 round","description":["A flash of light streaks toward a creature of your choice within range. Make a ranged spell attack against the target. On a hit, the target takes 4d6 radiant damage, and the next attack roll made against this target before the end of your next turn has advantage, thanks to the mystical dim light glittering on the target until then.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the damage increases by 1d6 for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric"]}');


var $953332b3387b4d31$exports = {};
$953332b3387b4d31$exports = JSON.parse('{"title":"Guiding Hand (UA)","source":"Unearthed Arcana 36 - Starter Spells","levelAndSchool":"1st-level divination (ritual)","level":1,"castingTime":"1 minute","range":"5 feet","components":"V, S","duration":"Concentration, up to 8 hours","description":["You create a Tiny incorporeal hand of shimmering light in an unoccupied space you can see within range. The hand exists for the duration, but it disappears if you teleport or you travel to a different plane of existence.","When the hand appears, you name one major landmark, such as a city, mountain, castle, or battlefield on the same plane of existence as you. Someone in history must have visited the site and mapped it. If the landmark appears on no map in existence, the spell fails. Otherwise, whenever you move toward the hand, it moves away from you at the same speed you moved, and it moves in the direction of the landmark, always remaining 5 feet away from you.","If you don\u2019t move toward the hand, it remains in place until you do and beckons for you to follow once every 1d4 minutes."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:wizard"]}');


var $c1b858626381ea3f$exports = {};
$c1b858626381ea3f$exports = JSON.parse('{"title":"Gust of Wind","source":"Player\'s Handbook","levelAndSchool":"2nd-level evocation","level":2,"castingTime":"1 action","range":"Self (60-foot line)","components":"V, S, M (a legume seed)","duration":"Concentration, up to 1 minute","description":["A line of strong wind 60 feet long and 10 feet wide blasts from you in a direction you choose for the spell\u2019s duration. Each creature that starts its turn in the line must succeed on a Strength saving throw or be pushed 15 feet away from you in a direction following the line.","Any creature in the line must spend 2 feet of movement for every 1 foot it moves when moving closer to you.","The gust disperses gas or vapor, and it extinguishes candles, torches, and similar unprotected flames in the area. It causes protected flames, such as those of lanterns, to dance wildly and has a 50 percent chance to extinguish them.","As a bonus action on each of your turns before the spell ends, you can change the direction in which the line blasts from you."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","/spells:ranger","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $5a773e1f665e9286$exports = {};
$5a773e1f665e9286$exports = JSON.parse('{"title":"Gust","source":"Xanathar\'s Guide to Everything","levelAndSchool":"Transmutation cantrip","level":0,"castingTime":"1 action","range":"30 feet","components":"V, S","duration":"Instantaneous","description":["You seize the air and compel it to create one of the following effects at a point you can see within range:","One Medium or smaller creature that you choose must succeed on a Strength saving throw or be pushed up to 5 feet away from you.","You create a small blast of air capable of moving one object that is neither held nor carried and that weighs no more than 5 pounds. The object is pushed up to 10 feet away from you. It isn\u2019t pushed with enough force to cause damage.","You create a harmless sensory affect using air, such as causing leaves to rustle, wind to slam shutters shut, or your clothing to ripple in a breeze."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $3401aa7374b03224$exports = {};
$3401aa7374b03224$exports = JSON.parse('{"title":"Hail of Thorns","source":"Player\'s Handbook","levelAndSchool":"1st-level conjuration","level":1,"castingTime":"1 bonus action","range":"Self","components":"V","duration":"Concentration, up to 1 minute","description":["The next time you hit a creature with a ranged weapon attack before the spell ends, this spell creates a rain of thorns that sprouts from your ranged weapon or ammunition. In addition to the normal effect of the attack, the target of the attack and each creature within 5 feet of it must make a Dexterity saving throw. A creature takes 1d10 piercing damage on a failed save, or half as much damage on a successful one.","At Higher Levels. If you cast this spell using a spell slot of 2nd level or higher, the damage increases by 1d10 for each slot level above 1st (to a maximum of 6d10)."],"spellLists":["http://dnd5e.wikidot.com/spells:ranger"]}');


var $5e3462c6a8389ad1$exports = {};
$5e3462c6a8389ad1$exports = JSON.parse('{"title":"Hallow","source":"Player\'s Handbook","levelAndSchool":"5th-level evocation","level":5,"castingTime":"24 hours","range":"Touch","components":"V, S, M (herbs, oils, and incense worth at least 1,000 gp, which the spell consumes)","duration":"Until dispelled","description":["You touch a point and infuse an area around it with holy (or unholy) power. The area can have a radius up to 60 feet, and the spell fails if the radius includes an area already under the effect a hallow spell. The affected area is subject to the following effects.","First, celestials, elementals, fey, fiends, and undead can\u2019t enter the area, nor can such creatures charm, frighten, or possess creatures within it. Any creature charmed, frightened, or possessed by such a creature is no longer charmed, frightened, or possessed upon entering the area. You can exclude one or more of those types of creatures from this effect.","Second, you can bind an extra effect to the area. Choose the effect from the following list, or choose an effect offered by the DM. Some of these effects apply to creatures in the area; you can designate whether the effect applies to all creatures, creatures that follow a specific deity or leader, or creatures of a specific sort, such as orcs or trolls. When a creature that would be affected enters the spell\u2019s area for the first time on a turn or starts its turn there, it can make a Charisma saving throw. On a success, the creature ignores the extra effect until it leaves the area.","Courage. Affected creatures can\u2019t be frightened while in the area.","Darkness. Darkness fills the area. Normal light, as well as magical light created by spells of a lower level than the slot you used to cast this spell, can\u2019t illuminate the area.","Daylight. Bright light fills the area. Magical darkness created by spells of a lower level than the slot you used to cast this spell can\u2019t extinguish the light.","Energy Protection. Affected creatures in the area have resistance to one damage type of your choice, except for bludgeoning, piercing, or slashing.","Energy Vulnerability. Affected creatures in the area have vulnerability to one damage type of your choice, except for bludgeoning, piercing, or slashing.","Everlasting Rest. Dead bodies interred in the area can\u2019t be turned into undead.","Extradimensional Interference. Affected creatures can\u2019t move or travel using teleportation or by extradimensional or interplanar means.","Fear. Affected creatures are frightened while in the area.","Silence. No sound can emanate from within the area, and no sound can reach into it.","Tongues. Affected creatures can communicate with any other creature in the area, even if they don\u2019t share a common language."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric"]}');


var $c68435893d0207f2$exports = {};
$c68435893d0207f2$exports = JSON.parse('{"title":"Hallucinatory Terrain","source":"Player\'s Handbook","levelAndSchool":"4th-level illusion","level":4,"castingTime":"10 minutes","range":"300 feet","components":"V, S, M (a stone, a twig, and a bit of green plant)","duration":"24 hours","description":["You make natural terrain in a 150-foot cube in range look, sound, and smell like some other sort of natural terrain. Thus, open fields or a road can be made to resemble a swamp, hill, crevasse, or some other difficult or impassable terrain. A pond can be made to seem like a grassy meadow, a precipice like a gentle slope, or a rock-strewn gully like a wide and smooth road. Manufactured structures, equipment, and creatures within the area aren\u2019t changed in appearance.","The tactile characteristics of the terrain are unchanged, so creatures entering the area are likely to see through the illusion. If the difference isn\u2019t obvious by touch, a creature carefully examining the illusion can attempt an Intelligence (Investigation) check against your spell save DC to disbelieve it. A creature who discerns the illusion for what it is, sees it as a vague image superimposed on the terrain."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $ae61e89b5b3e41f5$exports = {};
$ae61e89b5b3e41f5$exports = JSON.parse('{"title":"Hand of Radiance (UA)","source":"Unearthed Arcana 36 - Starter Spells","levelAndSchool":"Evocation cantrip","level":0,"castingTime":"1 action","range":"5 feet","components":"V, S","duration":"Instantaneous","description":["You raise your hand, and burning radiance erupts from it. Each creature of your choice that you can see within 5 feet of you must succeed on a Constitution saving throw or take 1d6 radiant damage.","At Higher Levels: The spell\'s damage increases by 1d6 when you reach 5th level (2d6), 11th level (3d6), and 17th level (4d6).","Spell Lists: Cleric"],"spellLists":["http://dnd5e.wikidot.com/spells:cleric"]}');


var $511d41955598f0b1$exports = {};
$511d41955598f0b1$exports = JSON.parse('{"title":"Harm","source":"Player\'s Handbook","levelAndSchool":"6th-level necromancy","level":6,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Instantanous","description":["You unleash a virulent disease on a creature that you can see within range. The target must make a Constitution saving throw. On a failed save, it takes 14d6 necrotic damage, or half as much damage on a successful save. The damage can\u2019t reduce the target\u2019s hit points below 1. If the target fails the saving throw, its hit point maximum is reduced for 1 hour by an amount equal to the necrotic damage it took. Any effect that removes a disease allows a creature\u2019s hit point maximum to return to normal before that time passes."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric"]}');


var $0112722eaf403158$exports = {};
$0112722eaf403158$exports = JSON.parse('{"title":"Haste","source":"Player\'s Handbook","levelAndSchool":"3rd-level transmutation","level":3,"castingTime":"1 action","range":"30 feet","components":"V, S, M (a shaving of licorice root)","duration":"Concentration, up to 1 minute","description":["Choose a willing creature that you can see within range. Until the spell ends, the target\u2019s speed is doubled, it gains a +2 bonus to AC, it has advantage on Dexterity saving throws, and it gains an additional action on each of its turns. That action can be used only to take the Attack (one weapon attack only), Dash, Disengage, Hide, or Use an Object action.","When the spell ends, the target can\u2019t move or take actions until after its next turn, as a wave of lethargy sweeps over it."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $faf98fe6c70105ec$exports = {};
$faf98fe6c70105ec$exports = JSON.parse('{"title":"Haywire (UA)","source":"Unearthed Arcana 7 - Modern Magic","levelAndSchool":"3rd-level enchantment (technomagic)","level":3,"castingTime":"1 action","range":"90 feet","components":"V, S","duration":"Concentration, up to 1 minute","description":["This spell plays havoc with electronic devices, making the use of such devices all but impossible. Each electronic device in a 10-foot-radius sphere centered on a point you choose within range is subject to random behavior while it remains within the area. A device not held by a creature is automatically affected. If an electronic device is held by a creature, that creature must succeed on a Wisdom saving throw or have the device affected by the spell.","At the start of each of your turns, roll a d6 for each affected device to determine its behavior. Except where otherwise indicated, that behavior lasts until the start of your next turn while this spell is in effect.","d6","Effect","1","The device shuts down and must be restarted. Do not roll again for this device until it is restarted.","2-4","The device does not function.","5","The device experiences a power surge, causing an electric shock to the wielder (if any and one random creature within 5 feet of the device. Each affected creature must make a Dexterity saving throw against your spell save DC, taking 6d6 lightning damage on a failed save, or half as much damage on a successful one.","6","The device is usable as normal.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, the radius of the sphere affected by the spell increases by 5 feet for each slot level above 3rd."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $914997b68796865b$exports = {};
$914997b68796865b$exports = JSON.parse('{"title":"Heal","source":"Player\'s Handbook","levelAndSchool":"6th-level evocation","level":6,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Instantaneous","description":["Choose a creature that you can see within range. A surge of positive energy washes through the creature, causing it to regain 70 hit points. The spell also ends blindness, deafness, and any diseases affecting the target. This spell has no effect on constructs or undead.","At Higher Levels. When you cast this spell using a spell slot of 7th level or higher, the amount of healing increases by 10 for each slot level above 6th."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid"]}');


var $f71743836b76e75f$exports = {};
$f71743836b76e75f$exports = JSON.parse('{"title":"Healing Elixir (UA)","source":"Unearthed Arcana 36 - Starter Spells","levelAndSchool":"1st-level conjuration","level":1,"castingTime":"1 minute","range":"Self","components":"V, S, M (alchemist\u2019s supplies)","duration":"24 hours","description":["You create a healing elixir in a simple vial that appears in your hand. The elixir retains its potency for the duration or until it\u2019s consumed, at which point the vial vanishes.","As an action, a creature can drink the elixir or administer it to another creature. The drinker regains 2d4 + 2 hit points.","+\xa0Show\xa0HB\xa0Suggestion","-\xa0Hide\xa0HB\xa0Note","HBThis spell is massively overpowered. For example, a 1st-level wizard could use this spell to produce enough healing for an entire party without losing any spell slots. Additionally, it could be used to run a potion-selling scam in which the product vanishes a day after purchase. I would not recommend allowing it.","Editor\'s Note: I don\'t have a clue as to what the first point is referring to, arcane recovery only gives 1 spell slot until 4th level, spell mastery is at 18th level, and any abusable subclass features are at 2nd level. But yes, either way, this spell is overpowered, it gives non-divine caster classes access to healing, and it can be abused in numerous ways. I\'d suggest limiting the duration to an hour or less.","Editor notes+: At higher levels, this allows wizards to heal creatures infinitely, and overall, wizards just shouldn\'t have healing spells, it goes against their design philosophy. On the warlock, its also still a confusing option, as though warlocks can gain healing spells through a celestial patron, this spell lacks any upcasting rules, which goes against the design of warlock."],"spellLists":["http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard","javascript:;","javascript:;"]}');


var $d4b144971f285714$exports = {};
$d4b144971f285714$exports = JSON.parse('{"title":"Healing Spirit","source":"Xanathar\'s Guide to Everything","levelAndSchool":"2nd-level conjuration","level":2,"castingTime":"1 bonus action","range":"60 feet","components":"V, S","duration":"Concentration, up to 1 minute","description":["You call forth a nature spirit to soothe the wounded. The intangible spirit appears in a space that is a 5-foot cube you can see within range. The spirit looks like a transparent beast or fey (your choice).","Until the spell ends, whenever you or a creature you can see moves into the spirits space for the first time on a turn or starts its turn there, you can cause the spirit to restore 1d6 hit points to that creature (no action required). The spirit can\u2019t heal constructs or undead.","As a bonus action on your turn, you can move the Spirit up to 30 feet to a space you can see. The spirit can heal a number of times equal to 1 + your spellcasting ability modifier (minimum of twice). After healing that number of times, the spirit disappears.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, the healing increases 1d6 for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger"]}');


var $e7a9c5651c450bde$exports = {};
$e7a9c5651c450bde$exports = JSON.parse('{"title":"Healing Word","source":"Player\'s Handbook","levelAndSchool":"1st-level evocation","level":1,"castingTime":"1 bonus action","range":"60 feet","components":"V","duration":"Instantaneous","description":["A creature of your choice that you can see within range regains hit points equal to 1d4 + your spellcasting ability modifier. This spell has no effect on undead or constructs.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the healing increases by 1d4 for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid"]}');


var $e82d984dafc88d37$exports = {};
$e82d984dafc88d37$exports = JSON.parse('{"title":"Heat Metal","source":"Player\'s Handbook","levelAndSchool":"2nd-level transmutation","level":2,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a piece of iron and a flame)","duration":"Concentration, up to 1 minute","description":["Choose a manufactured metal object, such as a metal weapon or a suit of heavy or medium metal armor, that you can see within range. You cause the object to glow red-hot. Any creature in physical contact with the object takes 2d8 fire damage when you cast the spell. Until the spell ends, you can use a bonus action on each of your subsequent turns to cause this damage again.","If a creature is holding or wearing the object and takes the damage from it, the creature must succeed on a Constitution saving throw or drop the object if it can. If it doesn\u2019t drop the object, it has disadvantage on attack rolls and ability checks until the start of your next turn.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, the damage increases by 1d8 for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:druid"]}');


var $2429aee4572aa06a$exports = {};
$2429aee4572aa06a$exports = JSON.parse('{"title":"Hellish Rebuke","source":"Player\'s Handbook","levelAndSchool":"1st-level evocation","level":1,"castingTime":"1 reaction, which you take when you are damaged by a creature within 60 feet of you that you can see","range":"60 feet","components":"V, S","duration":"Instantaneous","description":["You point your finger, and the creature that damaged you is momentarily surrounded by hellish flames. The creature must make a Dexterity saving throw. It takes 2d10 fire damage on a failed save, or half as much damage on a successful one.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the damage increases by 1d10 for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:warlock"]}');


var $a9a559f3952c4d7c$exports = {};
$a9a559f3952c4d7c$exports = JSON.parse('{"title":"Heroes\' Feast","source":"Player\'s Handbook","levelAndSchool":"6th-level conjuration","level":6,"castingTime":"10 minutes","range":"30 feet","components":"V, S, M (a gem-encrusted bowl worth at least 1,000 gp, which the spell consumes)","duration":"Instantaneous","description":["You bring forth a great feast, including magnificent food and drink. The feast takes 1 hour to consume and disappears at the end of that time, and the beneficial effects don\u2019t set in until this hour is over. Up to twelve creatures can partake of the feast.","A creature that partakes of the feast gains several benefits. The creature is cured of all diseases and poison, becomes immune to poison and being frightened, and makes all Wisdom saving throws with advantage. Its hit point maximum also increases by 2d10, and it gains the same number of hit points. These benefits last for 24 hours."],"spellLists":["/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid"]}');


var $4b3b49ee23d28e85$exports = {};
$4b3b49ee23d28e85$exports = JSON.parse('{"title":"Heroism","source":"Player\'s Handbook","levelAndSchool":"1st-level enchantment","level":1,"castingTime":"1 action","range":"Touch","components":"V, S","duration":"Concentration, up to 1 minute","description":["A willing creature you touch is imbued with bravery. Until the spell ends, the creature is immune to being frightened and gains temporary hit points equal to your spellcasting ability modifier at the start of each of its turns. When the spell ends, the target loses any remaining temporary hit points from this spell.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, you can target one additional creature for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:paladin"]}');


var $6a775378f7c75dd9$exports = {};
$6a775378f7c75dd9$exports = JSON.parse('{"title":"Hex","source":"Player\'s Handbook","levelAndSchool":"1st-level enchantment","level":1,"castingTime":"1 bonus action","range":"90 feet","components":"V, S, M (the petrified eye of a newt)","duration":"Concentration, up to 1 hour","description":["You place a curse on a creature that you can see within range. Until the spell ends, you deal an extra 1d6 necrotic damage to the target whenever you hit it with an attack. Also, choose one ability when you cast the spell. The target has disadvantage on ability checks made with the chosen ability.","If the target drops to 0 hit points before this spell ends, you can use a bonus action on a subsequent turn of yours to curse a new creature.","A Remove Curse cast on the target ends this spell early.","At Higher Levels. When you cast this spell using a spell slot of 3rd or 4th level, you can maintain your concentration on the spell for up to 8 hours. When you use a spell slot of 5th level or higher, you can maintain your concentration on the spell for up to 24 hours."],"spellLists":["http://dnd5e.wikidot.com/spell:remove-curse","http://dnd5e.wikidot.com/spells:warlock"]}');


var $01f6ce84961c213a$exports = {};
$01f6ce84961c213a$exports = JSON.parse('{"title":"Hold Monster","source":"Player\'s Handbook","levelAndSchool":"5th-level enchantment","level":5,"castingTime":"1 action","range":"90 feet","components":"V, S, M (a small, straight piece of iron)","duration":"Concentration, up to 1 minute","description":["Choose a creature that you can see within range. The target must succeed on a Wisdom saving throw or be paralyzed for the duration. This spell has no effect on undead. At the end of each of its turns, the target can make another Wisdom saving throw. On a success, the spell ends on the target.","At Higher Levels. When you cast this spell using a spell slot of 6th level or higher, you can target one additional creature for each slot level above 5th. The creatures must be within 30 feet of each other when you target them."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $f33b109d22eaec97$exports = {};
$f33b109d22eaec97$exports = JSON.parse('{"title":"Hold Person","source":"Player\'s Handbook","levelAndSchool":"2nd-level enchantment","level":2,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a small, straight piece of iron)","duration":"Concentration, up to 1 minute","description":["Choose a humanoid that you can see within range. The target must succeed on a Wisdom saving throw or be paralyzed for the duration. At the end of each of its turns, the target can make another Wisdom saving throw. On a success, the spell ends on the target.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, you can target one additional humanoid for each slot level above 2nd. The humanoids must be within 30 feet of each other when you target them."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $f3f99462e9c55ccc$exports = {};
$f3f99462e9c55ccc$exports = JSON.parse('{"title":"Holy Aura","source":"Player\'s Handbook","levelAndSchool":"8th-level abjuration","level":8,"castingTime":"1 action","range":"Self","components":"V, S, M (a tiny reliquary worth at least 1,000 gp containing a sacred relic, such as a scrap of cloth from a saint\u2019s robe or a piece of parchment from a religious text)","duration":"Concentration, up to 1 minute","description":["Divine light washes out from you and coalesces in a soft radiance in a 30-foot radius around you. Creatures of your choice in that radius when you cast this spell shed dim light in a 5-foot radius and have advantage on all saving throws, and other creatures have disadvantage on attack rolls against them until the spell ends. In addition, when a fiend or an undead hits an affected creature with a melee attack, the aura flashes with brilliant light. The attacker must succeed on a Constitution saving throw or be blinded until the spell ends."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric"]}');


var $c1c586ee4809ca11$exports = {};
$c1c586ee4809ca11$exports = JSON.parse('{"title":"Holy Weapon","source":"Xanathar\'s Guide to Everything","levelAndSchool":"5th-level evocation","level":5,"castingTime":"1 bonus action","range":"Touch","components":"V, S","duration":"Concentration, up to 1 hour","description":["You imbue a weapon you touch with holy power. Until the spell ends, the weapon emits bright light in a 30-foot radius and dim light for an additional 30 feet. In addition, weapon attacks made with it deal an extra 2d8 radiant damage on a hit. If the weapon isn\u2019t already a magic weapon, it becomes one for the duration. As a bonus action on your turn, you can dismiss this spell and cause the weapon to emit a burst of radiance. Each creature of your choice that you can see within 30 feet of the weapon must make a Constitution saving throw. On a failed save, a creature takes 4d8 radiant damage, and it is blinded for 1 minute. On a successful save, a creature takes half as much damage and isn\u2019t blinded. At the end of each of its turns, a blinded creature can make a Constitution saving throw, ending the effect on itself on a success."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:paladin"]}');


var $3fe9740fce9b6ae3$exports = {};
$3fe9740fce9b6ae3$exports = JSON.parse('{"title":"House of Cards (UA)","source":"Unearthed Arcana 85 - Wonders of the Multiverse","levelAndSchool":"3rd-level conjuration","level":3,"castingTime":"1 minute","range":"Touch","components":"V, S, M (a deck of cards)","duration":"24 hours","description":["You touch the ground and conjure forth a defensive structure made of enormous playing cards. The structure rises with you at its center, harmlessly lifting you and any creatures in the area. The house of cards has a square base that is 30 feet on each side, and it has three floors with 10-foot-high ceilings. The second floor is 20 feet on each side, and the top floor is 10 feet on each side\u2014both centered above the bottom floor. Ramps connect the interior of each floor, and empty doorframes connect the interior and exterior of each level. Creatures inside or on top of the structure have half cover.","Each card that comprises the house is 5 feet wide and 10 feet tall and is very fragile. A card has AC 10 and 1 hit point. The cards are immune to poison and psychic damage. Reducing a card to 0 hit points destroys it. Every time a card is destroyed, roll 1d6. If you roll a 5 or a 6, the house collapses, ending the spell.","The house and all its cards vanish when the spell ends."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $133419692413c577$exports = {};
$133419692413c577$exports = JSON.parse('{"title":"Hunger Of Hadar","source":"Player\'s Handbook","levelAndSchool":"3rd-level conjuration","level":3,"castingTime":"1 action","range":"150 feet","components":"V, S, M (a pickled octopus tentacle)","duration":"Concentration, up to 1 minute","description":["You open a gateway to the dark between the stars, a region infested with unknown horrors. A 20-foot-radius sphere of blackness and bitter cold appears, centered on a point within range and lasting for the duration. This void is filled with a cacophony of soft whispers and slurping noises that can be heard up to 30 feet away. No light, magical or otherwise, can illuminate the area, and creatures fully within the area are blinded.","The void creates a warp in the fabric of space, and the area is difficult terrain. Any creature that starts its turn in the area takes 2d6 cold damage. Any creature that ends its turn in the area must succeed on a Dexterity saving throw or take 2d6 acid damage as milky, otherworldly tentacles rub against it."],"spellLists":["http://dnd5e.wikidot.com/spells:warlock"]}');


var $b16a723273a63ded$exports = {};
$b16a723273a63ded$exports = JSON.parse('{"title":"Hunter\'s Mark","source":"Player\'s Handbook","levelAndSchool":"1st-level divination","level":1,"castingTime":"1 bonus action","range":"90 feet","components":"V","duration":"Concentration, up to 1 hour","description":["You choose a creature you can see within range and mystically mark it as your quarry. Until the spell ends, you deal an extra 1d6 damage to the target whenever you hit it with a weapon attack, and you have advantage on any Wisdom (Perception) or Wisdom (Survival) check you make to find it.","If the target drops to 0 hit points before this spell ends, you can use a bonus action on a subsequent turn of yours to mark a new creature.","At Higher Levels. When you cast this spell using a spell slot of 3rd or 4th level, you can maintain your concentration on the spell for up to 8 hours. When you use a spell slot of 5th level or higher, you can maintain your concentration on the spell for up to 24 hours."],"spellLists":["http://dnd5e.wikidot.com/spells:ranger"]}');


var $2938b917ca0dd679$exports = {};
$2938b917ca0dd679$exports = JSON.parse('{"title":"Hypnotic Pattern","source":"Player\'s Handbook","levelAndSchool":"3rd-level illusion","level":3,"castingTime":"1 action","range":"120 feet","components":"S, M (a glowing stick of incense or a crystal vial filled with phosphorescent material)","duration":"Concentration, up to 1 minute","description":["You create a twisting pattern of colors that weaves through the air inside a 30-foot cube within range. The pattern appears for a moment and vanishes. Each creature in the area who sees the pattern must make a Wisdom saving throw. On a failed save, the creature becomes charmed for the duration. While charmed by this spell, the creature is incapacitated and has a speed of 0.","The spell ends for an affected creature if it takes any damage or if someone else uses an action to shake the creature out of its stupor."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $f34eee2fb2b9c16a$exports = {};
$f34eee2fb2b9c16a$exports = JSON.parse('{"title":"Ice Knife","source":"Xanathar\'s Guide to Everything","levelAndSchool":"1st-level conjuration","level":1,"castingTime":"1 action","range":"60 feet","components":"S, M (a drop of water or piece of ice)","duration":"Instantaneous","description":["You create a shard of ice and fling it at one creature within range. Make a ranged spell attack against the target. On a hit, the target takes 1d10 piercing damage. Hit or miss, the shard then explodes. The target and each creature within 5 feet of the point where the ice exploded must succeed on a Dexterity saving throw or take 2d6 cold damage.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the cold damage increases by 1d6 for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $8f3d2b165b0f4775$exports = {};
$8f3d2b165b0f4775$exports = JSON.parse('{"title":"Ice Storm","source":"Player\'s Handbook","levelAndSchool":"4th-level evocation","level":4,"castingTime":"1 action","range":"300 feet","components":"V, S, M (a pinch of dust and a few drops of water)","duration":"Instantaneous","description":["A hail of rock-hard ice pounds to the ground in a 20-foot-radius, 40-foot-high cylinder centered on a point within range. Each creature in the cylinder must make a Dexterity saving throw. A creature takes 2d8 bludgeoning damage and 4d6 cold damage on a failed save, or half as much damage on a successful one.","Hailstones turn the storm\u2019s area of effect into difficult terrain until the end of your next turn.","At Higher Levels. When you cast this spell using a spell slot of 5th level or higher, the bludgeoning damage increases by 1d8 for each slot level above 4th."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $62249ccb41fe0750$exports = {};
$62249ccb41fe0750$exports = JSON.parse('{"title":"Icingdeath\'s Frost (UA)","source":"Unearthed Arcana 78 - Draconic Options","levelAndSchool":"2nd-level evocation","level":2,"castingTime":"1 action","range":"Self (15-foot cone)","components":"S, M (a vial of meltwater)","duration":"Instantaneous","description":["A burst of icy cold energy emanates from you in a 30-foot cone. Each creature in that area must make a Constitution saving throw. On a failed save, a creature takes 3d8 cold damage and is covered in ice for 1 minute or until a creature uses its action to break the ice off itself or another creature. A creature covered in ice has its speed reduced to 0. On a successful save, a creature takes half as much damage with no additional effects.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, increase the cold damage by 1d8 for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $af9a98c7d7193e02$exports = {};
$af9a98c7d7193e02$exports = JSON.parse('{"title":"Id Insinuation (UA)","source":"Unearthed Arcana 66 - Fighter, Rogue, and Wizard","levelAndSchool":"1st-level enchantment","level":1,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Concentration, up to 1 minute","description":["You unleash a torrent of conflicting desires in the mind of one creature you can see within range, impairing its ability to make decisions. The target must succeed on a Wisdom saving throw or be incapacitated. At the end of each of its turns, it takes 1d12 psychic damage, and it can then make another Wisdom saving throw. On a success, the spell ends on the target."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $d390efb88156e7e4$exports = {};
$d390efb88156e7e4$exports = JSON.parse('{"title":"Identify","source":"Player\'s Handbook","levelAndSchool":"1st-level divination (ritual)","level":1,"castingTime":"1 minute","range":"Touch","components":"V, S, M (a pearl worth at least 100 gp and an owl feather)","duration":"Instantaneous","description":["You choose one object that you must touch throughout the casting of the spell. If it is a magic item or some other magic-imbued object, you learn its properties and how to use them, whether it requires attunement to use, and how many charges it has, if any. You learn whether any spells are affecting the item and what they are. If the item was created by a spell, you learn which spell created it.","If you instead touch a creature throughout the casting, you learn what spells, if any, are currently affecting it."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:wizard"]}');


var $2be1adcf8565612f$exports = {};
$2be1adcf8565612f$exports = JSON.parse('{"title":"Illusory Dragon","source":"Xanathar\'s Guide to Everything","levelAndSchool":"8th-level illusion","level":8,"castingTime":"1 action","range":"120 feet","components":"S","duration":"Concentration, up to 1 minute","description":["By gathering threads of shadow material from the Shadowfell, you create a Huge shadowy dragon in an unoccupied space that you can see within range. The illusion lasts for the spell\u2019s duration and occupies its space, as if it were a creature.","When the illusion appears, any of your enemies that can see it must succeed on a Wisdom saving throw or become frightened of it for 1 minute. If a frightened creature ends its turn in a location where it doesn\u2019t have line of sight to the illusion, it can repeat the saving throw, ending the effect on itself on a success.","As a bonus action on your turn, you can move the illusion up to 60 feet. At any point during its movement, you can cause it to exhale a blast of energy in a 60-foot cone originating from its space.","When you create the dragon, choose a damage type: acid, cold, fire, lightning, necrotic, or poison. Each creature in the cone must make an Intelligence saving throw, taking 7d6 damage of the chosen damage type on a failed save, or half as much damage on a successful one.","The illusion is tangible because of the shadow stuff used to create it, but attacks miss it automatically. it succeeds on all saving throws, and it is immune to all damage and conditions. A creature that uses an action to examine the dragon can determine that it is an illusion by succeeding on an Intelligence (Investigation) check against your spell save DC. If a creature discerns the illusion for what it is, the creature can see through it and has advantage on saving throws against its breath."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $a854f889c0466cfc$exports = {};
$a854f889c0466cfc$exports = JSON.parse('{"title":"Illusory Script","source":"Player\'s Handbook","levelAndSchool":"1st-level illusion (ritual)","level":1,"castingTime":"1 minute","range":"Touch","components":"S, M (a lead-based ink worth at least 10 gp, which the spell consumes)","duration":"10 days","description":["You write on parchment, paper, or some other suitable writing material and imbue it with a potent illusion that lasts for the duration.","To you and any creatures you designate when you cast the spell, the writing appears normal, written in your hand, and conveys whatever meaning you intended when you wrote the text. To all others, the writing appears as if it were written in an unknown or magical script that is unintelligible. Alternatively, you can cause the writing to appear to be an entirely different message, written in a different hand and language, though the language must be one you know.","Should the spell be dispelled, the original script and the illusion both disappear. A creature with truesight can read the hidden message."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $9a2c54877e3bb82c$exports = {};
$9a2c54877e3bb82c$exports = JSON.parse('{"title":"Immolation","source":"Xanathar\'s Guide to Everything","levelAndSchool":"5th-level evocation","level":5,"castingTime":"1 action","range":"90 feet","components":"V","duration":"Concentration, up to 1 minute","description":["Flames wreathe one creature you can see within range. The target must make a Dexterity saving throw. It takes 7d6 fire damage on a failed save, or half as much damage on a successful one. On a failed save, the target also burns for the spell\u2019s duration. The burning target sheds bright light in a 30-foot radius and dim light for an additional 30 feet. At the end of each of its turns, the target repeats the saving throw. It takes 3d6 fire damage on a failed save, and the spell ends on a successful one. These magical flames can\u2019t be extinguished through nonmagical means.","If damage from this spell reduces a target to 0 hit points, the target is turned to ash."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $1f022459962e9db0$exports = {};
$1f022459962e9db0$exports = JSON.parse('{"title":"Immovable Object","source":"Explorer\'s Guide to Wildemount","levelAndSchool":"2nd-level transmutation (dunamancy:graviturgy)","level":2,"castingTime":"1 action","range":"Touch","components":"V, S, M (gold dust worth at least 25 gp, which the spell consumes)","duration":"1 hour","description":["You touch an object that weighs no more than 10 pounds and cause it to become magically fixed in place. You and the creatures you designate when you cast this spell can move the object normally. You can also set a password that, when spoken within 5 feet of the object, suppresses this spell for 1 minute.","If the object is fixed in the air, it can hold up to 4,000 pounds of weight. More weight causes the object to fall. Otherwise, a creature can use an action to make a Strength check against your spell save DC. On a success, the creature can move the object up to 10 feet.","At Higher Levels. If you cast this spell using a spell slot of 4th or 5th level, the DC to move the object increases by 5, it can carry up to 8,000 pounds of weight, and the duration increases to 24 hours. If you cast this spell using a spell slot of 6th level or higher, the DC to move the object increases by 10, it can carry up to 20,000 pounds of weight, and the effect is permanent until dispelled."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $7a7ae7490ff2b122$exports = {};
$7a7ae7490ff2b122$exports = JSON.parse('{"title":"Imprisonment","source":"Player\'s Handbook","levelAndSchool":"9th-level abjuration","level":9,"castingTime":"1 minute","range":"30 feet","components":"V, S, M (a vellum depiction or a carved statuette in the likeness of the target, and a special component that varies according to the version of the spell you choose, worth at least 500 gp per Hit Die of the target)","duration":"Until dispelled","description":["You create a magical restraint to hold a creature that you can see within range. The target must succeed on a Wisdom saving throw or be bound by the spell; if it succeeds, it is immune to this spell if you cast it again. While affected by this spell, the creature doesn\'t need to breathe, eat, or drink, and it doesn\u2019t age. Divination spells can\u2019t locate or perceive the target.","During the casting of the spell, in any of its versions, you can specify a condition that will cause the spell to end and release the target. The condition can be as specific or as elaborate as you choose, but the DM must agree that the condition is reasonable and has a likelihood of coming to pass. The conditions can be based on a creature\u2019s name, identity, or deity but otherwise must be based on observable actions or qualities and not based on intangibles such as level, class, or hit points.","A Dispel Magic spell can end the spell only if it is cast as a 9th-level spell, targeting either the prison or the special component used to create it.","You can use a particular special component to create only one prison at a time. If you cast the spell again using the same component, the target of the first casting is immediately freed from its binding.","When you cast the spell, you choose one of the following forms of imprisonment.","Burial. The target is entombed far beneath the earth in a sphere of magical force that is just large enough to contain the target. Nothing can pass through the sphere, nor can any creature teleport or use planar travel to get into or out of it.","The special component for this version of the spell is a small mithral orb.","Chaining. Heavy chains, firmly rooted in the ground, hold the target in place. The target is restrained until the spell ends, and it can\u2019t move or be moved by any means until then.","The special component for this version of the spell is a fine chain of precious metal.","Hedged Prison. The spell transports the target into a tiny demiplane that is warded against teleportation and planar travel. The demiplane can be a labyrinth, a cage, a tower, or any similar confined structure or area of your choice.","The special component for this version of the spell is a miniature representation of the prison made from jade.","Minimus Containment. The target shrinks to a height of 1 inch and is imprisoned inside a gemstone or similar object. Light can pass through the gemstone normally (allowing the target to see out and other creatures to see in), but nothing else can pass through, even by means of teleportation or planar travel. The gemstone can\u2019t be cut or broken while the spell remains in effect.","The special component for this version of the spell is a large, transparent gemstone, such as a corundum, diamond, or ruby.","Slumber. The target falls asleep and can\u2019t be awoken.","The special component for this version of the spell consists of rare soporific herbs."],"spellLists":["http://dnd5e.wikidot.com/spell:dispel-magic","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $674059480b56401c$exports = {};
$674059480b56401c$exports = JSON.parse('{"title":"Incendiary Cloud","source":"Player\'s Handbook","levelAndSchool":"8th-level conjuration","level":8,"castingTime":"1 action","range":"150 feet","components":"V, S","duration":"Concentration, up to 1 minute","description":["A swirling cloud of smoke shot through with white-hot embers appears in a 20-foot-radius sphere centered on a point within range. The cloud spreads around corners and is heavily obscured. It lasts for the duration or until a wind of moderate or greater speed (at least 10 miles per hour) disperses it.","When the cloud appears, each creature in it must make a Dexterity saving throw. A creature takes 10d8 fire damage on a failed save, or half as much damage on a successful one. A creature must also make this saving throw when it enters the spell\u2019s area for the first time on a turn or ends its turn there.","The cloud moves 10 feet directly away from you in a direction that you choose at the start of each of your turns."],"spellLists":["/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $21ef078fff2b9bbb$exports = {};
$21ef078fff2b9bbb$exports = JSON.parse('{"title":"Incite Greed","source":"Acquisitions Inc.","levelAndSchool":"3rd-level enchantment","level":3,"castingTime":"1 action","range":"30 feet","components":"V, S, M (a gem worth at least 50 gp)","duration":"Concentration, up to 1 minute","description":["When you cast this spell, you present the gem used as the material component and choose any number of creatures within range that can see you. Each target must succeed on a Wisdom saving throw or be charmed by you until the spell ends, or until you or your companions do anything harmful to it. While charmed in this way, a creature can do nothing but use its movement to approach you in a safe manner. While an affected creature is within 5 feel of you, it cannot move, but simply stares greedily at the gem you present.","At the end of each of its turns, an affected target can make a Wisdom saving throw. If it succeeds, this effect ends for that target."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $14e36cb4f7fa9d7c$exports = {};
$14e36cb4f7fa9d7c$exports = JSON.parse('{"title":"Infallible Relay (UA)","source":"Unearthed Arcana 7 - Modern Magic","levelAndSchool":"1st-level divination (technomagic)","level":1,"castingTime":"1 minute","range":"Self","components":"V, S, M (a mobile phone)","duration":"Concentration, up to 10 minutes","description":["With this spell, you can target any creature with whom you have spoken previously, as long as the two of you are on the same plane of existence. When you cast the spell, the nearest functioning telephone or similar communications device within 100 feet of the target begins to ring. If there is no suitable device close enough to the target, the spell fails.","The target must make a successful Charisma saving throw or be compelled to answer your call. Once the connection is established, the call is crystal clear and cannot be dropped until the conversation has ended or the spell\u2019s duration ends. You can end the conversation at any time, but a target must succeed on a Charisma saving throw to end the conversation."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $4f8367c625887fb2$exports = {};
$4f8367c625887fb2$exports = JSON.parse('{"title":"Infernal Calling","source":"Xanathar\'s Guide to Everything","levelAndSchool":"5th-level conjuration","level":5,"castingTime":"1 minute","range":"90 feet","components":"V, S, M (a ruby worth at least 999 gp)","duration":"Concentration, up to 1 hour","description":["Uttering a dark incantation, you summon a devil from the Nine Hells. You choose the devil\u2019s type, which must be one of challenge rating 6 or lower, such as a barbed devil or a bearded devil. The devil appears in an unoccupied space that you can see within range. The devil disappears when it drops to 0 hit points or when the spell ends.","The devil is unfriendly toward you and your companions. Roll initiative for the devil, which has its own turns. It is under the Dungeon Master\u2019s control and acts according to its nature on each of its turns, which might result in its attacking you if it thinks it can prevail, or trying to tempt you to undertake an evil act in exchange for limited service. The DM has the creature\u2019s statistics.","On each of your turns, you can try to issue a verbal command to the devil (no action required by you). It obeys the command if the likely outcome is in accordance with its desires, especially if the result would draw you toward evil. Otherwise, you must make a Charisma (Deception, Intimidation, or Persuasion) check contested by its Wisdom (Insight) check. You make the check with advantage if you say the devil\u2019s true name. If your check fails, the devil becomes immune to your verbal commands for the duration of the spell, though it can still carry out your commands if it chooses. If your check succeeds, the devil carries out your command\u2014 such as \u201Cattack my enemies,\u201D \u201Cexplore the room ahead,\\" or \u201Cbear this message to the queen\\"\u2014until it completes the activity, at which point it returns to you to report having done so.","If your concentration ends before the spell reaches its full duration, the devil doesn\'t disappear if it has become immune to your verbal commands. Instead, it acts in whatever manner it chooses for 3d6 minutes, and then it disappears.","If you possess an individual devil\u2019s talisman, you can summon that devil if it is of the appropriate challenge rating plus 1, and it obeys all your commands, with no Charisma checks required.","At Higher Levels When you cast this spell using a spell slot of 6th level or higher, the challenge rating increases by 1 for each slot level above 5th."],"spellLists":["http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $4d064ca866a923bf$exports = {};
$4d064ca866a923bf$exports = JSON.parse('{"title":"Infestation","source":"Xanathar\'s Guide to Everything","levelAndSchool":"Conjuration cantrip","level":0,"castingTime":"1 action","range":"30 feet","components":"V, S, M (a living flea)","duration":"Instantaneous","description":["You cause a cloud of mites, fleas, and other parasites to appear momentarily on one creature you can see within range. The target must succeed on a Constitution saving throw, or it takes 1d6 poison damage and moves 5 feet in a random direction if it can move and its speed is at least 5 feet. Roll a d4 for the direction: 1, north; 2, south; 3, east; or 4, west. This movement doesn\u2019t provoke opportunity attacks, and if the direction rolled is blocked, the target doesn\'t move.","At Higher Levels. The spell\u2019s damage increases by 1d6 when you reach 5th level (2d6), 11th level (3d6), and 17th level (4d6)."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $88751a180adbd5a2$exports = {};
$88751a180adbd5a2$exports = JSON.parse('{"title":"Inflict Wounds","source":"Player\'s Handbook","levelAndSchool":"1st-level necromancy","level":1,"castingTime":"1 action","range":"Touch","components":"V, S","duration":"Instantaneous","description":["Make a melee spell attack against a creature you can reach. On a hit, the target takes 3d10 necrotic damage.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the damage increases by 1d10 for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric"]}');


var $5056a3f17aa09523$exports = {};
$5056a3f17aa09523$exports = JSON.parse('{"title":"Insect Plague","source":"Player\'s Handbook","levelAndSchool":"5th-level conjuration","level":5,"castingTime":"1 action","range":"300 feet","components":"V, S, M (a few grains of sugar, some kernels of grain, and a smear of fat)","duration":"Concentration, up to 10 minutes","description":["Swarming, biting locusts fill a 20-foot-radius sphere centered on a point you choose within range. The sphere spreads around corners. The sphere remains for the duration, and its area is lightly obscured. The sphere\u2019s area is difficult terrain.","When the area appears, each creature in it must make a Constitution saving throw. A creature takes 4d10 piercing damage on a failed save, or half as much damage on a successful one. A creature must also make this saving throw when it enters the spell\u2019s area for the first time on a turn or ends its turn there.","At Higher Levels. When you cast this spell using a spell slot of 6th level or higher, the damage increases by 1d10 for each slot level above 5th."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer"]}');


var $a4b9f182b5c2b0d9$exports = {};
$a4b9f182b5c2b0d9$exports = JSON.parse('{"title":"Intellect Fortress","source":"Tasha\'s Cauldron of Everything","levelAndSchool":"3rd-level abjuration","level":3,"castingTime":"1 action","range":"30 feet","components":"V","duration":"Concentration, up to 1 hour","description":["For the duration, you or one willing creature you can see within range has resistance to psychic damage, as well as advantage on Intelligence, Wisdom, and Charisma saving throws.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, you can target one additional creature for each slot level above 3rd. The creatures must be within 30 feet of each other when you target them.","Spell Lists: Artificer, Bard (Optional), Sorcerer (Optional), Warlock (Optional), Wizard (Optional)"],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","/spells:bard","/spells:sorcerer","/spells:warlock","/spells:wizard"]}');


var $843caeb50c938e3e$exports = {};
$843caeb50c938e3e$exports = JSON.parse('{"title":"Investiture of Flame","source":"Xanathar\'s Guide to Everything","levelAndSchool":"6th-level transmutation","level":6,"castingTime":"1 action","range":"Self","components":"V, S","duration":"Concentration, up to 10 minutes","description":["Flames race across your body, shedding bright light in a 30-foot radius and dim light for an additional 30 feet for the spell\u2019s duration. The flames don\u2019t harm you. Until the spell ends, you gain the following benefits:","You are immune to fire damage and have resistance to cold damage.","Any creature that moves within 5 feet of you for the first time on a turn or ends its turn there takes 1d10 fire damage.","You can use your action to create a line of fire 15 feet long and 5 feet wide extending from you in a direction you choose. Each creature in the line must make a Dexterity saving throw. A creature takes 4d8 fire damage on a failed save, or half as much damage on a successful one."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $d1a2ab098dea5173$exports = {};
$d1a2ab098dea5173$exports = JSON.parse('{"title":"Investiture of Ice","source":"Xanathar\'s Guide to Everything","levelAndSchool":"6th-level transmutation","level":6,"castingTime":"1 action","range":"Self","components":"V, S","duration":"Concentration, up to 10 minutes","description":["Until the spell ends, ice rimes your body, and you gain the following benefits:","You are immune to cold damage and have resistance to fire damage.","You can move across difficult terrain created by ice or snow without spending extra movement.","The ground in a 10-foot radius around you is icy and is difficult terrain for creatures other than you. The radius moves with you.","You can use your action to create a 15-foot cone of freezing wind extending from your outstretched hand in a direction you choose. Each creature in the cone must make a Constitution saving throw. A creature takes 4d6 cold damage on a failed save, or half as much damage on a successful one. A creature that fails its save against this effect has its speed halved until the start of your next turn."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $bc24b307f03b414a$exports = {};
$bc24b307f03b414a$exports = JSON.parse('{"title":"Investiture of Stone","source":"Xanathar\'s Guide to Everything","levelAndSchool":"6th-level transmutation","level":6,"castingTime":"1 action","range":"Self","components":"V, S","duration":"Concentration, up to 10 minutes","description":["Until the spell ends, bits of rock spread across your body, and you gain the following benefits:","You have resistance to bludgeoning, piercing, and slashing damage from nonmagical weapons.","You can use your action to create a small earthquake on the ground in a 15-foot radius centered on you. Other creatures on that ground must succeed on a Dexterity saving throw or be knocked prone.","You can move across difficult terrain made of earth or stone without spending extra movement. You can move through solid earth or stone as if it was air and without destabilizing it, but you can\u2019t end your movement there. If you do so, you are ejected to the nearest unoccupied space, this spell ends, and you are stunned until the end of your next turn."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $91ae7e02ca54222a$exports = {};
$91ae7e02ca54222a$exports = JSON.parse('{"title":"Investiture of Wind","source":"Xanathar\'s Guide to Everything","levelAndSchool":"6th-level transmutation","level":6,"castingTime":"1 action","range":"Self","components":"V, S","duration":"Concentration, up to 10 minutes","description":["Until the spell ends, wind whirls around you, and you gain the following benefits:","Ranged weapon attacks made against you have disadvantage on the attack roll.","You gain a flying speed of 60 feet. If you are still flying when the spell ends, you fall, unless you can somehow prevent it.","You can use your action to create a 15-foot cube of swirling wind centered on a point you can see within 60 feet of you. Each creature in that area must make a Constitution saving throw. A creature takes 2d10 bludgeoning damage on a failed save, or half as much damage on a successful one. If a Large or smaller creature fails the save, that creature is also pushed up to 10 feet away from the center of the cube."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $a5b4afa678689007$exports = {};
$a5b4afa678689007$exports = JSON.parse('{"title":"Invisibility To Cameras (UA)","source":"Unearthed Arcana 7 - Modern Magic","levelAndSchool":"3rd-level illusion (technomagic)","level":3,"castingTime":"1 action","range":"10 feet","components":"V, S, M (a scrap of black paper)","duration":"Concentration, up to 1 minute","description":["Four creatures of your choice within range become undetectable to electronic sensors and cameras for the duration of the spell. Anything a target is wearing or carrying is likewise undetectable as long as it is on the target\u2019s person. The targets remain visible to vision."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $540576c43dd21f71$exports = {};
$540576c43dd21f71$exports = JSON.parse('{"title":"Invisibility","source":"Player\'s Handbook","levelAndSchool":"2nd-level illusion","level":2,"castingTime":"1 action","range":"Touch","components":"V, S, M (an eyelash encased in gum arabic)","duration":"Concentration, up to 1 hour","description":["A creature you touch becomes invisible until the spell ends. Anything the target is wearing or carrying is invisible as long as it is on the target\u2019s person. The spell ends for a target that attacks or casts a spell.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, you can target one additional creature for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $c861f7916e24bb54$exports = {};
$c861f7916e24bb54$exports = JSON.parse('{"title":"Invulnerability","source":"Xanathar\'s Guide to Everything","levelAndSchool":"9th-level abjuration","level":9,"castingTime":"1 action","range":"Self","components":"V, S, M (a small piece of adamantine worth at least 500 gp, which the spell consumes)","duration":"Concentration, up to 10 minutes","description":["You are immune to all damage until the spell ends."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $bd1473327f39f9e4$exports = {};
$bd1473327f39f9e4$exports = JSON.parse('{"title":"Jim\'s Glowing Coin","source":"Acquisitions Inc.","levelAndSchool":"2nd-level enchantment","level":2,"castingTime":"1 action","range":"60 feet","components":"S, M (a coin, 2 gold coins, which is consumed as tax for using the spell)","duration":"1 minute","description":["When you cast the spell, you hurl the coin that is the spell\'s material component to any spot within range. The coin lights up as if under the effect of a light spell. Each creature of your choice that you can see within 30 feet of the coin must succeed on a Wisdom saving throw or be distracted for the duration. While distracted, a creature has disadvantage on Wisdom (Perception) checks and initiative rolls."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $bd1b3d4060347d40$exports = {};
$bd1b3d4060347d40$exports = JSON.parse('{"title":"Jim\'s Magic Missile","source":"Acquisitions Inc.","levelAndSchool":"1st-level evocation","level":1,"castingTime":"1 action","range":"120 feet","components":"V, S, M (1 gold coin, which is consumed as tax for using the spell)","duration":"Instantaneous","description":["You create three twisting, whistling, hypoallergenic, gluten-free darts of magical force. Each dart can target a creature of your choice that you can see within range. Make a ranged spell attack for each missile. On a hit, the missile does 2d4 force damage.","If the attack roll scores a critical, the missile does 5d4 force damage instead of the 4d4 force that you would normally get on a critical. If any of the attack roll is a natural one, all missiles turn around and hit the caster for 1 force damage per missile.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the spell creates one more dart for each slot level above 1st. This also increases the tax by 1 gp per spell slot over 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $6d76e60090d3e3f5$exports = {};
$6d76e60090d3e3f5$exports = JSON.parse('{"title":"Jump","source":"Player\'s Handbook","levelAndSchool":"1st-level transmutation","level":1,"castingTime":"1 action","range":"Touch","components":"V, S, M (a grasshopper\u2019s hind leg)","duration":"1 minute","description":["You touch a creature. The creature\u2019s jump distance is tripled until the spell ends."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $7efd8960f0ed3d99$exports = {};
$7efd8960f0ed3d99$exports = JSON.parse('{"title":"Kinetic Jaunt","source":"Strixhaven: A Curriculum of Chaos","levelAndSchool":"2nd-level Transmutation","level":2,"castingTime":"1 bonus action","range":"Self","components":"S","duration":"Concentration, up to 1 minute","description":["You magically empower your movement with dancelike steps, giving yourself the following benefits for the duration:","Your walking speed increases by 10 feet.","You don\'t provoke opportunity attacks.","You can move through the space of another creature, and it doesn\'t count as difficult terrain. If you end your turn in another creature\'s space, you are shunted to the last unoccupied space you occupied, and you take 1d8 force damage."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $152dc79c64f59b07$exports = {};
$152dc79c64f59b07$exports = JSON.parse('{"title":"Knock","source":"Player\'s Handbook","levelAndSchool":"2nd-level transmutation","level":2,"castingTime":"1 action","range":"60 feet","components":"V","duration":"Instantaneous","description":["Choose an object that you can see within range. The object can be a door, a box, a chest, a set of manacles, a padlock, or another object that contains a mundane or magical means that prevents access.","A target that is held shut by a mundane lock or that is stuck or barred becomes unlocked, unstuck, or unbarred. If the object has multiple locks, only one of them is unlocked.","If you choose a target that is held shut with Arcane Lock, that spell is suppressed for 10 minutes, during which time the target can be opened and shut normally.","When you cast the spell, a loud knock, audible from as far away as 300 feet, emanates from the target object."],"spellLists":["http://dnd5e.wikidot.com/spell:arcane-lock","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $8381b05b2683fdbc$exports = {};
$8381b05b2683fdbc$exports = JSON.parse('{"title":"Legend Lore","source":"Player\'s Handbook","levelAndSchool":"5th-level divination","level":5,"castingTime":"10 minutes","range":"Self","components":"V, S, M (incense worth at least 250 gp, which the spell consumes, and four ivory strips worth at least 50 gp each)","duration":"Instantaneous","description":["Name or describe a person, place, or object. The spell brings to your mind a brief summary of the significant lore about the thing you named. The lore might consist of current tales, forgotten stories, or even secret lore that has never been widely known. If the thing you named isn\u2019t of legendary importance, you gain no information. The more information you already have about the thing, the more precise and detailed the information you receive is.","The information you learn is accurate but might be couched in figurative language. For example, if you have a mysterious magic axe on hand, the spell might yield this information: Woe to the evildoer whose hand touches the axe, for even the haft slices the hand of the evil ones. Only a true Child of Stone, lover and beloved of Moradin, may awaken the true powers of the axe, and only with the sacred word Rudnogg on the lips."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:wizard"]}');


var $2c51fc8e76e73251$exports = {};
$2c51fc8e76e73251$exports = JSON.parse('{"title":"Leomund\'s Secret Chest","source":"Player\'s Handbook","levelAndSchool":"4th-level conjuration","level":4,"castingTime":"1 action","range":"Touch","components":"V, S, M (an exquisite chest, 3 feet by 2 feet by 2 feet, constructed from rare materials worth at least 5,000 gp, and a Tiny replica made from the same materials worth at least 50 gp)","duration":"Instantaneous","description":["You hide a chest, and all its contents, on the Ethereal Plane. You must touch the chest and the miniature replica that serves as a material component for the spell. The chest can contain up to 12 cubic feet of nonliving material (3 feet by 2 feet by 2 feet).","While the chest remains on the Ethereal Plane, you can use an action and touch the replica to recall the chest. It appears in an unoccupied space on the ground within 5 feet of you. You can send the chest back to the Ethereal Plane by using an action and touching both the chest and the replica.","After 60 days, there is a cumulative 5 percent chance per day that the spell\u2019s effect ends. This effect ends if you cast this spell again, if the smaller replica chest is destroyed, or if you choose to end the spell as an action. If the spell ends and the larger chest is on the Ethereal Plane, it is irretrievably lost."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $c65d40e91c38f458$exports = {};
$c65d40e91c38f458$exports = JSON.parse('{"title":"Leomund\'s Tiny Hut","source":"Player\'s Handbook","levelAndSchool":"3rd-level evocation (ritual)","level":3,"castingTime":"1 minute","range":"Self (10-foot-radius hemisphere)","components":"V, S, M (a small crystal bead)","duration":"8 hours","description":["A 10-foot-radius immobile dome of force springs into existence around and above you and remains stationary for the duration. The spell ends if you leave its area.","Nine creatures of Medium size or smaller can fit inside the dome with you. The spell fails if its area includes a larger creature or more than nine creatures. Creatures and objects within the dome when you cast this spell can move through it freely. All other creatures and objects are barred from passing through it. Spells and other magical effects can\'t extend through the dome or be cast through it. The atmosphere inside the space is comfortable and dry, regardless of the weather outside.","Until the spell ends, you can command the interior to become dimly lit or dark. The dome is opaque from the outside, of any color you choose, but it is transparent from the inside."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:wizard"]}');


var $f4942c8e39a1b033$exports = {};
$f4942c8e39a1b033$exports = JSON.parse('{"title":"Lesser Restoration","source":"Player\'s Handbook","levelAndSchool":"2nd-level abjuration","level":2,"castingTime":"1 action","range":"Touch","components":"V, S","duration":"Instantaneous","description":["You touch a creature and can end either one disease or one condition afflicting it. The condition can be blinded, deafened, paralyzed, or poisoned."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:paladin","http://dnd5e.wikidot.com/spells:ranger"]}');


var $3ceac0a1eadbaaf8$exports = {};
$3ceac0a1eadbaaf8$exports = JSON.parse('{"title":"Levitate","source":"Player\'s Handbook","levelAndSchool":"2nd-level transmutation","level":2,"castingTime":"1 action","range":"60 feet","components":"V, S, M (either a small leather loop or a piece of golden wire bent into a cup shape with a long shank on one end)","duration":"Concentration, up to 10 minutes","description":["One creature or loose object of your choice that you can see within range rises vertically, up to 20 feet, and remains suspended there for the duration. The spell can levitate a target that weighs up to 500 pounds. An unwilling creature that succeeds on a Constitution saving throw is unaffected.","The target can move only by pushing or pulling against a fixed object or surface within reach (such as a wall or a ceiling), which allows it to move as if it were climbing. You can change the target\u2019s altitude by up to 20 feet in either direction on your turn. If you are the target, you can move up or down as part of your move. Otherwise, you can use your action to move the target, which must remain within the spell\u2019s range.","When the spell ends, the target floats gently to the ground if it is still aloft."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $aca93aeb10dd7c46$exports = {};
$aca93aeb10dd7c46$exports = JSON.parse('{"title":"Life Transference","source":"Xanathar\'s Guide to Everything","levelAndSchool":"3rd-level necromancy","level":3,"castingTime":"1 action","range":"30 feet","components":"V, S","duration":"Instantaneous","description":["You sacrifice some of your health to mend another creature\u2019s injuries. You take 4d8 necrotic damage, which can\u2019t be reduced in any way, and one creature of your choice that you can see within range regains a number of hit points equal to twice the necrotic damage you take.","At Higher Levels: When you cast this spell using a spell slot of 4th level or higher, the damage increases by 1d8 for each slot level above 3rd.","Spell Lists: Cleric, Wizard"],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:wizard"]}');


var $77d8c098cf8660f7$exports = {};
$77d8c098cf8660f7$exports = JSON.parse('{"title":"Light","source":"Player\'s Handbook","levelAndSchool":"Evocation cantrip","level":0,"castingTime":"1 action","range":"Touch","components":"V, M (a firefly or phosphorescent moss)","duration":"1 hour","description":["You touch one object that is no larger than 10 feet in any dimension. Until the spell ends, the object sheds bright light in a 20-foot radius and dim light for an additional 20 feet. The light can be colored as you like. Completely covering the object with something opaque blocks the light. The spell ends if you cast it again or dismiss it as an action.","If you target an object held or worn by a hostile creature, that creature must succeed on a Dexterity saving throw to avoid the spell."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $567216b7455f73ea$exports = {};
$567216b7455f73ea$exports = JSON.parse('{"title":"Lightning Arrow","source":"Player\'s Handbook","levelAndSchool":"3rd-level transmutation","level":3,"castingTime":"1 bonus action","range":"Self","components":"V, S","duration":"Concentration, up to 1 minute","description":["The next time you make a ranged weapon attack during the spell\u2019s duration, the weapon\u2019s ammunition, or the weapon itself if it\u2019s a thrown weapon, transforms into a bolt of lightning. Make the attack roll as normal. The target takes 4d8 lightning damage on a hit, or half as much damage on a miss, instead of the weapon\u2019s normal damage.","Whether you hit or miss, each creature within 10 feet of the target must make a Dexterity saving throw. Each of these creatures takes 2d8 lightning damage on a failed save, or half as much damage on a successful one.","The piece of ammunition or weapon then returns to its normal form.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, the damage for both effects of the spell increases by 1d8 for each slot level above 3rd."],"spellLists":["http://dnd5e.wikidot.com/spells:ranger"]}');


var $7a10d329896795ea$exports = {};
$7a10d329896795ea$exports = JSON.parse('{"title":"Lightning Bolt","source":"Player\'s Handbook","levelAndSchool":"3rd-level evocation","level":3,"castingTime":"1 action","range":"Self (100-foot line)","components":"V, S, M (a bit of fur and a rod of amber, crystal, or glass)","duration":"Instantaneous","description":["A stroke of lightning forming a line of 100 feet long and 5 feet wide blasts out from you in a direction you choose. Each creature in the line must make a Dexterity saving throw. A creature takes 8d6 lightning damage on a failed save, or half as much damage on a successful one.","The lightning ignites flammable objects in the area that aren\u2019t being worn or carried.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, the damage increases by 1d6 for each slot level above 3rd."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $f827229664309de1$exports = {};
$f827229664309de1$exports = JSON.parse('{"title":"Lightning Lure","source":"Tasha\'s Cauldron of Everything","levelAndSchool":"Evocation cantrip","level":0,"castingTime":"1 action","range":"Self (15-foot radius)","components":"V","duration":"Instantaneous","description":["You create a lash of lightning energy that strikes at one creature of your choice that you can see within 15 feet of you. The target must succeed on a Strength saving throw or be pulled up to 10 feet in a straight line toward you and then take 1d8 lightning damage if it is within 5 feet of you.","At Higher Levels. This spell\'s damage increases by 1d8 when you reach 5th level (2d8), 11th level (3d8), and 17th level (4d8)."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","/spells:sorcerer","/spells:warlock","/spells:wizard"]}');


var $71588ad97c2f1d38$exports = {};
$71588ad97c2f1d38$exports = JSON.parse('{"title":"Locate Animals or Plants","source":"Player\'s Handbook","levelAndSchool":"2nd-level divination (ritual)","level":2,"castingTime":"1 action","range":"Self","components":"V, S, M (a bit of fur from a bloodhound)","duration":"Instantaneous","description":["Describe or name a specific kind of beast or plant. Concentrating on the voice of nature in your surroundings, you learn the direction and distance to the closest creature or plant of that kind within 5 miles, if any are present."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger"]}');


var $b8ba7960e959166f$exports = {};
$b8ba7960e959166f$exports = JSON.parse('{"title":"Locate Creature","source":"Player\'s Handbook","levelAndSchool":"4th-level divination","level":4,"castingTime":"1 action","range":"Self","components":"V, S, M (a bit of fur from a bloodhound)","duration":"Concentration, up to 1 hour","description":["Describe or name a creature that is familiar to you. You sense the direction to the creature\u2019s location, as long as that creature is within 1,000 feet of you. If the creature is moving, you know the direction of its movement.","The spell can locate a specific creature known to you, or the nearest creature of a specific kind (such as a human or a unicorn), so long as you have seen such a creature up close \u2013 within 30 feet \u2013 at least once. If the creature you described or named is in a different form, such as being under the effects of a polymorph spell, this spell doesn\u2019t locate the creature.","This spell can\u2019t locate a creature if running water at least 10 feet wide blocks a direct path between you and the creature."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:paladin","http://dnd5e.wikidot.com/spells:ranger","http://dnd5e.wikidot.com/spells:wizard"]}');


var $2129956d6e85463c$exports = {};
$2129956d6e85463c$exports = JSON.parse('{"title":"Locate Object","source":"Player\'s Handbook","levelAndSchool":"2nd-level divination","level":2,"castingTime":"1 action","range":"Self","components":"V, S, M (a forked twig)","duration":"Concentration, up to 10 minutes","description":["Describe or name an object that is familiar to you. You sense the direction to the object\u2019s location, as long as that object is within 1,000 feet of you. If the object is in motion, you know the direction of its movement.","The spell can locate a specific object known to you, as long as you have seen it up close \u2013 within 30 feet \u2013 at least once. Alternatively, the spell can locate the nearest object of a particular kind, such as a certain kind of apparel, jewelry, furniture, tool, or weapon.","This spell can\u2019t locate an object if any thickness of lead, even a thin sheet, blocks a direct path between you and the object."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:paladin","http://dnd5e.wikidot.com/spells:ranger","http://dnd5e.wikidot.com/spells:wizard"]}');


var $cb39f790cc1fbca0$exports = {};
$cb39f790cc1fbca0$exports = JSON.parse('{"title":"Longstrider","source":"Player\'s Handbook","levelAndSchool":"1st-level transmutation","level":1,"castingTime":"1 action","range":"Touch","components":"V, S, M (a pinch of dirt)","duration":"1 hour","description":["You touch a creature. The target\u2019s speed increases by 10 feet until the spell ends.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, you can target one additional creature for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger","http://dnd5e.wikidot.com/spells:wizard"]}');


var $527f324f1d182b8d$exports = {};
$527f324f1d182b8d$exports = JSON.parse('{"title":"Maddening Darkness","source":"Xanathar\'s Guide to Everything","levelAndSchool":"8th-level evocation","level":8,"castingTime":"1 action","range":"150 feet","components":"V, M (a drop of pitch mixed with a drop of mercury)","duration":"Concentration, up to 10 minutes","description":["Magical darkness spreads from a point you choose within range to fill a 60-foot-radius sphere until the spell ends. The darkness spreads around corners. A creature with darkvision can\u2019t see through this darkness. Nonmagical light, as well as light created by spells of 8th level or lower, can\'t illuminate the area. Shrieks, gibbering, and mad laughter can be heard within the sphere. Whenever a creature starts its turn in the sphere, it must make a Wisdom saving throw, taking 8d8 psychic damage on a failed save, or half as much damage on a successful one."],"spellLists":["http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $8629aa34fee555b1$exports = {};
$8629aa34fee555b1$exports = JSON.parse('{"title":"Maelstrom","source":"Xanathar\'s Guide to Everything","levelAndSchool":"5th-level evocation","level":5,"castingTime":"1 action","range":"120 feet","components":"V, S, M (paper or leaf in the shape of a funnel)","duration":"Concentration, up to 1 minute","description":["A mass of 5-foot-deep water appears and swirls in a 30-foot radius centered on a point you can see within range. The point must be on ground or in a body of water. Until the spell ends, that area is difficult terrain, and any creature that starts its turn there must succeed on a Strength saving throw or take 6d6 bludgeoning damage and be pulled 10 feet toward the center."],"spellLists":["http://dnd5e.wikidot.com/spells:druid"]}');


var $8fb380daec6a8b26$exports = {};
$8fb380daec6a8b26$exports = JSON.parse('{"title":"Mage Armor","source":"Player\'s Handbook","levelAndSchool":"1st-level abjuration","level":1,"castingTime":"1 action","range":"Touch","components":"V, S, M (a piece of cured leather)","duration":"8 hours","description":["You touch a willing creature who isn\u2019t wearing armor, and a protective magical force surrounds it until the spell ends. The target\u2019s base AC becomes 13 + its Dexterity modifier. The spell ends if the target dons armor or if you dismiss the spell as an action."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $f005a9f6083f7504$exports = {};
$f005a9f6083f7504$exports = JSON.parse('{"title":"Mage Hand","source":"Player\'s Handbook","levelAndSchool":"Conjuration cantrip","level":0,"castingTime":"1 action","range":"30 feet","components":"V, S","duration":"1 minute","description":["A spectral, floating hand appears at a point you choose within range. The hand lasts for the duration or until you dismiss it as an action. The hand vanishes if it is ever more than 30 feet away from you or if you cast this spell again.","You can use your action to control the hand. You can use the hand to manipulate an object, open an unlocked door or container, stow or retrieve an item from an open container, or pour the contents out of a vial. You can move the hand up to 30 feet each time you use it.","The hand can\u2019t attack, activate magical items, or carry more than 10 pounds."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $e453c26816519957$exports = {};
$e453c26816519957$exports = JSON.parse('{"title":"Magic Circle","source":"Player\'s Handbook","levelAndSchool":"3rd-level abjuration","level":3,"castingTime":"1 minute","range":"10 feet","components":"V, S, M (holy water or powdered silver and iron worth at least 100 gp, which the spell consumes)","duration":"1 hour","description":["You create a 10-foot-radius, 20-foot-tall cylinder of magical energy centered on a point on the ground that you can see within range. Glowing runes appear wherever the cylinder intersects with the floor or other surface.","Choose one or more of the following types of creatures: celestials, elementals, fey, fiends, or undead. The circle affects a creature of the chosen type in the following ways:","The creature can\u2019t willingly enter the cylinder by nonmagical means. If the creature tries to use teleportation or interplanar travel to do so, it must first succeed on a Charisma saving throw.","The creature has disadvantage on attack rolls against targets within the cylinder.","Targets within the cylinder can\u2019t be charmed, frightened, or possessed by the creature.","When you cast this spell, you can elect to cause its magic to operate in the reverse direction, preventing a creature of the specified type from leaving the cylinder and protecting targets outside it.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, the duration increases by 1 hour for each slot level above 3rd."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:paladin","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $c3042a28bb0d6de0$exports = {};
$c3042a28bb0d6de0$exports = JSON.parse('{"title":"Magic Jar","source":"Player\'s Handbook","levelAndSchool":"6th-level necromancy","level":6,"castingTime":"1 minute","range":"Self","components":"V, S, M (a gem, crystal, reliquary, or some other ornamental container worth at least 500 gp)","duration":"Until dispelled","description":["Your body falls into a catatonic state as your soul leaves it and enters the container you used for the spell\u2019s material component. While your soul inhabits the container, you are aware of your surroundings as if you were in the container\u2019s space. You can\u2019t move or use reactions. The only action you can take is to project your soul up to 100 feet out of the container, either returning to your living body (and ending the spell) or attempting to possess a humanoids body.","You can attempt to possess any humanoid within 100 feet of you that you can see (creatures warded by a protection from evil and good or magic circle spells can\u2019t be possessed). The target must make a Charisma saving throw. On a failure, your soul moves into the target\u2019s body, and the target\u2019s soul becomes trapped in the container. On a success, the target resists your efforts to possess it, and you can\u2019t attempt to possess it again for 24 hours.","Once you possess a creature\u2019s body, you control it. Your game statistics are replaced by the statistics of the creature though you retain your alignment and your Intelligence, Wisdom, and Charisma scores. You retain the benefit of your own class features. If the target has any class levels, you can\u2019t use any of its class features.","Meanwhile, the possessed creature\u2019s soul can perceive from the container using its own senses, but it can\u2019t move or take actions at all.","While possessing a body, you can use your action to return from the host body to the container if it is within 100 feet of you, returning the host creature\u2019s soul to its body. If the host body dies while you\u2019re in it, the creature dies, and you must make a Charisma saving throw against your own spellcasting DC. On a success, you return to the container if it is within 100 feet of you. Otherwise, you die.","If the container is destroyed or the spell ends, your soul immediately returns to your body. If your body is more than 100 feet away from you, or if your body is dead when you attempt to return to it, you die. If another creature\u2019s soul is in the container when it is destroyed, the creature\u2019s soul returns to its body if the body is alive and within 100 feet. Otherwise, that creature dies.","When the spell ends, the container is destroyed."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $4fd887c87f04178b$exports = {};
$4fd887c87f04178b$exports = JSON.parse('{"title":"Magic Missile","source":"Player\'s Handbook","levelAndSchool":"1st-level evocation","level":1,"castingTime":"1 action","range":"120 feet","components":"V, S","duration":"Instantaneous","description":["You create three glowing darts of magical force. Each dart hits a creature of your choice that you can see within range. A dart deals 1d4 + 1 force damage to its target. The darts all strike simultaneously and you can direct them to hit one creature or several.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the spell creates one more dart for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $1cdd0125c29d580d$exports = {};
$1cdd0125c29d580d$exports = JSON.parse('{"title":"Magic Mouth","source":"Player\'s Handbook","levelAndSchool":"2nd-level illusion (ritual)","level":2,"castingTime":"1 minute","range":"30 feet","components":"V, S, M (a small bit of honeycomb and jade dust worth at least 10 gp, which the spell consumes)","duration":"Until dispelled","description":["You implant a message within an object in range, a message that is uttered when a trigger condition is met. Choose an object that you can see and that isn\u2019t being worn or carried by another creature. Then speak the message, which must be 25 words or less, though it can be delivered over as long as 10 minutes. Finally, determine the circumstance that will trigger the spell to deliver your message.","When that circumstance occurs, a magical mouth appears on the object and recites the message in your voice and at the same volume you spoke. If the object you chose has a mouth or something that looks like a mouth (for example, the mouth of a statue), the magical mouth appears there so that words appear to come from the object\u2019s mouth. When you cast this spell, you can have the spell end after it delivers its message, or it can remain and repeats its message whenever the trigger occurs.","The triggering circumstance can be as general or as detailed as you like, though it must be based on visual or audible conditions that occur within 30 feet of the object. For example, you could instruct the mouth to speak when any creature moves within 30 feet of the object or when a silver bell rings within 30 feet of it."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:wizard"]}');


var $868fad740224b6ea$exports = {};
$868fad740224b6ea$exports = JSON.parse('{"title":"Magic Stone","source":"Xanathar\'s Guide to Everything/Elemental Evil Player\'s Companion","levelAndSchool":"Transmutation cantrip","level":0,"castingTime":"1 bonus action","range":"Touch","components":"V, S","duration":"1 minute","description":["You touch one to three pebbles and imbue them with magic. You or someone else can make a ranged spell attack with one of the pebbles by throwing it or hurling it with a sling. If thrown, it has a range of 60 feet. If someone else attacks with the pebble, that attacker adds your spellcasting ability modifier, not the attacker\u2019s, to the attack roll. On a hit, the target takes bludgeoning damage equal to 1d6 + your spellcasting ability modifier. Hit or miss, the spell then ends on the stone.","If you cast this spell again, the spell ends early on any pebbles still affected by it."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:artificer"]}');


var $a0390db2158fa958$exports = {};
$a0390db2158fa958$exports = JSON.parse('{"title":"Magic Weapon","source":"Player\'s Handbook","levelAndSchool":"2nd-level transmutation","level":2,"castingTime":"1 bonus action","range":"Touch","components":"V, S","duration":"Concentration, up to 1 hour","description":["You touch a nonmagical weapon. Until the spell ends, that weapon becomes a magic weapon with a +1 bonus to attack rolls and damage rolls.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, the bonus increases to +2. When you use a spell slot of 6th level or higher, the bonus increases to +3."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:paladin","/spells:ranger","/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $f24067d92e033acb$exports = {};
$f24067d92e033acb$exports = JSON.parse('{"title":"Magnify Gravity","source":"Explorer\'s Guide to Wildemount","levelAndSchool":"1st-level transmutation (dunamancy:graviturgy)","level":1,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"1 round","description":["The gravity in a 10-foot-radius sphere centered on a point you can see within range increases for a moment. Each creature in the sphere on the turn when you cast the spell must make a Constitution saving throw. On a failed save, a creature takes 2d8 force damage, and its speed is halved until the end of its next turn. On a successful save, a creature takes half as much damage and suffers no reduction to its speed.","Until the start of your next turn, any object that isn\'t being worn or carried in the sphere requires a successful Strength check against your spell save DC to pick up or move.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the damage increases by 1d8 for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $fd87330567d9ea44$exports = {};
$fd87330567d9ea44$exports = JSON.parse('{"title":"Major Image","source":"Player\'s Handbook","levelAndSchool":"3rd-level illusion","level":3,"castingTime":"1 action","range":"120 feet","components":"V, S, M (a bit of fleece)","duration":"Concentration, up to 10 minutes","description":["You create the image of an object, a creature, or some other visible phenomenon that is no larger than a 20-foot cube. The image appears at a spot that you can see within range and lasts for the duration. It seems completely real, including sounds, smells, and temperature appropriate to the thing depicted. You can\u2019t create sufficient heat or cold to cause damage, a sound loud enough to deal thunder damage or deafen a creature, or a smell that might sicken a creature (like a troglodyte\u2019s stench).","As long as you are within range of the illusion, you can use your action to cause the image to move to any other spot within range. As the image changes location, you can alter its appearance so that its movements appear natural for the image. For example, if you create an image of a creature and move it, you can alter the image so that it appears to be walking. Similarly, you can cause the illusion to make different sounds at different times, even making it carry on a conversation, for example.","Physical interaction with the image reveals it to be an illusion, because things can pass through it. A creature that uses its action to examine the image can determine that it is an illusion with a successful Intelligence (Investigation) check against your spell save DC. If a creature discerns the illusion for what it is, the creature can see through the image, and its other sensory qualities become faint to the creature.","At Higher Levels. When you cast this spell using a spell slot of 6th level or higher, the spell lasts until dispelled, without requiring your concentration. In this form it is sometimes considered a different spell, known as Permanent Image."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $3a2946c1e33912a0$exports = {};
$3a2946c1e33912a0$exports = JSON.parse('{"title":"Mass Cure Wounds","source":"Player\'s Handbook","levelAndSchool":"5th-level evocation","level":5,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Instantaneous","description":["A wave of healing energy washes out from a point of your choice within range. Choose up to six creatures in a 30-foot-radius sphere centered on that point. Each target regains hit points equal to 3d8 + your spellcasting ability modifier. This spell has no effect on undead or constructs.","At Higher Levels. When you cast this spell using a spell slot of 6th level or higher, the healing increases by 1d8 for each slot level above 5th."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid"]}');


var $86bf85314052754e$exports = {};
$86bf85314052754e$exports = JSON.parse('{"title":"Mass Heal","source":"Player\'s Handbook","levelAndSchool":"9th-level evocation","level":9,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Instantaneous","description":["A flood of healing energy flows from you into injured creatures around you. You restore up to 700 hit points, divided as you choose among any number of creatures that you can see within range. Creatures healed by this spell are also cured of all diseases and any effect making them blinded or deafened. This spell has no effect on undead or constructs."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric"]}');


var $31b4f69eae865326$exports = {};
$31b4f69eae865326$exports = JSON.parse('{"title":"Mass Healing Word","source":"Player\'s Handbook","levelAndSchool":"3rd-level evocation","level":3,"castingTime":"1 bonus action","range":"60 feet","components":"V","duration":"Instantaneous","description":["As you call out words of restoration, up to six creatures of your choice that you can see within range regain hit points equal to 1d4 + your spellcasting ability modifier. This spell has no effect on undead or constructs.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, the healing increases by 1d4 for each slot level above 3rd."],"spellLists":["/spells:bard","http://dnd5e.wikidot.com/spells:cleric"]}');


var $3b5f10fd2271f3e1$exports = {};
$3b5f10fd2271f3e1$exports = JSON.parse('{"title":"Mass Polymorph","source":"Xanathar\'s Guide to Everything","levelAndSchool":"9th-level transmutation","level":9,"castingTime":"1 Action","range":"120 feet","components":"V, S, M (a caterpillar cocoon)","duration":"Concentration, up to 1 hour","description":["You transform up to ten creatures of your choice that you can see within range. An unwilling target must succeed on a Wisdom saving throw to resist the transformation. An unwilling shapechanger automatically succeeds on the save.","Each target assumes a beast form of your choice, and you can choose the same form or different ones for each target. The new form can be any beast you have seen whose challenge rating is equal to or less than the target\u2019s (or half the target\u2019s level, if the target doesn\u2019t have a challenge rating). The target\u2019s game statistics, including mental ability scores, are replaced by the statistics of the chosen beast, but the target retains its hit points, alignment, and personality.","Each target gains a number of temporary hit points equal to the hit points of its new form. These temporary hit points can\u2019t be replaced by temporary hit points from another source. A target reverts to its normal form when it has no more temporary hit points or it dies. If the spell ends before then, the creature loses all its temporary hit points and reverts to its normal form.","The creature is limited in the actions it can perform by the nature of its new form. It can\u2019t speak, cast spells, or do anything else that requires hands or speech. The target\u2019s gear melds into the new form.","The target can\u2019t activate, use, wield, or otherwise benefit from any of its equipment."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $355f098f99c19073$exports = {};
$355f098f99c19073$exports = JSON.parse('{"title":"Mass Suggestion","source":"Player\'s Handbook","levelAndSchool":"6th-level enchantment","level":6,"castingTime":"1 action","range":"60 feet","components":"V, M (a snake\u2019s tongue and either a bit of honeycomb or a drop of sweet oil)","duration":"24 hours","description":["You suggest a course of activity (limited to a sentence or two) and magically influence up to twelve creatures of your choice that you can see within range and that can hear and understand you. Creatures that can\u2019t be charmed are immune to this effect. The suggestion must be worded in such a manner as to make the course of action sound reasonable. Asking the creature to stab itself, throw itself onto a spear, immolate itself, or do some other obviously harmful act automatically negates the effect of the spell.","Each target must make a Wisdom saving throw. On a failed save, it pursues the course of action you described to the best of its ability. The suggested course of action can continue for the entire duration. If the suggested activity can be completed in a shorter time, the spell ends when the subject finishes what it was asked to do.","You can also specify conditions that will trigger a special activity during the duration. For example, you might suggest that a group of soldiers give all their money to the first beggar they meet. If the condition isn\u2019t met before the spell ends, the activity isn\u2019t performed.","If you or any of your companions damage a creature affected by this spell, the spell ends for that creature.","At Higher Levels. When you cast this spell using a 7th-level spell slot, the duration is 10 days. When you use an 8th-level spell slot, the duration is 30 days. When you use a 9th-level spell slot, the duration is a year and a day."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $f7a39d12d99c9334$exports = {};
$f7a39d12d99c9334$exports = JSON.parse('{"title":"Maximillian\'s Earthen Grasp","source":"Xanathar\'s Guide to Everything","levelAndSchool":"2nd-level transmutation","level":2,"castingTime":"1 action","range":"30 feet","components":"V, S, M (a miniature hand sculpted from clay)","duration":"Concentration, up to 1 minute","description":["You choose a 5-foot-square unoccupied space on the ground that you can see within range. A Medium hand made from compacted soil rises there and reaches for one creature you can see within 5 feet of it. The target must make a Strength saving throw. On a failed save, the target takes 2d6 bludgeoning damage and is restrained for the spell\u2019s duration.","As an action, you can cause the hand to crush the restrained target, who must make a Strength saving throw. It takes 2d6 bludgeoning damage on a failed save, or half as much damage on a successful one.","To break out, the restrained target can use its action to make a Strength check against your spell save DC. On a success, the target escapes and is no longer restrained by the hand.","As an action, you can cause the hand to reach for a different creature or to move to a different unoccupied space within range. The hand releases a restrained target if you do either."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $9e47ec657bf91a66$exports = {};
$9e47ec657bf91a66$exports = JSON.parse('{"title":"Maze","source":"Player\'s Handbook","levelAndSchool":"8th-level conjuration","level":8,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Concentration, up to 10 minutes","description":["You banish a creature that you can see within range into a labyrinthine demiplane. The target remains there for the duration or until it escapes the maze.","The target can use its action to attempt to escape. When it does so, it makes a DC 20 Intelligence check. If it succeeds, it escapes, and the spell ends (a minotaur or goristro demon automatically succeeds).","When the spell ends, the target reappears in the space it left or, if that space is occupied, in the nearest unoccupied space."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $3820ed5eb937a372$exports = {};
$3820ed5eb937a372$exports = JSON.parse('{"title":"Meld into Stone","source":"Player\'s Handbook","levelAndSchool":"3rd-level transmutation (ritual)","level":3,"castingTime":"1 action","range":"Touch","components":"V, S","duration":"8 hours","description":["You step into a stone object or surface large enough to fully contain your body, melding yourself and all the equipment you carry with the stone for the duration. Using your movement, you step into the stone at a point you can touch. Nothing of your presence remains visible or otherwise detectable by nonmagical senses.","While merged with the stone, you can\u2019t see what occurs outside it, and any Wisdom (Perception) checks you make to hear sounds outside it are made with disadvantage. You remain aware of the passage of time and can cast spells on yourself while merged in the stone. You can use your movement to leave the stone where you entered it, which ends the spell. You otherwise can\u2019t move.","Minor physical damage to the stone doesn\u2019t harm you, but its partial destruction or a change in its shape (to the extent that you no longer fit within it) expels you and deals 6d6 bludgeoning damage to you. The stone\u2019s complete destruction (or transmutation into a different substance) expels you and deals 50 bludgeoning damage to you. If expelled, you fall prone in an unoccupied space closest to where you first entered."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","/spells:ranger"]}');


var $caf8b16e57c9f44c$exports = {};
$caf8b16e57c9f44c$exports = JSON.parse('{"title":"Melf\'s Acid Arrow","source":"Player\'s Handbook","levelAndSchool":"2nd-level evocation","level":2,"castingTime":"1 action","range":"90 feet","components":"V, S, M (powdered rhubarb leaf and an adder\u2019s stomach)","duration":"Instantaneous","description":["A shimmering green arrow streaks toward a target within range and bursts in a spray of acid. Make a ranged spell attack against the target. On a hit, the target takes 4d4 acid damage immediately and 2d4 acid damage at the end of its next turn. On a miss, the arrow splashes the target with acid for half as much of the initial damage and no damage at the end of its next turn.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, the damage (both initial and later) increases by 1d4 for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $778d3295df263d31$exports = {};
$778d3295df263d31$exports = JSON.parse('{"title":"Melf\'s Minute Meteors","source":"Xanathar\'s Guide to Everything","levelAndSchool":"3rd-level evocation","level":3,"castingTime":"1 action","range":"Self","components":"V, S, M (niter, sulfur, and pine tar formed into a bead)","duration":"Concentration, up to 10 minutes","description":["You create six tiny meteors in your space. They float in the air and orbit you for the spell\u2019s duration. When you cast the spell \u2014 and as a bonus action on each of your turns thereafter \u2014 you can expend one or two of the meteors, sending them streaking toward a point or points you choose within 120 feet of you. Once a meteor reaches its destination or impacts against a solid surface, the meteor explodes. Each creature within 5 feet of the point where the meteor explodes must make a Dexterity saving throw. A creature takes 2d6 fire damage on a failed save, or half as much damage on a successful one.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, the number of meteors created increases by two for each slot level above 3rd."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $309bc76fbcafdf85$exports = {};
$309bc76fbcafdf85$exports = JSON.parse('{"title":"Mending","source":"Player\'s Handbook","levelAndSchool":"Transmutation cantrip","level":0,"castingTime":"1 minute","range":"Touch","components":"V, S, M (two lodestones)","duration":"Instantaneous","description":["This spell repairs a single break or tear in an object you touch, such as a broken chain link, two halves of a broken key, a torn cloak, or a leaking wineskin. As long as the break or tear is no larger than 1 foot in any dimension, you mend it, leaving no trace of the former damage.","This spell can physically repair a magic item or construct, but the spell can\u2019t restore magic to such an object."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $52b296c806cc34cc$exports = {};
$52b296c806cc34cc$exports = JSON.parse('{"title":"Mental Barrier (UA)","source":"Unearthed Arcana 66 - Fighter, Rogue, and Wizard","levelAndSchool":"2nd-level abjuration","level":2,"castingTime":"1 reaction, which you take when you are forced to make an Intelligence, a Wisdom, or a Charisma saving throw","range":"Self","components":"V","duration":"1 round","description":["You protect your mind with a wall of looping, repetitive thought. Until the start of your next turn, you have advantage on Intelligence, Wisdom, and Charisma saving throws, and you have resistance to psychic damage."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $2023a1954a9f2216$exports = {};
$2023a1954a9f2216$exports = JSON.parse('{"title":"Mental Prison","source":"Xanathar\'s Guide to Everything","levelAndSchool":"6th-level illusion","level":6,"castingTime":"1 action","range":"60 feet","components":"S","duration":"Concentration, up to 1 minute","description":["You attempt to bind a creature within an illusory cell that only it perceives. One creature you can see within range must make an Intelligence saving throw. The target succeeds automatically if it is immune to being charmed. On a successful save, the target takes 5d10 psychic damage, and the spell ends. On a failed save, the target takes 5d10 psychic damage, and you make the area immediately around the target\u2019s space appear dangerous to it in some way. You might cause the target to perceive itself as being surrounded by fire, floating razors, or hideous maws filled with dripping teeth. Whatever form the illusion takes, the target can\u2019t see or hear anything beyond it and is restrained for the spell\u2019s duration. If the target is moved out of the illusion, makes a melee attack through it, or reaches any part of its body through it, the target takes 10d10 psychic damage, and the spell ends."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $1bf6c3da2507b508$exports = {};
$1bf6c3da2507b508$exports = JSON.parse('{"title":"Message","source":"Player\'s Handbook","levelAndSchool":"Transmutation cantrip","level":0,"castingTime":"1 action","range":"120 feet","components":"V, S, M (a short piece of copper wire)","duration":"1 round","description":["You point your finger toward a creature within range and whisper a message. The target (and only the target) hears the message and can reply in a whisper that only you can hear.","You can cast this spell through solid objects if you are familiar with the target and know it is beyond the barrier. Magical silence, 1 foot of stone, 1 inch of common metal, a thin sheet of lead, or 3 feet of wood blocks the spell. The spell doesn\u2019t have to follow a straight line and can travel freely around corners or through openings."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $bc8a5d3d64ce61ad$exports = {};
$bc8a5d3d64ce61ad$exports = JSON.parse('{"title":"Meteor Swarm","source":"Player\'s Handbook","levelAndSchool":"9th-level evocation","level":9,"castingTime":"1 action","range":"1 mile","components":"V, S","duration":"Instantaneous","description":["Blazing orbs of fire plummet to the ground at four different points you can see within range. Each creature in a 40-foot-radius sphere centered on each point you choose must make a Dexterity saving throw. The sphere spreads around corners. A creature takes 20d6 fire damage and 20d6 bludgeoning damage on a failed save, or half as much damage on a successful one. A creature in the area of more than one fiery burst is affected only once.","The spell damages objects in the area and ignites flammable objects that aren\u2019t being worn or carried."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $70cb56c95afacede$exports = {};
$70cb56c95afacede$exports = JSON.parse('{"title":"Mighty Fortress","source":"Xanathar\'s Guide to Everything","levelAndSchool":"8th-level conjuration","level":8,"castingTime":"1 minute","range":"1 mile","components":"V, S, M (a diamond worth at least 500 gp, which the spell consumes)","duration":"Instantaneous","description":["A fortress of stone erupts from a square area of ground of your choice that you can see within range. The area is 120 feet on each side, and it must not have any buildings or other structures on it. Any creatures in the area are harmlessly lifted up as the fortress rises.","The fortress has four turrets with square bases, each one 20 feet on a side and 30 feet tall, with one turret on each corner. The turrets are connected to each other by stone walls that are each 80 feet long, creating an enclosed area. Each wall is 1 foot thick and is composed of panels that are 10 feet wide and 20 feet tall. Each panel is contiguous with two other panels or one other panel and a turret. You can place up to four stone doors in the fortress\u2019s outer wall.","A small keep stands inside the enclosed area. The keep has a square base that is 50 feet on each side, and it has three floors with 10-foot-high ceilings. Each of the floors can be divided into as many rooms as you like, provided each room is at least 5 feet on each side. The floors of the keep are connected by stone staircases, its walls are 6 inches thick, and interior rooms can have stone doors or open archways as you choose. The keep is furnished and decorated however you like, and it contains sufficient food to serve a nine-course banquet for up to 100 people each day. Furnishings, food, and other objects created by this spell crumble to dust if removed from the fortress.","A staff of one hundred invisible servants obeys any command given to them by creatures you designate when you cast the spell. Each servant functions as if created by the unseen servant spell.","The walls, turrets, and keep are all made of stone that can be damaged. Each 10-foot by 10-foot section of stone has AC 15 and 30 hit points per inch of thickness. It is immune to poison and psychic damage. Reducing a section of stone to 0 hit points destroys it and might cause connected sections to buckle and collapse at the DM\u2019s discretion.","After 7 days or when you cast this spell somewhere else, the fortress harmlessly crumbles and sinks back into the ground, leaving any creatures that were inside it safely on the ground.","Casting this spell on the same spot once every 7 days for a year makes the fortress permanent."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $83aaa28e66b80ad0$exports = {};
$83aaa28e66b80ad0$exports = JSON.parse('{"title":"Mind Blank","source":"Player\'s Handbook","levelAndSchool":"8th-level abjuration","level":8,"castingTime":"1 action","range":"Touch","components":"V, S","duration":"24 hours","description":["Until the spell ends, one willing creature you touch is immune to psychic damage, any effect that would sense its emotions or read its thoughts, divination spells, and the charmed condition. The spell even foils wish spells and spells or effects of similar power used to affect the target\'s mind or to gain information about the target."],"spellLists":["/spell:wish","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:wizard"]}');


var $a0897ccf2e27ffb1$exports = {};
$a0897ccf2e27ffb1$exports = JSON.parse('{"title":"Mind Sliver","source":"Tasha\'s Cauldron of Everything","levelAndSchool":"Enchantment cantrip","level":0,"castingTime":"1 action","range":"60 feet","components":"V","duration":"1 round","description":["You drive a disorienting spike of psychic energy into the mind of one creature you can see within range. The target must succeed on an Intelligence saving throw or take 1d6 psychic damage and subtract 1d4 from the next saving throw it makes before the end of your next turn.","At Higher Levels. This spell\u2019s damage increases by 1d6 when you reach certain levels: 5th level (2d6), 11th level (3d6), and 17th level (4d6)."],"spellLists":["/spells:sorcerer","/spells:warlock","/spells:wizard"]}');


var $f8122185344ba600$exports = {};
$f8122185344ba600$exports = JSON.parse('{"title":"Mind Spike","source":"Xanathar\'s Guide to Everything","levelAndSchool":"2nd-level divination","level":2,"castingTime":"1 action","range":"60 feet","components":"S","duration":"Concentration, up to 1 hour","description":["You reach into the mind of one creature you can see within range. The target must make a Wisdom saving throw, taking 3d8 psychic damage on a failed save, or half as much damage on a successful one. On a failed save, you also always know the target\'s location until the spell ends, but only while the two of you are on the same plane of existence. While you have this knowledge, the target can\u2019t become hidden from you, and if it\u2019s invisible, it gains no benefit from that condition against you.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, the damage increases by 1d8 for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $2ae40a09c583d765$exports = {};
$2ae40a09c583d765$exports = JSON.parse('{"title":"Mind Thrust (UA)","source":"Unearthed Arcana 71 - Psionic Options Revisited","levelAndSchool":"2nd-level enchantment","level":2,"castingTime":"1 bonus action","range":"60 feet","components":"V, S","duration":"1 round","description":["You thrust a lance of psychic disruption into the mind of one creature you can see within range. The target must make an Intelligence saving throw. On a failed save, the target takes 3d6 psychic damage, and it can\u2019t take a reaction until the end of its next turn. Moreover, on its next turn, it must choose whether it gets a move, an action, or a bonus action; it gets only one of the three. On a successful save, the target takes half as much damage and suffers none of the spell\u2019s other effects.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, you can target one additional creature for each slot level above 2nd. The creatures must be within 30 feet of each other when you target them."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $517cbbe9883506e9$exports = {};
$517cbbe9883506e9$exports = JSON.parse('{"title":"Minor Illusion","source":"Player\'s Handbook","levelAndSchool":"Illusion cantrip","level":0,"castingTime":"1 action","range":"30 feet","components":"S, M (a bit of fleece)","duration":"1 minute","description":["You create a sound or an image of an object within range that lasts for the duration. The illusion also ends if you dismiss it as an action or cast this spell again.","If you create a sound, its volume can range from a whisper to a scream. It can be your voice, someone else\u2019s voice, a lion\u2019s roar, a beating of drums, or any other sound you choose. The sound continues unabated throughout the duration, or you can make discrete sounds at different times before the spell ends.","If you create an image of an object\u2014such as a chair, muddy footprints, or a small chest\u2014it must be no larger than a 5-foot cube. The image can\u2019t create sound, light, smell, or any other sensory effect. Physical interaction with the image reveals it to be an illusion, because things can pass through it.","If a creature uses its action to examine the sound or image, the creature can determine that it is an illusion with a successful Intelligence (Investigation) check against your spell save DC. If a creature discerns the illusion for what it is, the illusion becomes faint to the creature."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $33768f27f0dbb53c$exports = {};
$33768f27f0dbb53c$exports = JSON.parse('{"title":"Mirage Arcane","source":"Player\'s Handbook","levelAndSchool":"7th-level illusion","level":7,"castingTime":"10 minutes","range":"Sight","components":"V, S","duration":"10 days","description":["You make terrain in an area up to 1 mile square look, sound, smell, and even feel like some other sort of terrain. The terrain\u2019s general shape remains the same, however. Open fields or a road could be made to resemble a swamp, hill, crevasse, or some other difficult or impassable terrain. A pond can be made to seem like a grassy meadow, a precipice like a gentle slope, or a rock-strewn gully like a wide and smooth road.","Similarly, you can alter the appearance of structures, or add them where none are present. The spell doesn\u2019t disguise, conceal, or add creatures.","The illusion includes audible, visual, tactile, and olfactory elements, so it can turn clear ground into difficult terrain (or vice versa) or otherwise impede movement through the area. Any piece of the illusory terrain (such as a rock or stick) that is removed from the spell\u2019s area disappears immediately.","Creatures with truesight can see through the illusion to the terrain\u2019s true form;\xa0however, all other elements of the illusion remain, so while the creature is aware of the illusion\u2019s presence, the creature can still physically interact with the illusion."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:wizard"]}');


var $6880821719308712$exports = {};
$6880821719308712$exports = JSON.parse('{"title":"Mirror Image","source":"Player\'s Handbook","levelAndSchool":"2nd-level illusion","level":2,"castingTime":"1 action","range":"Self","components":"V, S","duration":"1 minute","description":["Three illusory duplicates of yourself appear in your space. Until the spell ends, the duplicates move with you and mimic your actions, shifting position so it\u2019s impossible to track which image is real. You can use your action to dismiss the illusory duplicates.","Each time a creature targets you with an attack during the spell\u2019s duration, roll a d20 to determine whether the attack instead targets one of your duplicates.","If you have three duplicates, you must roll a 6 or higher to change the attack\u2019s target to a duplicate. With two duplicates, you must roll an 8 or higher. With one duplicate, you must roll an 11 or higher.","A duplicate\u2019s AC equals 10 + your Dexterity modifier. If an attack hits a duplicate, the duplicate is destroyed. A duplicate can be destroyed only by an attack that hits it. It ignores all other damage and effects. The spell ends when all three duplicates are destroyed.","A creature is unaffected by this spell if it can\u2019t see, if it relies on senses other than sight, such as blindsight, or if it can perceive illusions as false, as with truesight."],"spellLists":["/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $bbdd5f05276606ad$exports = {};
$bbdd5f05276606ad$exports = JSON.parse('{"title":"Mislead","source":"Player\'s Handbook","levelAndSchool":"5th-level illusion","level":5,"castingTime":"1 action","range":"Self","components":"S","duration":"Concentration, up to 1 hour","description":["You become invisible at the same time that an illusory double of you appears where you are standing. The double lasts for the duration, but the invisibility ends if you attack or cast a spell.","You can use your action to move your illusory double up to twice your speed and make it gesture, speak, and behave in whatever way you choose.","You can see through its eyes and hear through its ears as if you were located where it is. On each of your turns as a bonus action, you can switch from using its senses to using your own, or back again. While you are using its senses, you are blinded and deafened in regard to your own surroundings."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $871d4405e5fed229$exports = {};
$871d4405e5fed229$exports = JSON.parse('{"title":"Misty Step","source":"Player\'s Handbook","levelAndSchool":"2nd-level conjuration","level":2,"castingTime":"1 bonus action","range":"Self","components":"V","duration":"Instantaneous","description":["Briefly surrounded by silvery mist, you teleport up to 30 feet to an unoccupied space that you can see."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $a04c676dcd7504b3$exports = {};
$a04c676dcd7504b3$exports = JSON.parse('{"title":"Modify Memory","source":"Player\'s Handbook","levelAndSchool":"5th-level enchantment","level":5,"castingTime":"1 action","range":"30 feet","components":"V, S","duration":"Concentration, up to 1 minute","description":["You attempt to reshape another creature\u2019s memories. One creature that you can see must make a Wisdom saving throw. If you are fighting the creature, it has advantage on the saving throw. On a failed save, the target becomes charmed by you for the duration. The charmed target is incapacitated and unaware of its surroundings, though it can still hear you. If it takes any damage or is targeted by another spell, this spell ends, and none of the target\u2019s memories are modified.","While this charm lasts, you can affect the target\u2019s memory of an event that it experienced within the last 24 hours and that lasted no more than 10 minutes. You can permanently eliminate all memory of the event, allow the target to recall the event with perfect clarity and exacting detail, change its memory of the details of the event, or create a memory of some other event.","You must speak to the target to describe how its memories are affected, and it must be able to understand your language for the modified memories to take root. Its mind fills in any gaps in the details of your description. If the spell ends before you have finished describing the modified memories, the creature\u2019s memory isn\u2019t altered. Otherwise, the modified memories take hold when the spell ends.","A modified memory doesn\u2019t necessarily affect how a creature behaves, particularly if the memory contradicts the creature\u2019s natural inclinations, alignment, or beliefs. An illogical modified memory, such as implanting a memory of how much the creature enjoyed dousing itself in acid, is dismissed, perhaps as a bad dream. The DM might deem a modified memory too nonsensical to affect a creature in a significant manner.","A Remove Curse or Greater Restoration spell cast on the target restores the creature\u2019s true memory.","At Higher Levels. If you cast this spell using a spell slot of 6th level or higher, you can alter the target\u2019s memories of an event that took place up to 7 days ago (6th level), 30 days ago (7th level), 1 year ago (8th level), or any time in the creature\u2019s past (9th level)."],"spellLists":["http://dnd5e.wikidot.com/spell:remove-curse","http://dnd5e.wikidot.com/spell:greater-restoration","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:wizard"]}');


var $7b167df86788cffd$exports = {};
$7b167df86788cffd$exports = JSON.parse('{"title":"Mold Earth","source":"Xanathar\'s Guide to Everything","levelAndSchool":"Transmutation cantrip","level":0,"castingTime":"1 action","range":"30 feet","components":"S","duration":"Instantaneous or 1 hour","description":["You choose a portion of dirt or stone that you can see within range and that fits within a 5-foot cube. You manipulate it in one of the following ways:","If you target an area of loose earth, you can instantaneously excavate it, move it along the ground, and deposit it up to 5 feet away. This movement doesn\u2019t have enough force to cause damage.","You cause shapes, colors, or both to appear on the dirt or stone, spelling out words, creating images, or shaping patterns. The changes last for 1 hour.","If the dirt or stone you target is on the ground, you cause it to become difficult terrain. Alternatively, you can cause the ground to become normal terrain if it is already difficult terrain. This change lasts for 1 hour.","If you cast this spell multiple times, you can have no more than two of its non-instantaneous effects active at a time, and you can dismiss such an effect as an action."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $0a2bea3bc09a8815$exports = {};
$0a2bea3bc09a8815$exports = JSON.parse('{"title":"Moonbeam","source":"Player\'s Handbook","levelAndSchool":"2nd-level evocation","level":2,"castingTime":"1 action","range":"120 feet","components":"V, S, M (several seeds of any moonseed plant and a piece of opalescent feldspar)","duration":"Concentration, up to 1 minute","description":["A silvery beam of pale light shines down in a 5-foot radius, 40-foot-high cylinder centered on a point within range. Until the spell ends, dim light fills the cylinder.","When a creature enters the spell\u2019s area for the first time on a turn or starts its turn there, it is engulfed in ghostly flames that cause searing pain, and it must make a Constitution saving throw. It takes 2d10 radiant damage on a failed save, or half as much damage on a successful one.","A shapechanger makes its saving throw with disadvantage. If it fails, it also instantly reverts to its original form and can\u2019t assume a different form until it leaves the spell\u2019s light.","On each of your turns after you cast this spell, you can use an action to move the beam up to 60 feet in any direction.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, the damage increases by 1d10 for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:druid"]}');


var $b8872d736d2c71a0$exports = {};
$b8872d736d2c71a0$exports = JSON.parse('{"title":"Mordenkainen\'s Faithful Hound","source":"Player\'s Handbook","levelAndSchool":"4th-level conjuration","level":4,"castingTime":"1 action","range":"30 feet","components":"V, S, M (a tiny silver whistle, a piece of bone, and a thread)","duration":"8 hours","description":["You conjure a phantom watchdog in an unoccupied space that you can see within range, where it remains for the duration, until you dismiss it as an action, or until you move more than 100 feet away from it.","The hound is invisible to all creatures except you and can\u2019t be harmed. When a Small or larger creature comes within 30 feet of it without first speaking the password that you specify when you cast this spell, the hound starts barking loudly. The hound sees invisible creatures and can see into the Ethereal Plane. It ignores illusions.","At the start of each of your turns, the hound attempts to bite one creature within 5 feet of it that is hostile to you. The hound\u2019s attack bonus is equal to your spellcasting ability modifier + your proficiency bonus. On a hit, it deals 4d8 piercing damage."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $671514512b068e5e$exports = {};
$671514512b068e5e$exports = JSON.parse('{"title":"Mordenkainen\'s Magnificent Mansion","source":"Player\'s Handbook","levelAndSchool":"7th-level conjuration","level":7,"castingTime":"1 minute","range":"300 feet","components":"V, S, M (a miniature portal carved from ivory, a small piece of polished marble, and a tiny silver spoon, each item worth at least 5 gp)","duration":"24 hours","description":["You conjure an extradimensional dwelling in range that lasts for the duration. You choose where its one entrance is located. The entrance shimmers faintly and is 5 feet wide and 10 feet tall. You and any creature you designate when you cast the spell can enter the extradimensional dwelling as long as the portal remains open. You can open or close the portal if you are within 30 feet of it. While closed, the portal is invisible.","Beyond the portal is a magnificent foyer with numerous chambers beyond. The atmosphere is clean, fresh, and warm.","You can create any floor plan you like, but the space can\u2019t exceed 50 cubes, each cube being 10 feet on each side. The place is furnished and decorated as you choose. It contains sufficient food to serve a nine-course banquet for up to 100 people. A staff of 100 near-transparent servants attends all who enter. You decide the visual appearance of these servants and their attire. They are completely obedient to your orders. Each servant can perform any task a normal human servant could perform, but they can\u2019t attack or take any action that would directly harm another creature. Thus the servants can fetch things, clean, mend, fold clothes, light fires, serve food, pour wine, and so on. The servants can go anywhere in the mansion but can\u2019t leave it. Furnishings and other objects created by this spell dissipate into smoke if removed from the mansion. When the spell ends, any creatures or objects inside the extradimensional space are expelled into the open spaces nearest to the entrance."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:wizard"]}');


var $5f467966ee396996$exports = {};
$5f467966ee396996$exports = JSON.parse('{"title":"Mordenkainen\'s Private Sanctum","source":"Player\'s Handbook","levelAndSchool":"4th-level abjuration","level":4,"castingTime":"1 action","range":"120 feet","components":"V, S, M (a thin sheet of lead, a piece of opaque glass, a wad of cotton or cloth, and powdered chrysolite)","duration":"24 hours","description":["You make an area within range magically secure. The area is a cube that can be as small as 5 feet to as large as 100 feet on each side. The spell lasts for the duration or until you use an action to dismiss it.","When you cast the spell, you decide what sort of security the spell provides, choosing any or all of the following properties:","Sound can\u2019t pass through the barrier at the edge of the warded area.","The barrier of the warded area appears dark and foggy, preventing vision (including darkvision) through it.","Sensors created by divination spells can\u2019t appear inside the protected area or pass through the barrier at its perimeter.","Creatures in the area can\u2019t be targeted by divination spells.","Nothing can teleport into or out of the warded area.","Planar travel is blocked within the warded area.","Casting this spell on the same spot every day for a year makes this effect permanent.","At Higher Levels. When you cast this spell using a spell slot of 5th level or higher, you can increase the size of the cube by 100 feet for each slot level beyond 4th. Thus you could protect a cube that can be up to 200 feet on one side by using a spell slot of 5th level."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $d279c9ac3b3b8b21$exports = {};
$d279c9ac3b3b8b21$exports = JSON.parse('{"title":"Mordenkainen\'s Sword","source":"Player\'s Handbook","levelAndSchool":"7th-level evocation","level":7,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a miniature platinum sword with a grip and pommel of copper and zinc, worth 250 gp)","duration":"Concentration, up to 1 minute","description":["You create a sword-shaped plane of force that hovers within range. It lasts for the duration.","When the sword appears, you make a melee spell attack against a target of your choice within 5 feet of the sword. On a hit. the target takes 3d10 force damage. Until the spell ends, you can use a bonus action on each of your turns to move the sword up to 20 feet to a spot you can see and repeat this attack against the same target or a different one."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:wizard"]}');


var $51ba6d4afcccfba5$exports = {};
$51ba6d4afcccfba5$exports = JSON.parse('{"title":"Motivational Speech","source":"Acquisitions Inc.","levelAndSchool":"3rd-level enchantment","level":3,"castingTime":"1 minute","range":"60 feet","components":"V","duration":"1 hour","description":["Choose up to five creatures within range that can hear you. For the duration, each affected creature gains 5 temporary hit points and has advantage on Wisdom saving throws. If an affected creature is hit by an attack, it has advantage on the next attack roll it makes. Once an affected creature loses the temporary hit points granted by this spell, the spell ends for that creature.","At Higher Levels: When you cast this spell using a spell slot of 4th level or higher, the temporary hit points increase by 5 for each slot level above 3rd.","Spell Lists: Bard, Cleric"],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric"]}');


var $c3b84f1888ef85de$exports = {};
$c3b84f1888ef85de$exports = JSON.parse('{"title":"Move Earth","source":"Player\'s Handbook","levelAndSchool":"6th-level transmutation","level":6,"castingTime":"1 action","range":"120 feet","components":"V, S, M (an iron blade and a small bag containing a mixture of soils \u2013\xa0clay, loam, and sand)","duration":"Concentration, up to 2 hours","description":["Choose an area of terrain no larger than 40 feet on a side within range. You can reshape dirt, sand, or clay in the area in any manner you choose for the duration. You can raise or lower the area\u2019s elevation, create or fill in a trench, erect or flatten a wall, or form a pillar. The extent of any such changes can\u2019t exceed half the area\u2019s largest dimension. So, if you affect a 40-foot square, you can create a pillar up to 20 feet high, raise or lower the square\u2019s elevation by up to 20 feet, dig a trench up to 20 feet deep, and so on. It takes 10 minutes for these changes to complete.","At the end of every 10 minutes you spend concentrating on the spell, you can choose a new area of terrain to affect.","Because the terrain\u2019s transformation occurs slowly, creatures in the area can\u2019t usually be trapped or injured by the ground\u2019s movement.","This spell can\u2019t manipulate natural stone or stone construction. Rocks and structures shift to accommodate the new terrain. If the way you shape the terrain would make a structure unstable, it might collapse.","Similarly, this spell doesn\u2019t directly affect plant growth. The moved earth carries any plants along with it."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $c67a5cd5ff9d1175$exports = {};
$c67a5cd5ff9d1175$exports = JSON.parse('{"title":"Nathair\'s Mischief (UA)","source":"Unearthed Arcana 78 - Draconic Options","levelAndSchool":"2nd-level illusion","level":2,"castingTime":"1 action","range":"60 feet","components":"S, M (a piece of crust from an apple pie)","duration":"Concentration, up to 1 minute","description":["You fill a 20-foot cube centered on a point you choose within range with fey and draconic magic. Roll on the Mischievous Surge table to determine the magical effect produced. At the start of each of your turns, you can move the cube up to 10 feet and reroll on the table.","Mischievous Surge","d4","Effect","1","The smell of apple pie fills the air, and each creature in the cube must succeed on a Wisdom saving throw or become charmed by you until the start of your next turn.","2","Bouquets of flowers appear all around, and each creature in the cube must succeed on a Dexterity saving throw or be blinded until the start of your next turn as the flowers spray water in their faces.","3","Each creature in the cube must succeed on a Wisdom saving throw or begin giggling until the start of your next turn. A giggling creature is incapacitated and uses all its movement to move in a random direction.","4","Drops of molasses appear and hover in the cube, turning it into difficult terrain until the start of your next turn."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $bb4166f45ddc4989$exports = {};
$bb4166f45ddc4989$exports = JSON.parse('{"title":"Nathair\'s Mischief","source":"Fizban\'s Treasury of Dragons","levelAndSchool":"2nd-level Illusion","level":2,"castingTime":"1 Action","range":"60ft","components":"S, M (a piece of crust from an apple pie)","duration":"Concentration, up to 1 minute","description":["You fill a 20-foot cube you can see within range with fey and draconic magic. Roll on the Mischievous Surge table to determine the magical effect produced, and roll again at the start of each of your turns until the spell ends. You can move the cube up to 10 feet before you roll.","Mischievous Surge","d4","Effect","1","The smell of apple pie fills the air, and each creature in the cube must succeed on a Wisdom saving throw or become charmed by you until the start of your next turn.","2","Bouquets of flowers appear all around, and each creature in the cube must succeed on a Dexterity saving throw or be blinded until the start of your next turn as the flowers spray water in their faces.","3","Each creature in the cube must succeed on a Wisdom saving throw or begin giggling until the start of your next turn. A giggling creature is incapacitated and uses all its movement to move in a random direction.","4","Drops of molasses appear and hover in the cube, turning it into difficult terrain until the start of your next turn."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $06c2831b0d1375b1$exports = {};
$06c2831b0d1375b1$exports = JSON.parse('{"title":"Negative Energy Flood","source":"Xanathar\'s Guide to Everything","levelAndSchool":"5th-level necromancy","level":5,"castingTime":"1 action","range":"60 feet","components":"V, M (a broken bone and a square of black silk)","duration":"Instantaneous","description":["You send ribbons of negative energy at one creature you can see within range. Unless the target is undead, it must make a Constitution saving throw, taking 5d12 necrotic damage on a failed save, or half as much damage on a successful one. A target killed by this damage rises up as a zombie at the start of your next turn. The zombie pursues whatever creature it can see that is closest to it. Statistics for the zombie are in the Monster Manual. If you target an undead with this spell, the target doesn\u2019t make a saving throw. Instead, roll 5d12. The target gains half the total as temporary hit points."],"spellLists":["http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $9f016db087c1c754$exports = {};
$9f016db087c1c754$exports = JSON.parse('{"title":"Nondetection","source":"Player\'s Handbook","levelAndSchool":"3rd-level abjuration","level":3,"castingTime":"1 action","range":"Touch","components":"V, S, M (a pinch of diamond dust worth 25 gp sprinkled over the target, which the spell consumes)","duration":"8 hours","description":["For the duration, you hide a target that you touch from divination magic. The target can be a willing creature or a place or an object no larger than 10 feet in any dimension. The target can\u2019t be targeted by any divination magic or perceived through magical scrying sensors."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:ranger","http://dnd5e.wikidot.com/spells:wizard"]}');


var $9e497b6c045f57a7$exports = {};
$9e497b6c045f57a7$exports = JSON.parse('{"title":"Nystul\'s Magic Aura","source":"Player\'s Handbook","levelAndSchool":"2nd-level illusion","level":2,"castingTime":"1 action","range":"Touch","components":"V, S, M (a small square of silk)","duration":"24 hours","description":["You place an illusion on a creature or an object you touch so that divination spells reveal false information about it. The target can be a willing creature or an object that isn\u2019t being carried or worn by another creature.","When you cast the spell, choose one or both of the following effects. The effect lasts for the duration. If you cast this spell on the same creature or object every day for 30 days, placing the same effect on it each time, the illusion lasts until it is dispelled.","False Aura. You change the way the target appears to spells and magical effects, such as Detect Magic, that detect magical auras. You can make a nonmagical object appear magical, a magical object appear nonmagical, or change the object\u2019s magical aura so that it appears to belong to a specific school of magic that you choose. When you use this effect on an object, you can make the false magic apparent to any creature that handles the item.","Mask. You change the way the target appears to spells and magical effects that detect creature types, such as a paladin\u2019s Divine Sense or the trigger of a symbol spell. You choose a creature type and other spells and magical effects treat the target as if it were a creature of that type or of that alignment."],"spellLists":["http://dnd5e.wikidot.com/spell:detect-magic","http://dnd5e.wikidot.com/spells:wizard"]}');


var $a2bfed35b5d3dd2f$exports = {};
$a2bfed35b5d3dd2f$exports = JSON.parse('{"title":"On/Off (UA)","source":"Unearthed Arcana 7 - Modern Magic","levelAndSchool":"Transmutation cantrip (technomagic)","level":0,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Instantaneous","description":["This cantrip allows you to activate or deactivate any electronic device within range, as long as the device has a clearly defined on or off function that can be easily accessed from the outside of the device. Any device that requires a software-based shutdown sequence to activate or deactivate cannot be affected by On/Off."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $f27fb8fef3227bd6$exports = {};
$f27fb8fef3227bd6$exports = JSON.parse('{"title":"Otherworldly Form (UA)","source":"Unearthed Arcana 70 - Spells and Magic Tattoos","levelAndSchool":"6th-level transmutation","level":6,"castingTime":"1 action","range":"Self","components":"V, S, M (an object engraved with a symbol of the Outer Planes, worth at least 500 gp)","duration":"Concentration, up to 1 minute","description":["Uttering an incantation, you draw on the magic of the Lower Planes or Upper Planes (your choice) to transform yourself. You gain the following benefits until the spell ends:","You are immune to fire and poison damage (Lower Planes) or radiant and necrotic damage (Upper Planes).","You are immune to the poisoned condition (Lower Planes) or the charmed condition (Upper Planes).","Spectral wings appear on your back, giving you a flying speed of 40 feet.","You have a +2 bonus to AC.","All your weapon attacks are magical, and when you make a weapon attack, you can use your spellcasting ability modifier, instead of Strength or Dexterity, for the attack and damage rolls.","You can attack twice, instead of once, when you take the Attack action on your turn. You ignore this benefit if you already have a feature, like Extra Attack, that gives you extra attacks"],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $48a8485245ad6ab7$exports = {};
$48a8485245ad6ab7$exports = JSON.parse('{"title":"Otiluke\'s Freezing Sphere","source":"Player\'s Handbook","levelAndSchool":"6th-level evocation","level":6,"castingTime":"1 action","range":"300 feet","components":"V, S, M (a small crystal sphere)","duration":"Instantaneous","description":["A frigid globe of cold energy streaks from your fingertips to a point of your choice within range, where it explodes in a 60-foot-radius sphere. Each creature within the area must make a Constitution saving throw. On a failed save, a creature takes 10d6 cold damage. On a successful save, it takes half as much damage.","If the globe strikes a body of water or a liquid that is principally water (not including water-based creatures), it freezes the liquid to a depth of 6 inches over an area 30 feet square. This ice lasts for 1 minute. Creatures that were swimming on the surface of frozen water are trapped in the ice. A trapped creature can use an action to make a Strength check against your spell save DC to break free.","You can refrain from firing the globe after completing the spell, if you wish. A small globe about the size of a sling stone, cool to the touch, appears in your hand. At any time, you or a creature you give the globe to can throw the globe (to a range of 40 feet) or hurl it with a sling (to the sling\u2019s normal range). It shatters on impact, with the same effect as the normal casting of the spell. You can also set the globe down without shattering it. After 1 minute, if the globe hasn\u2019t already shattered, it explodes.","At Higher Levels. When you cast this spell using a spell slot of 7th level or higher, the damage increases by 1d6 for each slot level above 6th."],"spellLists":["/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $a475a9b476ee68b5$exports = {};
$a475a9b476ee68b5$exports = JSON.parse('{"title":"Otiluke\'s Resilient Sphere","source":"Player\'s Handbook","levelAndSchool":"4th-level evocation","level":4,"castingTime":"1 action","range":"30 feet","components":"V, S, M (a hemispherical piece of clear crystal and a matching hemispherical piece of gum arabic)","duration":"Concentration, up to 1 minute","description":["A sphere of shimmering force encloses a creature or object of Large size or smaller within range. An unwilling creature must make a Dexterity saving throw. On a failed save, the creature is enclosed for the duration.","Nothing \u2013\xa0not physical objects, energy, or other spell effects \u2013 can pass through the barrier, in or out, though a creature in the sphere can breathe there. The sphere is immune to all damage, and a creature or object inside can\u2019t be damaged by attacks or effects originating from outside, nor can a creature inside the sphere damage anything outside it.","The sphere is weightless and just large enough to contain the creature or object inside. An enclosed creature can use its action to push against the sphere\u2019s walls and thus roll the sphere at up to half the creature\u2019s speed. Similarly, the globe can be picked up and moved by other creatures.","A Disintegrate spell targeting the globe destroys it without harming anything inside it."],"spellLists":["http://dnd5e.wikidot.com/spell:disintegrate","http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $41ccd2150490d5ac$exports = {};
$41ccd2150490d5ac$exports = JSON.parse('{"title":"Otto\'s Irresistible Dance","source":"Player\'s Handbook","levelAndSchool":"6th-level enchantment","level":6,"castingTime":"1 action","range":"30 feet","components":"V","duration":"Concentration, up to 1 minute","description":["Choose one creature that you can see within range. The target begins a comic dance in place: shuffling, tapping its feet, and capering for the duration. Creatures that can\u2019t be charmed are immune to this spell.","A dancing creature must use all its movement to dance without leaving its space and has disadvantage on Dexterity saving throws and attack rolls. While the target is affected by this spell, other creatures have advantage on attack rolls against it. As an action, a dancing creature makes a Wisdom saving throw to regain control of itself. On a successful save, the spell ends."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:wizard"]}');


var $219754b3aa7a8f86$exports = {};
$219754b3aa7a8f86$exports = JSON.parse('{"title":"Pass Without Trace","source":"Player\'s Handbook","levelAndSchool":"2nd-level abjuration","level":2,"castingTime":"1 action","range":"Self","components":"V, S, M (ashes from a burned leaf of mistletoe and a sprig of spruce)","duration":"Concentration, up to 1 hour","description":["A veil of shadows and silence radiates from you, masking you and your companions from detection. For the duration, each creature you choose within 30 feet of you (including you) has a +10 bonus to Dexterity (Stealth) checks and can\u2019t be tracked except by magical means. A creature that receives this bonus leaves behind no tracks or other traces of its passage."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger"]}');


var $af7b22a9debeff02$exports = {};
$af7b22a9debeff02$exports = JSON.parse('{"title":"Passwall","source":"Player\'s Handbook","levelAndSchool":"5th-level transmutation","level":5,"castingTime":"1 action","range":"30 feet","components":"V, S, M (a pinch of sesame seeds)","duration":"1 hour","description":["A passage appears at a point of your choice that you can see on a wooden, plaster, or stone surface (such as a wall, a ceiling, or a floor) within range, and lasts for the duration. You choose the opening\u2019s dimensions: up to 5 feet wide, 8 feet tall, and 20 feet deep. The passage creates no instability in a structure surrounding it.","When the opening disappears, any creatures or objects still in the passage created by the spell are safely ejected to an unoccupied space nearest to the surface on which you cast the spell."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $58fa18a4e521d26a$exports = {};
$58fa18a4e521d26a$exports = JSON.parse('{"title":"Phantasmal Force","source":"Player\'s Handbook","levelAndSchool":"2nd-level illusion","level":2,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a bit of fleece)","duration":"Concentration, up to 1 minute","description":["You craft an illusion that takes root in the mind of a creature that you can see within range. The target must make an Intelligence saving throw. On a failed save, you create a phantasmal object, creature, or other visible phenomenon of your choice that is no larger than a 10-foot cube and that is perceivable only to the target for the duration. This spell has no effect on undead or constructs.","The phantasm includes sound, temperature, and other stimuli, also evident only to the creature.","The target can use its action to examine the phantasm with an Intelligence (Investigation) check against your spell save DC. If the check succeeds, the target realizes that the phantasm is an illusion, and the spell ends.","While a target is affected by the spell, the target treats the phantasm as if it were real. The target rationalizes any illogical outcomes from interacting with the phantasm. For example, a target attempting to walk across a phantasmal bridge that spans a chasm falls once it steps onto the bridge. If the target survives the fall, it still believes that the bridge exists and comes up with some other explanation for its fall; it was pushed, it slipped, or a strong wind might have knocked it off.","An affected target is so convinced of the phantasm\u2019s reality that it can even take damage from the illusion. A phantasm created to appear as a creature can attack the target. Similarly, a phantasm created to appear as fire, a pool of acid, or lava can burn the target. Each round on your turn, the phantasm can deal 1d6 psychic damage to the target if it is in the phantasm\u2019s area or within 5 feet of the phantasm, provided that the illusion is of a creature or hazard that could logically deal damage, such as by attacking. The target perceives the damage as a type appropriate to the illusion."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $1c0e215f962c89de$exports = {};
$1c0e215f962c89de$exports = JSON.parse('{"title":"Phantasmal Killer","source":"Player\'s Handbook","levelAndSchool":"4th-level illusion","level":4,"castingTime":"1 action","range":"120 feet","components":"V, S","duration":"Concentration, up to 1 minute","description":["You tap into the nightmares of a creature you can see within range and create an illusory manifestation of its deepest fears, visible only to that creature.","The target must make a Wisdom saving throw. On a failed save, the target becomes frightened for the duration. At the end of each of the target\u2019s turns before the spell ends, the target must succeed on a Wisdom saving throw or take 4d10 psychic damage. On a successful save, the spell ends.","At Higher Levels. When you cast this spell using a spell slot of 5th level or higher, the damage increases by 1d10 for each slot level above 4th."],"spellLists":["/spells:bard","http://dnd5e.wikidot.com/spells:wizard"]}');


var $ff98962361ff0547$exports = {};
$ff98962361ff0547$exports = JSON.parse('{"title":"Phantom Steed","source":"Player\'s Handbook","levelAndSchool":"3rd-level illusion (ritual)","level":3,"castingTime":"1 minute","range":"30 feet","components":"V, S","duration":"1 hour","description":["A Large quasi-real, horselike creature appears on the ground in an unoccupied space of your choice within range. You decide the creature\u2019s appearance, but it is equipped with a saddle, bit, and bridle. Any of the equipment created by the spell vanishes in a puff of smoke if it is carried more than 10 feet away from the steed.","For the duration, you or a creature you choose can ride the steed. The creature uses the statistics for a riding horse, except it has a speed of 100 feet and can travel 10 miles in an hour, or 13 miles at a fast pace. When the spell ends, the steed gradually fades, giving the rider 1 minute to dismount. The spell ends if you use an action to dismiss it or if the steed takes any damage."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $b9df3a999b3d8f92$exports = {};
$b9df3a999b3d8f92$exports = JSON.parse('{"title":"Planar Ally","source":"Player\'s Handbook","levelAndSchool":"6th-level conjuration","level":6,"castingTime":"10 minutes","range":"60 feet","components":"V, S","duration":"Instantaneous","description":["You beseech an otherworldly entity for aid. The being must be known to you: a god, a primordial, a demon prince, or some other being of cosmic power. That entity sends a celestial, an elemental, or a fiend loyal to it to aid you, making the creature appear in an unoccupied space within range. If you know a specific creature\u2019s name, you can speak that name when you cast this spell to request that creature, though you might get a different creature anyway (DM\u2019s choice).","When the creature appears, it is under no compulsion to behave in any particular way. You can ask the creature to perform a service in exchange for payment, but it isn\u2019t obliged to do so. The requested task could range from simple (fly us across the chasm, or help us fight a battle) to complex (spy on our enemies, or protect us during our foray into the dungeon). You must be able to communicate with the creature to bargain for its services.","Payment can take a variety of forms. A celestial might require a sizable donation of gold or magic items to an allied temple, while a fiend might demand a living sacrifice or a gift of treasure. Some creatures might exchange their service for a quest undertaken by you.","As a rule of thumb, a task that can be measured in minutes requires a payment worth 100 gp per minute. A task measured in hours requires 1,000 gp per hour. And a task measured in days (up to 10 days) requires 10,000 gp per day. The DM can adjust these payments based on the circumstances under which you cast the spell. If the task is aligned with the creature\u2019s ethos, the payment might be halved or even waived. Nonhazardous tasks typically require only half the suggested payment, while especially dangerous tasks might require a greater gift. Creatures rarely accept tasks that seem suicidal.","After the creature completes the task, or when the agreed-upon duration of service expires, the creature returns to its home plane after reporting back to you, if appropriate to the task and if possible. If you are unable to agree on a price for the creature\u2019s service, the creature immediately returns to its home plane.","A creature enlisted to join your group counts as a member of it, receiving a full share of experience points awarded."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric"]}');


var $aa406bbc28542466$exports = {};
$aa406bbc28542466$exports = JSON.parse('{"title":"Planar Binding","source":"Player\'s Handbook","levelAndSchool":"5th-level abjuration","level":5,"castingTime":"1 hour","range":"60 feet","components":"V, S, M (a jewel worth at least 1,000 gp, which the spell consumes)","duration":"24 hours","description":["With this spell, you attempt to bind a celestial, an elemental, a fey, or a fiend to your service. The creature must be within range for the entire casting of the spell. (Typically, the creature is first summoned into the center of an inverted Magic Circle in order to keep it trapped while this spell is cast.) At the completion of the casting, the target must make a Charisma saving throw. On a failed save, it is bound to serve you for the duration. If the creature was summoned or created by another spell, that spell\u2019s duration is extended to match the duration of this spell.","A bound creature must follow your instructions to the best of its ability. You might command the creature to accompany you on an adventure, to guard a location, or to deliver a message. The creature obeys the letter of your instructions, but if the creature is hostile to you, it strives to twist your words to achieve its own objectives. If the creature carries out your instructions completely before the spell ends, it travels to you to report this fact if you are on the same plane of existence. If you are on a different plane of existence, it returns to the place where you bound it and remains there until the spell ends.","At Higher Levels. When you cast this spell using a spell slot of a higher level, the duration increases to 10 days with a 6th-level slot, 30 days with a 7th-level slot, 180 days with an 8th-level slot, or 1 year and 1 day with a 9th-level spell slot."],"spellLists":["http://dnd5e.wikidot.com/spell:magic-circle","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $769dce99bb1cd809$exports = {};
$769dce99bb1cd809$exports = JSON.parse('{"title":"Plane Shift","source":"Player\'s Handbook","levelAndSchool":"7th-level conjuration","level":7,"castingTime":"1 action","range":"Touch","components":"V, S, M (a forked, metal rod worth at least 250 gp, attuned to a particular plane of existence)","duration":"Instantaneous","description":["You and up to eight willing creatures who link hands in a circle are transported to a different plane of existence. You can specify a target destination in general terms, such as the City of Brass on the Elemental Plane of Fire or the palace of Dispater on the second level of the Nine Hells, and you appear in or near that destination. If you are trying to reach the City of Brass, for example, you might arrive in its Street of Steel, before its Gate of Ashes, or looking at the city from across the Sea of Fire, at the DM\u2019s discretion.","Alternatively, if you know the sigil sequence of a teleportation circle on another plane of existence, this spell can take you to that circle. If the teleportation circle is too small to hold all the creatures you transported, they appear in the closest unoccupied spaces next to the circle.","You can use this spell to banish an unwilling creature to another plane. Choose a creature within your reach and make a melee spell attack against it. On a hit, the creature must make a Charisma saving throw. If the creature fails the save, it is transported to a random location on the plane of existence you specify. A creature so transported must find its own way back to your current plane of existence."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $0321a1403c6db4af$exports = {};
$0321a1403c6db4af$exports = JSON.parse('{"title":"Plant Growth","source":"Player\'s Handbook","levelAndSchool":"3rd-level transmutation","level":3,"castingTime":"1 action or 8 hours","range":"150 feet","components":"V, S","duration":"Instantaneous","description":["This spell channels vitality into plants within a specific area. There are two possible uses for the spell, granting either immediate or long-term benefits.","If you cast this spell using 1 action, choose a point within range. All normal plants in a 100-foot radius centered on that point become thick and overgrown. A creature moving through the area must spend 4 feet of movement for every 1 foot it moves.","You can exclude one or more areas of any size within the spell\u2019s area from being affected.","If you cast this spell over 8 hours, you enrich the land. All plants in a half-mile radius centered on a point within range become enriched for 1 year. The plants yield twice the normal amount of food when harvested."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger"]}');


var $940c8ef093f842b0$exports = {};
$940c8ef093f842b0$exports = JSON.parse('{"title":"Poison Spray","source":"Player\'s Handbook","levelAndSchool":"Conjuration cantrip","level":0,"castingTime":"1 action","range":"10 feet","components":"V, S","duration":"Instantaneous","description":["You extend your hand toward a creature you can see within range and project a puff of noxious gas from your palm. The creature must succeed on a Constitution saving throw or take 1d12 poison damage.","At Higher Levels. This spell\u2019s damage increases by 1d12 when you reach 5th level (2d12), 11th level (3d12), and 17th level (4d12)."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $a6c02d5b0bf72e22$exports = {};
$a6c02d5b0bf72e22$exports = JSON.parse('{"title":"Polymorph","source":"Player\'s Handbook","levelAndSchool":"4th-level transmutation","level":4,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a caterpillar cocoon)","duration":"Concentration, up to 1 hour","description":["This spell transforms a creature that you can see within range into a new form. An unwilling creature must make a Wisdom saving throw to avoid the effect. A shapechanger automatically succeeds on this saving throw.","The transformation lasts for the duration, or until the target drops to 0 hit points or dies. The new form can be any beast whose challenge rating is equal to or less than the target\u2019s (or the target\u2019s level, if it doesn\u2019t have a challenge rating). The target\u2019s game statistics, including mental ability scores, are replaced by the statistics of the chosen beast. It retains its alignment and personality.","The target assumes the hit points of its new form. When it reverts to its normal form, the creature returns to the number of hit points it had before it transformed. If it reverts as a result of dropping to 0 hit points, any excess damage carries over to its normal form. As long as the excess damage doesn\u2019t reduce the creature\u2019s normal form to 0 hit points, it isn\u2019t knocked unconscious.","The creature is limited in the actions it can perform by the nature of its new form, and it can\u2019t speak, cast spells, or take any other action that requires hands or speech.","The target\u2019s gear melds into the new form. The creature can\u2019t activate, use, wield, or otherwise benefit from any of its equipment. This spell can\u2019t affect a target that has 0 hit points."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $fd24294d7021a82b$exports = {};
$fd24294d7021a82b$exports = JSON.parse('{"title":"Power Word: Heal","source":"Player\'s Handbook","levelAndSchool":"9th-level evocation","level":9,"castingTime":"1 action","range":"Touch","components":"V, S","duration":"Instantaneous","description":["A wave of healing energy washes over a creature you touch. The target regains all its hit points. If the creature is charmed, frightened, paralyzed, or stunned, the condition ends. If the creature is prone, it can use its reaction to stand up. This spell has no effect on undead or constructs."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","/spells:cleric"]}');


var $c338c5525a56cdf8$exports = {};
$c338c5525a56cdf8$exports = JSON.parse('{"title":"Power Word: Kill","source":"Player\'s Handbook","levelAndSchool":"9th-level enchantment","level":9,"castingTime":"1 action","range":"60 feet","components":"V","duration":"Instantaneous","description":["You utter a word of power that can compel one creature you can see within range to die instantly. If the creature you chose has 100 hit points or fewer, it dies. Otherwise, the spell has no effect."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $72b8d26be40b06d3$exports = {};
$72b8d26be40b06d3$exports = JSON.parse('{"title":"Power Word: Pain","source":"Xanathar\'s Guide to Everything","levelAndSchool":"7th-level enchantment","level":7,"castingTime":"1 action","range":"60 feet","components":"V","duration":"Instantaneous","description":["You speak a word of power that causes waves of intense pain to assail one creature you can see within range. If the target has 100 hit points or fewer, it is subject to crippling pain. Otherwise, the spell has no effect on it. A target is also unaffected if it is immune to being charmed.","While the target is affected by crippling pain, any speed it has can be no higher than 10 feet. The target also has disadvantage on attack rolls, ability checks, and saving throws, other than Constitution saving throws. Finally, if the target tries to cast a spell, it must first succeed on a Constitution saving throw, or the casting fails and the spell is wasted.","A target suffering this pain can make a Constitution saving throw at the end of each of its turns. On a successful save, the pain ends."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $8383595459b86519$exports = {};
$8383595459b86519$exports = JSON.parse('{"title":"Power Word: Stun","source":"Player\'s Handbook","levelAndSchool":"8th-level enchantment","level":8,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Instantaneous","description":["You speak a word of power that can overwhelm the mind of one creature you can see within range, leaving it dumbfounded. If the target has 150 hit points or fewer, it is stunned. Otherwise, the spell has no effect. The stunned target must make a Constitution saving throw at the end of each of its turns. On a successful save, this stunning effect ends."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $e4632db1cecc8e97$exports = {};
$e4632db1cecc8e97$exports = JSON.parse('{"title":"Prayer of Healing","source":"Player\'s Handbook","levelAndSchool":"2nd-level evocation","level":2,"castingTime":"10 minutes","range":"30 feet","components":"V","duration":"Instantaneous","description":["Up to six creatures of your choice that you can see within range each regain hit points equal to 2d8 + your spellcasting ability modifier. This spell has no effect on undead or constructs.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, the healing increases by 1d8 for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","/spells:paladin"]}');


var $59cf5121ee9b8fdd$exports = {};
$59cf5121ee9b8fdd$exports = JSON.parse('{"title":"Prestidigitation","source":"Player\'s Handbook","levelAndSchool":"Transmutation cantrip","level":0,"castingTime":"1 action","range":"10 feet","components":"V, S","duration":"Up to 1 hour","description":["This spell is a minor magical trick that novice spellcasters use for practice. You create one of the following magical effects within range:","You create an instantaneous, harmless sensory effect, such as a shower of sparks, a puff of wind, faint musical notes, or an odd odor.","You instantaneously light or snuff out a candle, a torch, or a small campfire.","You instantaneously clean or soil an object no larger than 1 cubic foot.","You chill, warm, or flavor up to 1 cubic foot of nonliving material for 1 hour.","You make a color, a small mark, or a symbol appear on an object or a surface for 1 hour.","You create a nonmagical trinket or an illusory image that can fit in your hand and that lasts until the end of your next turn.","If you cast this spell multiple times, you can have up to three of its non-instantaneous effects active at a time, and you can dismiss such an effect as an action."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $e7191d4760ab7bcf$exports = {};
$e7191d4760ab7bcf$exports = JSON.parse('{"title":"Primal Savagery","source":"Xanathar\'s Guide to Everything","levelAndSchool":"Transmutation cantrip","level":0,"castingTime":"1 action","range":"Self","components":"S","duration":"Instantaneous","description":["You channel primal magic to cause your teeth or fingernails to sharpen, ready to deliver a corrosive attack. Make a melee spell attack against one creature within 5 feet of you. On a hit, the target takes 1d10 acid damage. After you make the attack, your teeth or fingernails return to normal.","At Higher Levels. The spell\u2019s damage increases by 1d10 when you reach 5th level (2d10), 11th level (3d10), and 17th level (4d10)."],"spellLists":["http://dnd5e.wikidot.com/spells:druid"]}');


var $2c4e45b8d8474797$exports = {};
$2c4e45b8d8474797$exports = JSON.parse('{"title":"Primordial Ward","source":"Xanathar\'s Guide to Everything","levelAndSchool":"6th-level abjuration","level":6,"castingTime":"1 action","range":"Self","components":"V, S","duration":"Concentration, up to 1 minute","description":["You have resistance to acid, cold, fire, lightning, and thunder damage for the spell\u2019s duration.","When you take damage of one of those types, you can use your reaction to gain immunity to that type of damage, including against the triggering damage. If you do so, the resistances end, and you have the immunity until the end of your next turn, at which time the spell ends."],"spellLists":["http://dnd5e.wikidot.com/spells:druid"]}');


var $92beb68521f19d9c$exports = {};
$92beb68521f19d9c$exports = JSON.parse('{"title":"Prismatic Spray","source":"Player\'s Handbook","levelAndSchool":"7th-level evocation","level":7,"castingTime":"1 action","range":"Self (60-foot cone)","components":"V, S","duration":"Instantaneous","description":["Eight multicolored rays of light flash from your hand. Each ray is a different color and has a different power and purpose. Each creature in a 60-foot cone must make a Dexterity saving throw. For each target, roll a d8 to determine which color ray affects it.","d8","Color","Ray Effect","1","Red","The target takes 10d6 fire damage on a failed save, or half as much damage on a successful one.","2","Orange","The target takes 10d6 acid damage on a failed save, or half as much damage on a successful one.","3","Yellow","The target takes 10d6 lightning damage on a failed save, or half as much damage on a successful one.","4","Green","The target takes 10d6 poison damage on a failed save, or half as much damage on a successful one.","5","Blue","The target takes 10d6 cold damage on a failed save, or half as much damage on a successful one.","6","Indigo","On a failed save, the target is restrained. It must then make a Constitution saving throw at the end of each of its turns. If it successfully saves three times, the spell ends. If it fails its save three times, it permanently turns to stone and is subjected to the petrified condition. The successes and failures don\u2019t need to be consecutive; keep track of both until the target collects three of a kind.","7","Violet","On a failed save, the target is blinded. It must then make a Wisdom saving throw at the start of your next turn. A successful save ends the blindness. If it fails that save, the creature is transported to another plane of existence of the DM\u2019s choosing and is no longer blinded. (Typically, a creature that is on a plane that isn\u2019t its home plane is banished home, while other creatures are usually cast into the Astral or Ethereal planes.)","8","Special","The target is struck by two rays. Roll twice more, rerolling any 8."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $01c27977ab710ddb$exports = {};
$01c27977ab710ddb$exports = JSON.parse('{"title":"Prismatic Wall","source":"Player\'s Handbook","levelAndSchool":"9th-level abjuration","level":9,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"10 minutes","description":["A shimmering, multicolored plane of light forms a vertical opaque wall \u2013\xa0up to 90 feet long, 30 feet high, and 1 inch thick \u2013\xa0centered on a point you can see within range. Alternatively, you can shape the wall into a sphere up to 30 feet in diameter centered on a point you choose within range. The wall remains in place for the duration. If you position the wall so that it passes through a space occupied by a creature, the spell fails, and your action and the spell slot are wasted.","The wall sheds bright light out to a range of 100 feet and dim light for an additional 100 feet. You and creatures you designate at the time you cast the spell can pass through and remain near the wall without harm. If another creature that can see the wall moves to within 20 feet of it or starts its turn there, the creature must succeed on a Constitution saving throw or become blinded for 1 minute.","The wall consists of seven layers, each with a different color. When a creature attempts to reach into or pass through the wall, it does so one layer at a time through all the wall\u2019s layers. As it passes or reaches through each layer, the creature must make a Dexterity saving throw or be affected by that layer\u2019s properties as described below.","The wall can be destroyed, also one layer at a time, in order from red to violet, by means specific to each layer. Once a layer is destroyed, it remains so for the duration of the spell. An Antimagic Field has no effect on it.","Color","Effect","Red","The creature takes 10d6 fire damage on a failed save, or half as much damage on a successful one. While this layer is in place, nonmagical ranged attacks can\u2019t pass through the wall. The layer can be destroyed by dealing at least 25 cold damage to it.","Orange","The creature takes 10d6 acid damage on a failed save, or half as much damage on a successful one. While this layer is in place, magical ranged attacks can\u2019t pass through the wall. The layer is destroyed by a strong wind.","Yellow","The creature takes 10d6 lightning damage on a failed save, or half as much damage on a successful one. This layer can be destroyed by dealing at least 60 force damage to it.","Green","The creature takes 10d6 poison damage on a failed save, or half as much damage on a successful one. A Passwall spell, or another spell of equal or greater level that can open a portal on a solid surface, destroys this layer.","Blue","The creature takes 10d6 cold damage on a failed save, or half as much damage on a successful one. This layer can be destroyed by dealing at least 25 fire damage to it.","Indigo","On a failed save, the creature is restrained. It must then make a Constitution saving throw at the end of each of its turns. If it successfully saves three times, the spell ends. If it fails its save three times, it permanently turns to stone and is subjected to the petrified condition. The successes and failures don\u2019t need to be consecutive; keep track of both until the creature collects three of a kind. While this layer is in place, spells can\u2019t be cast through the wall. The layer is destroyed by bright light shed by a Daylight spell or a similar spell of equal or higher level.","Violet","On a failed save, the creature is blinded. It must then make a Wisdom saving throw at the start of your next turn. A successful save ends the blindness. If it fails that save, the creature is transported to another plane of the DM\u2019s choosing and is no longer blinded. (Typically, a creature that is on a plane that isn\u2019t its home plane is banished home, while other creatures are usually cast into the Astral or Ethereal planes.) This layer is destroyed by a Dispel Magic spell or similar spell of equal or higher level that can end spells and magical effects."],"spellLists":["http://dnd5e.wikidot.com/spell:antimagic-field","http://dnd5e.wikidot.com/spell:passwall","http://dnd5e.wikidot.com/spell:daylight","http://dnd5e.wikidot.com/spell:dispel-magic","/spells:bard","http://dnd5e.wikidot.com/spells:wizard"]}');


var $f92d0536a1937c08$exports = {};
$f92d0536a1937c08$exports = JSON.parse('{"title":"Produce Flame","source":"Player\'s Handbook","levelAndSchool":"Conjuration cantrip","level":0,"castingTime":"1 action","range":"Self","components":"V, S","duration":"10 minutes","description":["A flickering flame appears in your hand. The flame remains there for the duration and harms neither you nor your equipment. The flame sheds bright light in a 10-foot radius and dim light for an additional 10 feet. The spell ends if you dismiss it as an action or if you cast it again.","You can also attack with the flame, although doing so ends the spell. When you cast this spell, or as an action on a later turn, you can hurl the flame at a creature within 30 feet of you. Make a ranged spell attack. On a hit, the target takes 1d8 fire damage.","At Higher Levels. This spell\u2019s damage increases by 1d8 when you reach 5th level (2d8), 11th level (3d8), and 17th level (4d8)."],"spellLists":["http://dnd5e.wikidot.com/spells:druid"]}');


var $b3df9e3a2b46554b$exports = {};
$b3df9e3a2b46554b$exports = JSON.parse('{"title":"Programmed Illusion","source":"Player\'s Handbook","levelAndSchool":"6th-level illusion","level":6,"castingTime":"1 action","range":"120 feet","components":"V, S, M (a bit of fleece and jade dust worth at least 25 gp)","duration":"Until dispelled","description":["You create an illusion of an object, a creature, or some other visible phenomenon within range that activates when a specific condition occurs. The illusion is imperceptible until then. It must be no larger than a 30-foot cube, and you decide when you cast the spell how the illusion behaves and what sounds it makes. This scripted performance can last up to 5 minutes.","When the condition you specify occurs, the illusion springs into existence and performs in the manner you described. Once the illusion finishes performing, it disappears and remains dormant for 10 minutes. After this time, the illusion can be activated again.","The triggering condition can be as general or as detailed as you like, though it must be based on visual or audible conditions that occur within 30 feet of the area. For example, you could create an illusion of yourself to appear and warn off others who attempt to open a trapped door, or you could set the illusion to trigger only when a creature says the correct word or phrase.","Physical interaction with the image reveals it to be an illusion, because things can pass through it. A creature that uses its action to examine the image can determine that it is an illusion with a successful Intelligence (Investigation) check against your spell save DC. If a creature discerns the illusion for what it is, the creature can see through the image, and any noise it makes sounds hollow to the creature."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:wizard"]}');


var $46b53f33ac72112b$exports = {};
$46b53f33ac72112b$exports = JSON.parse('{"title":"Project Image","source":"Player\'s Handbook","levelAndSchool":"7th-level illusion","level":7,"castingTime":"1 action","range":"500 miles","components":"V, S, M (a small replica of you made from materials worth at least 5 gp)","duration":"Concentration, up to 1 day","description":["You create an illusory copy of yourself that lasts for the duration. The copy can appear at any location within range that you have seen before, regardless of intervening obstacles. The illusion looks and sounds like you but is intangible. If the illusion takes any damage, it disappears, and the spell ends.","You can use your action to move this illusion up to twice your speed, and make it gesture, speak, and behave in whatever way you choose. It mimics your mannerisms perfectly.","You can see through its eyes and hear through its ears as if you were in its space. On your turn as a bonus action, you can switch from using its senses to using your own, or back again. While you are using its senses, you are blinded and deafened in regard to your own surroundings.","Physical interaction with the image reveals it to be an illusion, because things can pass through it. A creature that uses its action to examine the image can determine that it is an illusion with a successful Intelligence (Investigation) check against your spell save DC. If a creature discerns the illusion for what it is, the creature can see through the image, and any noise it makes sounds hollow to the creature."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:wizard"]}');


var $7e6879909bd3e048$exports = {};
$7e6879909bd3e048$exports = JSON.parse('{"title":"Protection from Ballistics (UA)","source":"Unearthed Arcana 7 - Modern Magic","levelAndSchool":"3rd-level abjuration (technomagic)","level":3,"castingTime":"1 action","range":"Touch","components":"V, S, M (a shell casing)","duration":"Concentration, up to 10 minutes","description":["This spell enchants the flesh of the target against the impact of bullets. Until the spell ends, the target has resistance to nonmagical ballistic damage."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $92085f8d86025584$exports = {};
$92085f8d86025584$exports = JSON.parse('{"title":"Protection from Energy","source":"Player\'s Handbook","levelAndSchool":"3rd-level abjuration","level":3,"castingTime":"1 action","range":"Touch","components":"V, S","duration":"Concentration, up to 1 hour","description":["For the duration, the willing creature you touch has resistance to one damage type of your choice: acid, cold, fire, lightning, or thunder."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $958bbda273372a7b$exports = {};
$958bbda273372a7b$exports = JSON.parse('{"title":"Protection from Evil and Good","source":"Player\'s Handbook","levelAndSchool":"1st-level abjuration","level":1,"castingTime":"1 action","range":"Touch","components":"V, S, M (holy water or powdered silver and iron, which the spell consumes)","duration":"Concentration, up to 10 minutes","description":["Until the spell ends, one willing creature you touch is protected against certain types of creatures: aberrations, celestials, elementals, fey, fiends, and undead.","The protection grants several benefits. Creatures of those types have disadvantage on attack rolls against the target. The target also can\'t be charmed, frightened, or possessed by them. If the target is already charmed, frightened, or possessed by such a creature, the target has advantage on any new saving throw against the relevant effect."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","/spells:druid","http://dnd5e.wikidot.com/spells:paladin","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $bfa20148da50f393$exports = {};
$bfa20148da50f393$exports = JSON.parse('{"title":"Protection from Poison","source":"Player\'s Handbook","levelAndSchool":"2nd-level abjuration","level":2,"castingTime":"1 action","range":"Touch","components":"V, S","duration":"1 hour","description":["You touch a creature. If it is poisoned, you neutralize the poison. If more than one poison afflicts the target, you neutralize one poison that you know is present, or you neutralize one at random.","For the duration, the target has advantage on saving throws against being poisoned, and it has resistance to poison damage."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:paladin","http://dnd5e.wikidot.com/spells:ranger"]}');


var $4cdd470c39692f7e$exports = {};
$4cdd470c39692f7e$exports = JSON.parse('{"title":"Psionic Blast (UA)","source":"Unearthed Arcana 66 - Fighter, Rogue, and Wizard","levelAndSchool":"3rd-level evocation","level":3,"castingTime":"1 action","range":"Self (30-foot cone)","components":"V","duration":"Instantaneous","description":["You unleash a destructive wave of mental power in a 30-foot cone. Each creature in the area must make a Dexterity saving throw. On a failed save, a target takes 5d8 force damage, is pushed 20 feet directly away from you, and is knocked prone. On a successful save, a target takes half as much damage and isn\u2019t pushed or knocked prone.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, the damage increases by 1d8 for each slot level above 3rd."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $2ae6773a6cc7427c$exports = {};
$2ae6773a6cc7427c$exports = JSON.parse('{"title":"Psychic Crush (UA)","source":"Unearthed Arcana 66 - Fighter, Rogue, and Wizard","levelAndSchool":"6th-level enchantment","level":6,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"1 minute","description":["You overload the mind of one creature you can see within range, filling its psyche with discordant emotions. The target must make an Intelligence saving throw. On a failed save, the target takes 12d6 psychic damage and is stunned for 1 minute. On a successful save, the target takes half as much damage and isn\u2019t stunned.","The stunned target can make an Intelligence saving throw at the end of each of its turns. On a successful save, the spell ends on the target."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $10f7480ccd7afbef$exports = {};
$10f7480ccd7afbef$exports = JSON.parse('{"title":"Psychic Scream","source":"Xanathar\'s Guide to Everything","levelAndSchool":"9th-level enchantment","level":9,"castingTime":"1 action","range":"90 feet","components":"S","duration":"Instantaneous","description":["You unleash the power of your mind to blast the intellect of up to ten creatures of your choice that you can see within range. Creatures that have an Intelligence score of 2 or lower are unaffected.","Each target must make an Intelligence saving throw. On a failed save, a target takes 14d6 psychic damage and is stunned. On a successful save, a target takes half as much damage and isn\u2019t stunned. If a target is killed by this damage, its head explodes, assuming it has one.","A stunned target can make an Intelligence saving throw at the end of each of its turns. On a successful save, the stunning effect ends."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $0539c58ad72c3e3e$exports = {};
$0539c58ad72c3e3e$exports = JSON.parse('{"title":"Pulse Wave","source":"Explorer\'s Guide to Wildemount","levelAndSchool":"3rd-level evocation (dunamancy)","level":3,"castingTime":"1 action","range":"Self (30-foot cone)","components":"V, S","duration":"Instantaneous","description":["You create intense pressure, unleash it in a 30-foot cone, and decide whether the pressure pulls or pushes creatures and objects. Each creature in that cone must make a Constitution saving throw. A creature takes 6d6 force damage on a failed save, or half as much damage on a successful one. And every creature that fails the save is either pulled 15 feet toward you or pushed 15 feet away from you, depending on the choice you made for the spell.","In addition, unsecured objects that are completely within the cone are likewise pulled or pushed 15 feet.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, the damage increases by 1d6 and the distance pulled or pushed increases by 5 feet for each slot level above 3rd."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $75cca48d4b387e0a$exports = {};
$75cca48d4b387e0a$exports = JSON.parse('{"title":"Puppet (UA)","source":"Unearthed Arcana 36 - Starter Spells","levelAndSchool":"1st-level enchantment","level":1,"castingTime":"1 action","range":"120 feet","components":"V","duration":"Instantaneous","description":["Your gesture forces one humanoid you can see within range to make a Constitution saving throw. On a failed save, the target must move up to its speed in a direction you choose. In addition, you can cause the target to drop whatever it is holding. This spell has no effect on a humanoid that is immune to being charmed.","+\xa0Show\xa0HB\xa0Suggestion","-\xa0Hide\xa0HB\xa0Suggestion","HBThis spell is somewhat overpowered. Forced movement is one thing, but forced disarmament is very strong. I would recommend allowing only forced movement or forced disarmament, not both."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard","javascript:;","javascript:;"]}');


var $5beef28f762e6b05$exports = {};
$5beef28f762e6b05$exports = JSON.parse('{"title":"Purify Food and Drink","source":"Player\'s Handbook","levelAndSchool":"1st-level transmutation (ritual)","level":1,"castingTime":"1 action","range":"10 feet","components":"V, S","duration":"Instantaneous","description":["All nonmagical food and drink within a 5-foot-radius sphere centered on a point of your choice within range is purified and rendered free of poison and disease."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:paladin"]}');


var $4428d68ef86b4602$exports = {};
$4428d68ef86b4602$exports = JSON.parse('{"title":"Pyrotechnics","source":"Xanathar\'s Guide to Everything","levelAndSchool":"2nd-level transmutation","level":2,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Instantaneous","description":["Choose an area of flame that you can see and that can fit within a 5-foot cube within range. You can extinguish the fire in that area, and you create either fireworks or smoke.","Fireworks. The target explodes with a dazzling display of colors. Each creature within 10 feet of the target must succeed on a Constitution saving throw or become blinded until the end of your next turn.","Smoke. Thick black smoke spreads out from the target in a 20-foot radius, moving around corners. The area of the smoke is heavily obscured. The smoke persists for 1 minute or until a strong wind disperses it."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard","http://dnd5e.wikidot.com/spells:artificer"]}');


var $2dca3fd18f2891cd$exports = {};
$2dca3fd18f2891cd$exports = JSON.parse('{"title":"Raise Dead","source":"Player\'s Handbook","levelAndSchool":"5th-level necromancy","level":5,"castingTime":"1 hour","range":"Touch","components":"V, S, M (a diamond worth at least 500 gp, which the spell consumes)","duration":"Instantaneous","description":["You return a dead creature you touch to life, provided that it has been dead no longer than 10 days. If the creature\u2019s soul is both willing and at liberty to rejoin the body, the creature returns to life with 1 hit point.","This spell also neutralizes any poison and cures nonmagical diseases that affected the creature at the time it died. This spell doesn\u2019t, however, remove magical diseases, curses, or similar effects; if these aren\u2019t first removed prior to casting the spell, they take effect when the creature returns to life. The spell can\u2019t return an undead creature to life.","This spell closes all mortal wounds, but it doesn\u2019t restore missing body parts. If the creature is lacking body parts or organs integral for its survival \u2013 its head, for instance \u2013 the spell automatically fails.","Coming back from the dead is an ordeal. The target takes a -4 penalty to all attack rolls, saving throws, and ability checks. Every time the target finishes a long rest, the penalty is reduced by 1 until it disappears."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:paladin"]}');


var $6a0b7238a9694a2c$exports = {};
$6a0b7238a9694a2c$exports = JSON.parse('{"title":"Rary\'s Telepathic Bond","source":"Player\'s Handbook","levelAndSchool":"5th-level divination (ritual)","level":5,"castingTime":"1 action","range":"30 feet","components":"V, S, M (pieces of eggshell from two different kinds of creatures)","duration":"1 hour","description":["You forge a telepathic link among up to eight willing creatures of your choice within range, psychically linking each creature to all the others for the duration. Creatures with Intelligence scores of 2 or less aren\u2019t affected by this spell.","Until the spell ends, the targets can communicate telepathically through the bond whether or not they have a common language. The communication is possible over any distance, though it can\u2019t extend to other planes of existence."],"spellLists":["/spells:bard","http://dnd5e.wikidot.com/spells:wizard"]}');


var $12ee7dd86521f553$exports = {};
$12ee7dd86521f553$exports = JSON.parse('{"title":"Raulothim\'s Psychic Lance (UA)","source":"Unearthed Arcana 78 - Draconic Options","levelAndSchool":"4th-level enchantment","level":4,"castingTime":"1 action","range":"120 feet","components":"V","duration":"Instantaneous","description":["You unleash a shimmering lance of psychic power from your forehead at a creature that you can see within range. Alternatively, you can utter the creature\u2019s name. If the named target is within range, it gains no benefit from cover or invisibility as the lance homes in on it. If the named target isn\u2019t within range, the lance dissipates, and the spell slot is not expended.","The target must succeed on an Intelligence saving throw or take 10d6 psychic damage and be incapacitated until the start of your next turn.","At Higher Levels. When you cast this spell using a spell slot of 5th level or higher, the damage increases by 1d6 for each slot level above 4th."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $546e46b8c46e6e03$exports = {};
$546e46b8c46e6e03$exports = JSON.parse('{"title":"Raulothim\'s Psychic Lance","source":"Fizban\'s Treasury of Dragons","levelAndSchool":"4th-level Enchantment","level":4,"castingTime":"1 action","range":"120 feet","components":"V","duration":"Instantaneous","description":["You unleash a shimmering lance of psychic power from your forehead at a creature that you can see within range. Alternatively, you can utter a creature\u2019s name. If the named target is within range, it becomes the spell\u2019s target even if you can\u2019t see it. If the named target isn\u2019t within range, the lance dissipates without effect.","The target must make an Intelligence saving throw. On a failed save, the target takes 7d6 psychic damage and is incapacitated until the start of your next turn. On a successful save, the creature takes half as much damage and isn\u2019t incapacitated.","At Higher Levels. When you cast this spell using a spell slot of 5th level or higher, the damage increases by 1d6 for each slot level above 4th."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $0180cebd66021fec$exports = {};
$0180cebd66021fec$exports = JSON.parse('{"title":"Ravenous Void","source":"Explorer\'s Guide to Wildemount","levelAndSchool":"9th-level evocation (dunamancy:graviturgy)","level":9,"castingTime":"1 action","range":"1,000 feet","components":"V, S, M (a small, nine-pointed star made of iron)","duration":"Concentration, up to 1 minute","description":["You create a 20-foot-radius sphere of destructive gravitation force centered on a point you can see within range. For the spell\'s duration, the sphere and any space within 100 feet of it are difficult terrain, and nonmagical objects fully inside the sphere are destroyed if they aren\'t being worn or carried.","When the sphere appears and at the start of each of your turns until the spell ends, unsecured objects within 100 feet of the sphere are pulled toward the sphere\'s center, ending in an unoccupied space as close to the center as possible.","A creature that starts its turn within 100 feet of the sphere must succeed on a Strength saving throw or be pulled straight toward the sphere\'s center, ending in an unoccupied space as close to the center as possible. A creature that enters the sphere for the first time on a turn or starts its turn there takes 5d10 force damage and is restrained until it is no longer in the sphere. If the sphere is in the air, the restrained creature hovers inside the sphere. A creature can use its action to make a Strength check against your spell save DC, ending this restrained condition on itself or another creature in the sphere that it can reach. A creature reduced to 0 hit points by this spell is annihilated, along with any nonmagical items it is wearing or carrying."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $29892325f445d710$exports = {};
$29892325f445d710$exports = JSON.parse('{"title":"Ray of Enfeeblement","source":"Player\'s Handbook","levelAndSchool":"2nd-level necromancy","level":2,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Concentration, up to 1 minute","description":["A black beam of enervating energy springs from your finger toward a creature within range. Make a ranged spell attack against the target. On a hit, the target deals only half damage with weapon attacks that use Strength until the spell ends.","At the end of each of the target\u2019s turns, it can make a Constitution saving throw against the spell. On a success, the spell ends."],"spellLists":["http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $f977ba866d6b1b12$exports = {};
$f977ba866d6b1b12$exports = JSON.parse('{"title":"Ray of Frost","source":"Player\'s Handbook","levelAndSchool":"Evocation cantrip","level":0,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Instantaneous","description":["A frigid beam of blue-white light streaks toward a creature within range. Make a ranged spell attack against the target. On a hit, it takes 1d8 cold damage, and its speed is reduced by 10 feet until the start of your next turn.","At Higher Levels. The spell\u2019s damage increases by 1d8 when you reach 5th level (2d8), 11th level (3d8), and 17th level (4d8)."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $bf5c3000e99c3ff7$exports = {};
$bf5c3000e99c3ff7$exports = JSON.parse('{"title":"Ray of Sickness","source":"Player\'s Handbook","levelAndSchool":"1st-level necromancy","level":1,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Instantaneous","description":["A ray of sickening greenish energy lashes out toward a creature within range. Make a ranged spell attack against the target. On a hit, the target takes 2d8 poison damage and must make a Constitution saving throw. On a failed save, it is also poisoned until the end of your next turn.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the damage increases by 1d8 for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $28b789b8c59bd00c$exports = {};
$28b789b8c59bd00c$exports = JSON.parse('{"title":"Reality Break","source":"Explorer\'s Guide to Wildemount","levelAndSchool":"8th-level conjuration (dunamancy:chronurgy)","level":8,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a crystal prism)","duration":"Concentration, up to 1 minute","description":["You shatter the barriers between realities and timelines, thrusting a creature into turmoil and madness. The target must succeed on a Wisdom saving throw, or it can\'t take reactions until the spell ends. The affected target must also roll a d10 at the start of each of its turns; the number rolled determines what happens to the target as shown on the Reality Break Effects table.","At the end of each of its turns, the affected target can repeat the Wisdom saving throw, ending the spell on itself on a success","Reality Break Effects","d10","Effect","1-2","Vision of the Far Realm. The target takes 6d12 psychic damage, and it is stunned until the end of the turn","3-5","Rending Rift. The target must make a Dexterity saving throw, taking 8d12 force damage on a failed save, or half as much damage on a successful save.","6-8","Wormhole. The target is teleported, along with everything it is wearing and carrying, up to 30 feet to an unoccupied space of your choice that you can see. The target also takes 10d12 force damage and is knocked prone.","9-10","Chill of the Dark Void. The target takes 10d12 cold damage, and it is blinded until the end of the turn."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $00600c36b9e03c6b$exports = {};
$00600c36b9e03c6b$exports = JSON.parse('{"title":"Regenerate","source":"Player\'s Handbook","levelAndSchool":"7th-level transmutation","level":7,"castingTime":"1 minute","range":"Touch","components":"V, S, M (a prayer wheel and holy water)","duration":"1 hour","description":["You touch a creature and stimulate its natural healing ability. The target regains 4d8 + 15 hit points. For the duration of the spell, the target regains 1 hit point at the start of each of its turns (10 hit points each minute).","The target\u2019s severed body members (fingers, legs, tails, and so on), if any, are restored after 2 minutes. If you have the severed part and hold it to the stump, the spell instantaneously causes the limb to knit to the stump."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid"]}');


var $8aba07065d29fd11$exports = {};
$8aba07065d29fd11$exports = JSON.parse('{"title":"Reincarnate","source":"Player\'s Handbook","levelAndSchool":"5th-level transmutation","level":5,"castingTime":"1 hour","range":"Touch","components":"V, S, M (rare oils and unguents worth at least 1,000 gp, which the spell consumes)","duration":"Instantaneous","description":["You touch a dead humanoid or a piece of a dead humanoid. Provided that the creature has been dead no longer than 10 days, the spell forms a new adult body for it and then calls the soul to enter that body. If the target\u2019s soul isn\u2019t free or willing to do so, the spell fails.","The magic fashions a new body for the creature to inhabit, which likely causes the creature\u2019s race to change. The DM rolls a d100 and consults the following table to determine what form the creature takes when restored to life, or the DM chooses a form.","Reincarnation Table","d100","Race","01-04","Dragonborn","05-13","Dwarf, hill","14-21","Dwarf, mountain","22-25","Elf, dark","26-34","Elf, high","35-42","Elf, wood","43-46","Gnome, forest","47-52","Gnome, rock","53-56","Half-elf","57-60","Half-orc","61-68","Halfling, lightfoot","69-76","Halfling, stout","77-96","Human","97-00","Tiefling","The reincarnated creature recalls its former life and experiences. It retains the capabilities it had in its original form, except it exchanges its original race for the new one and changes its racial traits accordingly."],"spellLists":["http://dnd5e.wikidot.com/spells:druid"]}');


var $1dbd8fa81b59e157$exports = {};
$1dbd8fa81b59e157$exports = JSON.parse('{"title":"Remote Access (UA)","source":"Unearthed Arcana 7 - Modern Magic","levelAndSchool":"1st-level transmutation (technomagic)","level":1,"castingTime":"1 action","range":"120 feet","components":"V, S","duration":"10 minutes","description":["You can use any electronic device within range as if it were in your hands. This is not a telekinesis effect. Rather, this spell allows you to simulate a device\'s mechanical functions electronically. You are able to access only functions that a person using the device manually would be able to access. You can use remote access with only one device at a time."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $d29d9d5c2e98ba9c$exports = {};
$d29d9d5c2e98ba9c$exports = JSON.parse('{"title":"Remove Curse","source":"Player\'s Handbook","levelAndSchool":"3rd-level abjuration","level":3,"castingTime":"1 action","range":"Touch","components":"V, S","duration":"Instantaneous","description":["At your touch, all curses affecting one creature or object end. If the object is a cursed magic item, its curse remains, but the spell breaks its owner\u2019s attunement to the object so it can be removed or discarded."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:paladin","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $9dc0b8aa009b1877$exports = {};
$9dc0b8aa009b1877$exports = JSON.parse('{"title":"Resistance","source":"Player\'s Handbook","levelAndSchool":"Abjuration cantrip","level":0,"castingTime":"1 action","range":"Touch","components":"V, S, M (a miniature cloak)","duration":"Concentration, up to 1 minute","description":["You touch one willing creature. Once before the spell ends, the target can roll a d4 and add the number rolled to one saving throw of its choice. It can roll the die before or after the saving throw. The spell then ends."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid"]}');


var $87e1fc2720182e88$exports = {};
$87e1fc2720182e88$exports = JSON.parse('{"title":"Resurrection","source":"Player\'s Handbook","levelAndSchool":"7th-level necromancy","level":7,"castingTime":"1 hour","range":"Touch","components":"V, S, M (a diamond worth at least 1,000 gp, which the spell consumes)","duration":"Instantaneous","description":["You touch a dead creature that has been dead for no more than a century, that didn\u2019t die of old age, and that isn\u2019t undead. If its soul is free and willing, the target returns to life with all its hit points.","This spell neutralizes any poisons and cures normal diseases afflicting the creature when it died. It doesn\u2019t, however, remove magical diseases, curses, and the like; if such affects aren\u2019t removed prior to casting the spell, they afflict the target on its return to life.","This spell closes all mortal wounds and restores any missing body parts.","Coming back from the dead is an ordeal. The target takes a -4 penalty to all attack rolls, saving throws, and ability checks. Every time the target finishes a long rest, the penalty is reduced by 1 until it disappears.","Casting this spell to restore life to a creature that has been dead for one year or longer taxes you greatly. Until you finish a long rest, you can\u2019t cast spells again, and you have disadvantage on all attack rolls, ability checks, and saving throws."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric"]}');


var $a467e2ccc4eb60ed$exports = {};
$a467e2ccc4eb60ed$exports = JSON.parse('{"title":"Reverse Gravity","source":"Player\'s Handbook","levelAndSchool":"7th-level transmutation","level":7,"castingTime":"1 action","range":"100 feet","components":"V, S, M (a lodestone and iron filings)","duration":"Concentration, up to 1 minute","description":["This spell reverses gravity in a 50-foot-radius, 100-foot high cylinder centered on a point within range. All creatures and objects that aren\u2019t somehow anchored to the ground in the area fall upward and reach the top of the area when you cast this spell. A creature can make a Dexterity saving throw to grab onto a fixed object it can reach, thus avoiding the fall.","If some solid object (such as a ceiling) is encountered in this fall, falling objects and creatures strike it just as they would during a normal downward fall. If an object or creature reaches the top of the area without striking anything, it remains there, oscillating slightly, for the duration.","At the end of the duration, affected objects and creatures fall back down."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $ac39bcdf82ced2a9$exports = {};
$ac39bcdf82ced2a9$exports = JSON.parse('{"title":"Revivify","source":"Player\'s Handbook","levelAndSchool":"3rd-level necromancy","level":3,"castingTime":"1 action","range":"Touch","components":"V, S, M (diamonds worth 300 gp, which the spell consumes)","duration":"Instantaneous","description":["You touch a creature that has died within the last minute. That creature returns to life with 1 hit point. This spell can\u2019t return to life a creature that has died of old age, nor can it restore any missing body parts."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:cleric","/spells:druid","http://dnd5e.wikidot.com/spells:paladin","/spells:ranger"]}');


var $c8573f4d9d008191$exports = {};
$c8573f4d9d008191$exports = JSON.parse('{"title":"Rime\'s Binding Ice","source":"Fizban\'s Treasury of Dragons","levelAndSchool":"2nd-level Evocation","level":2,"castingTime":"1 Action","range":"Self (30-foot cone)","components":"S, M (a vial of meltwater)","duration":"Instantaneous","description":["A burst of cold energy emanates from you in a 30-foot cone. Each creature in that area must make a Constitution saving throw. On a failed save, a creature takes 3d8 cold damage and is hindered by ice formations for 1 minute, or until it or another creature within reach of it uses an action to break away the ice. A creature hindered by ice has its speed reduced to 0. On a successful save, a creature takes half as much damage and isn\u2019t hindered by ice.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, increase the cold damage by 1d8 for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $b34260469caa4acb$exports = {};
$b34260469caa4acb$exports = JSON.parse('{"title":"Rope Trick","source":"Player\'s Handbook","levelAndSchool":"2nd-level transmutation","level":2,"castingTime":"1 action","range":"Touch","components":"V, S, M (powdered corn extract and a twisted loop of parchment)","duration":"1 hour","description":["You touch a length of rope that is up to 60 feet long. One end of the rope then rises into the air until the whole rope hangs perpendicular to the ground. At the upper end of the rope, an invisible entrance opens to an extradimensional space that lasts until the spell ends.","The extradimensional space can be reached by climbing to the top of the rope. The space can hold as many as eight Medium or smaller creatures. The rope can be pulled into the space, making the rope disappear from view outside the space.","Attacks and spells can\u2019t cross through the entrance into or out of the extradimensional space, but those inside can see out of it as if through a 3-foot-by-5-foot window centered on the rope.","Anything inside the extradimensional space drops out when the spell ends."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $fffff60320b6cfc6$exports = {};
$fffff60320b6cfc6$exports = JSON.parse('{"title":"Sacred Flame","source":"Player\'s Handbook","levelAndSchool":"Evocation cantrip","level":0,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Instantaneous","description":["Flame-like radiance descends on a creature that you can see within range. The target must succeed on a Dexterity saving throw or take 1d8 radiant damage. The target gains no benefit from cover for this saving throw.","At Higher Levels. The spell\u2019s damage increases by 1d8 when you reach 5th level (2d8), 11th level (3d8), and 17th level (4d8)."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric"]}');


var $c04aa5a307c77a0b$exports = {};
$c04aa5a307c77a0b$exports = JSON.parse('{"title":"Sanctuary","source":"Player\'s Handbook","levelAndSchool":"1st-level abjuration","level":1,"castingTime":"1 bonus action","range":"30 feet","components":"V, S, M (a small silver mirror)","duration":"1 minute","description":["You ward a creature within range against attack. Until the spell ends, any creature who targets the warded creature with an attack or a harmful spell must first make a Wisdom saving throw. On a failed save, the creature must choose a new target or lose the attack or spell. This spell doesn\u2019t protect the warded creature from area effects, such as the explosion of a fireball.","If the warded creature makes an attack, casts a spell that affects an enemy, or deals damage to another creature, this spell ends."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:cleric"]}');


var $942744d29227220b$exports = {};
$942744d29227220b$exports = JSON.parse('{"title":"Sapping Sting","source":"Explorer\'s Guide to Wildemount","levelAndSchool":"Necromancy cantrip","level":0,"castingTime":"1 action","range":"30 feet","components":"V, S","duration":"Instantaneous","description":["You sap the vitality of one creature you can see in range. The target must succeed on a Constitution saving throw or take 1d4 necrotic damage and fall prone.","At Higher Levels. This spell\'s damage increases by 1d4 when you reach 5th level (2d4), 11th level (3d4), and 17th level (4d4)."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $1fd7a45155fe1c1a$exports = {};
$1fd7a45155fe1c1a$exports = JSON.parse('{"title":"Scatter","source":"Xanathar\'s Guide to Everything","levelAndSchool":"6th-level conjuration","level":6,"castingTime":"1 action","range":"30 feet","components":"V","duration":"Instantaneous","description":["The air quivers around up to five creatures of your choice that you can see within range. An unwilling creature must succeed on a Wisdom saving throw to resist this spell. You teleport each affected target to an unoccupied space that you can see within 120 feet of you. That space must be on the ground or on a floor."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $650304715d85ac4b$exports = {};
$650304715d85ac4b$exports = JSON.parse('{"title":"Scorching Ray","source":"Player\'s Handbook","levelAndSchool":"2nd-level evocation","level":2,"castingTime":"1 action","range":"120 feet","components":"V, S","duration":"Instantaneous","description":["You create three rays of fire and hurl them at targets within range. You can hurl them at one target or several. Make a ranged spell attack for each ray. On a hit, the target takes 2d6 fire damage.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, you create one additional ray for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $420fb7c0185bfe76$exports = {};
$420fb7c0185bfe76$exports = JSON.parse('{"title":"Scrying","source":"Player\'s Handbook","levelAndSchool":"5th-level divination","level":5,"castingTime":"10 minutes","range":"Self","components":"V, S, M (a focus worth at least 1,000 gp, such as a crystal ball, a silver mirror, or a font filled with holy water)","duration":"Concentration, up to 10 minutes","description":["You can see and hear a particular creature you choose that is on the same plane of existence as you. The target must make a Wisdom saving throw, which is modified by how well you know the target and the sort of physical connection you have to it. If a target knows you\u2019re casting this spell, it can fail the saving throw voluntarily if it wants to be observed.","Knowledge","Save Modifier","Secondhand (you have heard of the target)","+5","Firsthand (you have met the target)","+0","Familiar (you know the target well)","-5","Connection","Save Modifier","Likeness or picture","-2","Possession or garment","-4","Body part, lock of hair, bit of nail, or the like\u2003","-10","On a successful save, the target isn\u2019t affected, and you can\u2019t use this spell against it again for 24 hours.","On a failed save, the spell creates an invisible sensor within 10 feet of the target. You can see and hear through the sensor as if you were there. The sensor moves with the target, remaining within 10 feet of it for the duration. A creature that can see invisible objects sees the sensor as a luminous orb about the size of your fist.","Instead of targeting a creature, you can choose a location you have seen before as the target of this spell. When you do, the sensor appears at that location and doesn\u2019t move."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $698708573b794da0$exports = {};
$698708573b794da0$exports = JSON.parse('{"title":"Searing Smite","source":"Player\'s Handbook","levelAndSchool":"1st-level evocation","level":1,"castingTime":"1 bonus action","range":"Self","components":"V","duration":"Concentration, up to 1 minute","description":["The next time you hit a creature with a melee weapon attack during the spell\u2019s duration, your weapon flares with white-hot intensity, and the attack deals an extra 1d6 fire damage to the target and causes the target to ignite in flames.","At the start of each of its turns until the spell ends, the target must make a Constitution saving throw. On a failed save, it takes 1d6 fire damage. On a successful save, the spells ends. If the target or a creature within 5 feet of it uses an action to put out the flames, or if some other effect douses the flames (such as the target being submerged in water), the spell ends.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the initial extra damage dealt by the attack increases by 1d6 for each slot above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:paladin","/spells:ranger"]}');


var $8fcfc6c360c4dcfb$exports = {};
$8fcfc6c360c4dcfb$exports = JSON.parse('{"title":"See Invisibility","source":"Player\'s Handbook","levelAndSchool":"2nd-level divination","level":2,"castingTime":"1 action","range":"Self","components":"V, S, M (a pinch of talc and a small sprinkling of powdered silver)","duration":"1 hour","description":["For the duration, you see invisible creatures and objects as if they were visible, and you can see into the Ethereal Plane. Ethereal creatures and objects appear ghostly and translucent."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $1908b0701e14725a$exports = {};
$1908b0701e14725a$exports = JSON.parse('{"title":"Seeming","source":"Player\'s Handbook","levelAndSchool":"5th-level illusion","level":5,"castingTime":"1 action","range":"30 feet","components":"V, S","duration":"8 hours","description":["This spell allows you to change the appearance of any number of creatures that you can see within range. You give each target you choose a new, illusory appearance. An unwilling target can make a Charisma saving throw, and if it succeeds, it is unaffected by this spell.","The spell disguises physical appearances as well as clothing, armor, weapons, and equipment. You can make each creature seem 1 foot shorter or taller and appear thin, fat, or in-between. You can\u2019t change a target\u2019s body type, so you must choose a form that has the same basic arrangement of limbs. Otherwise, the extent of the illusion is up to you. The spell lasts for the duration, unless you use your action to dismiss it sooner.","The changes wrought by this spell fail to hold up to physical inspections. For example, if you use this spell to add a hat to a creature\u2019s outfit, objects pass through the hat, and anyone who touches it would feel nothing or would feel the creature\u2019s head and hair. If you use this spell to appear thinner then you are, the hand of someone who reaches out to touch you would bump into you while it was seemingly still in midair.","A creature can use its action to inspect a target and make an Intelligence (Investigation) check against your spell save DC. If it succeeds, it becomes aware that the target is disguised."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $24609248f9df7a4b$exports = {};
$24609248f9df7a4b$exports = JSON.parse('{"title":"Sending","source":"Player\'s Handbook","levelAndSchool":"3rd-level evocation","level":3,"castingTime":"1 action","range":"Unlimited","components":"V, S, M (a short piece of fine copper wire)","duration":"1 round","description":["You send a short message of twenty-five words or less to a creature with which you are familiar. The creature hears the message in its mind, recognizes you as the sender if it knows you, and can answer in a like manner immediately. The spell enables creatures with Intelligence scores of at least 1 to understand the meaning of your message.","You can send the message across any distance and even to other planes of existence, but if the target is on a different plane than you, there is a 5 percent chance that the message doesn\'t arrive."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:wizard"]}');


var $4331c0d259eb375f$exports = {};
$4331c0d259eb375f$exports = JSON.parse('{"title":"Sense Emotion (UA)","source":"Unearthed Arcana 36 - Starter Spells","levelAndSchool":"1st-level divination","level":1,"castingTime":"1 action","range":"Self","components":"V, S","duration":"Concentration, up to 1 minute","description":["You attune your senses to pick up the emotions of others for the duration. When you cast the spell, and as your action on each turn until the spell ends, you can focus your senses on one humanoid you can see within 30 feet of you. You instantly learn the target\u2019s prevailing emotion, whether it\u2019s love, anger, pain, fear, calm, or something else. If the target isn\u2019t actually humanoid or it is immune to being charmed, you sense that it is calm."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $c2c92f6a1ee54ff3$exports = {};
$c2c92f6a1ee54ff3$exports = JSON.parse('{"title":"Sequester","source":"Player\'s Handbook","levelAndSchool":"7th-level transmutation","level":7,"castingTime":"1 action","range":"Touch","components":"V, S, M (a powder composed of diamond, emerald, ruby, and sapphire dust worth at least 5,000 gp, which the spell consumes)","duration":"Until dispelled","description":["By means of this spell, a willing creature or an object can be hidden away, safe from detection for the duration. When you cast the spell and touch the target, it becomes invisible and can\u2019t be targeted by divination spells or perceived through scrying sensors created by the divination of spells.","If the target is a creature, it falls into a state of suspended animation. Time ceases to flow for it, and it doesn\u2019t grow older.","You can set a condition for the spell to end early. The condition can be anything you choose, but it must occur or be visible within 1 mile of the target. Examples include \\"after 1,000 years\\" or \\"when the tarrasque awakes.\\" This spells also ends if the target takes any damage."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $8eda17735fcdc0f4$exports = {};
$8eda17735fcdc0f4$exports = JSON.parse('{"title":"Shadow Blade","source":"Xanathar\'s Guide to Everything","levelAndSchool":"2nd-level illusion","level":2,"castingTime":"1 bonus action","range":"Self","components":"V, S","duration":"Concentration, up to 1 minute","description":["You weave together threads of shadow to create a sword of solidified gloom in your hand. This magic sword lasts until the spell ends. It counts as a simple melee weapon with which you are proficient. It deals 2d8 psychic damage on a hit and has the finesse, light, and thrown properties (range 20/60). In addition, when you use the sword to attack a target that is in dim light or darkness, you make the attack roll with advantage.","If you drop the weapon or throw it, it dissipates at the end of the turn. Thereafter, while the spell persists, you can use a bonus action to cause the sword to reappear in your hand.","At Higher Levels. When you cast this spell using a 3rd- or 4th-level spell slot, the damage increases to 3d8. When you cast it using a 5th- or 6th-level spell slot, the damage increases to 4d8. When you cast it using a spell slot of 7th level or higher, the damage increases to 5d8."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $56ac2f70f92b9d15$exports = {};
$56ac2f70f92b9d15$exports = JSON.parse('{"title":"Shadow Of Moil","source":"Xanathar\'s Guide to Everything","levelAndSchool":"4th-level necromancy","level":4,"castingTime":"1 action","range":"Self","components":"V, S, M (an undead eyeball encased in a gem worth at least 150 gp)","duration":"Concentration, up to 1 minute","description":["Flame-like shadows wreathe your body until the spell ends, causing you to become heavily obscured to others. The shadows turn dim light within 10 feet of you into darkness, and bright light in the same area to dim light.","Until the spell ends, you have resistance to radiant damage. In addition, whenever a creature within 10 feet of you hits you with an attack, the shadows lash out at that creature, dealing it 2d8 necrotic damage."],"spellLists":["http://dnd5e.wikidot.com/spells:warlock"]}');


var $85d0fd5c30e8eaff$exports = {};
$85d0fd5c30e8eaff$exports = JSON.parse('{"title":"Shape Water","source":"Xanathar\'s Guide to Everything","levelAndSchool":"Transmutation cantrip","level":0,"castingTime":"1 action","range":"30 feet","components":"S","duration":"Instantaneous or 1 hour","description":["You choose an area of water that you can see within range and that fits within a 5-foot cube. You manipulate it in one of the following ways:","You instantaneously move or otherwise change the flow of the water as you direct, up to 5 feet in any direction. This movement doesn\u2019t have enough force to cause damage.","You cause the water to form into simple shapes and animate at your direction. This change lasts for 1 hour.","You change the water\u2019s color or opacity. The water must be changed in the same way throughout. This change lasts for 1 hour.","You freeze the water, provided that there are no creatures in it. The water unfreezes in 1 hour.","If you cast this spell multiple times, you can have no more than two of its non-instantaneous effects active at a time, and you can dismiss such an effect as an action."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $e1202f9a43d38b8a$exports = {};
$e1202f9a43d38b8a$exports = JSON.parse('{"title":"Shapechange","source":"Player\'s Handbook","levelAndSchool":"9th-level transmutation","level":9,"castingTime":"1 action","range":"Self","components":"V, S, M (a jade circlet worth at least 1,500 gp, which you must place on your head before you cast the spell)","duration":"Concentration, up to 1 hour","description":["You assume the form of a different creature for the duration. The new form can be any creature with a challenge rating equal to your level or lower. The creature can\'t be a construct or an undead, and you must have seen the sort of creature at least once. You transform into an average example of that creature, one without any class levels or the Spellcasting trait.","Your game statistics are replaced by the statistics of the chosen creature, though you retain your alignment and Intelligence, Wisdom, and Charisma scores. You also retain all of your skill and saving throw proficiencies, in addition to gaining those of the creature, If the creature has the same proficiency as you, and the bonus listed in its statistics is higher than yours, use the creature\'s bonus in place of yours. You can\'t use any legendary actions or lair actions of the new form.","You assume the hit points and Hit Dice of the new form. When you revert to your normal, you return to the number of hit points you had before you transformed. If you revert as a result of dropping to 0 hit points, any excess damage carries over to your normal form. As long as the excess damage doesn\'t reduce your normal form to 0 hitpoints, you aren\'t knocked unconscious.","You retain the benefit of any features from your class, race, or other source and can use them, provided that your new form is physically capable of doing so. You can\'t use any special senses you have (for example, darkvision) unless your new form also has that sense. You can only speak if the creature can normally speak.","When you transform, you choose whether your equipment falls to the ground, merges into the new form, or is worn by it. Worn equipment functions as normal. The DM determines whether it is practical for the new form to wear a piece of equipment, based on the creature\'s shape and size. Your equipment doesn\'t change shape or size to match the new form, and any equipment that the new form can\'t wear must either fall to the ground or merge into your new form. Equipment that merges has no effect in that state.","During this spell\'s duration, you can use your action to assume a different form following the same restrictions and rules for the original form, with one exception: if your new form has more hit points than your current one, your hit points remain at their current value."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:wizard"]}');


var $c2e57c0905b6c5ee$exports = {};
$c2e57c0905b6c5ee$exports = JSON.parse('{"title":"Shatter","source":"Player\'s Handbook","levelAndSchool":"2nd-level evocation","level":2,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a chip of mica)","duration":"Instantaneous","description":["A sudden loud ringing noise, painfully intense, erupts from a point of your choice within range. Each creature in a 10-foot-radius sphere centered on that point must make a Constitution saving throw. A creature takes 3d8 thunder damage on a failed save, or half as much damage on a successful one. A creature made of inorganic material such as stone, crystal, or metal has disadvantage on this saving throw.","A nonmagical object that isn\u2019t being worn or carried also takes the damage if it\u2019s in the spell\u2019s area.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, the damage increases by 1d8 for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $5943cd80a3bdf216$exports = {};
$5943cd80a3bdf216$exports = JSON.parse('{"title":"Shield of Faith","source":"Player\'s Handbook","levelAndSchool":"1st-level abjuration","level":1,"castingTime":"1 bonus action","range":"60 feet","components":"V, S, M (a small parchment with a bit of holy text written on it)","duration":"Concentration, up to 10 minutes","description":["A shimmering field appears and surrounds a creature of your choice within range, granting it a +2 bonus to AC for the duration."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:paladin"]}');


var $378e2ca2ed7f9242$exports = {};
$378e2ca2ed7f9242$exports = JSON.parse('{"title":"Shield","source":"Player\'s Handbook","levelAndSchool":"1st-level abjuration","level":1,"castingTime":"1 reaction, which you take when you are hit by an attack or targeted by the magic missile spell","range":"Self","components":"V, S","duration":"1 round","description":["An invisible barrier of magical force appears and protects you. Until the start of your next turn, you have a +5 bonus to AC, including against the triggering attack, and you take no damage from magic missile."],"spellLists":["http://dnd5e.wikidot.com/spell:magic-missile","http://dnd5e.wikidot.com/spell:magic-missile","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $b34bfc87e332000e$exports = {};
$b34bfc87e332000e$exports = JSON.parse('{"title":"Shillelagh","source":"Player\'s Handbook","levelAndSchool":"Transmutation cantrip","level":0,"castingTime":"1 bonus action","range":"Touch","components":"V, S, M (mistletoe, a shamrock leaf, and a club or quarterstaff)","duration":"1 minute","description":["The wood of a club or quarterstaff you are holding is imbued with nature\u2019s power. For the duration, you can use your spellcasting ability instead of Strength for the attack and damage rolls of melee attacks using that weapon, and the weapon\u2019s damage die becomes a d8. The weapon also becomes magical, if it isn\u2019t already. The spell ends if you cast it again or if you let go of the weapon."],"spellLists":["http://dnd5e.wikidot.com/spells:druid"]}');


var $c34a8337ba89b2b2$exports = {};
$c34a8337ba89b2b2$exports = JSON.parse('{"title":"Shocking Grasp","source":"Player\'s Handbook","levelAndSchool":"Evocation cantrip","level":0,"castingTime":"1 action","range":"Touch","components":"V, S","duration":"Instantaneous","description":["Lightning springs from your hand to deliver a shock to a creature you try to touch. Make a melee spell attack against the target. You have advantage on the attack roll if the target is wearing armor made of metal. On a hit, the target takes 1d8 lightning damage, and it can\u2019t take reactions until the start of its next turn.","At Higher Levels. The spell\u2019s damage increases by 1d8 when you reach 5th level (2d8), 11th level (3d8), and 17th level (4d8)."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $51c03c2dcf6f6853$exports = {};
$51c03c2dcf6f6853$exports = JSON.parse('{"title":"Shutdown (UA)","source":"Unearthed Arcana 7 - Modern Magic","levelAndSchool":"5th-level transmutation (technomagic)","level":5,"castingTime":"1 action","range":"120 feet","components":"V, S","duration":"Concentration, up to 1 minute","description":["This spell shuts down all electronic devices within range that are not wielded by or under the direct control of a creature. If an electronic device within range is used by a creature, that creature must succeed on a Constitution saving throw to prevent the device from being shut down. While the spell remains active, no electronic device within range can be started or restarted."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $3587956e6e75144b$exports = {};
$3587956e6e75144b$exports = JSON.parse('{"title":"Sickening Radiance","source":"Xanathar\'s Guide to Everything","levelAndSchool":"4th-level evocation","level":4,"castingTime":"1 action","range":"120 feet","components":"V, S","duration":"Concentration, up to 10 minutes","description":["Dim, greenish light spreads within a 30-foot-radius sphere centered on a point you choose within range. The light spreads around corners, and it lasts until the spell ends.","When a creature moves into the spell\u2019s area for the first time on a turn or starts its turn there, that creature must succeed on a Constitution saving throw or take 4d10 radiant damage, and it suffers one level of exhaustion and emits a dim, greenish light in a 5-foot radius. This light makes it impossible for the creature to benefit from being invisible. The light and any levels of exhaustion caused by this spell go away when the spell ends."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $ae50413ab7199ca9$exports = {};
$ae50413ab7199ca9$exports = JSON.parse('{"title":"Silence","source":"Player\'s Handbook","levelAndSchool":"2nd-level illusion (ritual)","level":2,"castingTime":"1 action","range":"120 feet","components":"V, S","duration":"Concentration, up to 10 minutes","description":["For the duration, no sound can be created within or pass through a 20-foot-radius sphere centered on a point you choose within range. Any creature or object entirely inside the sphere is immune to thunder damage, and creatures are deafened while entirely inside it. Casting a spell that includes a verbal component is impossible there."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:ranger"]}');


var $ee8b00cc74d85635$exports = {};
$ee8b00cc74d85635$exports = JSON.parse('{"title":"Silent Image","source":"Player\'s Handbook","levelAndSchool":"1st-level illusion","level":1,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a bit of fleece)","duration":"Concentration, up to 10 minutes","description":["You create the image of an object, a creature, or some other visible phenomenon that is no larger than a 15-foot cube. The image appears at a spot within range and lasts for the duration. The image is purely visual; it isn\u2019t accompanied by sound, smell, or other sensory effects.","You can use your action to cause the image to move to any spot within range. As the image changes location, you can alter its appearance so that its movements appear natural for the image. For example, if you create an image of a creature and move it, you can alter the image so that it appears to be walking.","Physical interaction with the image reveals it to be an illusion, because things can pass through it. A creature that uses its action to examine the image can determine that it is an illusion with a successful Intelligence (Investigation) check against your spell save DC. If a creature discerns the illusion for what it is, the creature can see through the image."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $b095199790523b80$exports = {};
$b095199790523b80$exports = JSON.parse('{"title":"Silvery Barbs","source":"Strixhaven: A Curriculum of Chaos","levelAndSchool":"1st-level Enchantment","level":1,"castingTime":"1 reaction, which you take when a creature you can see within 60 feet of yourself succeeds on an attack roll, an ability check, or a saving throw","range":"60 feet","components":"V","duration":"Instantaneous","description":["You magically distract the triggering creature and turn its momentary uncertainty into encouragement for another creature. The triggering creature must reroll the d20 and use the lower roll.","You can then choose a different creature you can see within range (you can choose yourself). The chosen creature has advantage on the next attack roll, ability check, or saving throw it makes within 1 minute. A creature can be empowered by only one use of this spell at a time."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $2b537277f3036e36$exports = {};
$2b537277f3036e36$exports = JSON.parse('{"title":"Simulacrum","source":"Player\'s Handbook","levelAndSchool":"7th-level illusion","level":7,"castingTime":"12 hours","range":"Touch","components":"V, S, M (snow or ice in quantities sufficient to made a life-size copy of the duplicated creature; some hair, fingernail clippings, or other piece of that creature\u2019s body placed inside the snow or ice; and powdered ruby worth 1,500 gp, sprinkled over the duplicate and consumed by the spell)","duration":"Until dispelled","description":["You shape an illusory duplicate of one beast or humanoid that is within range for the entire casting time of the spell. The duplicate is a creature, partially real and formed from ice or snow, and it can take actions and otherwise be affected as a normal creature. It appears to be the same as the original, but it has half the creature\u2019s hit point maximum and is formed without any equipment. Otherwise, the illusion uses all the statistics of the creature it duplicates, except that it is a construct.","The simulacrum is friendly to you and creatures you designate. It obeys your spoken commands, moving and acting in accordance with your wishes and acting on your turn in combat. The simulacrum lacks the ability to learn or become more powerful, so it never increases its level or other abilities, nor can it regain expended spell slots.","If the simulacrum is damaged, you can repair it in an alchemical laboratory, using rare herbs and minerals worth 100 gp per hit point it regains. The simulacrum lasts until it drops to 0 hit points, at which point it reverts to snow and melts instantly.","If you cast this spell again, any currently active duplicates you created with this spell are instantly destroyed."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $30db296bed2be08f$exports = {};
$30db296bed2be08f$exports = JSON.parse('{"title":"Skill Empowerment","source":"Xanathar\'s Guide to Everything","levelAndSchool":"5th-level transmutation","level":5,"castingTime":"1 action","range":"Touch","components":"V, S","duration":"Concentration, up to 1 hour","description":["Your magic deepens a creature\u2019s understanding of its own talent. You touch one willing creature and give it expertise in one skill of your choice; until the spell ends, the creature doubles its proficiency bonus for ability checks it makes that use the chosen skill.","You must choose a skill in which the target is proficient and that isn\u2019t already benefiting from an effect, such as Expertise, that doubles its proficiency bonus."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard","http://dnd5e.wikidot.com/spells:artificer"]}');


var $1015628c4786ee85$exports = {};
$1015628c4786ee85$exports = JSON.parse('{"title":"Skywrite","source":"Xanathar\'s Guide to Everything","levelAndSchool":"2nd-level transmutation (ritual)","level":2,"castingTime":"1 action","range":"Sight","components":"V, S","duration":"Concentration, up to 1 day","description":["You cause up to ten words to form in a part of the sky you can see. The words appear to be made of cloud and remain in place for the spell\u2019s duration. The words dissipate when the spell ends. A strong wind can disperse the clouds and end the spell early."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:wizard","http://dnd5e.wikidot.com/spells:artificer"]}');


var $df6d2b9811f8dbc8$exports = {};
$df6d2b9811f8dbc8$exports = JSON.parse('{"title":"Sleep","source":"Player\'s Handbook","levelAndSchool":"1st-level enchantment","level":1,"castingTime":"1 action","range":"90 feet","components":"V, S, M (a pinch of fine sand, rose petals, or a cricket)","duration":"1 minute","description":["This spell sends creatures into a magical slumber. Roll 5d8, the total is how many hit points of creatures this spell can affect. Creatures within 20 feet of a point you choose within range are affected in ascending order of their current hit points (ignoring unconscious creatures).","Starting with the creature that has the lowest current hit points, each creature affected by this spell falls unconscious until the spell ends, the sleeper takes damage, or someone uses an action to shake or slap the sleeper awake. Subtract each creature\u2019s hit points from the total before moving on to the creature with the next lowest hit points. A creature\u2019s hit points must be equal to or less than the remaining total for that creature to be affected. Undead and creatures immune to being charmed aren\u2019t affected by this spell.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, roll an additional 2d8 for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $09b72f384f228ca2$exports = {};
$09b72f384f228ca2$exports = JSON.parse('{"title":"Sleet Storm","source":"Player\'s Handbook","levelAndSchool":"3rd-level conjuration","level":3,"castingTime":"1 action","range":"120 feet","components":"V, S, M (a pinch of dust and a few drops of water)","duration":"Concentration, up to 1 minute","description":["Until the spell ends, freezing rain and sleet fall in a 20-foot-tall cylinder with a 40-foot radius centered on a point you choose within range. The area is heavily obscured, and exposed flames in the area are doused.","The ground in the area is covered with slick ice, making it difficult terrain. When a creature enters the spell\u2019s area for the first time on a turn or starts its turn there, it must make a Dexterity saving throw. On a failed save, it falls prone.","If a creature starts its turn in the spell\'s area and is concentrating on a spell, the creature must make a successful Constitution saving throw against your spell save DC or lose concentration."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $29f1807a024f6640$exports = {};
$29f1807a024f6640$exports = JSON.parse('{"title":"Slow","source":"Player\'s Handbook","levelAndSchool":"3rd-level transmutation","level":3,"castingTime":"1 action","range":"120 feet","components":"V, S, M (a drop of molasses)","duration":"Concentration, up to 1 minute","description":["You alter time around up to six creatures of your choice in a 40-foot cube within range. Each target must succeed on a Wisdom saving throw or be affected by this spell for the duration.","An affected target\u2019s speed is halved, it takes a -2 penalty to AC and Dexterity saving throws, and it can\u2019t use reactions. On its turn, it can use either an action or a bonus action, not both. Regardless of the creature\u2019s abilities or magic items, it can\u2019t make more than one melee or ranged attack during its turn.","If the creature attempts to cast a spell with a casting time of 1 action, roll a d20. On an 11 or higher, the spell doesn\u2019t take effect until the creature\u2019s next turn, and the creature must use its action on that turn to complete the spell. If it can\u2019t, the spell is wasted.","A creature affected by this spell makes another Wisdom saving throw at the end of each of its turns. On a successful save, the effect ends for it."],"spellLists":["/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $060bcca378914270$exports = {};
$060bcca378914270$exports = JSON.parse('{"title":"Snare","source":"Xanathar\'s Guide to Everything","levelAndSchool":"1st-level abjuration","level":1,"castingTime":"1 minute","range":"Touch","components":"V, S, M (30 feet of cord or rope, which is consumed by the spell)","duration":"Until dispelled or triggered","description":["While you cast this spell, you use the cord or rope to create a circle with a 5-foot radius on a flat surface within your reach. When you finish casting, the cord or rope disappears to become a magical trap.","The trap is nearly invisible and requires a successful Intelligence (Investigation) check against your spell save DC to be found.","The trap triggers when a Small creature or larger moves into the area protected by the spell. The triggering creature must succeed on a Dexterity saving throw or fall prone and be hoisted into the air until it hangs upside down 3 feet above the protected surface, where it is restrained.","The restrained creature can make a Dexterity saving throw with disadvantage at the end of each of its turns and ends the restrained effect on a success. Alternatively, another creature that can reach the restrained creature can use an action to make an Intelligence (Arcana) check against your spell save DC. On a success, the restrained effect also ends."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger","http://dnd5e.wikidot.com/spells:wizard"]}');


var $d86147f647ede1b7$exports = {};
$d86147f647ede1b7$exports = JSON.parse('{"title":"Snilloc\'s Snowball Storm","source":"Xanathar\'s Guide to Everything","levelAndSchool":"2nd-level evocation","level":2,"castingTime":"1 action","range":"90 feet","components":"V, S, M (a piece of ice or a small white rock chip)","duration":"Instantaneous","description":["A flurry of magic snowballs erupts from a point you choose within range. Each creature in a 5-foot-radius sphere centered on that point must make a Dexterity saving throw. A creature takes 3d6 cold damage on a failed save, or half as much damage on a successful one.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, the damage increases by 1d6 for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $146d8ea9c25fab65$exports = {};
$146d8ea9c25fab65$exports = JSON.parse('{"title":"Soul Cage","source":"Xanathar\'s Guide to Everything","levelAndSchool":"6th-level necromancy","level":6,"castingTime":"1 reaction, which you take when a humanoid you can see within 60 feet of you dies","range":"60 feet","components":"V, S, M (a tiny silver cage worth 100 gp)","duration":"8 hours","description":["This spell snatches the soul of a humanoid as it dies and traps it inside the tiny cage you use for the material component. A stolen soul remains inside the cage until the spell ends or until you destroy the cage, which ends the spell. While you have a soul inside the cage, you can exploit it in any of the ways described below. You can use a trapped soul up to six times. Once you exploit a soul for the sixth time, it is released, and the spell ends. While a soul is trapped, the dead humanoid it came from can\u2019t be revived.","Steal Life. You can use a bonus action to drain vigor from the soul and regain 2d8 hit points.","Query Soul. You ask the soul a question (no action required) and receive a brief telepathic answer, which you can understand regardless of the language used. The soul knows only what it knew in life, but it must answer you truthfully and to the best of its ability. The answer is no more than a sentence or two and might be cryptic.","Borrow Experience. You can use a bonus action to bolster yourself with the soul\u2019s life experience, making your next attack roll, ability check, or saving throw with advantage. If you don\u2019t use this benefit before the start of your next turn, it is lost.","Eyes of the Dead. You can use an action to name a place the humanoid saw in life, which creates an invisible sensor somewhere in that place if it is on the plane of existence you\u2019re currently on. The sensor remains for as long as you concentrate, up to 10 minutes (as if you were concentrating on a spell). You receive visual and auditory information from the sensor as if you were in its space using your senses.","A creature that can see the sensor (such as one using see invisibility or truesight) sees a translucent image of the tormented humanoid whose soul you caged."],"spellLists":["/spell:see-invisibility","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $e0040b35dd8cf9cc$exports = {};
$e0040b35dd8cf9cc$exports = JSON.parse('{"title":"Spare the Dying","source":"Player\'s Handbook","levelAndSchool":"Necromancy cantrip","level":0,"castingTime":"1 action","range":"Touch","components":"V, S","duration":"Instantaneous","description":["You touch a living creature that has 0 hit points. The creature becomes stable. This spell has no effect on undead or constructs."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:cleric"]}');


var $e4762d853c6c0bb7$exports = {};
$e4762d853c6c0bb7$exports = JSON.parse('{"title":"Speak with Animals","source":"Player\'s Handbook","levelAndSchool":"1st-level divination (ritual)","level":1,"castingTime":"1 action","range":"Self","components":"V, S","duration":"10 minutes","description":["You gain the ability to comprehend and verbally communicate with beasts for the duration. The knowledge and awareness of many beasts is limited by their intelligence, but at minimum, beasts can give you information about nearby locations and monsters, including whatever they can perceive or have perceived within the past day. You might be able to persuade a beast to perform a small favor for you, at the DM\u2019s discretion."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger"]}');


var $e205c460558b1684$exports = {};
$e205c460558b1684$exports = JSON.parse('{"title":"Speak with Dead","source":"Player\'s Handbook","levelAndSchool":"3rd-level necromancy","level":3,"castingTime":"1 action","range":"10 feet","components":"V, S, M (burning incense)","duration":"10 minutes","description":["You grant the semblance of life and intelligence to a corpse of your choice within range, allowing it to answer the questions you pose. The corpse must still have a mouth and can\u2019t be undead. The spell fails if the corpse was the target of this spell within the last 10 days.","Until the spell ends, you can ask the corpse up to five questions. The corpse knows only what it knew in life, including the languages it knew. Answers are usually brief, cryptic, or repetitive, and the corpse is under no compulsion to offer a truthful answer if you are hostile to it or it recognizes you as an enemy. This spell doesn\u2019t return the creature\u2019s soul to its body, only its animating spirit. Thus, the corpse can\u2019t learn new information, doesn\u2019t comprehend anything that has happened since it died, and can\u2019t speculate about future events."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","/spells:wizard"]}');


var $c9476a1c5a3d92f8$exports = {};
$c9476a1c5a3d92f8$exports = JSON.parse('{"title":"Speak with Plants","source":"Player\'s Handbook","levelAndSchool":"3rd-level transmutation","level":3,"castingTime":"1 action","range":"Self (30-foot radius)","components":"V, S","duration":"10 minutes","description":["You imbue plants within 30 feet of you with limited sentience and animation, giving them the ability to communicate with you and follow your simple commands. You can question plants about events in the spell\u2019s area within the past day, gaining information about creatures that have passed, weather, and other circumstances.","You can also turn difficult terrain caused by plant growth (such as thickets and undergrowth) into ordinary terrain that lasts for the duration. Or you can turn ordinary terrain where plants are present into difficult terrain that lasts for the duration, causing vines and branches to hinder pursuers, for example.","Plants might be able to perform other tasks on your behalf, at the DM\u2019s discretion. The spell doesn\u2019t enable plants to uproot themselves and move about, but they can freely move branches, tendrils, and stalks.","If a plant creature is in the area, you can communicate with it as if you share a common language, but you gain no magical ability to influence it.","This spell can cause the plants created by the entangle spell to release a restrained creature."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger"]}');


var $5fbbf612b9deed53$exports = {};
$5fbbf612b9deed53$exports = JSON.parse('{"title":"Spider Climb","source":"Player\'s Handbook","levelAndSchool":"2nd-level transmutation","level":2,"castingTime":"1 action","range":"Touch","components":"V, S, M (a drop of bitumen and a spider)","duration":"Concentration, up to 1 hour","description":["Until the spell ends, one willing creature you touch gains the ability to move up, down, and across vertical surfaces and upside down along ceilings, while leaving its hands free. The target also gains a climbing speed equal to its walking speed."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $635f2f5a3626796a$exports = {};
$635f2f5a3626796a$exports = JSON.parse('{"title":"Spike Growth","source":"Player\'s Handbook","levelAndSchool":"2nd-level transmutation","level":2,"castingTime":"1 action","range":"150 feet","components":"V, S, M (seven sharp thorns or seven small twigs, each sharpened to a point)","duration":"Concentration, up to 10 minutes","description":["The ground in a 20-foot radius centered on a point within range twists and sprouts hard spikes and thorns. The area becomes difficult terrain for the duration. When a creature moves into or within the area, it takes 2d4 piercing damage for every 5 feet it travels.","The transformation of the ground is camouflaged to look natural. Any creature that can\u2019t see the area at the time the spell is cast must make a Wisdom (Perception) check against your spell save DC to recognize the terrain as hazardous before entering it."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger"]}');


var $0c1e3202032e65a1$exports = {};
$0c1e3202032e65a1$exports = JSON.parse('{"title":"Spirit Guardians","source":"Player\'s Handbook","levelAndSchool":"3rd-level conjuration","level":3,"castingTime":"1 action","range":"Self (15-foot-radius)","components":"V, S, M (a holy symbol)","duration":"Concentration, up to 10 minutes","description":["You call forth spirits to protect you. They flit around you to a distance of 15 feet for the duration. If you are good or neutral, their spectral form appears angelic or fey (your choice). If you are evil, they appear fiendish.","When you cast this spell, you can designate any number of creatures you can see to be unaffected by it. An affected creature\u2019s speed is halved in the area, and when the creature enters the area for the first time on a turn or starts its turn there, it must make a Wisdom saving throw. On a failed save, the creature takes 3d8 radiant damage (if you are good or neutral) or 3d8 necrotic damage (if you are evil). On a successful save, the creature takes half as much damage.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, the damage increases by 1d8 for each slot level above 3rd."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric"]}');


var $cb2c34a29ee5742b$exports = {};
$cb2c34a29ee5742b$exports = JSON.parse('{"title":"Spirit of Death (UA)","source":"Unearthed Arcana 85 - Wonders of the Multiverse","levelAndSchool":"4th-level necromancy","level":4,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a gilded playing card depicting an avatar of death worth at least 400 gp)","duration":"Concentration, up to 1 minute","description":["You call forth a spirit that embodies death itself. Choose a creature you can see within range. The spirit manifests in an unoccupied space that you can see within 10 feet of the target, and the target becomes haunted by the spirit. The spirit uses the Reaper Spirit stat block. The spirit disappears when it or the haunted creature is reduced to 0 hit points, or when the spell ends.","The reaper spirit is an ally to you and your companions. In combat, the spirit shares your initiative count, but it takes its turn immediately after yours. It obeys your verbal commands (no action required by you), but it will only attack the haunted creature. If you don\u2019t issue the spirit any commands, it takes the Dodge action and uses its move to avoid danger","At Higher Levels. When you cast this spell using a spell slot of 5th level or higher, use the higher level wherever the spell\u2019s level appears in the stat block.","Reaper Spirit","Medium Undead","Armor Class: 11 + the level of the spell (natural armor)","Hit Points: 40 + 10 for each level of the spell above 4th","Speed: 30 ft., fly 30 ft. (hover)","STR","DEX","CON","INT","WIS","CHA","16 (+3)","16 (+3)","16 (+3)","16 (+3)","16 (+3)","16 (+3)","Damage Immunities: necrotic, poison","Condition Immunities: charmed, frightened, paralyzed, poisoned","Senses: darkvision 60 ft., passive Perception 13","Languages: understands the languages you speak","Challenge: \u2014","Proficiency Bonus: equals your bonus","Incorporeal Movement. The reaper can move through other creatures and objects as if they were difficult terrain. If it ends its turn inside an object, it is shunted to the nearest unoccupied space and takes 1d10 force damage for every 5 feet traveled.","Haunting Tracker. You and the reaper can sense the direction and distance to the haunted creature if it\u2019s on the same plane of existence as you.","Actions","Multiattack. The reaper makes a number of attacks equal to half this spell\u2019s level (rounded down).","Reaping Scythe. Melee Weapon Attack: your spell attack modifier to hit (with advantage), reach 5 ft., one target. Hit: 1d10 + 3 + the spell\u2019s level necrotic damage.","Paralyzing Fear (1/Day). The reaper attempts to instill fear into the haunted creature it can see within 60 feet of itself. The creature must succeed on a Wisdom saving throw against your spell save DC or be frightened of the reaper for 1 minute. While frightened this way, the creature\u2019s speed is 0, and it can\u2019t benefit from any bonus to its speed. The frightened creature can repeat the saving throw at the end of each of its turns, or immediately after it takes damage, ending the effect on itself on a success."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer,","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $3a74114e1f68238d$exports = {};
$3a74114e1f68238d$exports = JSON.parse('{"title":"Spirit Of Death","source":"The Book of Many Things","levelAndSchool":"4th-level necromancy","level":4,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a gilded playing card worth at least 400 gp and depicting an avatar of death)","duration":"Concentration, up to 1 hour","description":["You call forth a spirit that embodies death. The spirit manifests in an unoccupied space you can see within range and uses the reaper spirit stat block. The spirit disappears when it is reduced to 0 hit points or when the spell ends.","The spirit is an ally to you and your companions. In combat, the spirit shares your initiative count and takes its turn immediately after yours. It obeys your verbal commands (no action required by you). If you don\u2019t issue the spirit any commands, it takes the Dodge action and uses its movement to avoid danger.","At Higher Levels. When you cast this spell using a spell slot of 5th level or higher, use the higher level wherever the spell\u2019s level appears in the reaper spirit stat block.","Reaper Spirit","Medium Undead, Neutral","Armor Class: 11 + the level of the spell (natural armor)","Hit Points: 40 + 10 for each level of the spell above 4th","Speed: 30 ft., fly 30 ft. (hover)","STR","DEX","CON","INT","WIS","CHA","16 (+3)","16 (+3)","16 (+3)","16 (+3)","16 (+3)","16 (+3)","Damage Immunities: necrotic, poison","Condition Immunities: charmed, exhaustion, frightened, paralyzed, poisoned","Senses: darkvision 60 ft., passive Perception 13","Languages: understands the languages you speak","Challenge: \u2014","Proficiency Bonus: equals your bonus","Incorporeal Movement. The reaper can move through other creatures and objects as if they were difficult terrain. If it ends its turn inside an object, it is shunted to the nearest unoccupied space and takes 1d10 force damage for every 5 feet traveled.","Actions","Multiattack. The spirit makes a number of Reaping Scythe attacks equal to half the level of the spell (rounded down).","Reaping Scythe. Melee Weapon Attack: your spell attack modifier to hit (with advantage), reach 5 ft., one target. Hit: 1d8 + 3 + the spell\u2019s level necrotic damage.","Bonus Actions","Haunt Creature The spirit targets a creature it can see within 10 feet of itself and begins haunting it. While the target is haunted, you and the spirit sense the direction and distance to the target if it is on the same plane of existence as you. Additionally, if the target starts its turn within 10 feet of the spirit, the target must succeed on a Wisdom saving throw against your spell save DC or have the frightened condition until the start of the target\u2019s next turn. The target remains haunted until it dies, the spirit disappears, or the spirit uses this action again."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer,","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $03552509d5d38d92$exports = {};
$03552509d5d38d92$exports = JSON.parse('{"title":"Spirit Shroud","source":"Tasha\'s Cauldron of Everything","levelAndSchool":"3rd-level necromancy","level":3,"castingTime":"1 bonus action","range":"Self","components":"V, S","duration":"Concentration, up to 1 minute","description":["You call forth spirits of the dead, which flit around you for the spell\u2019s duration. The spirits are intangible and invulnerable.","Until the spell ends, any attack you make deals 1d8 extra damage when you hit a creature within 10 feet of you. This damage is radiant, necrotic, or cold (your choice when you cast the spell). Any creature that takes this damage can\u2019t regain hit points until the start of your next turn.","In addition, any creature of your choice that you can see that starts its turn within 10 feet of you has its speed reduced by 10 feet until the start of your next turn.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, the damage increases by 1d8 for every two slot levels above 3rd."],"spellLists":["/spells:cleric","/spells:paladin","/spells:warlock","/spells:wizard"]}');


var $1c31f868f61fb9a3$exports = {};
$1c31f868f61fb9a3$exports = JSON.parse('{"title":"Spiritual Weapon","source":"Player\'s Handbook","levelAndSchool":"2nd-level evocation","level":2,"castingTime":"1 bonus action","range":"60 feet","components":"V, S","duration":"1 minute","description":["You create a floating, spectral weapon within range that lasts for the duration or until you cast this spell again.","When you cast the spell, you can make a melee spell attack against a creature within 5 feet of the weapon. On a hit, the target takes force damage equal to 1d8 + your spellcasting ability modifier.","As a bonus action on your turn, you can move the weapon up to 20 feet and repeat the attack against a creature within 5 feet of it.","The weapon can take whatever form you choose. Clerics of deities who are associated with a particular weapon (as St. Cuthbert is known for his mace and Thor for his hammer) make this spell\u2019s effect resemble that weapon.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, the damage increases by 1d8 for every two slot levels above the 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric"]}');


var $57d2c6b702f2389a$exports = {};
$57d2c6b702f2389a$exports = JSON.parse('{"title":"Spray of Cards (UA)","source":"Unearthed Arcana 85 - Wonders of the Multiverse","levelAndSchool":"2nd-level conjuration","level":2,"castingTime":"1 action","range":"15-foot cone","components":"V, S, M (a deck of cards)","duration":"Instantaneous","description":["You spray spectral cards from your hands or sleeve; the cards blind or slash at your enemies, and then vanish. Choose one of the following effects for the cards:","Blinding Cards. Each creature in a 15-foot cone must succeed on a Wisdom saving throw or be blinded until the end of their next turn.","Cutting Cards. Each creature in a 15-foot cone must make a Dexterity saving throw. A creature takes 2d10 force damage on a failed save or half as much damage on a successful one.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, the damage of cutting cards increases by 1d10 for every two slot levels above 2nd"],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $9d11006347a3f755$exports = {};
$9d11006347a3f755$exports = JSON.parse('{"title":"Spray Of Cards","source":"The Book of Many Things","levelAndSchool":"2nd-level conjuration","level":2,"castingTime":"1 action","range":"Self (15-foot cone)","components":"V, S, M (a deck of cards)","duration":"Instantaneous","description":["You spray a 15-foot cone of spectral cards. Each creature in that area must make a Dexterity saving throw. On a failed save, a creature takes 2d10 force damage and has the blinded condition until the end of its next turn. On a successful save, a creature takes half as much damage only.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, the damage increases by 1d10 for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $046690db41889c21$exports = {};
$046690db41889c21$exports = JSON.parse('{"title":"Staggering Smite","source":"Player\'s Handbook","levelAndSchool":"4th-level evocation","level":4,"castingTime":"1 bonus action","range":"Self","components":"V","duration":"Concentration, up to 1 minute","description":["The next time you hit a creature with a melee weapon attack during this spell\u2019s duration, your weapon pierces both body and mind, and the attack deals an extra 4d6 psychic damage to the target. The target must make a Wisdom saving throw. On a failed save, it has disadvantage on attack rolls and ability checks, and can\u2019t take reactions, until the end of its next turn."],"spellLists":["http://dnd5e.wikidot.com/spells:paladin"]}');


var $435b128d2f22b782$exports = {};
$435b128d2f22b782$exports = JSON.parse('{"title":"Steel Wind Strike","source":"Xanathar\'s Guide to Everything","levelAndSchool":"5th-level conjuration","level":5,"castingTime":"1 action","range":"30 feet","components":"S, M (a melee weapon worth at least 1 sp)","duration":"Instantaneous","description":["You flourish the weapon used in the casting and then vanish to strike like the wind. Choose up to five creatures you can see within range. Make a melee spell attack against each target. On a hit, a target takes 6d10 force damage.","You can then teleport to an unoccupied space you can see within 5 feet of one of the targets you hit or missed."],"spellLists":["http://dnd5e.wikidot.com/spells:ranger","http://dnd5e.wikidot.com/spells:wizard"]}');


var $29fa7dc7e597796e$exports = {};
$29fa7dc7e597796e$exports = JSON.parse('{"title":"Stinking Cloud","source":"Player\'s Handbook","levelAndSchool":"3rd-level conjuration","level":3,"castingTime":"1 action","range":"90 feet","components":"V, S, M (a rotten egg or several skunk cabbage leaves)","duration":"Concentration, up to 1 minute","description":["You create a 20-foot-radius sphere of yellow, nauseating gas centered on a point within range. The cloud spreads around corners, and its area is heavily obscured. The cloud lingers in the air for the duration.","Each creature that is completely within the cloud at the start of its turn must make a Constitution saving throw against poison. On a failed save, the creature spends its action that turn retching and reeling. Creatures that don\u2019t need to breathe or are immune to poison automatically succeed on this saving throw.","A moderate wind (at least 10 miles per hour) disperses the cloud after 4 rounds. A strong wind (at least 20 miles per hour) disperses it after 1 round."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $6dafb99d2445dd07$exports = {};
$6dafb99d2445dd07$exports = JSON.parse('{"title":"Stone Shape","source":"Player\'s Handbook","levelAndSchool":"4th-level transmutation","level":4,"castingTime":"1 action","range":"Touch","components":"V, S, M (soft clay, which must be worked into roughly the desired shape of the stone object)","duration":"Instantaneous","description":["You touch a stone object of Medium size or smaller or a section of stone no more than 5 feet in any dimension and form it into any shape that suits your purpose. So, for example, you could shape a large rock into a weapon, idol, or coffer, or make a small passage through a wall, as long as the wall is less than 5 feet thick. You could also shape a stone door or its frame to seal the door shut. The object you create can have up to two hinges and a latch, but finer mechanical detail isn\u2019t possible."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:wizard"]}');


var $8a7e63998d65e569$exports = {};
$8a7e63998d65e569$exports = JSON.parse('{"title":"Stoneskin","source":"Player\'s Handbook","levelAndSchool":"4th-level abjuration","level":4,"castingTime":"1 action","range":"Touch","components":"V, S, M (diamond dust worth 100 gp, which the spell consumes)","duration":"Concentration, up to 1 hour","description":["This spell turns the flesh of a willing creature you touch as hard as stone. Until the spell ends, the target has resistance to nonmagical bludgeoning, piercing, and slashing damage."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $db2f85ce267bb5b9$exports = {};
$db2f85ce267bb5b9$exports = JSON.parse('{"title":"Storm of Vengeance","source":"Player\'s Handbook","levelAndSchool":"9th-level conjuration","level":9,"castingTime":"1 action","range":"Sight","components":"V, S","duration":"Concentration, up to 1 minute","description":["A churning storm cloud forms, centered on a point you can see and spreading to a radius of 360 feet. Lightning flashes in the area, thunder booms, and strong winds roar. Each creature under the cloud (no more than 5,000 feet beneath the cloud) when it appears must make a Constitution saving throw. On a failed save, a creature takes 2d6 thunder damage and becomes deafened for 5 minutes.","Each round you maintain concentration on this spell, the storm produces different effects on your turn.","Storm of Vengeance After Round 1","Round","Effect","2","Acidic rain falls from the cloud. Each creature and object under the cloud takes 1d6 acid damage.","3","You call six bolts of lightning from the cloud to strike six creatures or objects of your choice beneath the cloud. A given creature or object can\u2019t be struck by more than one bolt. A struck creature must make a Dexterity saving throw. The creature takes 10d6 lightning damage on a failed save, or half as much damage on a successful one.","4","Hailstones rain down from the cloud. Each creature under the cloud takes 2d6 bludgeoning damage.","5-10","Gusts and freezing rain assail the area under the cloud. The area becomes difficult terrain and is heavily obscured. Each creature there takes 1d6 cold damage. Ranged weapon attacks in the area are impossible. The wind and rain count as a severe distraction for the purposes of maintaining concentration on spells. Finally, gusts of strong wind (ranging from 20 to 50 miles per hour) automatically disperse fog, mists, and similar phenomena in the area whether mundane or magical."],"spellLists":["http://dnd5e.wikidot.com/spells:druid"]}');


var $0e528361d67969f5$exports = {};
$0e528361d67969f5$exports = JSON.parse('{"title":"Storm Sphere","source":"Xanathar\'s Guide to Everything","levelAndSchool":"4th-level evocation","level":4,"castingTime":"1 action","range":"150 feet","components":"V, S","duration":"Concentration, up to 1 minute","description":["A 20-foot-radius sphere of whirling air springs into existence centered on a point you choose within range. The sphere remains for the spell\u2019s duration. Each creature in the sphere when it appears or that ends its turn there must succeed on a Strength saving throw or take 2d6 bludgeoning damage. The sphere\u2019s space is difficult terrain.","Until the spell ends, you can use a bonus action on each of your turns to cause a bolt of lightning to leap from the center of the sphere toward one creature you choose within 60 feet of the center. Make a ranged spell attack. You have advantage on the attack roll if the target is in the sphere. On a hit, the target takes 4d6 lightning damage.","Creatures within 30 feet of the sphere have disadvantage on Wisdom (Perception) checks made to listen.","At Higher Levels. When you cast this spell using a spell slot of 5th level or higher, the damage increases for each of its effects by 1d6 for each slot level above 4th."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $e0dc93633b1bac7b$exports = {};
$e0dc93633b1bac7b$exports = JSON.parse('{"title":"Sudden Awakening (UA)","source":"Unearthed Arcana 36 - Starter Spells","levelAndSchool":"1st-level enchantment","level":1,"castingTime":"1 bonus action","range":"10 feet","components":"V","duration":"Instantaneous","description":["Each sleeping creature you choose within range awakens, and then each prone creature within range can stand up without expending any movement."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:ranger","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $328531626f0d416b$exports = {};
$328531626f0d416b$exports = JSON.parse('{"title":"Suggestion","source":"Player\'s Handbook","levelAndSchool":"2nd-level enchantment","level":2,"castingTime":"1 action","range":"30 feet","components":"V, M (a snake\u2019s tongue and either a bit of honeycomb or a drop of sweet oil)","duration":"Concentration, up to 8 hours","description":["You suggest a course of activity (limited to a sentence or two) and magically influence a creature you can see within range that can hear and understand you. Creatures that can\u2019t be charmed are immune to this effect. The suggestion must be worded in such a manner as to make the course of action sound reasonable. Asking the creature to stab itself, throw itself onto a spear, immolate itself, or do some other obviously harmful act ends the spell.","The target must make a Wisdom saving throw. On a failed save, it purses the course of action you described to the best of its ability. The suggested course of action can continue for the entire duration. If the suggested activity can be completed in a shorter time, the spell ends when the subject finishes what it was asked to do.","You can also specify conditions that will trigger a special activity during the duration. For example, you might suggest that a knight give her warhorse to the first beggar she meets. If the condition isn\u2019t met before the spell expires, the activity isn\u2019t preformed.","If you or any of your companions damage the target, the spell ends."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $fd3b1283bad4cc46$exports = {};
$fd3b1283bad4cc46$exports = JSON.parse('{"title":"Summon Aberration","source":"Tasha\'s Cauldron of Everything","levelAndSchool":"4th-level conjuration","level":4,"castingTime":"1 action","range":"90 feet","components":"V, S, M (a pickled tentacle and an eyeball in a platinum inlaid vial worth at least 400 gp)","duration":"Concentration, up to 1 hour","description":["You call forth an aberrant spirit. It manifests in an unoccupied space that you can see within range. This corporeal form uses the Aberrant Spirit stat block. When you cast the spell, choose Beholderkin, Slaad, or Star Spawn. The creature resembles an aberration of that kind, which determines certain traits in its stat block. The creature disappears when it drops to 0 hit points or when the spell ends.","The creature is an ally to you and your companions. In combat, the creature shares your initiative count, but it takes its turn immediately after yours. It obeys your verbal commands (no action required by you). If you don\u2019t issue any, it take the Dodge action and uses its move to avoid danger.","At Higher Levels. When you cast this spell using a spell slot of 5th level or higher, use the higher level wherever the spell\'s level appears on the stat block.","Aberrant Spirit","Medium aberration","Armor Class: 11 + the level of the spell (natural armor)","Hit Points: 40 + 10 for each spell level above 4th","Speed: 30 ft., fly 30 ft. (hover) (Beholderkin only)","STR","DEX","CON","INT","WIS","CHA","16 (+3)","10 (+0)","15 (+2)","16 (+3)","10 (+0)","6 (\u22122)","Damage Immunities: psychic","Senses: darkvision 60 ft., passive Perception 10","Languages: Deep Speech, understands the languages you speak","Challenge: \u2014","Proficiency Bonus: equals your bonus","Regeneration (Slaad Only). The aberration regains 5 hit points at the start of its turn if it has at least 1 hit point.","Whispering Aura (Star Spawn Only). At the start of each of the aberration\u2019s turns, each creature within 5 feet of the aberration must succeed on a Wisdom saving throw against your spell save DC or take 2d6 psychic damage, provided that the aberration isn\u2019t incapacitated.","Actions","Multiattack. The aberration makes a number of attacks equal to half this spell\u2019s level (rounded down).","Claws (Slaad Only). Melee Weapon Attack: your spell attack modifier to hit, reach 5 ft., one target. Hit: 1d10 + 3 + the spell\u2019s level slashing damage. If the target is a creature, it can\u2019t regain hit points until the start of the aberration\u2019s next turn.","Eye Ray (Beholderkin Only). Ranged Spell Attack: your spell attack modifier to hit, range 150 ft., one creature. Hit: 1d8 + 3 + the spell\u2019s level psychic damage.","Psychic Slam (Star Spawn Only). Melee Spell Attack: your spell attack modifier to hit, reach 5 ft., one creature. Hit: 1d8 + 3 + the spell\u2019s level psychic damage"],"spellLists":["/spells:warlock","/spells:wizard"]}');


var $e3c80454222be162$exports = {};
$e3c80454222be162$exports = JSON.parse('{"title":"Summon Beast","source":"Tasha\'s Cauldron of Everything","levelAndSchool":"2nd-level conjuration","level":2,"castingTime":"1 action","range":"90 feet","components":"V, S, M (a feather, tuft of fur, and fish tail inside a gilded acorn worth at least 200 gp)","duration":"Concentration, up to 1 hour","description":["You call forth a bestial spirit. It manifests in an unoccupied space that you can see within range. This corporeal form uses the Bestial Spirit stat block. When you cast the spell, choose an environment: Air, Land, or Water. The creature resembles an animal of your choice that is native to the chosen environment, which determines certain traits in its stat block. The creature disappears when it drops to 0 hit points or when the spell ends.","The creature is an ally to you and your companions. In combat, the creature shares your initiative count, but it takes its turn immediately after yours. It obeys your verbal commands (no action required by you). If you don\u2019t issue any, it takes the Dodge action and uses its move to avoid danger.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, use the higher level where the spell\u2019s level appears in the stat block.","Bestial Spirit","Small beast","Armor Class: 11 + the level of the spell (natural armor)","Hit Points: 20 (Air only) or 30 (Land and Water only) + 5 for each spell level above 2nd","Speed: 30 ft., climb 30 ft. (Land only), fly 60 ft. (Air only), swim 30 ft. (Water only)","STR","DEX","CON","INT","WIS","CHA","18 (+4)","11 (+0)","16 (+3)","4 (\u22123)","14 (+2)","5 (\u22123)","Senses: darkvision 60 ft., passive Perception 12","Languages: understands the languages you speak","Challenge: \u2014","Proficiency Bonus: equals your bonus","Flyby (Air Only). The beast doesn\u2019t provoke opportunity attacks when it flies out of an enemy\u2019s reach.","Pack Tactics (Land and Water Only). The beast has advantage on an attack roll against a creature if at least one of the beast\u2019s allies is within 5 feet of the creature and the ally isn\u2019t incapacitated.","Water Breathing (Water Only). The beast can breathe only underwater.","Actions","Multiattack. The beast makes a number of attacks equal to half this spell\u2019s level (rounded down).","Maul. Melee Weapon Attack: your spell attack modifier to hit, reach 5 ft., one target. Hit: 1d8 + 4 + the spell\u2019s level piercing damage."],"spellLists":["/spells:druid","/spells:ranger"]}');


var $740ef6bbe5d7bc97$exports = {};
$740ef6bbe5d7bc97$exports = JSON.parse('{"title":"Summon Celestial","source":"Tasha\'s Cauldron of Everything","levelAndSchool":"5th-level conjuration","level":5,"castingTime":"1 action","range":"90 feet","components":"V, S, M (a golden reliquary worth at least 500 gp)","duration":"Concentration, up to 1 hour","description":["You call forth a celestial spirit. It manifests in an angelic form in an unoccupied space that you can see within range. This corporeal form uses the Celestial Spirit stat block. When you cast the spell, choose Avenger or Defender. Your choice determines the creature\u2019s attack in its stat block. The creature disappears when it drops to 0 hit points or when the spell ends.","The creature is an ally to you and your companions. In combat, the creature shares your initiative count, but it takes its turn immediately after yours. It obeys your verbal commands (no action required by you). If you don\u2019t issue any, it takes the Dodge action and uses its move to avoid danger.","At Higher Levels. When you cast this spell using a spell slot of 6th level or higher, use the higher level whenever the spell\u2019s level appears in the stat block.","Celestial Spirit","Large celestial","Armor Class: 11 + the level of the spell (natural armor) + 2 (Defender only)","Hit Points: 40 + 10 for each spell level above 5th","Speed: 30 ft., fly 40 ft.","STR","DEX","CON","INT","WIS","CHA","16 (+3)","14 (+2)","16 (+3)","10 (+0)","14 (+2)","16 (+3)","Damage Resistances: radiant","Condition Immunities: charmed, frightened","Senses: darkvision 60 ft., passive Perception 10","Languages: Celestial, understands the languages you speak","Challenge: \u2014","Proficiency Bonus: equals your bonus","Actions","Multiattack. The celestial makes a number of attacks equal to half this spell\u2019s level (rounded down).","Radiant Bow (Avenger Only). Ranged Weapon Attack: your spell attack modifier to hit, reach 150/600 ft., one target. Hit: 2d6 + 2 + the spell\u2019s level radiant damage.","Radiant Mace (Defender Only). Melee Weapon Attack: your spell attack modifier to hit, reach 5 ft., one target. Hit: 1d10 + 3 + the spell\u2019s level radiant damage, and the celestial can choose itself or another creature it can see within 10 feet of the target. The chosen creature gains 1d10 temporary hit points.","Healing Touch (1/Day). The celestial touches another creature. The target magically regains hit points equal to 2d8 + the spell\u2019s level."],"spellLists":["/spells:cleric","/spells:paladin"]}');


var $b0b8281631d4c11f$exports = {};
$b0b8281631d4c11f$exports = JSON.parse('{"title":"Summon Construct","source":"Tasha\'s Cauldron of Everything","levelAndSchool":"4th-level conjuration","level":4,"castingTime":"1 action","range":"90 feet","components":"V, S, M (an ornate stone and metal lockbox worth at least 400 gp)","duration":"Concentration, up to 1 hour","description":["You call forth the spirit of a construct. It manifests in an unoccupied space that you can see within range. This corporeal form uses the Construct Spirit stat block. When you cast the spell, choose a material: Clay, Metal, or Stone. The creature resembles a golem or a modron (your choice) made of the chosen material, which determines certain traits in its stat block. The creature disappears when it drops to 0 hit points or when the spell ends.","The creature is an ally to you and your companions. In combat, the creature shares your initiative count, but it takes its turn immediately after yours. It obeys your verbal commands (no action required by you). If you don\u2019t issue any, it takes the Dodge action and uses its move to avoid danger.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, use the higher level wherever the spell\u2019s level appears in the stat block.","Construct Spirit","Medium construct","Armor Class: 13 + the level of the spell (natural armor)","Hit Points: 40 + 15 for each spell level above 4th","Speed: 30 ft.","STR","DEX","CON","INT","WIS","CHA","18 (+4)","10 (+0)","18 (+4)","14 (+2)","11 (+0)","5 (\u22123)","Damage Resistances: poison","Condition Immunities: charmed, exhaustion, frightened, incapacitated, paralyzed, petrified, poisoned","Senses: darkvision 60 ft., passive Perception 10","Languages: understands the languages you speak","Challenge: \u2014","Proficiency Bonus: equals your bonus","Heated Body (Metal Only). A creature that touches the construct or hits it with a melee attack while within 5 feet of it takes 1d10 fire damage.","Stony Lethargy (Stone Only). When a creature the construct can see starts its turn within 10 feet of the construct, the construct can force it to make a Wisdom saving throw against your spell save DC. On a failed save, the target can\u2019t use reactions and its speed is halved until the start of its next turn.","Actions","Multiattack. The construct makes a number of attacks equal to half this spell\u2019s level (rounded down).","Slam. Melee Weapon Attack: your spell attack modifier to hit, reach 5 ft., one target. Hit: 1d8 + 4 + the spell\u2019s level bludgeoning damage.","Reactions","Berserk Lashing (Clay Only). When the construct takes damage, it makes a slam attack against a random creature within 5 feet of it. If no creature is within reach, the construct moves up to half its speed toward an enemy it can see, without provoking opportunity attacks."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","/spells:wizard"]}');


var $efcd5824fc8656e3$exports = {};
$efcd5824fc8656e3$exports = JSON.parse('{"title":"Summon Draconic Spirit (UA)","source":"Unearthed Arcana 78 - Draconic Options","levelAndSchool":"5th-level conjuration","level":5,"castingTime":"1 action","range":"60 feet","components":"V, S, M (an art object from a dragon\'s hoard, worth at least 500 gp)","duration":"Concentration, up to 1 hour","description":["You call forth a draconic spirit. It manifests in an unoccupied space that you can see within range. This corporeal form uses the Draconic Spirit stat block. When you cast this spell, choose a family of dragon: Chromatic, Gem, or Metallic. The creature resembles a dragon of the chosen family, which determines certain traits in its stat block. The creature disappears when it drops to 0 hit points or when the spell ends.","The creature is an ally to you and your companions. In combat, the creature shares your initiative count, but it takes its turn immediately after yours. It obeys your verbal commands (no action required by you). If you don\u2019t issue any, it takes the Dodge action and uses its move to avoid danger.","At Higher Levels. When you cast this spell using a spell slot of 6th level or higher, use the higher level wherever the spell\u2019s level appears in the stat block.","Draconic Spirit","Large Dragon","Armor Class: 14 + the level of the spell (natural armor)","Hit Points: 50 + 10 for each level of the spell above 5th","Speed: 30 ft., fly 80 ft., swim 30 ft.","STR","DEX","CON","INT","WIS","CHA","19 (+4)","14 (+2)","17 (+3)","10 (+0)","14 (+2)","14 (+2)","Damage Resistances (Chromatic and Metallic only): acid, cold, fire, lightning, poison","Damage Resistances (Gem only): force, necrotic, psychic, radiant, thunder","Condition Immunities: charmed, frightened, poisoned","Senses: blindsight 30 ft., darkvision 60 ft., passive Perception 12","Languages: Draconic, understands the languages you speak","Challenge: \u2014","Proficiency Bonus: equals your bonus","Shared Resistances. When you summon the dragon, choose one of its damage resistances. You have resistance to the chosen damage type until the spell ends.","Actions","Multiattack. The dragon uses its Breath Weapon, and it makes a number of Bite and Claw attacks equal to half the spell\'s level (rounded down).","Bite and Claw. Melee Weapon Attack: your spell attack modifier to hit, reach 10 ft., one target. Hit: 1d6 + 4 + the spell\u2019s level piercing damage.","Breath Weapon. The dragon exhales a stream of multicolored energy in a 30-foot cone. Each creature in that area must make a Dexterity saving throw, taking 2d6 damage of your choice of a damage type this dragon has resistance to on a failed save, or half as much damage on a successful one."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $495147de3aed4460$exports = {};
$495147de3aed4460$exports = JSON.parse('{"title":"Summon Draconic Spirit","source":"Fizban\'s Treasury of Dragons","levelAndSchool":"5th-level Conjuration","level":5,"castingTime":"1 Action","range":"60ft","components":"V, S, M (an object with the image of a dragon engraved on it, worth at least 500 gp)","duration":"Concentration, up to 1 hour","description":["You call forth a draconic spirit. It manifests in an unoccupied space that you can see within range. This corporeal form uses the Draconic Spirit stat block. When you cast this spell, choose a family of dragon: chromatic, gem, or metallic. The creature resembles a dragon of the chosen family, which determines certain traits in its stat block. The creature disappears when it drops to 0 hit points or when the spell ends.","The creature is an ally to you and your companions. In combat, the creature shares your initiative count, but it takes its turn immediately after yours. It obeys your verbal commands (no action required by you). If you don\u2019t issue any, it takes the Dodge action and uses its move to avoid danger.","At Higher Levels. When you cast this spell using a spell slot of 6th level or higher, use the higher level wherever the spell\u2019s level appears in the stat block.","Draconic Spirit","Large Dragon, Neutral","Armor Class 14 + the level of the spell (natural armor)","Hit Points 50 + 10 for each spell level above 5th (the dragon has a number of hit dice [d10s] equal to the level of the spell)","Speed 30 ft., fly 60 ft., swim 30 ft.","STR","DEX","CON","INT","WIS","CHA","19 (+4)","14 (+2)","17 (+3)","10 (+0)","14 (+2)","14 (+2)","Damage Resistances(Chromatic and Metallic Only) acid, cold, fire, lightning, poison","Damage Resistances(Gem Only) force, necrotic, psychic, radiant, thunder","Condition Immunities charmed, frightened, poisoned","Senses blindsight 30 ft., darkvision 60 ft., passive Perception 12","Languages Draconic, understands the languages you speak","Challenge \u2014 Proficiency Bonus (PB) equals your bonus","Shared Resistances. When you summon the dragon, choose one of its damage resistances. You have resistance to the chosen damage type until the spell ends","Actions","Multiattack. The dragon makes a number of Rend attacks equal to half the spell\u2019s level (rounded down), and it uses Breath Weapon.","Rend. Melee Weapon Attack: your spell attack modifier to hit, reach 10 ft., one target. Hit: 1d6 plus 4 + the spell\'s level piercing damage.","Breath Weapon. The dragon exhales destructive energy in a 30-foot cone. Each creature in that area must make a Dexterity saving throw against your spell save DC. A creature takes 2d6 damage of a type this dragon has resistance to (your choice) on a failed save, or half as much damage on a successful one."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $99b1c01a1c32d65d$exports = {};
$99b1c01a1c32d65d$exports = JSON.parse('{"title":"Summon Elemental","source":"Tasha\'s Cauldron of Everything","levelAndSchool":"4th-level conjuration","level":4,"castingTime":"1 action","range":"90 feet","components":"V, S, M (air, a pebble, ash, and water inside a gold-inlaid vial worth at least 400 gp)","duration":"Concentration, up to 1 hour","description":["You call forth an elemental spirit. It manifests in an unoccupied space that you can see within range. This corporeal form uses the Elemental Spirit stat block. When you cast the spell, choose an element: Air, Earth, Fire, or Water. The creature resembles a bipedal form wreathed in the chosen element, which determines certain traits in its stat block. The creature disappears when it drops to 0 hit points or when the spell ends.","The creature is an ally to you and your companions. In combat, the creature shares your initiative count, but it takes its turn immediately after yours. It obeys your verbal commands (no action required by you). If you don\u2019t issue any, it takes the Dodge action and uses its move to avoid danger.","At Higher Levels. When you cast this spell using a spell slot of 5th level or higher, use the higher level wherever the spell\u2019s level appears in the stat block.","Elemental Spirit","Medium elemental","Armor Class: 11 + the level of the spell (natural armor)","Hit Points: 50 + 10 for each spell level above 4th","Speed: 40 ft.; burrow 40 ft. (Earth only); fly 40 ft. (hover) (Air only); swim 40 ft. (Water only)","STR","DEX","CON","INT","WIS","CHA","18 (+4)","15 (+2)","17 (+3)","4 (-3)","10 (+0)","16 (+3)","Damage Resistances: acid (Water only); lightning and thunder (Air only); piercing and slashing (Earth only)","Damage Immunities: poison; fire (Fire only)","Condition Immunities: exhaustion, frightened, paralyzed, petrified, poisoned, unconscious","Senses: darkvision 60 ft., passive Perception 10","Languages: Primordial, understands the languages you speak","Challenge: \u2014","Proficiency Bonus: equals your bonus","Amorphous Form (Air, Fire, and Water Only). The elemental can move through a space as narrow as 1 inch wide without squeezing.","Actions","Multiattack. The elemental makes a number of attacks equal to half this spell\u2019s level (rounded down).","Slam. Melee Weapon Attack: your spell attack modifier to hit, reach 5 ft., one target. Hit: 1d10 + 4 + the spell\u2019s level bludgeoning damage (Air, Earth, and Water only) or fire damage (Fire only)."],"spellLists":["/spells:druid","/spells:ranger","/spells:wizard"]}');


var $8ccfe05825e5667b$exports = {};
$8ccfe05825e5667b$exports = JSON.parse('{"title":"Summon Fey","source":"Tasha\'s Cauldron of Everything","levelAndSchool":"3rd-level conjuration","level":3,"castingTime":"1 action","range":"90 feet","components":"V, S, M (a gilded flower worth at least 300 gp)","duration":"Concentration, up to 1 hour","description":["You call forth a fey spirit. It manifests in an unoccupied space that you can see within range. This corporeal form uses the Fey Spirit stat block. When you cast the spell, choose a mood. Fuming, Mirthful, or Tricksy. The creature resembles a fey creature of your choice marked by the chosen mood, which determines one of the traits in its stat block. The creature disappears when it drops to 0 hit points or when the spell ends.","The creature is an ally to you and your companions. In combat, the creature shares your initiative count, but it takes its turn immediately after yours. It obeys your verbal commands (no action required by you). If you don\u2019t issue any, it takes the Dodge action and uses its move to avoid danger.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, use the higher level wherever the spell\u2019s level appears in the stat block.","Fey Spirit","Small fey","Armor Class: 12 + the level of the spell (natural armor)","Hit Points: 30 + 10 for each spell level above 3rd","Speed: 40 ft.","STR","DEX","CON","INT","WIS","CHA","13 (+1)","16 (+3)","14 (+2)","14 (+2)","11 (+0)","16 (+3)","Condition Immunities: charmed","Senses: darkvision 60 ft., passive Perception 10","Languages: Sylvan, understands the languages you speak","Challenge: \u2014","Proficiency Bonus: equals your bonus","Actions","Multiattack. The Fey makes a number of attacks equal to half this spell\u2019s level (rounded down).","Shortsword. Melee Weapon Attack: your spell attack modifier to hit, reach 5 ft., one target. Hit: 1d6 + 3 + the spell\u2019s level piercing damage + 1d6 force damage.","Bonus Actions","Fey Step. The fey magically teleports up to 30 feet to an unoccupied space it can see. Then one of the following effects occurs, based on the fey\u2019s chosen mood.","Fuming. The fey has advantage on the next attack roll it makes before the end of this turn.","Mirthful. The fey can force one creature it can see within 10 feet of it to make a Wisdom saving throw against your spell save DC. Unless the save succeeds, the target is charmed by you and the fey for 1 minute or until the target takes any damage.","Tricksy. The fey can fill a 5-foot cube within 5 feet of it with magical darkness, which lasts until the end of its next turn."],"spellLists":["/spells:druid","/spells:ranger","/spells:warlock","/spells:wizard"]}');


var $a80e82cc64ea61c9$exports = {};
$a80e82cc64ea61c9$exports = JSON.parse('{"title":"Summon Fiend","source":"Tasha\'s Cauldron of Everything","levelAndSchool":"6th-level conjuration","level":6,"castingTime":"1 action","range":"90 feet","components":"V, S, M (humanoid blood inside a ruby vial worth at least 600 gp)","duration":"Concentration, up to 1 hour","description":["You call forth a fiendish spirit. It manifests in an unoccupied space that you can see within range. This corporeal form uses the Fiendish Spirit stat block. When you cast the spell, choose Demon, Devil, or Yugoloth. The creature resembles a fiend of the chosen type, which determines certain traits in its stat block. The creature disappears when it drops to 0 hit points or when the spell ends.","The creature is an ally to you and your companions. In combat, the creature shares your initiative count, but it takes its turn immediately after yours. It obeys your verbal commands (no action required by you). If you don\u2019t issue any, it takes the Dodge action and uses its move to avoid danger.","At Higher Levels. When you cast this spell using a spell slot of 7th level or higher, use the higher level wherever the spell\u2019s level appears in the stat block.","Fiendish Spirit","Large fiend","Armor Class: 12 + the level of the spell (natural armor)","Hit Points: 50 (Demon only) or 40 (Devil only) or 60 (Yugoloth only) + 15 for each spell level above 6th","Speed: 40 ft., climb 40 ft. (Demon only), fly 60 ft. (Devil only)","STR","DEX","CON","INT","WIS","CHA","13 (+1)","16 (+3)","15 (+2)","10 (+0)","10 (+0)","16 (+3)","Damage Resistances: fire","Damage Immunities: poison","Condition Immunities: poisoned","Senses: darkvision 60 ft., passive Perception 10","Languages: Abyssal, Infernal, telepathy 60 ft.","Challenge: \u2014","Proficiency Bonus: equals your bonus","Death Throes (Demon Only). When the fiend drops to 0 hit points or the spell ends, the fiend explodes, and each creature within 10 feet of it must make a Dexterity saving throw against your spell save DC. A creature takes 2d10 + the spell\u2019s level fire damage on a failed save, or half as much damage on a successful one.","Devil\u2019s Sight (Devil Only). Magical darkness doesn\u2019t impede the fiend\u2019s darkvision.","Magic Resistance. The fiend has advantage on saving throws against spells and other magical effects.","Actions","Multiattack. The fiend makes a number of attacks equal to half this spell\u2019s level (rounded down).","Bite (Demon Only). Melee Weapon Attack: your spell attack modifier to hit, reach 5 ft., one target. Hit: 1d12 + 3 + the spell\u2019s level necrotic damage.","Claws (Yugoloth Only). Melee Weapon Attack: your spell attack modifier to hit, reach 5 ft., one target. Hit: 1d8 + 3 + the spell\u2019s level slashing damage. Immediately after the attack hits or misses, the fiend can magically teleport up to 30 feet to an unoccupied space it can see.","Hurl Flame (Devil Only). Ranged Spell Attack: your spell attack modifier to hit, range 150 ft., one target. Hit: 2d6 + 3 + the spell\u2019s level fire damage. If the target is a flammable object that isn\u2019t being worn or carried, it also catches fire."],"spellLists":["/spells:warlock","/spells:wizard"]}');


var $d32859a7b1cbf5a0$exports = {};
$d32859a7b1cbf5a0$exports = JSON.parse('{"title":"Summon Greater Demon","source":"Xanathar\'s Guide to Everything","levelAndSchool":"4th-level conjuration","level":4,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a vial of blood from a humanoid killed within the past 24 hours)","duration":"Concentration, up to 1 hour","description":["You utter foul words, summoning one demon from the chaos of the Abyss. You choose the demon\u2019s type, which must be one of challenge rating 5 or lower, such as a shadow demon or a barlgura. The demon appears in an unoccupied space you can see within range, and the demon disappears when it drops to 0 hit points or when the spell ends.","Roll initiative for the demon, which has its own turns. When you summon it and on each of your turns thereafter, you can issue a verbal command to it (requiring no action on your part), telling it what it must do on its next turn. If you issue no command, it spends its turn attacking any creature within reach that has attacked it.","At the end of each of the demon\u2019s turns, it makes a Charisma saving throw. The demon has disadvantage on this saving throw if you say its true name. On a failed save, the demon continues to obey you. On a successful save, your control of the demon ends for the rest of the duration, and the demon spends its turns pursuing and attacking the nearest non-demons to the best of its ability. If you stop concentrating on the spell before it reaches its full duration, an uncontrolled demon doesn\u2019t disappear for 1d6 rounds if it still has hit points.","As part of casting the spell, you can form a circle on the ground with the blood used as a material component. The circle is large enough to encompass your space. While the spell lasts, the summoned demon can\u2019t cross the circle or harm it, and it can\u2019t target anyone within it. Using the material component in this manner consumes it when the spell ends.","At Higher Levels. When you cast this spell using a spell slot of 5th level or higher, the challenge rating increases by 1 for each slot level above 4th."],"spellLists":["/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $e7afc817f8f7d99f$exports = {};
$e7afc817f8f7d99f$exports = JSON.parse('{"title":"Summon Lesser Demons","source":"Xanathar\'s Guide to Everything","levelAndSchool":"3rd-level conjuration","level":3,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a vial of blood from a humanoid killed within the past 24 hours)","duration":"Concentration, up to 1 hour","description":["You utter foul words, summoning demons from the chaos of the Abyss. Roll on the following table to determine what appears.","d6","Demons Summoned","1-2","Two demons of challenge rating 1 or lower","3-4","Four demons of challenge rating 1/2 or lower","5-6","Eight demons of challenge rating 1/4 or lower","The DM chooses the demons, such as manes or dretches, and you choose the unoccupied spaces you can see within range where they appear. A summoned demon disappears when it drops to 0 hit points or when the spell ends.","The demons are hostile to all creatures, including you. Roll initiative for the summoned demons as a group, which has its own turns. The demons pursue and attack the nearest non-demons to the best of their ability.","As part of casting the spell, you can form a circle on the ground with the blood used as a material component. The circle is large enough to encompass your space. While the spell lasts, the summoned demons can\'t cross the circle or harm it, and they can\'t target anyone within it. Using the material component in this manner consumes it when the spell ends.","At Higher Levels. When you cast this spell using a spell slot of 6th or 7th level, you summon twice as many demons. If you cast it using a spell slot of 8th or 9th level, you summon three times as many demons."],"spellLists":["http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $313ce4698a34aad3$exports = {};
$313ce4698a34aad3$exports = JSON.parse('{"title":"Summon Shadowspawn","source":"Tasha\'s Cauldron of Everything","levelAndSchool":"3rd-level conjuration","level":3,"castingTime":"1 action","range":"90 feet","components":"V, S, M (tears inside a crystal vial worth at least 300 gp)","duration":"Concentration, up to 1 hour","description":["You call forth a shadowy spirit. It manifests in an unoccupied space that you can see within range. This corporeal form uses the Shadow Spirit stat block. When you cast the spell, choose an emotion: Fury, Despair, or Fear. The creature resembles a misshapen biped marked by the chosen emotion, which determines certain traits in its stat block. The creature disappears when it drop to 0 hit points or when the spell ends.","The creature is an ally to you and your companions. In combat, the creature shares your initiative count, but it takes its turn immediately after your. It obeys your verbal commands (no action required by you). If you don\u2019t issue any, it takes the Dodge action and it uses its move to avoid danger.","At Higher Levels. When you cast the spell using a spell slot of 4th level or higher, use the higher level wherever the spell\u2019s level appears on the stat block.","Shadow Spirit","Medium monstrosity","Armor Class: 11 + the level of the spell (natural armor)","Hit Points: 35 + 15 for each level of the spell above 3rd","Speed: 40 ft.","STR","DEX","CON","INT","WIS","CHA","13 (+1)","16 (+3)","15 (+2)","4 (\u22123)","10 (+0)","16 (+3)","Damage Resistances: necrotic","Condition Immunities: frightened","Senses: darkvision 120 ft., passive Perception 10","Languages: understands the languages you speak","Challenge: \u2014","Proficiency Bonus: equals your bonus","Terror Frenzy (Fury Only). The spirit has advantage on attack rolls against frightened creatures.","Weight of Sorrow (Despair Only). Any creature, other than you, that starts its turn within 5 feet of the spirit has its speed reduced by 20 feet until the start of that creature\u2019s next turn.","Actions","Multiattack. The spirit makes a number of attacks equal to half this spell\u2019s level (rounded down).","Chilling Hand. Melee Weapon Attack: your spell attack modifier to hit, reach 5 ft., one target. Hit: 1d12 + 3 + the spell\u2019s level cold damage.","Dreadful Scream (1/Day). The spirit screams. Each creature within 30 feet of it must succeed on a Wisdom saving throw against your spell save DC or be frightened of the spirit for 1 minute. The frightened creature can repeat the saving throw at the end of each of its turns, ending the effect on itself on a success.","Bonus Action","Shadow Stealth (Fear Only). While in dim light or darkness, the spirit takes the Hide action."],"spellLists":["/spells:warlock","/spells:wizard"]}');


var $d77892c171f5d88f$exports = {};
$d77892c171f5d88f$exports = JSON.parse('{"title":"Summon Undead","source":"Tasha\'s Cauldron of Everything","levelAndSchool":"3rd-level necromancy","level":3,"castingTime":"1 action","range":"90 feet","components":"V, S, M (a gilded skull worth at least 300 gp)","duration":"Concentration, up to 1 hour","description":["You call forth an undead spirit. It manifests in an unoccupied space that you can see within range. This corporeal form uses the Undead Spirit stat block. When you cast the spell, choose the creature\u2019s form: Ghostly, Putrid, or Skeletal. The spirit resembles an undead creature with the chosen form, which determines certain traits in its stat block. The creature disappears when it drops to 0 hit points or when the spell ends.","The creature is an ally to you and your companions. In combat, the creature shares your initiative count, but it takes its turn immediately after yours. It obeys your verbal commands (no action required by you). If you don\u2019t issue any, it takes the Dodge action and uses its move to avoid danger.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, use the higher level wherever the spell\u2019s level appears in the stat block.","Undead Spirit","Medium undead","Armor Class: 11 + the level of the spell (natural armor)","Hit Points: 30 (Ghostly and Putrid only) or 20 (Skeletal only) + 10 for each level of the spell above 3rd","Speed: 30 ft., fly 40 ft. (hover) (Ghostly only)","STR","DEX","CON","INT","WIS","CHA","12 (+1)","16 (+3)","15 (+2)","4 (\u22123)","10 (+0)","9 (\u22121)","Damage Immunities: necrotic, poison","Condition Immunities: exhaustion, frightened, paralyzed, poisoned","Senses: darkvision 60 ft., passive Perception 10","Languages: understands the languages you speak","Challenge: \u2014","Proficiency Bonus: equals your bonus","Festering Aura (Putrid Only). Any creature, other than you, that starts its turn within 5 feet of the spirit must succeed on a Constitution saving throw against your spell save DC or be poisoned until the start of its next turn.","Incorporeal Passage (Ghostly Only). The spirit can move through other creatures and objects as if they were difficult terrain. If it ends its turn inside an objects, it is shunted to the nearest unoccupied space and takes 1d10 force damage for every 5 feet traveled.","Actions","Multiattack. The spirit makes a number of attacks equal to half this spell\u2019s level (rounded down).","Deathly Touch (Ghostly Only). Melee Weapon Attack: your spell attack modifier to hit, reach 5 ft., one creature. Hit: 1d8 + 3 + the spell\u2019s level necrotic damage, and the creature must succeed on a Wisdom saving throw against your spell save DC or be frightened of the undead until the end of the target\u2019s next turn.","Grave Bolt (Skeletal Only). Ranged Spell Attack: your spell attack modifier to hit, range 150 ft., one target. Hit: 2d4 + 3 + the spell\u2019s level necrotic damage.","Rotting Claw (Putrid Only). Melee Weapon Attack: your spell attack modifier to hit, reach 5 ft., one target. Hit: 1d6 + 3 + the spell\u2019s level slashing damage. If the target is poisoned, it must succeed on a Constitution saving throw against your spell save DC or be paralyzed until the end of its next turn."],"spellLists":["/spells:warlock","/spells:wizard"]}');


var $542d075d0721fb12$exports = {};
$542d075d0721fb12$exports = JSON.parse('{"title":"Summon Warrior Spirit (UA)","source":"Unearthed Arcana 85 - Wonders of the Multiverse","levelAndSchool":"3rd-level conjuration","level":3,"castingTime":"1 action","range":"90 feet","components":"V, S, M (a gilded playing card depicting a knight worth at least 300 gp)","duration":"Concentration, up to 1 hour","description":["You call forth a warrior spirit from the legendary Deck of Many Things. It manifests in an unoccupied space that you can see within range. This corporeal form uses the Warrior Spirit stat block. When you cast the spell, choose a type of warrior: barbarian, fighter, or monk. The warrior resembles a humanoid armed appropriately to the chosen class, which determines certain traits in its stat block. The warrior disappears when it drops to 0 hit points or when the spell ends.","The warrior is an ally to you and your companions. In combat, the warrior shares your initiative count, but it takes its turn immediately after yours. It obeys your verbal commands (no action required by you). If you don\u2019t issue any, it takes the Dodge action and uses its move to avoid danger.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, the creature assumes the higher level for that casting wherever it uses the spell\u2019s level in its stat block.","Warrior Spirit","Medium Undead","Armor Class: 13 + the level of the spell + 2 (Fighter only)","Hit Points: 30 (Babarian and Fighter only) or 20 (Monk only) + 10 for each spell level above 3rd","Speed: 30 ft., 40 ft. (Monk only)","STR","DEX","CON","INT","WIS","CHA","16 (+3)","16 (+3)","14 (+2)","10 (+0)","16 (+3)","9 (-1)","Saving Throws: Str +3, Dex +3","Damage Resistances: poison","Condition Immunities: charmed, poisoned","Senses: passive Perception 13","Languages: Common, understands the languages you speak","Challenge: \u2014","Proficiency Bonus: equals your bonus","Actions","Multiattack. The warrior makes a number of attacks equal to half this spell\u2019s level (rounded down).","Reckless Strike (Barbarian Only). Melee Weapon Attack: your spell attack modifier to hit (with advantage), reach 5 ft., one target. Hit: 1d12 + 3 + the spell\u2019s level slashing damage, and attacks made against the warrior until the start of its next turn are made with advantage.","Rallying Strike (Fighter Only). Melee or Ranged Weapon Attack: your spell attack modifier to hit, reach 5 ft., or range 20/60 ft., one target. Hit: 1d6 + 3 + the spell\u2019s level piercing damage, and the warrior can choose another creature it can see within 20 feet of itself. The chosen creature gains 1d6 temporary hit points.","Unarmed Strike (Monk Only). Melee Weapon Attack: your spell attack modifier to hit, reach 5 ft., one target. Hit: 1d4 + 3 + the spell\u2019s level bludgeoning damage, and the target must succeed on a Strength saving throw against your spell save DC or be knocked prone.","Bonus Actions","Flurry of Blows (Monk Only). The monk makes one Unarmed Strike attack."],"spellLists":["http://dnd5e.wikidot.com/wondrous-items:deck-of-many-things","http://dnd5e.wikidot.com/spells:sorcerer,","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $57eee20222489b05$exports = {};
$57eee20222489b05$exports = JSON.parse('{"title":"Sunbeam","source":"Player\'s Handbook","levelAndSchool":"6th-level evocation","level":6,"castingTime":"1 action","range":"Self (60-foot line)","components":"V, S, M (a magnifying glass)","duration":"Concentration, up to 1 minute","description":["A beam of brilliant light flashes out from your hand in a 5-foot-wide, 60-foot-line. Each creature in the line must make a Constitution saving throw. On a failed save, a creature takes 6d8 radiant damage and is blinded until your next turn. On a successful save, it takes half as much damage and isn\u2019t blinded by this spell. Undead and oozes have disadvantage on this saving throw.","You can create a new line of radiance as your action on any turn until the spell ends.","For the duration, a mote of brilliant radiance shines in your hand. It sheds bright light in a 30-foot radius and dim light for an additional 30 feet. The light is sunlight."],"spellLists":["/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $7baa48519a384bec$exports = {};
$7baa48519a384bec$exports = JSON.parse('{"title":"Sunburst","source":"Player\'s Handbook","levelAndSchool":"8th-level evocation","level":8,"castingTime":"1 action","range":"150 feet","components":"V, S, M (fire and a piece of sunstone)","duration":"Instantaneous","description":["Brilliant sunlight flashes in a 60-foot radius centered on a point you choose within range. Each creature in that light must make a Constitution saving throw. On a failed save, a creature takes 12d6 radiant damage and is blinded for 1 minute. On a successful save, it takes half as much damage and isn\u2019t blinded by this spell. Undead and oozes have disadvantage on this saving throw.","A creature blinded by this spell makes another Constitution saving throw at the end of each of its turns. On a successful save, it is no longer blinded.","This spell dispels any darkness in its area that was created by a spell."],"spellLists":["/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $8ccb331841375541$exports = {};
$8ccb331841375541$exports = JSON.parse('{"title":"Swift Quiver","source":"Player\'s Handbook","levelAndSchool":"5th-level transmutation","level":5,"castingTime":"1 bonus action","range":"Touch","components":"V, S, M (a quiver containing at least one piece of ammunition)","duration":"Concentration, up to 1 minute","description":["You transmute your quiver so it produces an endless supply of nonmagical ammunition, which seems to leap into your hand when you reach for it.","On each of your turns until the spell ends, you can use a bonus action to make two attacks with a weapon that uses ammunition from the quiver. Each time you make such a ranged attack, your quiver magically replaces the piece of ammunition you used with a similar piece of nonmagical ammunition. Any pieces of ammunition created by this spell disintegrate when the spell ends. If the quiver leaves your possession, the spell ends."],"spellLists":["http://dnd5e.wikidot.com/spells:ranger"]}');


var $0a741ff952cbe994$exports = {};
$0a741ff952cbe994$exports = JSON.parse('{"title":"Sword Burst","source":"Tasha\'s Cauldron of Everything","levelAndSchool":"Conjuration cantrip","level":0,"castingTime":"1 action","range":"Self (5-foot radius)","components":"V","duration":"Instantaneous","description":["You create a momentary circle of spectral blades that sweep around you. All other creatures within 5 feet of you must succeed on a Dexterity saving throw or take 1d6 force damage.","At Higher Levels. This spell\'s damage increases by 1d6 when you reach 5th level (2d6), 11th level (3d6), and 17th level (4d6)."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","/spells:sorcerer","/spells:warlock","/spells:wizard"]}');


var $533e237bcdc632c0$exports = {};
$533e237bcdc632c0$exports = JSON.parse('{"title":"Symbol","source":"Player\'s Handbook","levelAndSchool":"7th-level abjuration","level":7,"castingTime":"1 minute","range":"Touch","components":"V, S, M (mercury, phosphorus, and powdered diamond and opal with a total value of at least 1,000 gp, which the spell consumes)","duration":"Until dispelled or triggered","description":["When you cast this spell, you inscribe a harmful glyph either on a surface (such as a section of floor, a wall, or a table) or within an object that can be closed to conceal the glyph (such as a book, a scroll, or a treasure chest). If you choose a surface, the glyph can cover an area of the surface no larger than 10 feet in diameter. If you choose an object, that object must remain in its place; if the object is moved more than 10 feet from where you cast this spell, the glyph is broken, and the spell ends without being triggered.","The glyph is nearly invisible, requiring an Intelligence (Investigation) check against your spell save DC to find it.","You decide what triggers the glyph when you cast the spell. For glyphs inscribed on a surface, the most typical triggers include touching or stepping on the glyph, removing another object covering it, approaching within a certain distance of it, or manipulating the object that holds it. For glyphs inscribed within an object, the most common triggers are opening the object, approaching within a certain distance of it, or seeing or reading the glyph.","You can further refine the trigger so the spell is activated only under certain circumstances or according to a creature\'s physical characteristics (such as height or weight), or physical kind (for example, the ward could be set to affect hags or shapechangers). You can also specify creatures that don\'t trigger the glyph, such as those who say a certain password.","When you inscribe the glyph, choose one of the options below for its effect. Once triggered, the glyph glows, filling a 60-foot-radius sphere with dim light for 10 minutes, after which time the spell ends. Each creature in the sphere when the glyph activates is targeted by its effect, as is a creature that enters the sphere for the first time on a turn or ends its turn there.","Death. Each target must make a Constitution saving throw, taking 10d10 necrotic damage on a failed save, or half as much damage on a successful save.","Discord. Each target must make a Constitution saving throw. On a failed save, a target bickers and argues with other creatures for 1 minute. During this time, it is incapable of meaningful communication and has disadvantage on attack rolls and ability checks.","Fear. Each target must make a Wisdom saving throw and becomes frightened for 1 minute on a failed save. While frightened, the target drops whatever it is holding and must move at least 20 feet away from the glyph on each of its turns, if able.","Hopelessness. Each target must make a Charisma saving throw. On a failed save, the target is overwhelmed with despair for 1 minute. During this time, it can\'t attack or target any creature with harmful abilities, spells, or other magical effects.","Insanity. Each target must make an Intelligence saving throw. On a failed save, the target is driven insane for 1 minute. An insane creature can\'t take actions, can\'t understand what other creatures say, can\'t read, and speaks only in gibberish. The DM controls its movement, which is erratic.","Pain. Each target must make a Constitution saving throw and becomes incapacitated with excruciating pain for 1 minute on a failed save.","Sleep. Each target must make a Wisdom saving throw and falls unconscious for 10 minutes on a failed save. A creature awakens if it takes damage or if someone uses an action to shake or slap it awake.","Stunning. Each target must make a Wisdom saving throw and becomes stunned for 1 minute on a failed save."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","/spells:druid","http://dnd5e.wikidot.com/spells:wizard"]}');


var $95e88632bb908958$exports = {};
$95e88632bb908958$exports = JSON.parse('{"title":"Synaptic Static","source":"Xanathar\'s Guide to Everything","levelAndSchool":"5th-level enchantment","level":5,"castingTime":"1 action","range":"120 feet","components":"V, S","duration":"Instantaneous","description":["You choose a point within range and cause psychic energy to explode there. Each creature in a 20-foot-radius sphere centered on that point must make an Intelligence saving throw. A creature with an Intelligence score of 2 or lower can\u2019t be affected by this spell. A target takes 8d6 psychic damage on a failed save, or half as much damage on a successful one.","After a failed save, a target has muddled thoughts for 1 minute. During that time, it rolls a d6 and subtracts the number rolled from all its attack rolls and ability checks, as well as its Constitution saving throws to maintain concentration. The target can make an Intelligence saving throw at the end of each of its turns, ending the effect on itself on a success."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $9f762190120bfbc9$exports = {};
$9f762190120bfbc9$exports = JSON.parse('{"title":"Synchronicity (UA)","source":"Unearthed Arcana 7 - Modern Magic","levelAndSchool":"4th-level enchantment (technomagic)","level":4,"castingTime":"1 action","range":"Touch","components":"V, S","duration":"Concentration, up to 1 hour","description":["The creature you touch feels reality subtly shifted to its favor while this spell is in effect. The target isn\'t inconvenienced by mundane delays of any sort. Traffic lights are always green, there\'s always a waiting elevator, and a taxi is always around the corner. The target can run at full speed through dense crowds, and attacks of opportunity provoked by the target\'s movement are made with disadvantage.","Synchronicity grants advantage to Dexterity (Stealth) checks, since the target always finds a handy piece of cover available. Additionally, the target has advantage on all ability checks made to drive a vehicle.","In the event that two or more creatures under the effect of synchronicity are attempting to avoid being inconvenienced by each other, the creatures engage in a contest of Charisma each time the effects of the spells would oppose each other."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $8947c9a9cd7bf816$exports = {};
$8947c9a9cd7bf816$exports = JSON.parse('{"title":"System Backdoor (UA)","source":"Unearthed Arcana 7 - Modern Magic","levelAndSchool":"4th-level transmutation (technomagic)","level":4,"castingTime":"1 minute","range":"Self","components":"V, S, M (hacking tools)","duration":"Concentration, up to 1 hour","description":["This spell allows you to bypass system security in order to create a secure login on a foreign system. The login you create allows you administrator-level privileges in any computer system not enhanced through technomagic. The login defeats any technomagic spells of 3rd level or lower.","Once the duration of the spell expires, the login and all privileges are wiped from the system. System logs still show the activity of the user, but the user identification cannot be found or traced.","At Higher Levels. When you cast this spell using a spell slot of 5th level or higher, you are able to bypass technomagic spells if the spell\u2019s level is equal to or less than the level of the spell slot you used."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $39ea9be63744a4e0$exports = {};
$39ea9be63744a4e0$exports = JSON.parse('{"title":"Tasha\'s Caustic Brew","source":"Tasha\'s Cauldron of Everything","levelAndSchool":"1st-level evocation","level":1,"castingTime":"1 action","range":"Self (30-foot line)","components":"V, S, M (a bit of rotten food)","duration":"Concentration, up to 1 minute","description":["A stream of acid emanates from you in a line 30 feet long and 5 feet wide in a direction you choose. Each creature in the line must succeed on a Dexterity saving throw or be covered in acid for the spell\u2019s duration or until a creature uses its action to scrape or wash the acid off itself or another creature. A creature covered in the acid takes 2d4 acid damage at start of each of its turns.","At Higher Levels. When you cast this spell using a spell slot 2nd level or higher, the damage increases by 2d4 for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","/spells:sorcerer","/spells:wizard"]}');


var $44e4079403f5fa4a$exports = {};
$44e4079403f5fa4a$exports = JSON.parse('{"title":"Tasha\'s Hideous Laughter","source":"Player\'s Handbook","levelAndSchool":"1st-level enchantment","level":1,"castingTime":"1 action","range":"30 feet","components":"V, S, M (tiny tarts and a feather that is waved in the air)","duration":"Concentration, up to 1 minute","description":["A creature of your choice that you can see within range perceives everything as hilariously funny and falls into fits of laughter if this spell affects it. The target must succeed on a Wisdom saving throw or fall prone, becoming incapacitated and unable to stand up for the duration. A creature with an Intelligence score of 4 or less isn\u2019t affected.","At the end of each of its turns, and each time it takes damage, the target can make another Wisdom saving throw. The target has advantage on the saving throw if it\u2019s triggered by damage. On a success, the spell ends."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:wizard"]}');


var $34efc813c5318e9e$exports = {};
$34efc813c5318e9e$exports = JSON.parse('{"title":"Tasha\'s Mind Whip","source":"Tasha\'s Cauldron of Everything","levelAndSchool":"2nd-level enchantment","level":2,"castingTime":"1 action","range":"90 feet","components":"V","duration":"1 round","description":["You psychically lash out at one creature you can see within range. The target must make an Intelligence saving throw. On a failed save, the target takes 3d6 psychic damage, and it can\u2019t take a reaction until the end of its next turn. Moreover, on its next turn, it must choose whether it gets a move, an action, or a bonus action; it gets only one of the three. On a successful save, the target takes half as much damage and suffers none of the spell\u2019s other effects.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, you can target one additional creature for each slot level above 2nd. The creatures must be within 30 feet of each other when you target them."],"spellLists":["/spells:sorcerer","/spells:wizard"]}');


var $2d9096c3ac51c167$exports = {};
$2d9096c3ac51c167$exports = JSON.parse('{"title":"Tasha\'s Otherworldly Guise","source":"Tasha\'s Cauldron of Everything","levelAndSchool":"6th-level transmutation","level":6,"castingTime":"1 bonus action","range":"Self","components":"V, S, M (an object engraved with a symbol of the Outer Planes, worth at least 500 gp)","duration":"Concentration, up to 1 minute","description":["Uttering an incantation, you draw on the magic of the Lower Planes or Upper Planes (your choice) to transform yourself. You gain the following benefits until the spell ends:","You are immune to fire and poison damage (Lower Planes) or radiant and necrotic damage (Upper Planes).","You are immune to the poisoned condition (Lower Planes) or the charmed condition (Upper Planes).","Spectral wings appear on your back, giving you a flying speed of 40 feet.","You have a +2 bonus to AC.","All your weapon attacks are magical, and when you make a weapon attack, you can use your spell casting ability modifier instead of Strength or Dexterity for the attack and damage rolls.","You can attack twice, instead of once, when you take the Attack action on your turn. You ignore this benefit if you already have a feature, like Extra Attack, that lets you attack more than once when you take the Attack action on your turn."],"spellLists":["/spells:sorcerer","/spells:warlock","/spells:wizard"]}');


var $377bc4af675a60a6$exports = {};
$377bc4af675a60a6$exports = JSON.parse('{"title":"Telekinesis","source":"Player\'s Handbook","levelAndSchool":"5th-level transmutation","level":5,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Concentration, up to 10 minutes","description":["You gain the ability to move or manipulate creatures or objects by thought. When you cast the spell, and as your action each round for the duration, you can exert your will on one creature or object that you can see within range, causing the appropriate effect below. You can affect the same target round after round, or choose a new one at any time. If you switch targets, the prior target is no longer affected by the spell.","Creature.","You can try to move a Huge or smaller creature. Make an ability check with your spellcasting ability contested by the creature\u2019s Strength check. If you win the contest, you move the creature up to 30 feet in any direction, including upward but not beyond the range of this spell. Until the end of your next turn, the creature is restrained in your telekinetic grip. A creature lifted upward is suspended in mid-air.","On subsequent rounds, you can use your action to attempt to maintain your telekinetic grip on the creature by repeating the contest.","Object.","You can try to move an object that weighs up to 1,000 pounds. If the object isn\u2019t being worn or carried, you automatically move it up to 30 feet in any direction, but not beyond the range of this spell.","If the object is worn or carried by a creature, you must make an ability check with your spellcasting ability contested by that creature\u2019s Strength check. If you succeed, you pull the object away from that creature and can move it up to 30 feet in any direction but not beyond the range of this spell.","You can exert fine control on objects with your telekinetic grip, such as manipulating a simple tool, opening a door or a container, stowing or retrieving an item from an open container, or pouring the contents from a vial."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $5fd23de7e4708328$exports = {};
$5fd23de7e4708328$exports = JSON.parse('{"title":"Telepathy","source":"Player\'s Handbook","levelAndSchool":"8th-level evocation","level":8,"castingTime":"1 action","range":"Unlimited","components":"V, S, M (a pair of linked silver rings)","duration":"24 hours","description":["You create a telepathic link between yourself and a willing creature with which you are familiar. The creature can be anywhere on the same plane of existence as you. The spell ends if you or the target are no longer on the same plane.","Until the spell ends, you and the target can instantaneously share words, images, sounds, and other sensory messages with one another through the link, and the target recognizes you as the creature it is communicating with. The spell enables a creature with an Intelligence score of at least 1 to understand the meaning of your words and take in the scope of any sensory messages you send to it."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $827474045104af7e$exports = {};
$827474045104af7e$exports = JSON.parse('{"title":"Teleport","source":"Player\'s Handbook","levelAndSchool":"7th-level conjuration","level":7,"castingTime":"1 action","range":"10 feet","components":"V","duration":"Instantaneous","description":["This spell instantly transports you and up to eight willing creatures of your choice that you can see within range, or a single object that you can see within range, to a destination you select. If you target an object, it must be able to fit entirely inside a 10-foot cube, and it can\u2019t be held or carried by an unwilling creature.","The destination you choose must be known to you, and it must be on the same plane of existence as you. Your familiarity with the destination determines whether you arrive there successfully. The DM rolls d100 and consults the table.","Familiarity","Mishap","Similar Area","Off Target","On Target","Permanent circle","\u2014","\u2014","\u2014","01-100","Associated object","\u2014","\u2014","\u2014","01-100","Very familiar","01-05","06-13","14-24","25-100","Seen casually","01-33","34-43","44-53","54-100","Viewed once","01-43","44-53","54-73","74-100","Description","01-43","44-53","54-73","74-100","False destination","01-50","51-100","\u2014","\u2014","\\"Permanent circle\\" means a permanent Teleportation Circle whose sigil sequence you know.","\\"Associated object\\" means that you possess an object taken from the desired destination within the last six months, such as a book from a wizard\'s library, bed linen from a royal suite, or a chunk of marble from a lich\'s secret tomb.","\\"Very familiar\\" is a place you have been very often, a place you have carefully studied, or a place you can see when you cast the spell.","\\"Seen casually\\" is someplace you have seen more than once but with which you aren\'t very familiar.","\\"Viewed once\\" is a place you have seen once, possibly using magic.","\\"Description\\" is a place whose location and appearance you know through someone else\'s description, perhaps from a map.","\\"False destination\\" is a place that doesn\'t exist. Perhaps you tried to scry an enemy\'s sanctum but instead viewed an illusion, or you are attempting to teleport to a familiar location that no longer exists.","On Target. You and your group (or the target object) appear where you want to.","Off Target. You and your group (or the target object) appear a random distance away from the destination in a random direction. Distance off target is 1d10 x 1d10 percent of the distance that was to be traveled. For example, if you tried to travel 120 miles, landed off target, and rolled a 5 and 3 on the two d10s, then you would be off target by 15 percent, or 18 miles. The DM determines the direction off target randomly by rolling a d8 and designating 1 as north, 2 as northeast, 3 as east, and so on around the points of the compass. If you were teleporting to a coastal city and wound up 18 miles out at sea, you could be in trouble.","Similar Area. You and your group (or the target object) wind up in a different area that\'s visually or thematically similar to the target area. If you are heading for your home laboratory, for example, you might wind up in another wizard\'s laboratory or in an alchemical supply shop that has many of the same tools and implements as your laboratory. Generally, you appear in the closest similar place, but since the spell has no range limit, you could conceivably wind up anywhere on the plane.","Mishap. The spell\'s unpredictable magic results in a difficult journey. Each teleporting creature (or the target object) takes 3d10 force damage, and the DM rerolls on the table to see where you wind up (multiple mishaps can occur, dealing damage each time)."],"spellLists":["http://dnd5e.wikidot.com/spell:teleportation-circle","http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $8b8e5695b1917771$exports = {};
$8b8e5695b1917771$exports = JSON.parse('{"title":"Teleportation Circle","source":"Player\'s Handbook","levelAndSchool":"5th-level conjuration","level":5,"castingTime":"1 minute","range":"10 feet","components":"V, M (rare chalks and inks infused with precious gems worth 50 gp, which the spell consumes)","duration":"1 round","description":["As you cast the spell, you draw a 10-foot-diameter circle on the ground inscribed with sigils that link your location to a permanent teleportation circle of your choice whose sigil sequence you know and that is on the same plane of existence as you.","A shimmering portal opens within the circle you drew and remains open until the end of your next turn. Any creature that enters the portal instantly appears within 5 feet of the destination circle or in the nearest unoccupied space if that space is occupied.","Many major temples, guilds, and other important places have permanent teleportation circles inscribed somewhere within their confines. Each such circle includes a unique sigil sequence \u2013 a string of magical runes arranged in a particular pattern. When you first gain the ability to cast this spell, you learn the sigil sequences for two destinations on the Material Plane, determined by the DM. You can learn additional sigil sequences during your adventures. You can commit a new sigil sequence to memory after studying it for 1 minute.","You can create a permanent teleportation circle by casting this spell in the same location every day for one year. You need not use the circle to teleport when you cast the spell in this way."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $96ca36d778dbba71$exports = {};
$96ca36d778dbba71$exports = JSON.parse('{"title":"Temple of the Gods","source":"Xanathar\'s Guide to Everything","levelAndSchool":"7th-level conjuration","level":7,"castingTime":"1 hour","range":"120 feet","components":"V, S, M (a holy symbol worth at least 5 gp)","duration":"24 hours","description":["You cause a temple to shimmer into existence on ground you can see within range. The temple must fit within an unoccupied cube of space, up to 120 feet on each side. The temple remains until the spell ends. It is dedicated to whatever god, pantheon, or philosophy is represented by the holy symbol used in the casting.","You make all decisions about the temple\u2019s appearance. The interior is enclosed by a floor, walls, and a roof, with one door granting access to the interior and as many windows as you wish. Only you and any creatures you designate when you cast the spell can open or close the door.","The temple\u2019s interior is an open space with an idol or altar at one end. You decide whether the temple is illuminated and whether that illumination is bright light or dim light. The smell of burning incense fills the air within, and the temperature is mild.","The temple opposes types of creatures you choose when you cast this spell. Choose one or more of the following: celestials, elementals, fey, fiends, or undead. If a creature of the chosen type attempts to enter the temple, that creature must make a Charisma saving throw. On a failed save, it can\u2019t enter the temple for 24 hours. Even if the creature can enter the temple, the magic there hinders it; whenever it makes an attack roll, an ability check, or a saving throw inside the temple, it must roll a d4 and subtract the number rolled from the d20 roll.","In addition, the sensors created by divination spells can\u2019t appear inside the temple, and creatures within can\u2019t be targeted by divination spells.","Finally, whenever any creature in the temple regains hit points from a spell of 1st level or higher, the creature regains additional hit points equal to your Wisdom modifier (minimum 1 hit point).","The temple is made from opaque magical force that extends into the Ethereal Plane, thus blocking ethereal travel into the temple\u2019s interior. Nothing can physically pass through the temple\u2019s exterior. It can\u2019t be dispelled by dispel magic, and antimagic field has no effect on it. A disintegrate spell destroys the temple instantly.","Casting this spell on the same spot every day for a year makes this effect permanent."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric"]}');


var $e6d37ebcc66bef53$exports = {};
$e6d37ebcc66bef53$exports = JSON.parse('{"title":"Temporal Shunt","source":"Explorer\'s Guide to Wildemount","levelAndSchool":"5th-level transmutation (dunamancy:chronurgy)","level":5,"castingTime":"1 reaction, taken when a creature you see makes an attack roll or starts to cast a spell","range":"120 feet","components":"V, S","duration":"1 round","description":["You target the triggering creature, which must succeed on a Wisdom saving throw or vanish, being thrown to another point in time and causing the attack to miss or the spell to be wasted. At the start of its next turn, the target reappears where it was or in the closest unoccupied space. The target doesn\'t remember you casting the spell or being affected by it.","At Higher Levels. When you cast this spell using a spell slot of 6th level or higher, you can target one additional creature for each slot level above 5th. All targets must be within 30 feet of each other."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $8432aeab7e645466$exports = {};
$8432aeab7e645466$exports = JSON.parse('{"title":"Tenser\'s Floating Disk","source":"Player\'s Handbook","levelAndSchool":"1st-level conjuration (ritual)","level":1,"castingTime":"1 action","range":"30 feet","components":"V, S, M (a drop of mercury)","duration":"1 hour","description":["This spell creates a circular, horizontal plane of force, 3 feet in diameter and 1 inch thick, that floats 3 feet above the ground in an unoccupied space of your choice that you can see within range. The disk remains for the duration, and can hold up to 500 pounds. If more weight is placed on it, the spell ends, and everything on the disk falls to the ground.","The disk is immobile while you are within 20 feet of it. If you move more than 20 feet away from it, the disk follows you so that it remains within 20 feet of you. It can move across uneven terrain, up or down stairs, slopes, and the like, but it can\u2019t cross an elevation change of 10 feet or more. For example, the disk can\u2019t move across a 10-foot-deep pit, nor could it leave such a pit if it were created at the bottom.","If you move more than 100 feet from the disk (typically because it can\u2019t move around an obstacle to follow you), the spell ends."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $7778a35de77fbb0e$exports = {};
$7778a35de77fbb0e$exports = JSON.parse('{"title":"Tenser\'s Transformation","source":"Xanathar\'s Guide to Everything","levelAndSchool":"6th-level transmutation","level":6,"castingTime":"1 action","range":"Self","components":"V, S, M (a few hairs from a bull)","duration":"Concentration, up to 10 minutes","description":["You endow yourself with endurance and martial prowess fueled by magic. Until the spell ends, you can\u2019t cast spells, and you gain the following benefits:","You gain 50 temporary hit points. If any of these remain when the spell ends, they are lost.","You have advantage on attack rolls that you make with simple and martial weapons.","When you hit a target with a weapon attack, that target takes an extra 2d12 force damage.","You have proficiency with all armor, shields, simple weapons, and martial weapons.","You have proficiency in Strength and Constitution saving throws.","You can attack twice, instead of once, when you take the Attack action on your turn. You ignore this benefit if you already have a feature, like Extra Attack, that gives you extra attacks.","Immediately after the spell ends, you must succeed on a DC 15 Constitution saving throw or suffer one level of exhaustion."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $848765d49f8a40ff$exports = {};
$848765d49f8a40ff$exports = JSON.parse('{"title":"Tether Essence","source":"Explorer\'s Guide to Wildemount","levelAndSchool":"7th-level necromancy (dunamancy)","level":7,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a spool of platinum cord worth at least 250 gp, which the spell consumes)","duration":"Concentration, up to 1 hour","description":["Two creatures you can see within range must make a Constitution saving throw, with disadvantage if they are within 30 feet of each other. Either creature can willingly fail the save. If either save succeeds, the spell has no effect. If both saves fail, the creatures are magically linked for the duration, regardless of the distance between them. When damage is dealt to one of them, the same damage is dealt to the other one. If hit points are restored to one of them, the same number of hit points are restored to the other one. If either of the tethered creatures is reduced to 0 hit points, the spell ends on both. If the spell ends on one creature, it ends on both."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $0110507f8b663293$exports = {};
$0110507f8b663293$exports = JSON.parse('{"title":"Thaumaturgy","source":"Player\'s Handbook","levelAndSchool":"Transmutation cantrip","level":0,"castingTime":"1 action","range":"30 feet","components":"V","duration":"Up to 1 minute","description":["You manifest a minor wonder, a sign of supernatural power, within range. You create one of the following magical effects within range:","Your voice booms up to three times as loud as normal for 1 minute.","You cause flames to flicker, brighten, dim, or change color for 1 minute.","You cause harmless tremors in the ground for 1 minute.","You create an instantaneous sound that originates from a point of your choice within range, such as a rumble of thunder, the cry of a raven, or ominous whispers.","You instantaneously cause an unlocked door or window to fly open or slam shut.","You alter the appearance of your eyes for 1 minute.","If you cast this spell multiple times, you can have up to three of its 1-minute effects active at a time, and you can dismiss such an effect as an action."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric"]}');


var $8a93239665517c4c$exports = {};
$8a93239665517c4c$exports = JSON.parse('{"title":"Thorn Whip","source":"Player\'s Handbook","levelAndSchool":"Transmutation cantrip","level":0,"castingTime":"1 action","range":"30 feet","components":"V, S, M (the stem of a plant with thorns)","duration":"Instantaneous","description":["You create a long, vine-like whip covered in thorns that lashes out at your command toward a creature in range. Make a melee spell attack against the target. If the attack hits, the creature takes 1d6 piercing damage, and if the creature is Large or smaller, you pull the creature up to 10 feet closer to you.","At Higher Levels. This spell\u2019s damage increases by 1d6 when you reach 5th level (2d6), 11th level (3d6), and 17th level (4d6)."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:druid"]}');


var $d02774c467c98f63$exports = {};
$d02774c467c98f63$exports = JSON.parse('{"title":"Thought Shield (UA)","source":"Unearthed Arcana 66 - Fighter, Rogue, and Wizard","levelAndSchool":"2nd-level abjuration","level":2,"castingTime":"1 action","range":"Touch","components":"V, S","duration":"8 hours","description":["You weave a clouding veil over the mind of one creature you touch. For the duration, the target\u2019s mind can\u2019t be read or detected, creatures can\u2019t telepathically communicate with the target unless the target allows it, and the target has advantage on saving throws against any effect that would determine whether it is telling the truth."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $ca1a7d8f97c8ba39$exports = {};
$ca1a7d8f97c8ba39$exports = JSON.parse('{"title":"Thunder Step","source":"Xanathar\'s Guide to Everything","levelAndSchool":"3rd-level conjuration","level":3,"castingTime":"1 action","range":"90 ft","components":"V","duration":"Instantaneous","description":["You teleport yourself to an unoccupied space you can see within range. Immediately after you disappear, a thunderous boom sounds, and each creature within 10 feet of the space you left must make a Constitution saving throw, taking 3d10 thunder damage on a failed save, or half as much damage on a successful one. The thunder can be heard from up to 300 feet away.","You can bring along objects as long as their weight doesn\u2019t exceed what you can carry. You can also teleport one willing creature of your size or smaller who is carrying gear up to its carrying capacity. The creature must be within 5 feet of you when you cast this spell, and there must be an unoccupied space within 5 feet of your destination space for the creature to appear in; otherwise, the creature is left behind.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, the damage increases by 1d10 for each slot level above 3rd."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $090388d642ddd8a7$exports = {};
$090388d642ddd8a7$exports = JSON.parse('{"title":"Thunderclap","source":"Xanathar\'s Guide to Everything","levelAndSchool":"Evocation cantrip","level":0,"castingTime":"1 action","range":"Self (5-foot radius)","components":"S","duration":"Instantaneous","description":["You create a burst of thunderous sound, which can be heard 100 feet away. Each creature other than you within 5 feet of you must make a Constitution saving throw. On a failed save, the creature takes 1d6 thunder damage.","At Higher Levels. The spell\u2019s damage increases by 1d6 when you reach 5th level (2d6), 11th level (3d6), and 17th level (4d6)."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard","http://dnd5e.wikidot.com/spells:artificer"]}');


var $4d178e83213b23a7$exports = {};
$4d178e83213b23a7$exports = JSON.parse('{"title":"Thunderous Smite","source":"Player\'s Handbook","levelAndSchool":"1st-level evocation","level":1,"castingTime":"1 bonus action","range":"Self","components":"V","duration":"Concentration, up to 1 minute","description":["The first time you hit with a melee weapon attack during this spell\u2019s duration, your weapon rings with thunder that is audible within 300 feet of you, and the attack deals an extra 2d6 thunder damage to the target. Additionally, if the target is a creature, it must succeed on a Strength saving throw or be pushed 10 feet away from you and knocked prone."],"spellLists":["http://dnd5e.wikidot.com/spells:paladin"]}');


var $2441d85a1a46a26c$exports = {};
$2441d85a1a46a26c$exports = JSON.parse('{"title":"Thunderwave","source":"Player\'s Handbook","levelAndSchool":"1st-level evocation","level":1,"castingTime":"1 action","range":"Self (15-foot cube)","components":"V, S","duration":"Instantaneous","description":["A wave of thunderous force sweeps out from you. Each creature in a 15-foot cube originating from you must make a Constitution saving throw. On a failed save, a creature takes 2d8 thunder damage and is pushed 10 feet away from you. On a successful save, the creature takes half as much damage and isn\u2019t pushed.","In addition, unsecured objects that are completely within the area of effect are automatically pushed 10 feet away from you by the spell\u2019s effect, and the spell emits a thunderous boom audible out to 300 feet.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the damage increases by 1d8 for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $d9afc69e486b312e$exports = {};
$d9afc69e486b312e$exports = JSON.parse('{"title":"Tidal Wave","source":"Xanathar\'s Guide to Everything","levelAndSchool":"3rd-level conjuration","level":3,"castingTime":"1 action","range":"120 feet","components":"V, S, M (a drop of water)","duration":"Instantaneous","description":["You conjure up a wave of water that crashes down on an area within range. The area can be up to 30 feet long, up to 10 feet wide, and up to 10 feet tall. Each creature in that area must make a Dexterity saving throw. On a failure, a creature takes 4d8 bludgeoning damage and is knocked prone. On a success, a creature takes half as much damage and isn\u2019t knocked prone. The water then spreads out across the ground in all directions, extinguishing unprotected flames in its area and within 30 feet of it."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $29f5ea8caa481a22$exports = {};
$29f5ea8caa481a22$exports = JSON.parse('{"title":"Time Ravage","source":"Explorer\'s Guide to Wildemount","levelAndSchool":"9th-level necromancy (dunamancy:chronurgy)","level":9,"castingTime":"1 action","range":"90 feet","components":"V, S, M (an hourglass filled with diamond dust worth at least 5,000 gp, which the spell consumes)","duration":"Instantaneous","description":["You target a creature you can see within range, putting its physical form through the devastation of rapid aging. The target must make a Constitution saving throw, taking 10d12 necrotic damage on a failed save, or half as much damage on a successful one. If the save fails, the target also ages to the point where it has only 30 days left before it dies of old age. In this aged state, the target has disadvantage on attack rolls, ability checks, and saving throws, and its walking speed is halved. Only the Wish spell or the Greater Restoration spell cast with a 9th-level spell slot can end these effects and restore the target to its previous age."],"spellLists":["http://dnd5e.wikidot.com/spell:wish","http://dnd5e.wikidot.com/spell:greater-restoration","http://dnd5e.wikidot.com/spells:wizard"]}');


var $7bcad9c453c24b9a$exports = {};
$7bcad9c453c24b9a$exports = JSON.parse('{"title":"Time Stop","source":"Player\'s Handbook","levelAndSchool":"9th-level transmutation","level":9,"castingTime":"1 action","range":"Self","components":"V","duration":"Instantaneous","description":["You briefly stop the flow of time for everyone but yourself. No time passes for other creatures, while you take 1d4 + 1 turns in a row, during which you can use actions and move as normal.","This spell ends if one of the actions you use during this period, or any effects that you create during this period, affects a creature other than you or an object being worn or carried by someone other than you. In addition, the spell ends if you move to a place more than 1,000 feet from the location where you cast it."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $8b53da5c3a1c5932$exports = {};
$8b53da5c3a1c5932$exports = JSON.parse('{"title":"Tiny Servant","source":"Xanathar\'s Guide to Everything","levelAndSchool":"3rd-level transmutation","level":3,"castingTime":"1 minute","range":"Touch","components":"V, S","duration":"8 hours","description":["You touch one Tiny, nonmagical object that isn\u2019t attached to another object or a surface and isn\u2019t being carried by another creature. The target animates and sprouts little arms and legs, becoming a creature under your control until the spell ends or the creature drops to 0 hit points. See the stat block for its statistics.","As a bonus action, you can mentally command the creature if it is within 120 feet of you. (If you control multiple creatures with this spell, you can command any or all of them at the same time, issuing the same command to each one.) You decide what action the creature will take and where it will move during its next turn, or you can issue a simple, general command, such as to fetch a key, stand watch, or stack some books. If you issue no commands, the servant does nothing other than defend itself against hostile creatures. Once given an order, the servant continues to follow that order until its task is complete.","When the creature drops to 0 hit points, it reverts to its original form, and any remaining damage carries over to that form.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, you can animate two additional objects for each slot level above 3rd.","Tiny Servant","Tiny Construct","Armor Class: 15 (natural armor)","Hit Points: 10 (4d4)","Speed: 30ft., climb 30 ft.","STR","DEX","CON","INT","WIS","CHA","4 (-3)","16 (+3)","10 (+0)","2 (-4)","10 (+0)","1 (-5)","Damage Immunities poison, psychic","Condition Immunities: blinded, charmed, deafened, exhaustion, frightened, paralyzed, petrified, poisoned","Senses: blindsight 60 ft. (blind beyond this radius), passive Perception 10","Languages: \u2014","Challenge: \u2014","Actions","Slam. Melee Weapon Attack: +5 to hit, reach 5 ft., one target. Hit: 5 (1d4 + 3) bludgeoning damage."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard","http://dnd5e.wikidot.com/spells:artificer"]}');


var $97d17c5a3670c0e4$exports = {};
$97d17c5a3670c0e4$exports = JSON.parse('{"title":"Toll the Dead","source":"Xanathar\'s Guide to Everything","levelAndSchool":"Necromancy cantrip","level":0,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"Instantaneous","description":["You point at one creature you can see within range, and the sound of a dolorous bell fills the air around it for a moment. The target must succeed on a Wisdom saving throw or take 1d8 necrotic damage. If the target is missing any of its hit points, it instead takes 1d12 necrotic damage.","At Higher Levels. The spell\u2019s damage increases by one die when you reach 5th level (2d8 or 2d12), 11th level (3d8 or 3d12), and 17th level (4d8 or 4d12)."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $3a91f52439db95be$exports = {};
$3a91f52439db95be$exports = JSON.parse('{"title":"Tongues","source":"Player\'s Handbook","levelAndSchool":"3rd-level divination","level":3,"castingTime":"1 action","range":"Touch","components":"V, M (a small clay model of a ziggurat)","duration":"1 hour","description":["This spell grants the creature you touch the ability to understand any spoken language it hears. Moreover, when the target speaks, any creature that knows at least one language and can hear the target understands what it says."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $65e185ff2b71af1f$exports = {};
$65e185ff2b71af1f$exports = JSON.parse('{"title":"Transmute Rock","source":"Xanathar\'s Guide to Everything","levelAndSchool":"5th-level transmutation","level":5,"castingTime":"1 action","range":"120 feet","components":"V, S, M (clay and water)","duration":"Instantaneous","description":["You choose an area of stone or mud that you can see that fits within a 40-foot cube and that is within range, and choose one of the following effects.","Transmute Rock to Mud.","Nonmagical rock of any sort in the area becomes an equal volume of thick and flowing mud that remains for the spell\u2019s duration.","If you cast the spell on an area of ground, it becomes muddy enough that creatures can sink into it. Each foot that a creature moves through the mud costs 4 feet of movement, and any creature on the ground when you cast the spell must make a Strength saving throw. A creature must also make this save the first time it enters the area on a turn or ends its turn there. On a failed save, a creature sinks into the mud and is restrained, though it can use an action to end the restrained condition on itself by pulling itself free of the mud.","If you cast the spell on a ceiling, the mud falls. Any creature under the mud when it falls must make a Dexterity saving throw. A creature takes 4d8 bludgeoning damage on a failed save, or half as much damage on a successful one.","Transmute Mud to Rock.","Nonmagical mud or quicksand in the area no more than 10 feet deep transforms into soft stone for the spell\u2019s duration. Any creature in the mud when it transforms must make a Dexterity saving throw. On a failed save, a creature becomes restrained by the rock. The restrained creature can use an action to try to break free by succeeding on a Strength check (DC 20) or by dealing 25 damage to the rock around it. On a successful save, a creature is shunted safely to the surface to an unoccupied space."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:wizard","http://dnd5e.wikidot.com/spells:artificer"]}');


var $1f0da9e7f20e6da7$exports = {};
$1f0da9e7f20e6da7$exports = JSON.parse('{"title":"Transport via Plants","source":"Player\'s Handbook","levelAndSchool":"6th-level conjuration","level":6,"castingTime":"1 action","range":"10 feet","components":"V, S","duration":"1 round","description":["This spell creates a magical link between a Large or larger inanimate plant within range and another plant, at any distance, on the same plane of existence. You must have seen or touched the destination plant at least once before. For the duration, any creature can step into the target plant and exit from the destination plant by using 5 feet of movement."],"spellLists":["http://dnd5e.wikidot.com/spells:druid"]}');


var $57d1a798709c2c50$exports = {};
$57d1a798709c2c50$exports = JSON.parse('{"title":"Tree Stride","source":"Player\'s Handbook","levelAndSchool":"5th-level conjuration","level":5,"castingTime":"1 action","range":"Self","components":"V, S","duration":"Concentration, up to 1 minute","description":["You gain the ability to enter a tree and move from inside it to inside another tree of the same kind within 500 feet.","Both trees must be living and at least the same size as you. You must use 5 feet of movement to enter a tree. You instantly know the location of all other trees of the same kind within 500 feet and, as part of the move used to enter the tree, can either pass into one of those trees or step out of the tree you\u2019re in. You appear in a spot of your choice within 5 feet of the destination tree, using another 5 feet of movement. If you have no movement left, you appear within 5 feet of the tree you entered.","You can use this transportation ability once per round for the duration. You must end each turn outside a tree."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger"]}');


var $062abc8c355e17cb$exports = {};
$062abc8c355e17cb$exports = JSON.parse('{"title":"True Polymorph","source":"Player\'s Handbook","levelAndSchool":"9th-level transmutation","level":9,"castingTime":"1 action","range":"30 feet","components":"V, S, M (a drop of mercury, a dollop of gum arabic, and a wisp of smoke)","duration":"Concentration, up to 1 hour","description":["Choose one creature or nonmagical object that you can see within range. You transform the creature into a different creature, the creature into a nonmagical object, or the object into a creature (the object must be neither worn nor carried by another creature). The transformation lasts for the duration, or until the target drops to 0 hit points or dies. If you concentrate on this spell for the full duration, the transformation becomes permanent.","Shapechangers aren\'t affected by this spell. An unwilling creature can make a Wisdom saving throw, and if it succeeds, it isn\'t affected by this spell.","This spell can\'t affect a target that has 0 hit points.","Creature into Creature.","If you turn a creature into another kind of creature, the new form can be any kind you choose whose challenge rating is equal to or less than the target\'s (or its level, if the target doesn\'t have a challenge rating). The target\'s game statistics, including mental ability scores, are replaced by the statistics of the new form. It retains its alignment and personality.","The target assumes the hit points of its new form, and when it reverts to its normal form, the creature returns to the number of hit points it had before it transformed. If it reverts as a result of dropping to 0 hit points, any excess damage carries over to its normal form. As long as the excess damage doesn\'t reduce the creature\'s normal form to 0 hit points, it isn\'t knocked unconscious.","The creature is limited in the actions it can perform by the nature of its new form, and it can\'t speak, cast spells, or take any other action that requires hands or speech unless its new form is capable of such actions.","The target\'s gear melds into the new form. The creature can\'t activate, use, wield, or otherwise benefit from any of its equipment.","Object into Creature.","You can turn an object into any kind of creature, as long as the creature\'s size is no larger than the object\'s size and the creature\'s challenge rating is 9 or lower. The creature is friendly to you and your companions. It acts on each of your turns. You decide what action it takes and how it moves. The DM has the creature\'s statistics and resolves all of its actions and movement.","If the spell becomes permanent, you no longer control the creature. It might remain friendly to you, depending on how you have treated it.","Creature into Object.","If you turn a creature into an object, it transforms along with whatever it is wearing and carrying into that form, as long as the object\'s size is no larger than the creature\'s size. The creature\'s statistics become those of the object, and the creature has no memory of time spent in this form, after the spell ends and it returns to its normal form."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $de10d89710d659e4$exports = {};
$de10d89710d659e4$exports = JSON.parse('{"title":"True Resurrection","source":"Player\'s Handbook","levelAndSchool":"9th-level necromancy","level":9,"castingTime":"1 hour","range":"Touch","components":"V, S, M (a sprinkle of holy water and diamonds worth at least 25,000 gp, which the spell consumes)","duration":"Instantaneous","description":["You touch a creature that has been dead for no longer than 200 years and that died for any reason except old age. If the creature\u2019s soul is free and willing, the creature is restored to life with all its hit points.","This spell closes all wounds, neutralizes any poison, cures all diseases, and lifts any curses affecting the creature when it died. The spell replaces damaged or missing organs or limbs. If the creature was undead, it is restored to its non-undead form.","The spell can even provide a new body if the original no longer exists, in which case you must speak the creature\u2019s name. The creature then appears in an unoccupied space you choose within 10 feet of you."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid"]}');


var $45be26ddf88deb22$exports = {};
$45be26ddf88deb22$exports = JSON.parse('{"title":"True Seeing","source":"Player\'s Handbook","levelAndSchool":"6th-level divination","level":6,"castingTime":"1 action","range":"Touch","components":"V, S, M (an ointment for the eyes that costs 25 gp; is made from mushroom powder, saffron, and fat; and is consumed by the spell)","duration":"1 hour","description":["This spell gives the willing creature you touch the ability to see things as they actually are. For the duration, the creature has truesight, notices secret doors hidden by magic, and can see into the Ethereal Plane, all out to a range of 120 feet."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $f57507c3f4d35ba1$exports = {};
$f57507c3f4d35ba1$exports = JSON.parse('{"title":"True Strike","source":"Player\'s Handbook","levelAndSchool":"Divination cantrip","level":0,"castingTime":"1 action","range":"30 feet","components":"S","duration":"Concentration, up to 1 round","description":["You extend your hand and point a finger at a target in range. Your magic grants you a brief insight into the target\u2019s defenses. On your next turn, you gain advantage on your first attack roll against the target, provided that this spell hasn\u2019t ended."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $e9f8738906feaf39$exports = {};
$e9f8738906feaf39$exports = JSON.parse('{"title":"Tsunami","source":"Player\'s Handbook","levelAndSchool":"8th-level conjuration","level":8,"castingTime":"1 minute","range":"Sight","components":"V, S","duration":"Concentration, up to 6 rounds","description":["A wall of water springs into existence at a point you choose within range. You can make the wall up to 300 feet long, 300 feet high, and 50 feet thick. The wall lasts for the duration.","When the wall appears, each creature within its area must make a Strength saving throw. On a failed save, a creature takes 6d10 bludgeoning damage, or half as much damage on a successful save.","At the start of each of your turns after the wall appears, the wall, along with any creatures in it, moves 50 feet away from you. Any Huge or smaller creature inside the wall or whose space the wall enters when it moves must succeed on a Strength saving throw or take 5d10 bludgeoning damage. A creature can take this damage only once per round. At the end of the turn, the wall\u2019s height is reduced by 50 feet, and the damage creatures take from the spell on subsequent rounds is reduced by 1d10. When the wall reaches 0 feet in height, the spell ends.","A creature caught in the wall can move by swimming. Because of the force of the wave, though, the creature must make a successful Strength (Athletics) check against your spell save DC in order to move at all. If it fails the check, it can\u2019t move. A creature that moves out of the area falls to the ground."],"spellLists":["http://dnd5e.wikidot.com/spells:druid"]}');


var $9abb0d47a1c4df2c$exports = {};
$9abb0d47a1c4df2c$exports = JSON.parse('{"title":"Unearthly Chorus (UA)","source":"Unearthed Arcana 36 - Starter Spells","levelAndSchool":"1st-level illusion","level":1,"castingTime":"1 action","range":"Self (30-foot radius)","components":"V","duration":"Concentration, up to 10 minutes","description":["Music of a style you choose fills the air around you in a 30-foot radius. The music spreads around corners and can be heard from up to 100 feet away. The music moves with you, centered on you for the duration.","Until the spell ends, you make Charisma (Performance) checks with advantage. In addition, you can use a bonus action on each of your turns to beguile one creature you choose within 30 feet of you that can see you and hear the music. The creature must make a Charisma saving throw. If you or your companions are attacking it, the creature automatically succeeds on the saving throw. On a failure, the creature becomes friendly to you for as long as it can hear the music and for 1 hour thereafter. You make Charisma (Deception) checks and Charisma (Persuasion) checks against creatures made friendly by this spell with advantage."],"spellLists":["http://dnd5e.wikidot.com/spells:bard"]}');


var $344f4c228970687d$exports = {};
$344f4c228970687d$exports = JSON.parse('{"title":"Unseen Servant","source":"Player\'s Handbook","levelAndSchool":"1st-level conjuration (ritual)","level":1,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a piece of string and a bit of wood)","duration":"1 hour","description":["This spell creates an invisible, mindless, shapeless, Medium force that performs simple tasks at your command until the spell ends. The servant springs into existence in an unoccupied space on the ground within range. It has AC 10, 1 hit point, and a Strength of 2, and it can\u2019t attack. If it drops to 0 hit points, the spell ends.","Once on each of your turns as a bonus action, you can mentally command the servant to move up to 15 feet and interact with an object. The servant can perform simple tasks that a human servant could do, such as fetching things, cleaning, mending, folding clothes, lighting fires, serving food, and pouring wine. Once you give the command, the servant performs the task to the best of its ability until it completes the task, then waits for your next command.","If you command the servant to perform a task that would move it more than 60 feet away from you, the spell ends."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $6930456e10aa79ff$exports = {};
$6930456e10aa79ff$exports = JSON.parse('{"title":"Vampiric Touch","source":"Player\'s Handbook","levelAndSchool":"3rd-level necromancy","level":3,"castingTime":"1 action","range":"Self","components":"V, S","duration":"Concentration, up to 1 minute","description":["The touch of your shadow-wreathed hand can siphon force from others to heal your wounds. Make a melee spell attack against a creature within your reach. On a hit, the target takes 3d6 necrotic damage, and you regain hit points equal to half the amount of necrotic damage dealt. Until the spell ends, you can make the attack again on each of your turns as an action.","At Higher Levels. When you cast this spell using a spell slot of 4th level or higher, the damage increases by 1d6 for each slot level above 3rd."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $20fcec55b1c3f5d6$exports = {};
$20fcec55b1c3f5d6$exports = JSON.parse('{"title":"Vicious Mockery","source":"Player\'s Handbook","levelAndSchool":"Enchantment cantrip","level":0,"castingTime":"1 action","range":"60 feet","components":"V","duration":"Instantaneous","description":["You unleash a string of insults laced with subtle enchantments at a creature you can see within range. If the target can hear you (though it need not understand you), it must succeed on a Wisdom saving throw or take 1d4 psychic damage and have disadvantage on the next attack roll it makes before the end of its next turn.","At Higher Levels. This spell\u2019s damage increases by 1d4 when you reach 5th level (2d4), 11th level (3d4), and 17th level (4d4)."],"spellLists":["http://dnd5e.wikidot.com/spells:bard"]}');


var $3e44b93d730e831b$exports = {};
$3e44b93d730e831b$exports = JSON.parse('{"title":"Virtue (UA)","source":"Unearthed Arcana 36 - Starter Spells","levelAndSchool":"Abjuration cantrip","level":0,"castingTime":"1 action","range":"Touch","components":"V, S","duration":"1 round","description":["You touch one creature, imbuing it with vitality. If the target has at least 1 hit point, it gains a number of temporary hit points equal to 1d4 + your spellcasting ability modifier. The temporary hit points are lost when the spell ends."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric"]}');


var $1cf64a221fb7de00$exports = {};
$1cf64a221fb7de00$exports = JSON.parse('{"title":"Vitriolic Sphere","source":"Xanathar\'s Guide to Everything","levelAndSchool":"4th-level evocation","level":4,"castingTime":"1 action","range":"150 feet","components":"V, S, M (a drop of giant slug bile)","duration":"Instantaneous","description":["You point at a place within range, and a glowing 1-foot ball of emerald acid streaks there and explodes in a 20-foot radius. Each creature in that area must make a Dexterity saving throw. On a failed save, a creature takes 10d4 acid damage and 5d4 acid damage at the end of its next turn. On a successful save, a creature takes half the initial damage and no damage at the end of its next turn.","At Higher Levels. When you cast this spell using a spell slot of 5th level or higher, the initial damage increases by 2d4 for each slot level above 4th."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $703dec29b2c0c7fa$exports = {};
$703dec29b2c0c7fa$exports = JSON.parse('{"title":"Vortex Warp","source":"Strixhaven: A Curriculum of Chaos","levelAndSchool":"2nd-level Conjuration","level":2,"castingTime":"1 action","range":"90 feet","components":"V, S","duration":"Instantaneous","description":["You magically twist space around another creature you can see within range. The target must succeed on a Constitution saving throw (the target can choose to fail), or the target is teleported to an unoccupied space of your choice that you can see within range. The chosen space must be on a surface or in a liquid that can support the target without the target having to squeeze.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, the range of the spell increases by 30 feet for each slot level above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $10db00c660cdfd29$exports = {};
$10db00c660cdfd29$exports = JSON.parse('{"title":"Wall of Fire","source":"Player\'s Handbook","levelAndSchool":"4th-level evocation","level":4,"castingTime":"1 action","range":"120 feet","components":"V, S, M (a small piece of phosphorus)","duration":"Concentration, up to 1 minute","description":["You create a wall of fire on a solid surface within range. You can make the wall up to 60 feet long, 20 feet high, and 1 foot thick, or a ringed wall up to 20 feet in diameter, 20 feet high, and 1 foot thick. The wall is opaque and lasts for the duration.","When the wall appears, each creature within its area must make a Dexterity saving throw. On a failed save, a creature takes 5d8 fire damage, or half as much damage on a successful save.","One side of the wall, selected by you when you cast this spell, deals 5d8 fire damage to each creature that ends its turn within 10 feet of that side or inside the wall. A creature takes the same damage when it enters the wall for the first time on a turn or ends its turn there. The other side of the wall deals no damage.","At Higher Levels. When you cast this spell using a spell slot of 5th level or higher, the damage increases by 1d8 for each slot level above 4th."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $da4fec919cbf8e0d$exports = {};
$da4fec919cbf8e0d$exports = JSON.parse('{"title":"Wall of Force","source":"Player\'s Handbook","levelAndSchool":"5th-level evocation","level":5,"castingTime":"1 action","range":"120 feet","components":"V, S, M (a pinch of powder made by crushing a clear gemstone)","duration":"Concentration, up to 10 minutes","description":["An invisible wall of force springs into existence at a point you choose within range.","The wall appears in any orientation you choose, as a horizontal or vertical barrier or at an angle. It can be free floating or resting on a solid surface. You can form it into a hemispherical dome or a sphere with a radius of up to 10 feet, or you can shape a flat surface made up of ten 10-foot-by-10-foot panels. Each panel must be contiguous with another panel. In any form, the wall is 1/4 inch thick. It lasts for the duration. If the wall cuts through a creature\'s space when it appears, the creature is pushed to one side of the wall (your choice which side).","Nothing can physically pass through the wall. It is immune to all damage and can\'t be dispelled by dispel magic. A disintegrate spell destroys the wall instantly, however. The wall also extends into the Ethereal Plane, blocking ethereal travel through the wall."],"spellLists":["/spell:dispel-magic","/spell:disintegrate","http://dnd5e.wikidot.com/spells:wizard"]}');


var $474a78cdd8e7fcb2$exports = {};
$474a78cdd8e7fcb2$exports = JSON.parse('{"title":"Wall of Ice","source":"Player\'s Handbook","levelAndSchool":"6th-level evocation","level":6,"castingTime":"1 action","range":"120 feet","components":"V, S, M (a small piece of quartz)","duration":"Concentration, up to 10 minutes","description":["You create a wall of ice on a solid surface within range. You can form it into a hemispherical dome or a sphere with radius of up to 10 feet, or you can shape a flat surface made up of ten 10-foot-square panels. Each panel must be contiguous with another panel. In any form, the wall is 1 foot thick and lasts for the duration.","If the wall cuts through a creature\u2019s space when it appears, the creature within its area is pushed to one side of the wall and must make a Dexterity saving throw. On a failed save, the creature takes 10d6 cold damage, or half as much damage on a successful save.","The wall is an object that can be damaged and thus breached. It has AC 12 and 30 hit points per 10-foot section, and it is vulnerable to fire damage. Reducing a 10-foot section of wall to 0 hit points destroys it and leaves behind a sheet of frigid air in he space the wall occupied. A creature moving through the sheet of frigid air for the first time on a turn must make a Constitution saving throw. The creature takes 5d6 cold damage on a failed save, or half as much damage on a successful one.","At Higher Levels. When you cast this spell using a spell slot of 7th level or higher, the damage the wall deals when it appears increases by 2d6, and the damage from passing through the sheet of frigid air increases by 1d6, for each slot level above 6th."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $8c6baf3c2fc5e5c0$exports = {};
$8c6baf3c2fc5e5c0$exports = JSON.parse('{"title":"Wall of Light","source":"Xanathar\'s Guide to Everything","levelAndSchool":"5th-level evocation","level":5,"castingTime":"1 action","range":"120 feet","components":"V, S, M (a hand mirror)","duration":"Concentration, up to 10 minutes","description":["A shimmering wall of bright light appears at a point you choose within range. The wall appears in any orientation you choose: horizontally, vertically, or diagonally. It can be free floating, or it can rest on a solid surface. The wall can be up to 60 feet long, 10 feet high, and 5 feet thick. The wall blocks line of sight, but creatures and objects can pass through it. It emits bright light out to 120 feet and dim light for an additional 120 feet.","When the wall appears, each creature in its area must make a Constitution saving throw. On a failed save, a creature takes 4d8 radiant damage, and it is blinded for 1 minute. On a successful save, it takes half as much damage and isn\u2019t blinded. A blinded creature can make a Constitution saving throw at the end of each of its turns, ending the effect on itself on a success.","A creature that ends its turn in the wall\u2019s area takes 4d8 radiant damage.","Until the spell ends, you can use an action to launch a beam of radiance from the wall at one creature you can see within 60 feet of it. Make a ranged spell attack. On a hit, the target takes 4d8 radiant damage. Whether you hit or miss, reduce the length of the wall by 10 feet. If the wall\u2019s length drops to 0 feet, the spell ends.","At Higher Levels. When you cast this spell using a spell slot of 6th level or higher, the damage increases by 1d8 for each slot level above 5th."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $5d7e05de71a2d150$exports = {};
$5d7e05de71a2d150$exports = JSON.parse('{"title":"Wall of Sand","source":"Xanathar\'s Guide to Everything","levelAndSchool":"3rd-level evocation","level":3,"castingTime":"1 action","range":"90 feet","components":"V, S, M (a handful of sand)","duration":"Concentration, up to 10 minutes","description":["You conjure up a wall of swirling sand on the ground at a point you can see within range. You can make the wall up to 30 feet long, 10 feet high, and 10 feet thick, and it vanishes when the spell ends. It blocks line of sight but not movement. A creature is blinded while in the wall\u2019s space and must spend 3 feet of movement for every 1 foot it moves there."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $9d5d35d3ef7cf1a9$exports = {};
$9d5d35d3ef7cf1a9$exports = JSON.parse('{"title":"Wall of Stone","source":"Player\'s Handbook","levelAndSchool":"5th-level evocation","level":5,"castingTime":"1 action","range":"120 feet","components":"V, S, M (a small block of granite)","duration":"Concentration, up to 10 minutes","description":["A nonmagical wall of solid stone springs into existence at a point you choose within range. The wall is 6 inches thick and is composed of ten 10-foot-by-10-foot panels. Each panel must be contiguous with at least on other panel. Alternatively, you can create 10-foot-by-20-foot panels that are only 3 inches thick.","If the wall cuts through a creature\u2019s space when it appears, the creature is pushed to one side of the wall (your choice). If a creature would be surrounded on all sides by the wall (or the wall and another solid surface), that creature can make a Dexterity saving throw. On a success, it can use its reaction to move up to its speed so that it is no longer enclosed by the wall.","The wall can have any shape you desire, though it can\u2019t occupy the same space as a creature or object. the wall doesn\u2019t need to be vertical or resting on any firm foundation. It must, however, merge with and be solidly supported by existing stone. Thus you can use this spell to bridge a chasm or create a ramp.","If you create a span greater than 20 feet in length, you must halve the size of each panel to create supports. You can crudely shape the wall to create crenelations, battlements, and so on.","The wall is an object made of stone that can be damaged and thus breached. Each panel has AC 15 and 30 hit points per inch of thickness. Reducing a panel to 0 hit points destroys it and might cause connected panels to collapse at the DM\u2019s discretion.","If you maintain your concentration on this spell for its whole duration, the wall becomes permanent and can\u2019t be dispelled. Otherwise, the wall disappears when the spell ends."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $a68cdc0eb56bbb94$exports = {};
$a68cdc0eb56bbb94$exports = JSON.parse('{"title":"Wall of Thorns","source":"Player\'s Handbook","levelAndSchool":"6th-level conjuration","level":6,"castingTime":"1 action","range":"120 feet","components":"V, S, M (a handful of thorns)","duration":"Concentration, up to 10 minutes","description":["You create a wall of tough, pliable, tangled brush bristling with needle-sharp thorns. The wall appears within range on a solid surface and lasts for the duration. You choose to make the wall up to 60 feet long, 10 feet high, and 5 feet thick or a circle that has a 20-foot diameter and is up to 20 feet high and 5 feet thick. The wall blocks line of sight.","When the wall appears, each creature within its area must make a Dexterity saving throw. On a failed save, a creature takes 7d8 piercing damage, or half as much damage on a successful save.","A creature can move through the wall, albeit slowly and painfully. For every 1 foot a creature moves through the wall, it must spend 4 feet of movement. Furthermore, the first time a creature enters the wall on a turn or ends its turn there, the creature must make a Dexterity saving throw. It takes 7d8 slashing damage on a failed save, or half as much on a successful save.","At Higher Levels. When you cast this spell using a spell slot of 7th level or higher, both types of damage increase by 1d8 for each slot level above 6th."],"spellLists":["http://dnd5e.wikidot.com/spells:druid"]}');


var $720abca4eece86b5$exports = {};
$720abca4eece86b5$exports = JSON.parse('{"title":"Wall of Water","source":"Xanathar\'s Guide to Everything","levelAndSchool":"3rd-level evocation","level":3,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a drop of water)","duration":"Concentration, up to 10 minutes","description":["You conjure up a wall of water on the ground at a point you can see within range. You can make the wall up to 30 feet long, 10 feet high, and 1 foot thick, or you can make a ringed wall up to 20 feet in diameter, 20 feet high, and 1 foot thick. The wall vanishes when the spell ends. The wall\u2019s space is difficult terrain.","Any ranged weapon attack that enters the wall\u2019s space has disadvantage on the attack roll, and fire damage is halved if the fire effect passes through the wall to reach its target. Spells that deal cold damage that pass through the wall cause the area of the wall they pass through to freeze solid (at least a 5-foot square section is frozen). Each 5-foot-square frozen section has AC 5 and 15 hit points. Reducing a frozen section to 0 hit points destroys it. When a section is destroyed, the wall\u2019s water doesn\u2019t fill it."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $29a64edae32af6e3$exports = {};
$29a64edae32af6e3$exports = JSON.parse('{"title":"Warding Bond","source":"Player\'s Handbook","levelAndSchool":"2nd-level abjuration","level":2,"castingTime":"1 action","range":"Touch","components":"V, S, M (a pair of platinum rings worth at least 50 gp each, which you and target must wear for the duration)","duration":"1 hour","description":["This spell wards a willing creature you touch and creates a mystic connection between you and the target until the spell ends.","While the target is within 60 feet of you, it gains a +1 bonus to AC and saving throws, and it has resistance to all damage. Also, each time it takes damage, you take the same amount of damage.","The spell ends if you drop to 0 hit points or if you and the target become separated by more than 60 feet. It also ends if the spell is cast again on either of the connected creatures. You can also dismiss the spell as an action."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric","/spells:paladin"]}');


var $6d515dbca414e480$exports = {};
$6d515dbca414e480$exports = JSON.parse('{"title":"Warding Wind","source":"Xanathar\'s Guide to Everything","levelAndSchool":"2nd-level evocation","level":2,"castingTime":"1 action","range":"Self","components":"V","duration":"Concentration, up to 10 minutes","description":["A strong wind (20 miles per hour) blows around you in a 10-foot radius and moves with you, remaining centered on you. The wind lasts for the spell\u2019s duration.","The wind has the following effects:","It deafens you and other creatures in its area.","It extinguishes unprotected flames in its area that are torch-sized or smaller.","The area is difficult terrain for creatures other than you.","The attack rolls of ranged weapon attacks have disadvantage if they pass in or out of the wind.","It hedges out vapor, gas, and fog that can be dispersed by strong wind."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $cbd5e8b38f5dda80$exports = {};
$cbd5e8b38f5dda80$exports = JSON.parse('{"title":"Warp Sense","source":"Planescape - Adventures in the Multiverse","levelAndSchool":"2nd-Level divination","level":2,"castingTime":"1 action","range":"Self","components":"V, S, M (a razorvine leaf)","duration":"Concentration, up to 1 minute","description":["For the duration, you sense the presence of portals, even inactive ones, within 30 feet of yourself.","If you detect a portal in this way, you can use your action to study it. Make a DC 15 ability check using your spellcasting ability. On a successful check, you learn the destination plane of the portal and what portal key it requires, then the spell ends. On a failed check, you learn nothing and can\'t study that portal again using this spell until you cast it again.","The spell can penetrate most barriers but is blocked by 1 foot of stone, 1 inch of common metal, a thin sheet of lead, or 3 feet of wood or dirt."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $aee5fe166f89b2e7$exports = {};
$aee5fe166f89b2e7$exports = JSON.parse('{"title":"Water Breathing","source":"Player\'s Handbook","levelAndSchool":"3rd-level transmutation (ritual)","level":3,"castingTime":"1 action","range":"30 feet","components":"V, S, M (a short reed or piece of straw)","duration":"24 hours","description":["This spell grants up to ten willing creatures you can see within range the ability to breathe underwater until the spell ends. Affected creatures also retain their normal mode of respiration."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $28ea58a20debf96c$exports = {};
$28ea58a20debf96c$exports = JSON.parse('{"title":"Water Walk","source":"Player\'s Handbook","levelAndSchool":"3rd-level transmutation (ritual)","level":3,"castingTime":"1 action","range":"30 feet","components":"V, S, M (a piece of cork)","duration":"1 hour","description":["This spell grants the ability to move across any liquid surface \u2013 such as water, acid, mud, snow, quicksand, or lava \u2013 as if it were harmless solid ground (creatures crossing molten lava can still take damage from the heat). Up to ten willing creatures you can see within range gain this ability for the duration.","If you target a creature submerged in a liquid, the spell carries the target to the surface of the liquid at a rate of 60 feet per round."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger","http://dnd5e.wikidot.com/spells:sorcerer"]}');


var $f6cb79b8979fb4ab$exports = {};
$f6cb79b8979fb4ab$exports = JSON.parse('{"title":"Watery Sphere","source":"Xanathar\'s Guide to Everything","levelAndSchool":"4th-level conjuration","level":4,"castingTime":"1 action","range":"90 feet","components":"V, S, M (a droplet of water)","duration":"Concentration, up to 1 minute","description":["You conjure up a sphere of water with a 5-foot radius on a point you can see within range. The sphere can hover in the air, but no more than 10 feet off the ground. The sphere remains for the spell\u2019s duration.","Any creature in the sphere\u2019s space must make a Strength saving throw. On a successful save, a creature is ejected from that space to the nearest unoccupied space outside it. A Huge or larger creature succeeds on the saving throw automatically. On a failed save, a creature is restrained by the sphere and is engulfed by the water. At the end of each of its turns, a restrained target can repeat the saving throw.","The sphere can restrain a maximum of four Medium or smaller creatures or one Large creature. If the sphere restrains a creature in excess of these numbers, a random creature that was already restrained by the sphere falls out of it and lands prone in a space within 5 feet of it.","As an action, you can move the sphere up to 30 feet in a straight line. If it moves over a pit, cliff, or other drop, it safely descends until it is hovering 10 feet over ground. Any creature restrained by the sphere moves with it. You can ram the sphere into creatures, forcing them to make the saving throw, but no more than once per turn.","When the spell ends, the sphere falls to the ground and extinguishes all normal flames within 30 feet of it. Any creature restrained by the sphere is knocked prone in the space where it falls."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $c7af6aea4787bb01$exports = {};
$c7af6aea4787bb01$exports = JSON.parse('{"title":"Web","source":"Player\'s Handbook","levelAndSchool":"2nd-level conjuration","level":2,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a bit of spiderweb)","duration":"Concentration, up to 1 hour","description":["You conjure a mass of thick, sticky webbing at a point of your choice within range. The webs fill a 20-foot cube from that point for the duration. The webs are difficult terrain and lightly obscure their area.","If the webs aren\u2019t anchored between two solid masses (such as walls or trees) or layered across a floor, wall, or ceiling, the conjured web collapses on itself, and the spell ends at the start of your next turn. Webs layered over a flat surface have a depth of 5 feet.","Each creature that starts its turn in the webs or that enters them during its turn must make a Dexterity saving throw. On a failed save, the creature is restrained as long as it remains in the webs or until it breaks free.","A creature restrained by the webs can use its action to make a Strength check against your spell save DC. If it succeeds, it is no longer restrained.","The webs are flammable. Any 5-foot cube of webs exposed to fire burns away in 1 round, dealing 2d4 fire damage to any creature that starts its turn in the fire."],"spellLists":["http://dnd5e.wikidot.com/spells:artificer","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $0fd5dbfbbf90f6ba$exports = {};
$0fd5dbfbbf90f6ba$exports = JSON.parse('{"title":"Weird","source":"Player\'s Handbook","levelAndSchool":"9th-level illusion","level":9,"castingTime":"1 action","range":"120 feet","components":"V, S","duration":"Concentration, up to 1 minute","description":["Drawing on the deepest fears of a group of creatures, you create illusory creatures in their minds, visible only to them.","Each creature in a 30-foot-radius sphere centered on a point of your choice within range must make a Wisdom saving throw. On a failed save, a creature becomes frightened for the duration.","The illusion calls on the creature\u2019s deepest fears, manifesting its worst nightmares as an implacable threat. At the end of each of the frightened creature\u2019s turns, it must succeed on a Wisdom saving throw or take 4d10 psychic damage. On a successful save, the spell ends for that creature."],"spellLists":["/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $9ac15f0d42d2ba53$exports = {};
$9ac15f0d42d2ba53$exports = JSON.parse('{"title":"Whirlwind","source":"Xanathar\'s Guide to Everything","levelAndSchool":"7th-level evocation","level":7,"castingTime":"1 action","range":"300 feet","components":"V, M (a piece of straw)","duration":"Concentration, up to 1 minute","description":["A whirlwind howls down to a point on the ground you specify. The whirlwind is a 10-foot-radius, 30-foot-high cylinder centered on that point. Until the spell ends, you can use your action to move the whirlwind up to 30 feet in any direction along the ground. The whirlwind sucks up any Medium or smaller objects that aren\u2019t secured to anything and that aren\u2019t worn or carried by anyone.","A creature must make a Dexterity saving throw the first time on a turn that it enters the whirlwind or that the whirlwind enters its space, including when the whirlwind first appears. A creature takes 10d6 bludgeoning damage on a failed save, or half as much damage on a successful one. In addition, a Large or smaller creature that fails the save must succeed on a Strength saving throw or become restrained in the whirlwind until the spell ends.","When a creature starts its turn restrained by the whirlwind, the creature is pulled 5 feet higher inside it, unless the creature is at the top. A restrained creature moves with the whirlwind and falls when the spell ends, unless the creature has some means to stay aloft.","A restrained creature can use an action to make a Strength or Dexterity check against your spell save DC. If successful, the creature is no longer restrained by the whirlwind and is hurled 3d6 \xd7 10 feet away from it in a random direction."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:wizard"]}');


var $30be88ae94b6f466$exports = {};
$30be88ae94b6f466$exports = JSON.parse('{"title":"Widogast\'s Transmogrification (HB)","source":"Critical Role (Twitter)","levelAndSchool":"6th-level transmutation","level":6,"castingTime":"1 hour","range":"Touch","components":"V, S, M (Damp clay equal to the weight of the target and 150 gp worth of crushed gem dust, both of which the spell consumes)","duration":"Instantaneous","description":["You permanently alter the physical body of a humanoid creature into another type of humanoid body. After encasing the target in clay, you conduct a rigorous, one-hour-long ritual that manipulates the flesh and function of the target\'s body into that of another humanoid race. They lose their previous racial traits and instead gain the racial traits of another humanoid race of the target\'s choice, aside from languages known (which remain unchanged). Should the target wish to alter their gender along with or instead of their race, they can choose to do so as part of the spell. When the ritual is completed, you and the target suffer one level of exhaustion.","Once a creature\'s race or gender has been changed via this spell, they cannot be affected again by this spell for 1 year."],"spellLists":["https://twitter.com/VoiceOfOBrien/status/1233524328517586949","http://dnd5e.wikidot.com/spells:wizard"]}');


var $cd200c1a161a2d4a$exports = {};
$cd200c1a161a2d4a$exports = JSON.parse('{"title":"Widogast\'s Vault of Amber (HB)","source":"Critical Role (Twitter)","levelAndSchool":"4th-level transmutation (ritual)","level":4,"castingTime":"1 minute","range":"Touch","components":"V, S, M (5 small amber gems worth 200 gp)","duration":"Until dispelled","description":["You arrange 5 small amber gems in a loose circle around any non-living materials and trace Transmutative sigils above each of them. All materials within the circle are pulled into the largest of the gems and are stored there, in stasis. The contents do not age, weather, or rot. The gem can hold up to 500lbs of material.","The caster can use an Action to speak a single, chosen word and release the gem\'s contents onto the ground. Contents are also released if dispelled."],"spellLists":["https://twitter.com/VoiceOfOBrien/status/1233524328517586949","http://dnd5e.wikidot.com/spells:wizard"]}');


var $7aefd451bbed1ff0$exports = {};
$7aefd451bbed1ff0$exports = JSON.parse('{"title":"Widogast\'s Web of Fire (HB)","source":"Critical Role (Twitter)","levelAndSchool":"4th-level evocation","level":4,"castingTime":"1 action","range":"60 ft","components":"V, S, M (A cat\'s cradle of thread or string coated in phosphorus)","duration":"Instantaneous","description":["Striking both palms down upon the ground, a web of flame crackles out around the caster and five streaks of fire rapidly snake along the ground toward up to five enemies the caster can see within a range of 60 feet, leaping towards their target and exploding into a column of flame upon reaching them. Each target must make a Dexterity saving throw, taking 8d6 fire damage on a failed save, or half as much damage on a successful one.","Alternatively, all five streaks of fire can instead converge toward a single target, dealing 12d6 fire damage on a failed save, or half as much damage on a successful one.","The fire can travel over obstacles up to 5 feet high, and ignites flammable objects along its path that aren\'t being worn or carried.","At Higher Levels. When you cast this spell using a spell slot of 5th level or higher, the damage increases by 1d6 for each slot level above 4th."],"spellLists":["https://twitter.com/VoiceOfOBrien/status/1182533609283915776","http://dnd5e.wikidot.com/spells:wizard"]}');


var $b0a5bccf9f1f6aed$exports = {};
$b0a5bccf9f1f6aed$exports = JSON.parse('{"title":"Wild Cunning (UA)","source":"Unearthed Arcana 36 - Starter Spells","levelAndSchool":"1st-level transmutation (ritual)","level":1,"castingTime":"1 action","range":"120 feet","components":"V, S","duration":"Instantaneous","description":["You call out to the spirits of nature to aid you. When you cast this spell, choose one of the following effects:","If there are any tracks on the ground within range, you know where they are, and you make Wisdom (Survival) checks to follow these tracks with advantage for 1 hour or until you cast this spell again.","If there is edible forage within range, you know it and where to find it.","If there is clean drinking water within range, you know it and where to find it.","If there is suitable shelter for you and your companions within range, you know it and where to find it.","Send the spirits to bring back wood for a fire and to set up a campsite in the area using your supplies. The spirits build the fire in a circle of stones, put up tents, unroll bedrolls, and put out any rations and water for consumption.","Have the spirits instantly break down a campsite, which includes putting out a fire, taking down tents, packing up bags, and burying any rubbish."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger"]}');


var $81d0809728ba16c4$exports = {};
$81d0809728ba16c4$exports = JSON.parse('{"title":"Wind Walk","source":"Player\'s Handbook","levelAndSchool":"6th-level transmutation","level":6,"castingTime":"1 minute","range":"30 feet","components":"V, S, M (fire and holy water)","duration":"8 hours","description":["You and up to ten willing creatures you can see within range assume a gaseous form for the duration, appearing as wisps of cloud. While in this cloud form, a creature has a flying speed of 300 feet and has resistance to damage from nonmagical weapons. The only actions a creature can take in this form are the Dash action or to revert to its normal form.","Reverting takes 1 minute, during which time a creature is incapacitated and can\u2019t move. Until the spell ends, a creature can revert to cloud form, which also requires the 1-minute transformation.","If a creature is in cloud form and flying when the effect ends, the creature descends 60 feet per round for 1 minute until it lands, which it does safely. If it can\u2019t land after 1 minute, the creature falls the remaining distance."],"spellLists":["http://dnd5e.wikidot.com/spells:druid"]}');


var $345664f89452a25c$exports = {};
$345664f89452a25c$exports = JSON.parse('{"title":"Wind Wall","source":"Player\'s Handbook","levelAndSchool":"3rd-level evocation","level":3,"castingTime":"1 action","range":"120 feet","components":"V, S, M (a tiny fan and a feather of exotic origin)","duration":"Concentration, up to 1 minute","description":["A wall of strong wind rises from the ground at a point you choose within range. You can make the wall up to 50 feet long, 15 feet high, and 1 foot thick. You can shape the wall in any way you choose so long as it makes one continuous path along the ground. The wall lasts for the duration.","When the wall appears, each creature within its area must make a Strength saving throw. A creature takes 3d8 bludgeoning damage on a failed save, or half as much damage on a successful one.","The strong wind keeps fog, smoke, and other gases at bay. Small or smaller flying creatures or objects can\u2019t pass through the wall. Loose, lightweight materials brought into the wall fly upward. Arrows, bolts, and other ordinary projectiles launched at targets behind the wall are deflected upward and automatically miss. (Boulders hurled by giants or siege engines, and similar projectiles, are unaffected.) Creatures in gaseous form can\u2019t pass through it."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger"]}');


var $e5d5c48fb06255e5$exports = {};
$e5d5c48fb06255e5$exports = JSON.parse('{"title":"Wish","source":"Player\'s Handbook","levelAndSchool":"9th-level conjuration","level":9,"castingTime":"1 action","range":"Self","components":"V","duration":"Instantaneous","description":["Wish is the mightiest spell a mortal creature can cast. By simply speaking aloud, you can alter the very foundations of reality in accord with your desires.","The basic use of this spell is to duplicate any other spell of 8th level or lower. You don\u2019t need to meet any requirements in that spell, including costly components. The spell simply takes effect.","Alternatively, you can create one of the following effects of your choice:","You create one object of up to 25,000 gp in value that isn\u2019t a magic item. The object can be no more than 300 feet in any dimension, and it appears in an unoccupied space you can see on the ground.","You allow up to twenty creatures that you can see to regain all hit points, and you end all effects on them described in the greater restoration spell.","You grant up to ten creatures that you can see resistance to a damage type you choose.","You grant up to ten creatures you can see immunity to a single spell or other magical effect for 8 hours. For instance, you could make yourself and all your companions immune to a lich\u2019s life drain attack.","You undo a single recent event by forcing a reroll of any roll made within the last round (including your last turn). Reality reshapes itself to accommodate the new result. For example, a wish spell could undo an opponent\u2019s successful save, a foe\u2019s critical hit, or a friend\u2019s failed save. You can force the reroll to be made with advantage or disadvantage, and you can choose whether to use the reroll or the original roll.","You might be able to achieve something beyond the scope of the above examples. State your wish to the DM as precisely as possible. The DM has great latitude in ruling what occurs in such an instance; the greater the wish, the greater the likelihood that something goes wrong. This spell might simply fail, the effect you desire might only be partly achieved, or you might suffer some unforeseen consequence as a result of how you worded the wish. For example, wishing that a villain were dead might propel you forward in time to a period when that villain is no longer alive, effectively removing you from the game. Similarly, wishing for a legendary magic item or artifact might instantly transport you to the presence of the item\u2019s current owner.","The stress of casting this spell to produce any effect other than duplicating another spell weakens you. After enduring that stress, each time you cast a spell until you finish a long rest, you take 1d10 necrotic damage per level of that spell. This damage can\u2019t be reduced or prevented in any way. In addition, your Strength drops to 3, if it isn\u2019t 3 or lower already, for 2d4 days. For each of those days that you spend resting and doing nothing more than light activity, your remaining recovery time decreases by 2 days. Finally, there is a 33 percent chance that you are unable to cast wish ever again if you suffer this stress."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $fe2d88f5a30e24ca$exports = {};
$fe2d88f5a30e24ca$exports = JSON.parse('{"title":"Witch Bolt","source":"Player\'s Handbook","levelAndSchool":"1st-level evocation","level":1,"castingTime":"1 action","range":"30 feet","components":"V, S, M (a twig from a tree that has been struck by lightning)","duration":"Concentration, up to 1 minute","description":["A beam of crackling, blue energy lances out toward a creature within range, forming a sustained arc of lightning between you and the target. Make a ranged spell attack against that creature. On a hit, the target takes 1d12 lightning damage, and on each of your turns for the duration, you can use your action to deal 1d12 lightning damage to the target automatically. The spell ends if you use your action to do anything else. The spell also ends if the target is ever outside the spell\u2019s range or if it has total cover from you.","At Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the initial damage increases by 1d12 for each slot level above 1st."],"spellLists":["http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:warlock","http://dnd5e.wikidot.com/spells:wizard"]}');


var $676fc5f0d148de4b$exports = {};
$676fc5f0d148de4b$exports = JSON.parse('{"title":"Wither and Bloom","source":"Strixhaven: A Curriculum of Chaos","levelAndSchool":"2nd-level Necromancy","level":2,"castingTime":"1 action","range":"60 feet","components":"V, S, M (a withered vine twisted into a loop)","duration":"Instantaneous","description":["You invoke both death and life upon a 10-foot-radius sphere centered on a point within range. Each creature of your choice in that area must make a Constitution saving throw, taking 2d6 necrotic damage on a failed save, or half as much damage on a successful one. Nonmagical vegetation in that area withers.","In addition, one creature of your choice in that area can spend and roll one of its unspent Hit Dice and regain a number of hit points equal to the roll plus your spellcasting ability modifier.","At Higher Levels. When you cast this spell using a spell slot of 3rd level or higher, the damage increases by 1d6 for each slot above 2nd, and the number of Hit Dice that can be spent and added to the healing roll increases by one for each slot above 2nd."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:sorcerer","http://dnd5e.wikidot.com/spells:wizard"]}');


var $4acf3d8ff1620ae0$exports = {};
$4acf3d8ff1620ae0$exports = JSON.parse('{"title":"Word of Radiance","source":"Xanathar\'s Guide to Everything","levelAndSchool":"Evocation cantrip","level":0,"castingTime":"1 action","range":"5 feet","components":"V, M (a holy symbol)","duration":"Instantaneous","description":["You utter a divine word, and burning radiance erupts from you. Each creature of your choice that you can see within range must succeed on a Constitution saving throw or take 1d6 radiant damage.","At Higher Levels. The spell\u2019s damage increases by 1d6 when you reach 5th level (2d6), 11th level (3d6), and 17th level (4d6)."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric"]}');


var $69f675d164eb0cbb$exports = {};
$69f675d164eb0cbb$exports = JSON.parse('{"title":"Word of Recall","source":"Player\'s Handbook","levelAndSchool":"6th-level conjuration","level":6,"castingTime":"1 action","range":"5 feet","components":"V","duration":"Instantaneous","description":["You and up to five willing creatures within 5 feet of you instantly teleport to a previously designated sanctuary. You and any creatures that teleport with you appear in the nearest unoccupied space to the spot you designated when you prepared your sanctuary (see below). If you cast this spell without first preparing a sanctuary, the spell has no effect.","You must designate a sanctuary by casting this spell within a location, such as a temple, dedicated to or strongly linked to your deity. If you attempt to cast the spell in this manner in an area that isn\u2019t dedicated to your deity, the spell has no effect."],"spellLists":["http://dnd5e.wikidot.com/spells:cleric"]}');


var $dfe3801b5be643fa$exports = {};
$dfe3801b5be643fa$exports = JSON.parse('{"title":"Wrath Of Nature","source":"Xanathar\'s Guide to Everything","levelAndSchool":"5th-level evocation","level":5,"castingTime":"1 action","range":"120 feet","components":"V, S","duration":"Concentration, up to 1 minute","description":["You call out to the spirits of nature to rouse them against your enemies. Choose a point you can see within range. The spirits cause trees, rocks, and grasses in a 60-foot cube centered on that point to become animated until the spell ends.","Grasses and Undergrowth. Any area of ground in the cube that is covered by grass or undergrowth is difficult terrain for your enemies.","Trees. At the start of each of your turns, each of your enemies within 10 feet of any tree in the cube must succeed on a Dexterity saving throw or take 4d6 slashing damage from whipping branches.","Roots and Vines. At the end of each of your turns, one creature of your choice that is on the ground in the cube must succeed on a Strength saving throw or become restrained until the spell ends. A restrained creature can use an action to make a Strength (Athletics) check against your spell save DC, ending the effect on itself on a success.","Rocks. As a bonus action on your turn, you can cause a loose rock in the cube to launch at a creature you can see in the cube. Make a ranged spell attack against the target. On a hit, the target takes 3d8 nonmagical bludgeoning damage, and it must succeed on a Strength saving throw or fall prone."],"spellLists":["http://dnd5e.wikidot.com/spells:druid","http://dnd5e.wikidot.com/spells:ranger"]}');


var $4a3dc57d686ed092$exports = {};
$4a3dc57d686ed092$exports = JSON.parse('{"title":"Wrathful Smite","source":"Player\'s Handbook","levelAndSchool":"1st-level evocation","level":1,"castingTime":"1 bonus action","range":"Self","components":"V","duration":"Concentration, up to 1 minute","description":["The next time you hit with a melee weapon attack during this spell\u2019s duration, your attack deals an extra 1d6 psychic damage. Additionally, if the target is a creature, it must make a Wisdom saving throw or be frightened of you until the spell ends. As an action, the creature can make a Wisdom check against your spell save DC to steel its resolve and end this spell."],"spellLists":["http://dnd5e.wikidot.com/spells:paladin"]}');


var $f0f982f0ae61eaec$exports = {};
$f0f982f0ae61eaec$exports = JSON.parse('{"title":"Wristpocket","source":"Explorer\'s Guide to Wildemount","levelAndSchool":"2nd-level conjuration (ritual) (dunamancy)","level":2,"castingTime":"1 action","range":"Self","components":"S","duration":"Concentration, up to 1 hour","description":["You flick your wrist, causing one object in your hand to vanish. The object, which only you can be holding and can weigh no more than 5 pounds, is transported to an extradimensional space, where it remains for the duration.","Until the spell ends, you can use your action to summon the object to your free hand, and you can use your action to return the object to the extradimensional space. An object still in the pocket plane when the spell ends appears in your space, at your feet."],"spellLists":["http://dnd5e.wikidot.com/spells:wizard"]}');


var $db84b3a59d60a5d1$exports = {};
$db84b3a59d60a5d1$exports = JSON.parse('{"title":"Zephyr Strike","source":"Xanathar\'s Guide to Everything","levelAndSchool":"1st-level transmutation","level":1,"castingTime":"1 bonus action","range":"Self","components":"V","duration":"Concentration, up to 1 minute","description":["You move like the wind. For the duration, your movement doesn\u2019t provoke opportunity attacks.","Once before the spell ends, you can give yourself advantage on one weapon attack roll on your turn. That attack deals an extra 1d8 force damage on a hit. Whether you hit or miss, your walking speed increases by 30 feet until the end of that turn."],"spellLists":["http://dnd5e.wikidot.com/spells:ranger"]}');


var $acbd90fbe63754db$exports = {};
$acbd90fbe63754db$exports = JSON.parse('{"title":"Zone of Truth","source":"Player\'s Handbook","levelAndSchool":"2nd-level enchantment","level":2,"castingTime":"1 action","range":"60 feet","components":"V, S","duration":"10 minutes","description":["You create a magical zone that guards against deception in a 15-foot-radius sphere centered on a point of your choice within range. Until the spell ends, a creature that enters the spell\u2019s area for the first time on a turn or starts its turn there must make a Charisma saving throw. On a failed save, a creature can\u2019t speak a deliberate lie while in the radius. You know whether each creature succeeds or fails on its saving throw.","An affected creature is aware of the spell and can thus avoid answering questions to which it would normally respond with a lie. Such creatures can be evasive in its answers as long as it remains within the boundaries of the truth."],"spellLists":["http://dnd5e.wikidot.com/spells:bard","http://dnd5e.wikidot.com/spells:cleric","http://dnd5e.wikidot.com/spells:paladin"]}');


